g(100006269,'exVojne poleg tega terjajo velikansko ceno v človeških življenjih, razdejanju in psiholoških posledicah, ki se celijo več generacij.').
g(100007846,'exNaprava BICOM je torej nekakšna zbirka impulzov, oblikovanih v zdravilne programe, ki pospešujejo zdravljenje in normalizacijo presnovnih procesov v telesu, toda na koncu je vseeno od človeka, ki upravlja z aparatom, in od njegovih izkušenj odvisno, ali bo pravilno postavil diagnozo in izbral pravi program za bolnika.; exZaradi nizkih plač v Sloveniji bi namreč na Koroško prihajala poceni delovna sila in tamkajšnji ljudje bi izgubljali delo.; exStaremu predsedniku Jegorju Strojevu, ki je zaradi zakona o nezdružljivosti funkcij kak mesec omahoval, ali naj ostane tretji najmočnejši človek Ruske federacije ali pa naj se povsem posveti guvernerskim opravilom v orlovski oblasti, je predsednik Vladimir Putin za slovo podelil red zaslug za domovino.; exIn če velja, da znanost lahko deluje le v svobodnem okolju, je obenem tudi neodtujljiva pravica vsakega človeka, da mu tvegane tehnologije ne kratijo človeškega dostojanstva in ne jemljejo njegove svobode.; exV sindikatu, kot nam je povedal njegov predsednik Roman Molan, sicer še vedno upajo, da jim bo do konca leta le uspelo prepričati ljudi v ministrstvu za gospodarstvo in za okolje, da je proizvodnja celuloze pomembna ne le za Krško, ampak tudi za celo papirno-predelovalno industrijo, slovenske gozdove in državo sploh.; exKaže, da Sloveniji ni mar za svoje imetje, za svoje ljudi in zato ne čudi izjava Franca Droleta, predsednika kobariške mlekarne, na včerajšni tiskovni konferenci: "Če Ljubljani ni mar za nas, se bomo pa priključili Furlaniji in prodajali mleko v Videm.; exZ uvedbo alternativnega zdravljenja pa bi bili mnogi zdravniki razbremenjeni, saj so tudi oni samo ljudje z dobrimi in slabimi dnevi.; exLjudje sumijo, da so jih organizirano zastrupile mestne oblasti, ki so hotele pred olimpijskimi igrami »očistiti« mesto in odstraniti to »sramoto«.; exPredsednik šentjernejske SKD Jože Simončič, ki je raziskavo predstavil, meni, da je v Orehovici volja ljudi jasna, še naprej želijo sedanjo KS, v Šentjerneju pa ta interes ni tako velik.; ex"Pred sprejetjem dopolnjene zakonodaje o lokalni samoupravi smo bili proti KS, sedaj jim ne nasprotujemo, če si jih ljudje želijo, vendar to ne pomeni, da je prišlo do preloma v našem mišlenju, ampak se je v tem času zakonodaja obrnila na glavo," je povedal Simončič.; ex1Njegov rojak Lewis Goldberg, ki je vpeljal pojem "velika peterica", pa je ugotovil, da se vsak od nas, ko prvič sreča novega človeka, v mislih vpraša prav po teh petih osebnostnih lastnostih: "Je zanesljiv, dobrosrčen in prijeten, ali pa morda nezanesljiv, hladen in zoprn?; ex1Človek nenehno presega snovnost, zasužnjenost materiji in se dviga nad vse.; ex1Ta človek bi lahko zakadil strope cele hiše.; ex1Travma torej ni zgolj proces, ki človeka osami in naredi drugačnega od vseh drugih ljudi, temveč lahko tudi ustvarja skupnost.; ex1Danes ljudje, ki so delovali v nekdanji Jugoslaviji, ob meni še Jani Koman in Jože Mikeln, v strokovnih organizacijah zveze nimamo nobene vloge.; ex1Shakespearov opus je sicer (zaradi preglednosti) porazdeljen na posamezna obdobja in zvrsti, vendar je kljub razlikam med posameznimi deli med seboj povezan z mnogimi temeljnimi vprašanji o človeku in njegovem statusu na planetu Zemlja.; ex1Drugi je Brus (pavliha), ki je tudi filozofično nadarjen, je pa “človek iz ljudstva” in sprejme vlogo Norca zato, da bo lahko neobremenjeno govoril resnico.; ex1Vse je torej v človeku in v spletu dogodkov, ki jih povzročajo ljudje s svojimi različnimi interesi, značajskimi potezami in strastmi.; ex1V človeku zmeraj tiči “rogata muka”.; ex1Ta karakter (s tem problemom se je dosti kasneje, sicer drugače, a zanimivo ubadal August Strindberg) pomeni polnost osvobojenega človeka in ga je odkrila renesansa, seveda v povezavi z vsemi drugimi, tudi epohalnimi odkritji.; ex2Človek brez srca je človek brez ljubezni.; ex2K ponižnemu človeku se sklanja Bog, ponižnemu daje veliko milosti in po ponižanju ga povišuje v slavo.; ex2V običajnih okoliščinah do časa, ko začutimo žejo, izgubimo že približno odstotek telesne teže s tekočino, to je pri 75 kilogramov težkem človeku 75 dekagramov.; ex2»e se pri tem poveča teža prihodnosti v subjektivnem gospodinjenju z izkušnjami, je to zagotovo povezano s tehnično-industrijsko preoblikovanim svetom, ki človeka sili k vedno krajšim časovnim obdobjem, ko lahko nabira nove izkušnje in se lahko prilagodi vedno hitreje izzvanim spremembam.; ex2Precej pozneje se je pojavil pri Sandiju Čolniku v njegovem Večernem gostu in opazil sem, da je to ta isti človek iz članka, ki ga že hranim v fasciklu.; ex2Tak človek se bo sicer obdal z več predmeti, a le onimi, ki so uporabni in koristni za delo (priročen telefonski imenik, stojalo s pisali - zanimive oblike, nenavaden koledar...; ex2Tak človek skuša vselej in za vsako ceno strogo ločevati zasebno življenje od službenega, delo postavlja na prvo mesto, materialne dobrine mu zelo veliko pomenijo.; ex2Zdravniška združenja in farmacevtske družbe, pogosto ob podpori združenj obolelih, oznanjajo v začetku novega stoletja novo zdravilstvo, v katerem ni več prostora za zdravega človeka.; ex2Poročite se s komerkoli, ker se ne boste več čutila počaščena in rešena, če vas bo človek z veliko kulturo sprejel v svoje naročje in vam odpustil, vam spregledal, da ste se rodila slovenskim staršem!; ex2Sodišča odločajo o zadevah ljudi.; ex3Po njegovem mnenju (pri pisanju pravne obtožbe naj bi zaprosil tudi za pravno pomoč) naj bi bile vsakemu človeku, ki proti svoji volji služi vojaški rok storjene krivice, kot so omejevanje svobode, vsiljevanje proti volji posameznika in izguba prihodka.; ex3(2) Vsak človek ima štiri osnovna čustva: to so JEZA, ŽALOST, STRAH in VESELJE.; ex3Osnovno sporočilo plesnih in glasbenih nastopov ter recitalov je bilo, da je merilo vseh stvari človek, ne glede na drugačnost, s čimer so se spomnili dneva strpnosti in splošne deklaracije človekovih pravic.; ex3Pravzaprav smo človeka v obeh primerih ubili in ga tako po splošnem mnenju kvečjemu od-rešili vse hujših predsmrtnih muk.; ex3Na seznamu italijanskih mest, ki jih duši brezposelnost, je na prvem mestu Enna na Siciliji, kjer so uradno našteli 35,4 odstotka ljudi brez dela.; ex3Ne bi pa bilo lepo, ko bi zaradi odpakov izbruhnila v Trgu kakšna huda bolezen in bi pobrala še tistih nekaj starih prebivalcev in tako na Slovenskem ne bi imeli več grajskega kompleksa, ki je poseljen z ljudmi domačini.; ex3Boštjan Pirc, zbiralec vsega lepega, je človek, ki ne prenese avtoritete s formalne pozicije; ex3Tistih, ki jih ne more potolažiti niti takšna pridobitev, kot je logistični center za pošto, saj zanjo s sarkazmom pravijo, da bodo zdaj iz mesta poleg ljudi pač hitreje odhajale še pošiljke.; ex3Z mono sicer označujejo dolgočasnega, nezavzetega, nepodjetnega človeka.; ex3Človek, ki bi jih iskal, ali kdor koli, ki bi se sprehajal po gozdovih, bi jih le stežka našel.; ex4Zaposlen človek v naši državi je v povprečju, po podatkih iz leta 1999, na dopustu 17 delovnih ur na mesec.; ex4Pred dvajset tisoč leti je kromanjonski človek bil sicer telesno enak nam, ni pa obvladal jezika, s katerim bi z besedami izrazil tiste značilnosti, zaradi katerih še danes kako osebo ocenimo kot privlačno: znamenja plodnosti pri ženski, pri moških pa sposobnost vzdrževanja družine in vodenje otrok.; ex4Sloj ljudi, ki je gmotno bolje preskrbljen, številčno pa manjši, je izpolnil svoje stanovanjske načrte, zato je nastal presežek večjih stanovanj.; ex4Ljudje bi morali normalno služiti, da bi si lahko kupili stanovanje.; ex4Nataša Jerkovič (367) na človeku najprej opazi njegov pogled.').
