g(100028651,'exPri pogledu od strani in od zadaj se nam na desni strani najprej prismehlja priročno nameščen vmesnik USB, nato pa še podpora za FireWire in reža za različne PC kartice tipa II, na desni strani pa je svoj prostor našel pogon DVD Super Multi Drive, ki v eni enoti zmore brati bolj ali manj vse, kar lahko svetlečega in okroglega dobite na trgu.; exDa bi spoznali življenje invalidnih otrok, so igrali sedečo odbojko ter se z zavezanimi očmi poskušali orientirati po prostoru (slika spodaj).; exŠimpanzi se tlačijo po nezavidljivo majhnem prostoru, lev bi lahko vsak trenutek raztrgal žičnato ograjo, če ne bi bil zaradi dolgoletnega ujetništva že popolnoma apatičen, slonica Ganga pa očitno trpi akutno pomanjkanje družbe.; exNamen objave uzakonjenih prepovedi in omejitev v uradnih prostorih je v tem, da se stranke z njimi lahko seznanijo neposredno tam, kjer pridejo v stik z javno upravo, ne pa da so ta pravila »skrita« nekje v uradnem listu.; exRade bi mislile, da so naši pozivi k realnim svetovom več kot le obupan odmik od cinizma in dejanje vere, podobno kakšnemu drugemu kultu, ne glede na to, koliko prostora radodarno namenimo bogatim in vedno zgodovinsko specifičnim posredovanjem, s katerimi moramo me in vsi drugi spoznavati svet.; exV petdesetih letih so biološka telesa postala tehnološki komunikacijski sistemi, a se pri tem še niso povsem rekonstituirala kot prostori "razlik" v postmodernem smislu - kot igra označevalcev in replikatorjev v strateškem polju, katerega pomen je le z zelo problematičnega vidika odvisen od zunanjega sveta.; exZdaj premišljate o vsem tem, malce ste ljubosumni na tiste, ki zavzamejo vam nedosegljiv prostor.').
