g(100312691,'exOče ji je med potjo umrl in morala je poskrbeti sama zase, zato je šla v samostan.; exKunze, perzijski vodnik, ki jih je spremljal skoraj vso pot od Benetk, se je odpravil proti konju, še prej pa je s pogledom ošinil Marca.; exJerry se je štopal na poti do zasilnega izhoda na streho.; exVeč tehničnih podatkov o letalu, s katerim se bo na pot odpravil Matevž Lenarčič, smo v Gei objavili decembra lani (Gea XI., 12/6).; exNa vsak način se v Jeličićevi zgodbi ni moč izogniti naslednjemu dejstvu: da se je kot obetaven fant - tudi za jugoslovanske razmere - odločil za pot v Slovenijo, ki ne slovi kot država naklonjena mladim nogometašem, še zlasti tujim ne.; exNOVO MESTO - Prejšnjo soboto je bilo sto članov Rodu gorjanskih tabornikov na veselem izletu, ki so ga po poti čez Sv. Rok na ruperčvrški jasi sklenili s priljubljenim opravilom: s peko kostanja.').
