g(100415676,'exTako bo Jezus Kristus po svojem križu in vstajenju zame pot, resnica in življenje.; exŽenskam se je težje odločiti za tako pot, ker sta naše odrekanje in slaba vest drugačna kot pri moških.; exODKRITJE JE BILO SENZACIJA, KI JE NAŠLA POT V MNOGE ČASOPISE PO ZDA.; exNekdanji diktator, general Augusto Pinochet, ki se je izmuznil evropskemu pravosodju, je zdaj, kot pravijo, na začetku poti, ki ga utegne pripeljati pred sodišče v domovini.; exScreening bo pokazala, kje smo na poti v EU. kaj mu sledi in ali je leto 2002 še vedno tisto, ko naj bi Slovenija dosegla polnopravno članstvo v novi širši domovini?; exRazstava v Umetnostni galeriji Maribor predstavlja, kot rečeno, njegova slikarska in scenografska dela, v tretjem delu pa dokumentarno gradivo, ki prikazuje Kavčičevo pot od mladosti do ustvarjalne zrelosti.; exSmuknil je mimo nje v hišo in se napotil naravnost po znani poti v spalnico.; exRoditi želim po naravni poti brez lajšanja bolečin, ker menim, da bolečina poveže mamo in otroka.; ex- Slovenska plinska družba Geoplin je nastala iz Petrolovega sozda Zemeljski plin in krenila po lastni poti, a vsaj kar se tiče vpisa v sodni register, še ni končana.; exPodoba našega sveta nastaja po dveh poteh: prva vodi preko neposrednega spoznanja tega, kar lahko vidimo z lastnimi očmi; sistem, ki s tem nastane in v katerega informacije umeščamo, nam pomaga osmišljati vsakdanje življenje.; ex1Misli in čustva nastopajočih oseb najbolj pogosto izražajo po asociativni poti določene stvari iz narave, ki jih kot značilne v veliki meri poznamo že iz Župančičeve lirike: peruti oziroma krila in živali s perutmi, zlasti ptice: metuljčki, čebelica, golobi, kukavica, utva, sokoli in orli, nadalje konji vranci, potem svetlobna telesa in pojavi: zvezde, mesec, zarja in sonce pa luč in kres, od rastlin posebno rože in pelin ter končno morje, veter in val, od predmetov pa plašč in čaša.; ex1Vsak portfolio se zaključi z zapisom »poti, ki jo je otrok prehodil«, ki se ga pripravi s pomočjo prelistavanja portfolia oz. vsega, kar je bilo vloženo vanj.; ex1Približno dva meseca pozneje, 18. novembra 1969, je Stane Sever naslovil vodstvu Drame dopis, s katerim je ta veliki umetnik sklenil svojo izjemno bogato in pomembno umetniško pot.; ex1So pa tudi mnenja, da je odločitev povsem normalna, saj v Jugoslaviji nogometno pot krojijo slabe razmere, razen če nisi član slovitih klubov Crvene zvezde ali Partizana.; ex1Mineva leto dni, odkar me je pot vodila v Spodnji Gasteraj k družini Bohak, Jožici, Zarji in Ernestu.').
