g(100430606,'exPrvi v vrsti so Igre in aplikacije.; exTestni primerek je imel naloženih nič aplikacij in dve igri: Gulos Tale in Speed Devils, dve precej preprosti zadevščini, zaradi katerih ne boste dobili občutka, da so mobilne igre kaj napredovale.; exVsebina Večpredstavnega albuma je pričakovana; sličice, videi, zvoki (igre in programi) ter informacije o prostem spominu, ki ga je v tem strojčku za nekaj kB manj kot 2 MB.; exVseh izbirnikov je devet, poleg omenjenih pritisni in govori ter organizatorja so še operaterjeve storitve (WAP, GPRS), programi (igri Disco in Chic Pinball ter Translator in Size converter; te ne smejo preseči 128 kB), nastavitve (profili možnost kreiranja dveh lastnih, toni, teme, nastavitve obeh zaslonov, časa, datuma, bližnjic, glasovni ukazi, desna izbirna tipka), povezovanje (infrardeči vmesnik, GPRS), klicne nastavitve, nastavitve telefona, dodatkov, konfiguracije, nastavitve zaščitne narave), galerija (podobe, videoposnetki, teme, grafike, zvočni posnetki), predstavnost (digitalna kamera, predvajalnik, snemalnik zvoka, radio), zadnji klici (neodgovorjeni, prejeti in klicani …; exNekateri bogati kmetavzarji so namreč poboj svojih živali vzeli za najbolj zabavno igro na svetu in svoje ovčke, po ukazu veterinarjev, streljali z vsem mogočim orožjem, na vse mogoče načine.').
g(100431893,'exUživajmo ob igri mehurčkov.; exIn nazaj naj bi jo dobil z igro, ki je nisem poznal - v nasprotju s temi izkoreninjenimi otroki, ki niti z očesom ne trenejo, ko se poslavljajo od svojih mater!; exKaj naj si mislimo o igri takšnih otrok?; exTočno, bila je grda igra in z mojo naivnostjo je imela nekaj skupnega.; exLastnici sta se odločili, da turnirski šport ni šport, ampak okrutna tekmovalnost, in sta začeli uživati v tem, da sta s konjem prijateljevali, rekreativno in za svoje zdravje malce jahali, sicer pa spoznavali draž košnje trave za štirinožca, igre z njim ter lovljenja po jahalnici.').
