g(100551215,'exV drugem delu, ki se bo začel ob 18. uri, bodo na portoroški ploščadi izvedli krajši program v spremstvu fanfar, po devetnajsti uri pa bo v restavraciji hotela Slovenija slavnostni program, ki ga bodo v celoti pripravili študentje.; exZ vzpostavljenim razstavnim programom bomo nadaljevali, saj smo dosegli potrebno ravnotežje med starim in novim, tujim in domačim, ki ga je vredno in smiselno ohranjati tudi v naprej, saj smo hkrati edina ustanova, ki lahko pripravlja razstave na tej ravni in v takšnem obsegu.; exTo pomeni, da nekdanji novorokerski program Štirke sedaj lahko najdemo v Orto klubu.; exKot prva je v svojem programu izvajala tudi aksel.; exV prvem delu programa se bosta pomerili selekciji Vzhoda in Zahoda v pionirski, kadetski in mladinski kategoriji.').
g(100575741,'exSvet je za obveščevalno delo Sorgea in njegove skupine izvedel šele iz poročila, ki ga je po 2. svetovni vojni za senatni odbor v Washingtonu izdelal šef obveščevalne službe ameriškega generala McArthurja na Japonskem.; exAli ima center veliko dela spričo tako hudih medvrstniških obračunavanj?; exZnanstvenike njihova božanska radovednost in neustavljivi entuziazem zaslepita do te mere, da praviloma niti ne uvidijo možnih negativnih posledic svojega dela, prav tako pa jim nikoli v zgodovini ni uspelo nadzirati družbenih posledic svojih odkritij.; exOb 50-letnici delovanja odpira Koroški pokrajinski muzej priložnostno razstavo s pregledom razvoja in delovanja muzeja od ustanovitve Okrajnega muzeja NOB leta 1951 do zadnjega desetletja delovanja, ko so težišče dela preusmerili na skrb za varstvo premične kulturne dediščine na območju Koroške v Republiki Sloveniji.; exDanes skrbi muzej ob svojem rednem delu še za leta 1992 postavljeno zbirko v cerkvi sv. Jurija na Legnu ter leta 1994 postavljeno razstavo o koroškem plebiscitu v župnišču v Libeličah.; exPri nas pomanjkanje časa (verjetno) še ni tako pereče, da bi v kakšnem izmed podjetij že razmišljali o tem, da bi učinkovitost dela proizvodnega in vodstvenega kadra izboljševali s takimi metodami.; ex»Sicer je res, da je bilo v letu in pol na ministrstvu in drugod opravljeno ogromno delo, a za takšno nalogo je bilo časa absolutno premalo.; exToda rekla bi, da je tisto delo, za katero je Jimmy rekel, da je ''prepozno, da bi ga odpovedali'', v središču vse te zadeve o denarju in plačilu.; exPriznala je, da se tudi v kuhinji kdaj pa kdaj zgodi kakšna nesreča: "Nekateri pravijo, da razbiti krožniki prinašajo srečo, drugi nesrečo, meni pa taka nesreča prinaša le dodatno delo - pospravljanje.; exPot do novega izdelka ali le do izboljšave je dolga vsaj leto dni in terja delo različnih strokovnjakov, raziskovalcev trga, razvojnih konstruktorjev, oblikovalcev, psihologov, strokovnjakov z določenega področja raziskav in razvoja (če gre za gospodinjstvo, sodelujejo tudi kuharji, pri osebni negi pa ne gre brez medicincev) in tudi ljudi s ceste.; ex1Ljudje "tehnične pomočnike" namreč različno uporabljamo, različno občutimo lagodje in bolečine, različno se lotimo dela, itd.; ex1Naš državni zbor je opravil veliko delo in ni zamudil nobene zgodovinske priložnosti; ex1Navdušena je bila nad samostojnim delom, sodelovanju z ljudmi z vsega sveta, v službi je veliko potovala tako po Franciji kot po svetu.; ex1Ob duhovniškem delu je dušnemu pastirju ostalo še dovolj časa, da je v fari ustanovil nogometno ekipo in pripravil nekaj večjih srečanj ljubiteljev težkih motorjev.; ex1V Banki Slovenije menijo, da se je Rant, sicer diplomirani ekonomist in diplomirani romanist in član skupin za pogajanja z Evropsko unijo in sukcesijo, izkazal s svojim dosedanjim delom.; ex1Ali je mogoče, da so v našem zavodu, kjer je toliko dela, taki, ki grešijo z brezdeljem?; ex1Na besedi delo smo brali: Sredstvo proti poželjivosti, najmočnejše orožje proti vsem napadom hudobnega duha.; ex1Predvsem o tisti, ki ženskam »lajša« delo v hiši.; ex1Delo ''mam," je rekla Pearl.; ex1Zemeljska dela pri dograditvi sedanje plastične smučarske skakalnice so že stekla - Skakalci se bodo pomerili ob rudarskem prazniku; ex2Postapartheidske institucije pomiritve v Južni Afriki temeljijo na »dolgem spominu« in na spominjanju kot delu, ki ga opravljajo skupnosti in njihovi posamezniki.; ex2Kje je tukaj stimulacija klubu in trenerju za delo, če pa imata zgolj stroške!; ex2Druga konvencija evropskih visokošolskih zavodov (2003) pod naslovom Strengthening the Role of Institutions je bila rezultat obsežnega pripravljalnega dela, usmerjenega k vsem ključnim ''bolonjskih'' temam v tistih vidikih, ki imajo za univerze še posebno težo.; ex2EUA je začela priprave na konvencijo že takoj po praškem vrhu, k delu pa je pritegnila vsa svoja uradna telesa in članice.; ex2Med tem priprav-ljalnim delom je EUA spomladi 2003 sprejela tudi svoj odgovor na sporočilo Evropske komisije The role of universities in the Europe of knowledge, ki je postal še eno od izhodišč za kasnejše razprave v Gradcu.; ex2Kaliban je bil sam svoj in sam sebi kralj, zdaj pa je suženj, ki mora opravljati najtežja dela.; ex2Pojte no - jaz bi bil, kar sem, četudi bi takrat, ko so imeli mene v delu, mežikala name najbolj deviška zvezdica na firmamentu!; ex2Učenjaki so ponovno začeli z delom in bistveno zbrali v eni sami knjigi.; ex2Precej dela nas čaka, je zavzdihnil Lut, ko se je vrnil iz barake, z desnico neprestano na svoji Juliji, kakor je bilo ime njegovi dvocevki s skrajšano cevjo.; ex2Na njegovem obrazu je bila vidna utrujenost in znerviranost, celodnevno izigravanje čudežno ozdravljenega fanatika je bilo naporno delo.; ex3Tak človek se bo sicer obdal z več predmeti, a le onimi, ki so uporabni in koristni za delo (priročen telefonski imenik, stojalo s pisali - zanimive oblike, nenavaden koledar...; ex3Seznanitev s pravili v zvezi s sprejemanjem daril naj bi stranke odvrnila od poskusov nedovoljenega »obdarovanja« javnih uslužbencev, hkrati pa krepila zaupanje strank v delo uprave.; ex3Ko bo zakon o družbah, prepričani smo, da bo sprejet, sprejet, se bo pravo delo šele začelo.; ex3Zato so na župana naslovili prošnjo, ki jo je podpisalo 69 mater oziroma očetov, naj v prvih razredih omogoči skupinsko pedagoško delo.; ex3V prošnji so zapisali, da bi se pri takšnem delu učiteljica in vzgojiteljica laže posvetili tistim učencem, ki imajo pri pouku težave, oziroma laže dodatno zaposlili tiste, ki nekatere dele učnega programa že obvladajo.; ex338. člen zakona o vojaški dolžnosti omogoča tudi civilno služenje vojaškega roka, kar pa ni nič drugega, kot prisilno delo, saj mora delo posameznik opravljati proti svoji volji in brez ustreznega finančnega nadomestila.; ex3Koliko iskanja in koliko dela je šlo v nič!; ex3Zgodovinar dr. Peter Vodopivec je z nekaj manjšimi netočnostmi pri preverjanju posameznih odličij opisal delo lože Valentin Vodnik, predstavil znani ljubljanski predpasnik in omenil odličja škotskega reda iz časov francosko-ilirske lože, kar pomeni, da so nekateri slovenski prostozidarji tudi doma imeli višje stopnje, torej večje prostozidarsko znanje, odgovornost in ugled.; ex3Morilec je opravil svoje delo.; ex3Že tako ste preveč zanemarili svoje delo zaradi mene.; ex4Vse to so izdolbli v strjen peščenec ljudje, oboroženi le z dleti, katerih sledovi so tu in tam še zdaj vidni na stenah, in čvrsto odločnostjo, da dobro opravijo svoje delo.; ex4Šibke gospodarske subjekte, o katerih pišejo predstavniki SAS, bomo zaščitili podobno kot druge gospodarske subjekte: z znižanjem bremen, ki nam jih nalaga draga država, pa tudi z znižanjem nekaterih vrst stroškov, ki v strukturi stroškov storitve zavzemajo pomemben delež (stroški dela, pogonskih goriv, zavarovalnih premij ...; ex4To mu je v nadaljevanju v podporo pri izboljševanju kakovosti njegovega dela.; ex4TEHNIK - EKONOMSKI (splošni); Ž; mariborska;; MARIBOR; 1987; Agencija RS za plačilni promet;; računovodstvo, plačilni promet, sposobnost vodenja in javnega nastopanja, delo z ljudmi, terensko delo, poznavanje dela na računalniku;; banka, pisarniško delo kjerkoli;; programirano, kreativno; administrativno, strokovno; neposredni izvajalec, nižji vodja, srednji vodja; 31292; ex4Kot dober primer pripravljenosti, da bi v praksi lahko uresničevali akcijski program ukrepov Nacionalnega programa varstva okolja (NPVO) in strategije za ohranjevanje biotske raznovrstnosti, krajinske pestrosti ter varstva naravnih vrednot, pozivamo naslovnike, naj čimprej skličejo sestanek Ribiške družine Ribnica in izvajalcev gradbenih del ter se ob Bistrici na kraju samem dogovorijo o nadaljnih delih oz. boljšem sodelovanju.; ex4Hkrati je pozval predstavnike vseh strank, da navežejo stike s vodstvi strank na državni ravni in vsak po svojih močeh pomagajo pri razvoju občine, kajti čaka jih veliko dela.; ex4Nič težjega dela ne bi imel, če bi moral prišteti še zastave v drugih