g(100584367,'exZaradi nizkih plač v Sloveniji bi namreč na Koroško prihajala poceni delovna sila in tamkajšnji ljudje bi izgubljali delo.; exPri nas sicer niso delali podobnih poskusov, a v Ameriki so se potrudili in pri 2500 zaposlenih, ki so kadili hašiš, ugotovili, da se je število delovnih nezgod (dr. Bilban je za potrebe stroke izračunal, da je zaradi poškodb na delu v Sloveniji toliko škode, da bi lahko na leto zgradili 150 kilometrov avtocest) povečalo za 85 odstotkov.; exGospa Katarina je kuharica že 34 let: "Kot kmečko dekle nisem imela možnosti za šolanje in začela sem kot pomivalka, potem pa sem se šolala ob rednem delu.; exZa delavce zaposlene pri zasebnih delodajalcih (120. člen ZDR) - samostojni podjetniki - je višina nadomestila za prehrano med delom lahko določena le v kolektivni pogodbi in pogodbi o zaposlitvi.; exPri tem seveda upošteva bolnikovo zdravstveno stanje, socialno okolje, njegove navade in vrsto dela, ki ga opravlja.; exNovost novega zakona o pokojninskem in invalidskem zavarovanju je tudi stimuliranje kasnejšega odhoda v pokoj, tako zaradi dosežene daljše delovne dobe kot za delo po določeni starosti.; exŠuštar pravi, da zakon ravno zato predvideva pravico beguncev do začasnega in občasnega dela.; exBeguncem bo posredoval različna dela, za katera ne bodo potrebovali delovnega vizuma.; exVallaressovi so izgubili svoje premoženje in zapustili otok in s sestro sva si poiskala delo v mestu.; exTak človek skuša vselej in za vsako ceno strogo ločevati zasebno življenje od službenega, delo postavlja na prvo mesto, materialne dobrine mu zelo veliko pomenijo.; ex1V imenu odbora, ki ga vodim, to je Odbora za zdravstvo, delo, družino in socialno politiko, sem dolžan stališče gospoda Mozetiča še podkrepiti z mnenjem oziroma poročilom Odbora.; ex1Odbor za kreditno monetarno politiko in finance torej ni predlagal uvrstitve na dnevni red, zato kot zainteresirano delovno telo - Odbor za zdravstvo, delo, družino in socialno politiko - predlagamo, vam spoštovane poslanke in poslanci, da uvrstimo ta predlog zakona na dnevni red.; ex1Vsak dan ob štirih zjutraj jih razpadajoči vlak, ki ga je vlada leta 1937 rabljenega kupila od Nemcev, odpelje na delo v osemdeset kilometrov oddaljeni Rio.; ex1PREDVSEM JE BIL NLRA UZAKONJEN Z NAMENOM, DA DELAVCI Z ZDRUŽEVANJEM V DELAVSKA ZDRUŽENJA IN S KOLEKTIVNIM POGAJANJEM PREK TEH ZDRUŽENJ REŠUJEJO MOREBITNE PROBLEME PRI DELU TER TAKO IZBOLJŠAJO DELOVNE RAZMERE IN POGOJE NA SVOJEM DELOVNEM MESTU.; ex1– NAZIV DELOVNEGA MESTA OZIROMA PODATKE O VRSTI DELA, ZA KATERO DELAVEC SKLEPA POGODBO O ZAPOSLITVI, S KRATKIM OPISOM POSLOV, KI JIH MORA OPRAVLJATI PO POGODBI O ZAPOSLITVI,; ex1- ZAPOSLITEV ZA DOLOČEN ČAS ZARADI DELA V PRILAGODITVENEM OBDOBJU NA PODLAGI DOKONČNE ODLOČBE IN POTRDILA PRISTOJNEGA ORGANA, IZDANE V POSTOPKU PRIZNAVANJA KVALIFIKACIJ PO POSEBNEM ZAKONU,; ex1KO DELAVEC ČAKA NA PRERAZPOREDITEV, DELODAJALEC PROTI NJEMU NE MORE IZVAJATI NOBENIH SANKCIJ, ČE NE OPRAVLJA DELA.; ex1DELAVKINA ODSOTNOST Z DELA V TEM ČASU SE ZATO NE MORE ŠTETI KOT NEOPRAVIČENA IN PROTI NJEJ NE MORE BITI IZREČEN DISCIPLINSKI UKREP PRENEHANJA DELOVNEGA RAZMERJA; ex1KOT OBLIKO REDNEGA DELOVNEGA RAZMERJA JE DELO NA DOMU UREJALA ŽE DO TAKRAT VELJAVNA ZAKONODAJA, VENDAR SE V VEČJEM OBSEGU NI UVELJAVILA.; ex1ORGANIZACIJA OZIROMA DELODAJALEC PO ZDR LAHKO ORGANIZIRA DELO NA DOMU, ČE NARAVA DELA TO DOPUŠČA (26.; ex2DELOVNI ČAS PRI OPRAVLJANJU DELA NA DOMU SE LAHKO DOLOČI NA PODLAGI VNAPREJ OPREDELJENE KOLIČINE DELA NA ČASOVNO ENOTO.; ex2KOT DELO NA DOMU SE ŠTEJE OPRAVLJANJE DELA NA DOMU DELAVCA ALI V PROSTORIH PO NJEGOVI IZBIRI, VENDAR ZUNAJ DELOVNIH PROSTOROV DELODAJALCA.; ex2- ČE PRENEHA POTREBA PO DOLŽNOSTI, KI JO OPRAVLJA, ALI ČE SE ZMANJŠA STALNA SESTAVA, PA NI MOGOČA NJEGOVA RAZPOREDITEV NA DRUGO DELO.; ex2TUDI SICER JE BIL ZRP JZDOLS PRESEŽEN IN ZARADI TOGOSTI DOLOČANJA RAZMERIJ OSNOVNIH PLAČ TER OMEJENIH MOŽNOSTI NAGRAJEVANJA POSAMEZNEGA ZAPOSLENEGA V SKLADU Z REZULTATI NJEGOVEGA DELA ZA DANAŠNJI ČAS ZASTAREL.; ex2ZJU DOLOČA ŠTIRI OCENE, IN SICER: DA DELO OPRAVLJA ODLIČNO, DELO OPRAVLJA DOBRO, DELO OPRAVLJA ZADOVOLJIVO IN DELO OPRAVLJA NEZADOVOLJIVO (113.; ex2– OB PRENEHANJU MANDATA NA ŽELJO MENEDŽERJA IN OB POZITIVNI OCENI PRISTOJNEGA ORGANA O NJEGOVEM DELU 6-KRATNI ZNESEK ZADNJE MESEČNE PLAČE,; ex2DELODAJALEC MORA DELAVCU NADURNO DELO ODREDITI V PISNI OBLIKI (IZJEMOMA TUDI USTNO, V TEM PRIMERU SE PISNO ODREDITEV VROČI DELAVCU NAKNADNO, VENDAR NAJKASNEJE DO KONCA DELOVNEGA TEDNA PO OPRAVLJENEM NADURNEM DELU).; ex2POGODBA O ZAPOSLITVI ZA DOPOLNILNO DELO PRENEHA VELJATI PO POTEKU DOGOVORJENEGA ČASA (IZ ČESAR IZHAJA, DA JE TAKŠNO POGODBO DOPUSTNO SKLENITI TUDI ZA DOLOČEN ČAS, LAHKO PA TUDI ZA NEDOLOČEN ČAS) ALI ČE JE UMAKNJENO SOGLASJE DELODAJALCA, KJER JE DELAVEC ZAPOSLEN S POLNIM DELOVNIM ČASOM.; ex2ZVZD JE NOV, VSEOBSEŽEN PRAVNI VIR SODOBNE ZAKONSKE UREDITVE VARNOSTI IN ZDRAVJA PRI DELU, KI JE NADOMESTIL DOTLEJ VELJAVNI ZAKON O VARSTVU PRI DELU IZ LETA 1974.; ex2S TEM DNEM PRENEHAJO VELJATI ZAKON O VARSTVU PRI DELU (URADNI LIST SRS, ŠT. 32/74, 16/80 IN 25/86), RAZEN 48.; ex3ZVZD DOLOČA PRAVICE IN DOLŽNOSTI DELODAJALCEV IN DELAVCEV V ZVEZI Z VARNIM IN ZDRAVIM DELOM TER UKREPE ZA ZAGOTAVLJANJE VARNOSTI IN ZDRAVJA PRI DELU.; ex3ZVZD DOLOČA TUDI ORGANE, PRISTOJNE ZA VARNOST IN ZDRAVJE PRI DELU.; ex3Tudi Mednarodna organizacija dela, ki skrbi za pravice delavcev, v svoji konvenciji vsebuje restriktivne določbe o stavki v javnem sektorju.; ex3Na seznamu italijanskih mest, ki jih duši brezposelnost, je na prvem mestu Enna na Siciliji, kjer so uradno našteli 35,4 odstotka ljudi brez dela.; ex3Opozorilno okrožnico v zvezi s to grožnjo je te dni razposlal tudi minister za delo Roberto Maroni.; ex3Izvajalca, ki sta skupaj sodelovala na javnem razpisu za graditev predora Trojane, a dela nista dobila, sta izpodbijala sklep državne revizijske komisije, ki jima ni dovolila vpogled v dokumentacijo konkurenčnega ponudnika, italijanskega Grassetta.; ex3Žena me je pogosto in na veliko zmerjala, ko je opazila, da zaradi svojih ‘period’ izgubljam še tisto delo, ki sem si ga lahko našel.; ex3V letu 1980, ko se je preselil v svojo hišo, se je v Dolgi vasi vključil v vrste prostovoljnega gasilskega društva Dolga vas, kjer je več let prizadevno opravljal delo tajnika.; ex3Na vseh delovnih mestih se zavarovalna doba šteje tako, da se za vsakih 12 mesecev dela šteje 16 mesecev pokojninske dobe.; ex3En dan pri tistih, ki so vključeni v programe razvoja, je mnogim nakazal nekatere možnosti za delo; ex4Verjetno ga delo v eksperimentalnem gledališču, kot smo si ga predstavljali mi, ni pretirano zanimalo.').
g(100586262,'exOdkar je po Antonu Drobniču mesto generalnega državnega tožilca prevzela Zdenka Cerar, visi v zraku obtožba, da je, poenostavljeno rečeno, tožilstvo prevzela v svoje roke druga politična opcija.; exIzobčil je Henrika in razglasil, da je odstavljen z mesta cesarja.; exMinister, pristojen za pravosodje, lahko na utemeljen predlog Notarske zbornice Slovenije imenuje notarja na prosto mesto v drugem kraju brez razpisa.; exTakoj so mu ponudili mesto svetovalca.; exTa je še zmeraj v službi v 1. policijski postaji, toda iz mesta namestnika poveljnika postaje so ga premestili na detektor laži.; ex), da se je o podžupanskem mestu pogovarjal celo z dosedanjim županom iz vrst LDS, pa tudi s Tatjano Jevševar, predsednico trboveljske ZLSD.').
