g(100623862,'exNastale spremembe so povzročile nevšečnosti na televiziji BBC, kjer so le s težavo uskladili prenos vseh pomembnih dogodkov.; exPetčlanska uprava Sume postala tričlanska - Članice še niso določile menjalnega razmerja - Kljub težavam optimisti; exNočemo namreč, da bi vstop Poljske v bruseljsko skupnost našemu podeželju povzročil nove težave.; exEna od težav pri izsušitvi je ta, da je žeja slab kazalec potrebe telesa po tekočini.; exČe pa si partnerja določita vsak svoj "revir", ponavadi ni težav.; ex- M. Grosman: Bralec in književnost: težave pri branju poezije v tujem jeziku (7985).; exFanika ne govori nobenega živega ali mrtvega jezika razen nekaj mimogrede nalovljenih drobcev štajerščine, zato tudi misli s težavo.; exV prošnji so zapisali, da bi se pri takšnem delu učiteljica in vzgojiteljica laže posvetili tistim učencem, ki imajo pri pouku težave, oziroma laže dodatno zaposlili tiste, ki nekatere dele učnega programa že obvladajo.; exLosjon Ceramide Defining Eye Brightener, ki ga nanašamo pod ličila, je primeren za vse vrste kože, ki se spopadajo s težavami staranja.; exTo je bil hkrati tudi težko pričakovan test pnevmatik za novi razred, a posebnih težav ni bilo.; ex1Potem s pobiranjem odpadkov ne bi bilo težav, saj je bila takrat cesta prevozna tudi za težke vozove, danes pa ni.; ex1Pred tem s sistematičnim pritiskanjem na Slovenijo ni bilo težav.; ex1Imenuje se »težava z zabavo«.; ex1Opisno poročilo olajša komunikacijo s starši in preprečuje, da bi posameznikove značilnosti, navade, napredek in težave posploševali, ker bi se nam izgubile v množici otrok v skupini.; ex1Če bo postopek do vseh enak in pravičen, ne bi smelo biti težav.').
