g(100720565,'exNajmanj uspešne so združitve enakih podjetij, ker se pojavi težava, kdo bo prevzel vodilno vlogo v podjetju, katera blagovna znamka bo prevladala.; exPOSEBEJ POMEMBNO PRI TEJ OBLIKI ZAČASNE POROKE JE, DA JE ŽENSKA TISTA, KI DA POBUDO ZA SKLENITEV ZVEZE IN TUDI DOLOČI POGOJE POGODBE, POGOSTO PA POGODBO TUDI PLAČA, MEDTEM KO IMA TAKŠNO VLOGO PRI DRUGIH OBLIKAH ZAČASNE POROKE MOŠKI.; exDanes ljudje, ki so delovali v nekdanji Jugoslaviji, ob meni še Jani Koman in Jože Mikeln, v strokovnih organizacijah zveze nimamo nobene vloge.; exVodilna slovenska teniška igralka Katarina Srebotnik je dosegla v vlogi nosilke druge skupine pomembno zmago v osmini finala turnirja Tippmix grand prix v Budimpešti, ko je premagala rusko igralko Ekaterino Bičkovo po dramatičnem maratonskem dvoboju z 2:6, 7:6 (13:11), 6:3.; exZ rokami na kozarcih in zdrobljen na koščke je videl, da si je spisal vlogo nekakšnega odrešitelja, nekakšnega zmagovalca, vlogo zablodelega viteza, don Kihota, ki je zgrešil čas in vrata in na svojem vrancu prijezdil v sobo.; exVidno vlogo je imel Nemec še pred tremi leti, ko je na začetku tako močno dominiral, da je njegov najbolj nevarni tekmec Mika HŠkkinen čutil že veliko pritiska na svojih ramenih.; exToda v vlogi goljufivega vaškega zdravnika, ki ljudem izbija iz glave zdravje, je neprimerljivo večja moč: sodobna medicina.; ex»Dominantni dvojček lahko nastopa z vedenjsko strukturo modela moške vloge,« sem rekel Kate.; exVaša vloga »pivota«, krožne napadalke, je malce nenavadna: večino časa ste obrnjeni s hrbtom proti golu, ki ga napadate.; ex- Maksimalno, vendar realno upoštevajmo vlogo otroka pri oblikovanju in vodenju njegovega portfolia kar je mogoče, delajmo skupaj v vrtcu.; ex1Na vse ravni so uvedli tudi sistem planiranja ter sestanke z delavci, kjer se seznanijo s cilji in s svojo vlogo pri tem.; ex1Vlogo direktorja ima ekonomistka Francka Zorman, troje mladih pa se ukvarja z operativnim vodenjem del.').
