g(100721660,'exŽENSKA SE ZAOBLJUBI V SVOJEM ALI HČERINEM IMENU, DA BO SKLENILA SIGHEH Z VERSKIM VODJEM, NAJVEČKRAT S SAYYIDOM, KI JE PREROKOV POTOMEC.; exMenila sem, da so hoteli Hrvati v imenu Bošnjakov, ki so takrat zaradi srbskega osvajanja izgubljali ozemlje, prevesiti ameriško javno mnenje na bosansko stran tako, da so vse Srbe označevali za posiljevalce.; exV imenu odbora, ki ga vodim, to je Odbora za zdravstvo, delo, družino in socialno politiko, sem dolžan stališče gospoda Mozetiča še podkrepiti z mnenjem oziroma poročilom Odbora.; exZdaj bi lahko jaz obrazložil svoj glas v imenu divjadi, ampak se bom temu raje odpovedal.; exS kuponom za žrebanje v Timesovi šolski prilogi in na spletni strani Bloomsburyja so povabili učitelje - samo učitelje - naj se v imenu svojih učencev prijavijo za mesta med publiko, in to največ za 50 na šolo.').
