g(100795720,'exVodja projekta Phare in predstavnik danskega tehnološkega inštituta Ib Sejersen pa je dejal, da slovenska podjetja večinoma že ravnajo v skladu z evropskimi predpisi, čeprav ta za zdaj še niso zavezujoča.; exFilmska pripoved o slovenskih muzejih je nastala kot projekt, katerega nadaljevanje bomo za spremembo gledali že prihodnji teden.; exV Slovenski filharmoniji je kot poslovna in programska direktorica izpeljala projekt obnove stavbe Slovenske filharmonije in pripravila ključne aktivnosti ob 300. obletnici ustanovitve filharmonije.; exZ domačim znanjem so razvili projekt sodobnega upravljanja sejne sobe in stanovanja oziroma dnevne sobe, in sicer z uporabo interaktivne predstavitvene opreme in sodobnih telekomunikacij.; exNatura 2000 je evropski projekt, katerega namen je ohranjanje biotske raznovrstnosti, vzpostavljanje takšnih območij pa je mednarodna obveza Slovenije, pravzaprav je to njena odgovornost s pravnega in še s kakšnega drugega vidika.; exRekel je, da so projekt zavrnili.; exŽe leta 1831 mu je uspel preboj z romanom Šagrinova koža, zatem pa se je lotil velikega projekta s skupnim naslovom Človeška komedija, ki ga zaradi prezgodnje smrti ni uresničil v celoti, a dolgovi niso nič manj pogoltno pritiskali nanj.; exTo je po rekreativnem odmoru in jutranji skupini, avtorskem antropohigienskem konceptu svetovalne pomoči za razvoj zdrave osebnosti, moj tretji projekt, ki naj bi zmanjšal število neuspešnih učencev.; exDel otrok in staršev, vajen barantanja, je začel zavirati, čeprav je projekt potrdil tudi Zavod za šolstvo in ga bo jeseni tudi eksterno ocenil.; exV Bruslju namenjajo veliko denarja za različne projekte.; ex1Za tovrstne projekte je Slovenija namenila 80 milijonov tolarjev, kar seveda ni veliko, vendar je denar namenjen za majhne projekte, ki bodo zagotavljali gospodarsko oživitev v demografsko ogroženih področjih.; ex1Drnovšek lani izsilil hitro profesionalizacijo vojske, šolski minister Gaber pa predlaga upočasnitev projekta; ex1Na vsakem srečanju želimo v delavnice vključiti tudi nekaj taborniškega, med drugim smo se učili delati taborniške vozle (slika zgoraj) kljub temu, da je letos poudarek na otrokovih pravicah, je povedala vodja projekta Mateja Klep iz roda Dobra volja.; ex1Projekt Literarni vlak Evropa 2000 poteka pod pokroviteljstvom Evropske komisije.; ex1Na drugi razstavi, na temo Projekt - knjiga, ki so jo odprli 28. junija in bo v Chioggi na ogled do 22. avgusta, prav tako svoja dela predstavljata David Ličen in Polona Kunaver-Ličen.; ex1Lokalne skupnosti so namreč lahko z dodatnim projektom kandidirale za nagrado 10.000 britanskih funtov, ki je namenjena sofinanciranju točno določenega projekta, ki je vezan na upravljanje z okoljem.; ex1Mandarić pravi, da je zanj največja težava pomanjkanje časa, kajti menda je polno zaposlen s projektom gradnje novega štadiona Portsmoutha.; ex1Vlada ob tem ugotavlja, da so v zaključnih fazah tudi vsi drugi, za izvajanje zakona o gospodarskih družbah pomembni oziroma z njim neločljivo povezani drugi zakonski projekti: revidiranje, notariat, sodelovanje delavcev pri upravljanju, trg vrednostnih papirjev, sanacija, tečaj in podobno.; ex1S projektom, ki vključuje tudi razstavo originalnih del, objavljenih v antologiji, stripovske delavnice, jam sessione in predavanja, so letos gostovali že v Budimpešti, Poitiersu, Bourgesu in Parizu.; ex1Glede Vaše samohvale, koliko da ste pripomogli k reševanju omenjenih projektov, pa Vam moram povedati, da sem zbral podatke za občini Jesenice in Kranjska Gora, iz katerih je razvidno, da NI RES, da ste lahko zadovoljni.; ex2Tehnologijo je razvil svetovalec kanadske vlade dr. Norman L. Arrison, ki je drugim povedal, da v osmih državah po svetu že deluje 27 projektov s tovrstno tehnologijo.; ex2Ministrico in njene sodelavce je očitno prepričala tudi predstavitev projekta Inovacijski preboj primorske regije, katerega glavni namen je ustvarjalno povezati in spodbuditi Primorsko, da bi oblikovala eno najbolj inventivnih in konkurenčnih regionalnih gospodarstev v bodoči, povezani Evropi.; ex2»Verjamem v takšen projekt, dali smo mu izrazito podporo.; ex2Za te je odgovoren Pungartnik, ki pravi, da ima kot član IO KKŠpravico obveščati člane o projektih, čeprav sam za koroško gavdo 18. decembra ni pristojen.; ex2Njihov projekt nosi naslov Naš turistični jutri: Düja, keri de prvi (Dija, kdo bo prvi).').
