g(100818678,'exOdkar je po Antonu Drobniču mesto generalnega državnega tožilca prevzela Zdenka Cerar, visi v zraku obtožba, da je, poenostavljeno rečeno, tožilstvo prevzela v svoje roke druga politična opcija.; exV rokah slovenskega prometnega ministrstva je zdaj odločitev, ali bo Jatu vendarle podelilo dovoljenja za polete v Ljubljano brez reciprocitete za Adrio.; exStrah me je tega, da se lahko tisti, ki ima trenutno večino, čeprav samo enega glasu in čeprav samo za en dan, v trenutku polasti poleg vsega, kar demokratični politični oblasti gre, tudi vsega tistega, česar demokratična politična oblast sploh nikdar ne bi smela dobiti v roke.; exMisel, da imata v rokah nekaj, česar ni odkril še nihče drug, le onadva, ju je tako vznemirila, da tudi naslednjega dne nista odšla v Portorož zapravljat denarja.').
