g(100877127,'exPri pogledu od strani in od zadaj se nam na desni strani najprej prismehlja priročno nameščen vmesnik USB, nato pa še podpora za FireWire in reža za različne PC kartice tipa II, na desni strani pa je svoj prostor našel pogon DVD Super Multi Drive, ki v eni enoti zmore brati bolj ali manj vse, kar lahko svetlečega in okroglega dobite na trgu.; exZato da bodo ulice in stavbe lepše na pogled, prebivalci poslej ne bodo smeli več sušiti perila na balkonih oziroma tako, da bi ga lahko kdo videl.; exOzebnik pod nami je le še temačna soteska, pogled navzgor pa odkrije le podplate in nahrbtnika obeh Francozov v gladki plošči, potem pa nebo, globoko kot ocean.; exGotovo vam bo dovolila, da s pogledom ujamete njene noge.; exKunze, perzijski vodnik, ki jih je spremljal skoraj vso pot od Benetk, se je odpravil proti konju, še prej pa je s pogledom ošinil Marca.; exJa, se je nasmehnil Florijan in obmiroval s pogledom na skupinici kaplanov iz okoliških mestec in vasi, ki so se hranili ob obloženi mizi sredi prostora, ampak svet je ne glede na muke zadnjih dni odrešen.; exPovlekel je pogled od žarnice, prevlečene s kožo, ki ga je pravkar nagovorila, in se zagledal v vrsto, ki se je vila kačasto prek vsega trga, vsi so si hoteli za dva zelena bankovca očistiti dušo in jo preložiti na očetova ramena in si za dva naslednja bankovca olajšati telo, ga ubiti v deklici.; exNeka znanka mi je opisala ljubljenje s Škorpijonom kot »pogled na vulkansko lavo, ki se vali proti tebi«!; exNataša Jerkovič (367) na človeku najprej opazi njegov pogled.; exA ob pogledu na stanovanje, ki jo je tako zelo spominjalo na njen nekdanji dom, je deklico razumela.').
