g(100889472,'exPodobna matineja bo na sporedu danes, ko bodo srečanju z likovno umetnostjo dve šolski uri namenili člani likovnih krožkov osnovnih šol iz Brežic in Senovega.; exUbijalska velikost teh dveh mastodontov je bil moj prvi stik z metafiziko ure katekizma na šoli Bossuet so bile manj razburljive.; exŠimeljček pa je pred njiju vedno znova postavljal nove in nove zahteve ter ju prepričeval, da tega ali onega nikakor ne zmoreta, ter si zamišljal poteke svojih ur jahanja po svoje, kar naj bi bilo po njegovem mnenju veliko bolje in bolj zabavno kot dolgočasne lekcije.').
