g(100947128,'exPo besedah Dermeljeve obstajajo boljše in okoljsko sprejemljivejše možnosti, kot je uporaba gensko spremenjenih organizmov.; ex"Menimo, da uporaba GSO v kmetijstvu ogroža ekonomski obstoj konvencionalnih in ekoloških kmetov, poleg tega nihče ne ve, kako bo njihova uporaba dolgoročno vplivala na okolje in zdravje ljudi.; exNo, ker so bili nekateri telefoni znamke Nokia zaklenjeni za uporabo le finskih slušalk, so bile takšne domneve deloma upravičene.; exZato je vprašanje javnega nadzora nad uporabo tveganih tehnologij temeljno vprašanje demokracije sodobnega sveta.; exNikakor ne gre za omejevanje svobode znanosti, pač pa za omejevanje nekritične uporabe tveganih tehnologij.; exZ domačim znanjem so razvili projekt sodobnega upravljanja sejne sobe in stanovanja oziroma dnevne sobe, in sicer z uporabo interaktivne predstavitvene opreme in sodobnih telekomunikacij.; exDr. Michael Kennedy, zgodovinar, izvedenec za zgodovino irske diplomacije, pravi, da uporaba birokratskih postopkov izpolnjevanja obrazcev, fotografiranja in udarjanja s petami znotraj umetniškega performansa pomeni globoko ironijo, posebej v kontekstu dogodkov, ki so spremljali nastop NSK.; exIn zato si tokrat lahko ogledate pametni telefon, ki ima vse slabosti drugih tovrstnih naprav (velikost, nerodna uporaba za telefoniranje in podobno), hkrati pa eno zelo dobro lastnost: govori palmOS.; exSlovenski oglaševalski kodeks (samoregulativni akt oglaševalcev) poleg nekaterih že naštetih pravil, ki jih vsebuje pravilnik o oglaševanju zdravil, dodatno določa, da oglas ne sme trditi, da zdravilo odpravlja prave vzroke bolezni oziroma da ob uporabi ni potreben niti posvet z zdravnikom.; exPrednost kompatibilnostnega pred načinom »legacy« je predvsem v uporabi vseh 4 GB pomnilnika za namen določenega procesa (pri 32-bitnih aplikacijah obstaja 2 GB omejitev, preostala 2 GB pa sta namenjena operacijskemu sistemu).; ex1Zanimajo ga materiali, uporaba in načini izdelovanja krakov za loke.; ex1Danes že uporabljajo tehnologijo za katero so mislili, da bo prišla v uporabo šele v prihodnjem tisočletju.; ex1Za srčne operacije že uporabljajo umetne mišične strukture in v uporabi so že "čitalci" očesne roženice, ki ni enaka niti pri dveh osebah in jih uporabljajo kot PIN kodoZ vodo v Evropo; ex1To dejstvo nam omogoča, da tudi brez uporabe kompasa ali podobnih pripomočkov zlahka ocenimo, v katero smer bo jadrnica plula po prečenju.; ex1Slovar je narejen po virih ene najboljših slovarskih založb Oxford University Press, njegova gesla vsebujejo med drugim tudi primere tipične uporabe besede in slovnične posebnosti.; ex1LJUBLJANA Ministrstvo za zdravje je s šestmesečno odločbo javnemu podjetju Vodovod- kanalizacija (VO-KA) dovolilo uporabo pitne vode, in sicer kljub prekoračeni vsebnosti nekaterih pesticidov, na primer atrazina, desetilatrazina in 2,6-diklorobenzamida.; ex1Stranske produkte, ki bodo nastali pri predelavi olj, pepelne pogačice, bodo izvažali za nadaljnjo uporabo.; ex1PREHRANA: Izogibajmo se pitju vode iz vodnjakov, uporabi ledenih kock v pijačah itn.; ex1To pa ni pogodu Pungartniku, ki meni, da je uporaba prepoznavnega imena koroška gavda za Rotovnikovo zabavo moralno sporna.; ex1Možno bi bilo, da bi z uporabo tehnične soli, ki se pozimi uporablja za soljenje cest ali v kemični industriji, uživali sol brez joda, kar pa bi po daljšem času vodilo v golšavost pod pogojem, da bi bila naša prehrana zelo enostranska.; ex2Uporaba RSS-vira za posredovanje informacij je še zlasti primerna za vse informacijsko naravnane spletne strani in za vse tiste strani, ki v pogostih časovnih intervalih osvežujejo svojo vsebino.; ex2Uporaba RSS-vira nikakor ne pomeni, da morate na stranski tir postaviti e-pošto.; ex2Smisel uporabe različnih orodij je v njihovem povezovanju in doseganju sinergijskih učinkov.').
g(100947596,'exV petdesetih letih so biološka telesa postala tehnološki komunikacijski sistemi, a se pri tem še niso povsem rekonstituirala kot prostori "razlik" v postmodernem smislu - kot igra označevalcev in replikatorjev v strateškem polju, katerega pomen je le z zelo problematičnega vidika odvisen od zunanjega sveta.; exIgra teh pomenov, ki jih lahko izpeljemo iz imena, nas je spodbudila k delu, razvoju in želji, da odpremo ta vinska vrata in ponudimo naša zlata vina, je povedal Matjaž Berce, ki se je skupaj s Tadejem Pavlico in Davidom Rijavcem pred tremi leti odločil za skupen nastop na domačem in tujih trgih.').
