g(100949134,'exZ njo je mogoče delovati bolj ciljno, saj lahko znanstveniki dosežejo spremembo ene same lastnosti, kar bi jim z uporabo tradicionalnih metod težko uspelo oziroma bi bil proces zelo dolgotrajen.; exUstrezna uporaba Priloge k diplomi je sredstvo, ki pospešuje ta proces.; exPoslanci so nato obravnavali spremembe pravilnika o merilih za uporabo sredstev fundacije za financiranje športnih organizacij .; exPrav v zbirki Molčanja je sicer najti tudi nekatere postmodernistične pripovedne postopke (npr. simulacija »uredniške« opombe, uporaba konvencije najdenega rokopisa, imitacija zgodovinske pripovedi v slogu Borgesa), vendar Šeligo izhaja iz povsem drugačne pisateljske poetike.; exKer je tovrstnih pobegov vedno več, skušajo na ljubljanskem okrožnem državnem tožilstvu sodišče razbremeniti obravnave takih zadev z uporabo inštituta odloženega pregona, ki ga opredeljuje zakon o kazenskem postopku.; exKot so nam pred časom, ko smo o uporabi novega inštituta kazenske zakonodaje poročali podrobneje, povedali na ljubljanskem okrožnem državnem tožilstvu, v takih primerih tožilec ob vložitvi obtožnice ali obtožnega predloga sodišču predlaga, da zadevo obravnava prednostno.').
