g(100973077,'exDa sploh ni padel v vojni.; exJa, vojna je iz njih naredila pošasti.; exSeveda ga je vrgla iz tira vojna.; exVojne poleg tega terjajo velikansko ceno v človeških življenjih, razdejanju in psiholoških posledicah, ki se celijo več generacij.; exNemški zunanji minister Joschka Fischer je v javni razpravi bistvo politike preprečevanja konfliktov povzel z besedami, da je bolje preprečiti kot zdraviti, kajti vojne je pogosto lažje preprečiti kot pa prekiniti.; exZ vojnami, ki so pustošile okoli Jezusovega rojstnega kraja, so vrata postajala manjša, deležna prezidav …; exCerkev se ni mogla izogniti vojnam …; exCerkev Kristusovega rojstva se tudi v sedanjosti ne more izogniti vojni ...; exVojni se ne morejo izogniti niti ljudje, ki živijo v bližini.; exDanes so vojne drugačne, ljudje in narava so se v stoletjih verjetno manj spremenili.; ex1Sicer niso vedeli, zakaj, jaz pa sem preprosto zagovarjala svojo politično filozofijo o tem, kdo v vojnah posiljuje vedno zmagovita stran.; ex1Odgovor se ponuja sam: svet bi se po Afganistanu in Iraku očitno znašel pred novo vojno.; ex1To bi bila pravična vojna.').
