g(101023820,'exMed celotnim postopkom moramo paziti, da koža in plavuti ostanejo vlažne.; exLetošnje letno poročilo evropske komisije navaja velik napredek pri postopkih za ustanavljanje podjetij, boljši dostop podjetij do elektronskega poslovanja, uvajanje različnih oblik podjetniškega izobraževanja na visokih in srednjih šolah, na drugi strani pa tudi opozarja na zanemarjanje vprašanja učinkovitega zastopanja interesov malih podjetij na nacionalni in evropski ravni.; ex«19 Institucija je za Mary Douglas sprejetje določenega miselnega sloga, prevzetje skupnih definicij za določene kategorije, kar daje vtis, da institucije mislijo same od sebe in nato posameznike in postopke, ki potekajo v instituciji, dejansko poenotijo in iz raznoličnih posameznikov naredijo skupino.; exPomembna novost je tudi dodaten postopek za izbor izvajalcev na področju gradnje športnih objektov.; exZdravnik, ki je tukaj govoril, je odprl celo vrsto vprašanj, katerih razrešitev je potrebna, če hočemo o tem zakonu glasovati - in vendarle ni predlagal tega, da je proti temu, da se zakon sprejme po hitrem postopku.; exPrav dramaturgija nas namreč opozarja, da sta dramska in gledališka umetnina soodvisni in ju je treba spoznavati kot soodvisni in s posebnimi didaktično-metodičnimi postopki.; exPrav v zbirki Molčanja je sicer najti tudi nekatere postmodernistične pripovedne postopke (npr. simulacija »uredniške« opombe, uporaba konvencije najdenega rokopisa, imitacija zgodovinske pripovedi v slogu Borgesa), vendar Šeligo izhaja iz povsem drugačne pisateljske poetike.; exOcena zdravniške zbornice: bolnica je pretrpela škodo na psihofizičnem zdravju - Postopek histološke diagnoze nedopustno malomaren; exKomisija je zahtevo za revizijo postopka zavrnila z razlago, da v reviziji postopka oddaje javnega naročila ni mogoče oddati začasne odredbe.; exStranko pregleda zdravnik, označi mesta dlakavosti, izvor dlak (posledica morebitnega hormonskega delovanja) ter določi postopek njihovega odstranjevanja in moč nastavitve laserja.').
