g(101182654,'exV zadevi VIII-Ips-17/2003, kjer sta sodišči druge in prve stopnje ugotovili delno kršitev KP glede uskladitve izhodiščnih plač, je revizijsko sodišče revizijo zavrnilo.; exPrekinitev stavke je dopustna, če se stranki KDS, ki se želita pogajati in doseči sporazum, prav zaradi tega dogovorita za njeno prekinitev (zadeva VIII-Ips-48/2003).; exKot so nam pred časom, ko smo o uporabi novega inštituta kazenske zakonodaje poročali podrobneje, povedali na ljubljanskem okrožnem državnem tožilstvu, v takih primerih tožilec ob vložitvi obtožnice ali obtožnega predloga sodišču predlaga, da zadevo obravnava prednostno.').
