čni center za pošto, saj zanjo s sarkazmom pravijo, da bodo zdaj iz mesta poleg ljudi pač hitreje odhajale še pošiljke.; ex1Dve ugrabljeni letali sta takrat zadeli nebotičnika Svetovnega trgovskega centra, tretje poslopje Pentagona, četrto pa je strmoglavilo v Pensilvaniji.; ex2Mladinski kulturni center Maribor ob podpori Študentske organizacije Univerze v Mariboru pripravlja danes ob 19. uri v galeriji Abruni v Mariboru galerijski literarni večer.; ex2Center za vodenje, nadzor in varnost celotnega premostitvenega objekta je v terminalu pri Lernackernu na švedski strani, kjer je tudi cestninska postaja.; ex2Z BESEDO, GLASBO IN SLIKO - V večnamenski dvorani Kulturnega centra Janeza Trdine v Novem mestu je Literarni klub Dragotina Ketteja v petek, 18. decembra, zvečer pripravil zanimiv in pester literarni večer, na katerem se je s svojimi deli predstavilo kar enajst besednih ustvarjalcev: Franc Umek, Klavdija Kotar, Mihail Gričar Skelendžija, Sebastijan Podobnik, Ana Černe Dražumerič, Mitja Bukovec, Blaž Simič, Damijan Knafelc (na sliki od leve proti desni) ter Samo Dražumerič, Jadranka Matić Zupančič in Katja Plut.; ex2Centru za kriminalističnotehnične preiskave ministrstva za notranje zadeve so s haaškega sodišča za vojne zločine oziroma tamkajšnjega tožilstva poslali zahvalno pismo, ker so jim kakovostno in hitro izdelali strokovno mnenje.').
