g(104105893,'exDolgoročnejši program je močno povezan z adaptacijami, saj moramo prenoviti matično hišo, poleg tega pa načrtujemo tudi posebne programe za nove, oz. obnovljene prostore, ki so nam namenjeni na Metelkovi.; exV San Franciscu je od 9. do 12. januarja v prostorih konferenčnega centra Moscone potekala konferenca Mac World Expo, na kateri se je zbralo 93.000 privržencev računalnikov Macintosh.; exZagovornici selitve, predstavnica mesta Francka Trobec, načelnica mestnega oddelka za predšolsko vzgojo, izobraževanje in šport ter ravnateljica glasbene šole Lučka Winkler-Kurent, sta prepričevali starše, da je selitev smotrna, saj bi se glasbena dejavnost za to področje lahko odvijala v enem glasbenem centru v Reboljevi ulici v adaptiranih prostorih vrtca Ciciban in kasneje še v prizidku OŠ Milana Šušteršiča, ki se nahaja v bližini, ne pa da je razbita po sedmih različnih lokacijah.; exHRASTNIK - Delniška družba Stedek, ki se ukvarja s satiniranjem in dekoriranjem steklanih izdelkov, zdaj še deluje v prostorih steklarne.; exZaradi utesnjenosti in iztekajoče se najemne pogodbe za sedanje prostore se je vodstvo Stedeka odločilo za nakup nekdanjih prostorov obrata cestne mehanizacije, ki je pred leti deloval v okviru Strojne tovarne Trbovlje oziroma njene naslednice Strojegradnje Trbovlje, ki je prav tako končala v stečaju.; exZdaj objekt pripravljajo za potrebe Stedekove proizvodnje, v obnovljene prostore pa naj bi se zaposleni vselili konec letošnjega oziroma na začetku prihodnjega leta.; exJa, se je nasmehnil Florijan in obmiroval s pogledom na skupinici kaplanov iz okoliških mestec in vasi, ki so se hranili ob obloženi mizi sredi prostora, ampak svet je ne glede na muke zadnjih dni odrešen.; exV predstavi Kapital je zelo pomembno nekaj, kar lahko odpre v gledališču nove možnosti uprizarjanja, t. j. vrtljivi prostor, v katerem sedijo gledalci in spremljajo dogajanje okoli sebe.; exPri tem vrtljivem gledalčevem prostoru gre v bistvu …; exV drugih dveh Asovih pros