g(104377057,'exSistem posebnih cevi omogoča izmenjavo vode oziroma vzdrževanje enakomerne vsebnosti kisika, raztopljenega v vodi.; exSandra je tako našla službo: povezala se je z majhnim računalniškim podjetjem, ki razvija programsko opremo in sisteme.; exTe modele je treba potem le malenkostno prilagoditi posameznim sistemom, trdijo pri IBM.; exDa bi stranke prepričali, da je res tako, ponujajo možnost tako imenovanega POC ( proof of concept ), ki je nekakšna predintegracija sistema, ki uporabniku pokaže, da rešitev res deluje.').
