g(104424218,'exDruga stran, zelo skromna manjšina, je nad njimi navdušena, pa čeprav &amp; so tipke premajhne, telefon ne zna pošiljati faksa, stvar je velika in ne gre v žep, kot telefon pa ni nič kaj prida.; exDobili smo tudi taka odgovora: Vsaj pravilno zložite stvari...; exČe bodo Rusi videli, da sami lahko prodajo določeno zadevo z reekspotom, nam ne bodo dali pisnega soglasja in pri nas se bodo zaloge kopičile.; exV združenju menimo, da trenutne oblike organiziranosti niso najpomembnejši razlog za razmere, v kakršnih so se znašli gospodarski subjekti s področja prevoza stvari v cestnem prometu.').
g(104424418,'exFunkcijsko ni 7270 nič posebnega, večina stvari je že videna.; exZa Kajna pa se zadeva šele začne.; ex(»Stvar je super.; exToda rekla bi, da je tisto delo, za katero je Jimmy rekel, da je ''prepozno, da bi ga odpovedali'', v središču vse te zadeve o denarju in plačilu.; exProfesionalizem je sila kruta stvar in marsikdaj se športniku po robu postavijo številne okoliščine, skoraj nepremostljive, ko se pojavijo tudi razmišljanja o predčasnem koncu kariere.; exČe Tina Pisnik v svojem teniškem življenju pri kateri stvari ni imela sreče, so bile to poškodbe: najprej hrbta, nato gležnja, zaradi katerih bi članica zmagovalne slovenske vrste, ki je osvojila naslov svetovnih prvakinj do 14 in do 16 let, teniški lopar skoraj postavila v kot.; exNa trg omrežij CDMA (uporabljajo jih tudi v Južni in Srednji Ameriki) ga je poslala Kyocera, zadeva pa je vzbudila veliko pozornosti tudi pri nas.; exTo je vprašanje za predsednika državnega zbora, predvsem pa je vprašanje za vodje poslanskih skupin in predsednike delovnih teles, ki se ukvarjajo s temi zadevami.; exSicer pa imata Adria in Jat še stare nerazčiščene finančne zadeve, ki jih bo Adria potegnila iz rokava, če se bo položaj zaostril.; exTo večno razkaz''vanje stvari!; ex1Zadeva Jacka Frosta je zbudila veliko hrupa.; ex1"Dejstvo, da so se predlagatelji vlade dr. Andreja Bajuka odločili za tožbo, pove več stvari.; ex1Vendar je tudi prosilna molitev upravičena, če le prosimo za dobro stvar in s pravim namenom.; ex1Tudi njeno zavzemanje za higienske zadeve našega gospodinjstva je začela z besedami "Saj zares ne zahtevam preveč ...; ex1Saj ni treba sodelovati pri takih stvareh.; ex1Dolgo sem ležal buden in premišljeval o tej zadevi.; ex1Take divje stvari mi blodijo po glavi, nenehno, brez prestanka, stalno - in nihče me tega ne odreši.; ex1Tudi oni so bili veseli, da je končno prišel nekdo, ki je stvar hotel odstraniti.; ex1In tudi, ko grem naprej v druge vrste ogrožanja nacionalne varnosti Republike Slovenije začne s stavkom, ki je že padel v oči predgovornikom, namreč je neposredni ali posredni nedemokratičen nazivni posegi za spremembo ustavne ureditve, ki se potem nadaljujejo s teoristično dejavnostjo, trgovanje z belim blagom in podobna grozodejstva, konča pa s stvarjo, ki me pravzaprav najbolj skrbi, namreč definicija na koncu obstajajo tudi možnosti nastajanja povsem novih oblik ogrožanja nacionalne varnosti.; ex1Prav zato predlagatelj ne more sprejeti nekaterih očitkov, da so določene zadeve sicer zanimivo urejene v zakonu, da so primerne, vendar le za evropske razmere, za nas pa ne oziroma še ne.; ex2Poleg tega je pa zadeva lahko tudi ustavno sporna.; ex2Zame je tu cela vrsta vprašanj; jaz se sicer ne spoznam na stvari, ampak če postavi trditev, da na eni strani tega kadra manjka, na drugi strani pa je cela vrsta ljudi, ki so na zavodu za brezposelne, potem je zame pač zelo jasno vprašanje: tem je treba več plačati, drugače jih ne bomo dobili.; ex2Zdajšnja davčna zakonodaja je pravzaprav absurdna za situacijo, v kateri smo, in s temi stvarmi se lahko vse tisto pokrije, kar bi tam izgubili.; ex2Sodišča odločajo o zadevah ljudi.; ex2Najbrž še ni uporabnika elektronske pošte, ki v svojem poštnem predalu še ni našel takoimenovane spam mail ali odpadne pošte, ki je največkrat namenjena različnim propagandnim sporočilom ali kakšnim podobnim zadevam.; ex2Današnji tempo stvari spreminja vsak mesec, vprašanje pa je, kdaj se splača obnoviti knjižno obliko in ali je perioda petih let za to prekratka.; ex2Objektivnost, ki v izhodišču govori o oblikovanju primerjalne vednosti (kako poimenovati stvari, da bi bile stabilne in podobne druga drugi), postane vprašanje politike novega postavljanja meja, da bi dobili nenedolžna pogajanja in povezave.; ex2Vzemite si čas za ponovno skladiščenje stvari, ki vas spravljajo v bes.; ex2Osnovno sporočilo plesnih in glasbenih nastopov ter recitalov je bilo, da je merilo vseh stvari človek, ne glede na drugačnost, s čimer so se spomnili dneva strpnosti in splošne deklaracije človekovih pravic.; ex2Zadeva je zapletena, ker si strokovnjaki niso edini o njenih vzrokih.; ex3Odvetnik Stambolićeve družine Nikola Barović in Stambolićeva žena Katarina pa sta zavrnila namige, da bi lahko bile v ozadju kakšne poslovne zadeve, saj se menda Ivan Stambolić, odkar se je upokojil, ni ukvarjal z nobenimi poslovnimi zadevami.; ex3Pogosto je ostalo samo pri poskusih ali celó zamislih, najbolj zgodnja igra iz Krekovega krožka se je zgubila, nekaj stvari je pesnik dokončal, a so ostale v rokopisu, dve manj pomembni sta izšli v mladinskih listih, trajno veljavo so ohranila tri dela, objavljena v Ljubljanskem zvonu ali v knjigi.; ex3Misli in čustva nastopajočih oseb najbolj pogosto izražajo po asociativni poti določene stvari iz narave, ki jih kot značilne v veliki meri poznamo že iz Župančičeve lirike: peruti oziroma krila in živali s perutmi, zlasti ptice: metuljčki, čebelica, golobi, kukavica, utva, sokoli in orli, nadalje konji vranci, potem svetlobna telesa in pojavi: zvezde, mesec, zarja in sonce pa luč in kres, od rastlin posebno rože in pelin ter končno morje, veter in val, od predmetov pa plašč in čaša.; ex3Ker je tovrstnih pobegov vedno več, skušajo na ljubljanskem okrožnem državnem tožilstvu sodišče razbremeniti obravnave takih zadev z uporabo inštituta odloženega pregona, ki ga opredeljuje zakon o kazenskem postopku.; ex3Tako je npr. zelo koristno, če prejemnike svojih poštnih sporočil povabite na prebiranje svojega bloga, v blogu pa jih povabite, da se naročijo na vaše e-novice in jih npr. prek RSS-a obvestite o vseh teh stvareh.; ex3Za format VCD ni potrebno veliko, zadeva pa bo na TV-zaslonu popolnoma gledljiva.').
