g(105093890,'exPomemben pogoj je stopnja gospodarske razvitosti, kar pomeni, da morajo pred polnopravnim članstvom Slovenije osebni dohodki njenih državljanov dosegati vsaj 50 ali 60 odstotkov povprečnega evropskega dohodka.; exEkonomski inštituti in analitiki mednarodnih organizacij še vedno znižujejo svoje napovedi stopenj gospodarske rasti, ki so glede na dobro leto nazaj pravzaprav že prepolovljene.; exSlovenija se s tem uvršča med evropske države z višjo stopnjo maternalne umrljivosti.; exBanka Slovenije bo naredila vse, da se bo v Sloveniji zadržala sedanja stopnja razvoja in da bo domača valuta še naprej dokaj stabilna, je na včerajšnjem srečanju z gorenjskimi gospodarstveniki dejal guverner Banke Slovenije dr. France Arhar, ki ob neugodnih mednarodnih razmerah pričakuje rebalans proračuna in prevlado razuma v slovenski plačni politiki.; ex- razbremenitev obrtništva (nižje stopnje DDV za določene dejavnosti, uvedba pavšalne obdavčitve, znižanje zavarovalnih osnov, zmanjšanje birokratskih postopkov, urediti področje inšpekcijskih nadzorov,; exPredvsem sta zdaj predlagani dve stopnji davka, in sicer po uklajevanju na vladi 19 in 8 odstotkov.; exDDV z omenjenima stopnjama in trošarine, katerih uvedbo tudi predlaga vlada, naj bi s stališča proračunskih prilivov zagotovili toliko sredstev (skupaj 13,7 odstotka BDP), kot jih zdaj zagotavlja prometni davek.; exMinimalna stopnja narodne zavesti veleva, da v duhu naše narodnostne identitete ne bi smeli prestopiti vrat nasilnih trgovskih središč še bolj nasilnih imen.; exČe k temu številu dodamo še 22 voznikov, ki so preizkus z alkotestom odklonili, dobimo podatek, da je bilo v minulem Martinovem vikendu na cestah več kot 15 odstotkov takšnih, ki so bolj ali manj, pa tudi krepko prekoračili še dovoljeno stopnjo alkoholiziranosti.; exInženir Kikelj, asistent na letalskem oddelku Strojne fakultete, je prispeval ključne aerodinamične in trdnostne izračune, zmanjševanje teže letala do najnižje možne točke pa je delo Saša Kolarja, medtem ko je Celjan Črt Rojnik v svojem svetovno uveljavljenem podjetju letalskih instrumentov in letalske opreme LX Navigation izdelal instrumente zanj.').
g(105099796,'exStranko pregleda zdravnik, označi mesta dlakavosti, izvor dlak (posledica morebitnega hormonskega delovanja) ter določi postopek njihovega odstranjevanja in moč nastavitve laserja.').
g(105122557,'exOna je lahko spala največ pet ur, tako, da je revica bila večino dneva sama.; exFunkcijsko ni 7270 nič posebnega, večina stvari je že videna.; exKo pride poletje, so lososi v večini vodotokov razporejeni po različnih predelih; v zgornjih in srednjih odsekih posameznih rek.; exPri muharjenju v morju je utrujanje večine rib, brez kolesca, opremljenega z zavoro, ki sprosti rezervno vrvico, preden se konica vrvice pretrga, nemogoče.; exPodobno kot velja za ostale cvetoče okrasne rastline, so tudi med okrasnimi travami takšne, ki nase opozorijo že spomladi (med prvimi so razni šaši in ločje, ki z novimi listi vnesejo svežino na vrt), večina trav pa doživi svoj višek poleti ali celo na začetku jeseni.; exNekatere fotografije, ki so nam jih dali za objavo, sicer razkrivajo njihove obraze, vendar pravijo, da jih večina ljudi ne bo spoznala.; exPametni telefoni so se sicer pojavili tudi v naših krajih, le da večina ne ve, kaj bi z njimi.; exDeklaracija iz Kanade ni po volji večine držav, toda ker so dogovor morali sprejeti s konsenzom, je na koncu zmagal Fujimori, čeprav ne manjka ocen, da to pomeni njegov poraz, ker bo moral sprejeti delegacijo, ki naj bi nato predlagala, kako naprej.; exV tem kontekstu bi celo tvegal trditev, da bomo večino pogajanj opravili doma, da bo manj pomemben delpogajanj z komisijo EU, čewprav tega ne podcenjujem, še zlasti ghlede vprašanj glede Luke Koper.; exGlede na število prebivalcev je to trikrat več kot v večini srednjeevropskih držav.; ex1Seveda je večina že pozabila na polpreteklo zgodovino in se z njo ne ukvarja več, vendar so tudi na nasprotni strani tisti, ki bi radi obračunali do konca.; ex1Enakega evropskega prvenstva v tenisu se je na primer na stroške državnega zbora udeležilo šest poslancev, večina seveda iz LDS.; ex1Delničarjih so v večini primerov potrdili predlagane sklepe, marsikje pa tudi ne v celoti; ex1Možje večina jih sploh ni spala so si začeli pošiljati signale z ladje na ladjo; upali so, da se bo vsak čas izza pene pojavilo veliko kitajsko ladjevje.; ex1Večina potnikov so bile ženske, oblečene v preprosta nabrana krila in rožaste bluze, na kolenih in pod sedežem pa so tovorile košare, cekarje in mreže, polne dobrot.; ex1Večino časa so bili boljši nasprotnik in v zadnji tretjini so vodili že s 4:1.; ex1Zanimivo je, da so večino označenih morskih želv opazili prav na Jadranu, točneje v vzhodnojadranskem akvatoriju.; ex1Za večino od nas je to materni jezik naučili smo se ga v zgodnjem otroštvu v domačem okolju.; ex1Večina slovenskih srednješolcev opravlja tudi delovno prakso ali praktični pouk v vsakdanjem delovnem okolju preizkušajo in dokazujejo svoje znanje.; ex1Celo več, prvi dnevi po izvalitvi so brez tega lahko celo usodni za večino teh in sorodnih vrst.; ex2« Čisto možno je, da se je večina ljudi v restavraciji lepo držala navodil, naj se ne gane, pri čemer je hlastala za zrakom, razbijala šipe in plezala na mize, da ne bi zgorela.; ex2Hitreje in bolj zanesljivo skozi ovinke: novi variabilni zaporni sistem odpravlja večino slabosti klasične diferencialne zapore, zato nudi več voznih užitkov na različnih cestnih podlagah.; ex2Pri dvajsetih letih se le redko katera ženska sprašuje o svoji plodnosti, večina se zanositvi prav v teh letih skuša čim bolj izogniti.; ex2Dean Podgornik (desno) je s pogumno vožnjo dobil večino šprintov v Šenčurju in zasluženo slavil na prvi kolesarski dirki v letu 2002 v Sloveniji.; ex2Če bi med številnimi raziskavami tržišča naredili še kakšno o tem, bi jim postalo kaj hitro jasno, da je večina klobas Poli v hladilnikih le zato, ker jih imajo radi otroci - kategorija potrošnikov, ki jo bodo v PP morali vzeti bolj resno kot doslej.; ex2Skupne podpore vladnim predlogom ni niti v koaliciji Pri večini olajšanje zaradi propada železničarskih zahtev; ex2Vaša vloga »pivota«, krožne napadalke, je malce nenavadna: večino časa ste obrnjeni s hrbtom proti golu, ki ga napadate.; ex2A če sploh, bodo večino poslopij zasnovali drugi arhitekti, s svojim lastnim rokopisom.; ex2Veliko večino pesmi pa je zasnoval od pomladi do jeseni 1915; izmed njih je samo štiri (Zlato v Blatni vasi, Ciciban in čebela, Uspavanka: Kaj se sveti rimska cesta?; ex2Ta nasprotna stališča pojasnjujejo predvsem z močno polarizacijo družbe, ki je po mnenju večine opazovalcev posledica ideologije Fidesz-MPP, ki temelji na ustvarjanju bipolarnega političnega sistema v državi.; ex3Hkrati so predstavili statistične kazalce (mimogrede, večina jih je strogo zaupna, zato jih ne moremo predstaviti), ki nas uvrščajo v povprečje ali celo med najuspešnejše evropske države (gre za kazalce, ki kažejo uspešnost regulacije trga).').
g(105125377,'exZadovoljni policisti in ljudje z območja Policijske uprave v Mariboru; exZ delnicami Etola se trenutno trguje v območju med 20.000 in 21.000 tolarji, kjer je tudi spodnja ter zgornja trendna črta padajočega kanala.; exV tem območju se nahaja tudi močna podpora, kjer pa bi postavili prve nakupne naloge.; exČe povpraševanje ne bo dovolj močno pri 20.000 tolarjih, lahko pričakujemo pomik trgovanja v območje med 18.000 in 19.000 tolarjev.; exOb malo večjem povpraševanju pa se bo območje trgovanja takoj pomaknilo na 21.000 tolarjev, kjer ponudbe ni veliko.; exNarečja razmejujejo izoglose črte na zemljevidu, ki zaznamujejo mejo med območjem ene besede, oblike ali izgovorjave in druge.; exPreden je pričel padati sneg, se je ohladilo (z drugimi besedami, padla je temperatura zraka), približala se nam je vremenska fronta, ki je povezana s ciklonom, torej območjem nižjega zračnega tlaka.; exPodatki iz sistema omogočajo gospodarne odločitve o tem, kakšna prenapetostna zaščita električnih naprav je na posameznih območjih potrebna, lažje pa je tudi odkrivanje krajev poškodb zaradi strele.').
g(105149325,'exPretok idej, informacij, izmenjava izkušenj, preverjanje znanj in vedenj so argumenti organizatorjev in kustosov, ki so prepričani o pozitivni vlogi tovrstnih manifestacij.; exOpozoril je na vlogo in pomen slovenščine, ko bo Slovenija postala članica EU - nastopala bo v njenih odločilnih organih, sodelovala v skupnih akcijah.; exPodobno kot zakon o zunanjih zadevah je velika večina načelno podprla tudi besedilo novega zakona o knjižničarstvu, vendar je bilo jasno, da bo do nesoglasij med strankami prišlo v tistem delu besedila, ki določa vlogo in pristojnosti občin v zvezi s knjižnicami.; exJasno je, da bodo posamezni ekonomski interesi igrali pomembno vlogo.; ex- Kakšno vlogo imata v doživljanju ljubezni naravno in človeško okolje?; exVse do Gerharda Schröderja je imela to vlogo imela Nemčija, ki zdaj nima več ne volje ne sredstev za nenehno žrtvovanje za skupno dobro.; exPojem četnika je najverjetneje izkrivljena slika ali pa se ne ve, kakšna je bila vloga četnikov med narodnoosvobodilnim bojem pri nas.; exDoumeti mora, da ima vaš poskus, da bi mu posredovali pomoč, bistveno vlogo tudi v vašem samozdravljenju.; exTakratna odločitev Bernarda II., da Kostanjevica postane vsestransko središče Dolenjske, je razumljiva, saj v tem času ni bilo naselbine, ki bi v negotovih razmerah visokega srednjega veka lahko prevzela to vlogo.; exVendar v procesu zastoja niso igrali vloge samo omenjeni osnovni dejavniki, temveč tudi drugi, o katerih bo govor v nadaljevanju.').
g(105174653,'exIn če velja, da znanost lahko deluje le v svobodnem okolju, je obenem tudi neodtujljiva pravica vsakega človeka, da mu tvegane tehnologije ne kratijo človeškega dostojanstva in ne jemljejo njegove svobode.; exFinančno ministrstvo ima zato legitimno pravico, da predlaga rešitev.; exOdgovor: Stvarnopravni zakonik določa, da ima lastnik nepremičnine pravico odstraniti in si prilastiti veje sosedovega drevesa, ki segajo v zračni prostor njegove nepremičnine, in korenine, ki rastejo v njegovo nepremičnino, če ga motijo in če tega na njegov poziv ne stori lastnik sosednje nepremičnine.; exNajvečja kršiteljica človekovih pravic je bila Italija, največ postopkov ima zaradi kršitve pravice do sojenja v razumnem roku, saj traja v Italiji sodni postopek v povprečju sedem let.; exPravico voliti in biti voljen za člana občinskega sveta - predstavnika romske skupnosti imajo pripadniki te skupnosti, ki imajo volilno pravico.; exNa vsakem srečanju želimo v delavnice vključiti tudi nekaj taborniškega, med drugim smo se učili delati taborniške vozle (slika zgoraj) kljub temu, da je letos poudarek na otrokovih pravicah, je povedala vodja projekta Mateja Klep iz roda Dobra volja.; exŠuštar pravi, da zakon ravno zato predvideva pravico beguncev do začasnega in občasnega dela.; exTedaj bodo nekdanji imetniki stanovanjske pravice za povprečno 50 kvadratnih metrov veliko stanovanje plačali 22,8 odstotka več kot po zgoraj omenjeni uskladitvi, najemnikom v novejših stanovanjih, ki so doslej plačevali najvišje stopnje, se bo najemnina za 7,9 odstotka znižala, denacionalizacijskim upravičencem pa se bo zvišala kar za 84,2 odstotka.; exCopyright Salomon d.o.o., vse avtorske pravice pridržane.; exGre za zakon o ustavnem sodišču, o sodiščih, o socialnih in o delovnih, o državnem tožilstvu, o računskem sodišču, o varuhu pravic državljanov, o davčni zakonodaji in drugo.; ex1Avtorsko pravo je na področju uporabe umetniških avtorskih del razmeroma enostavno: avtorske pravice ugasnejo po 70 letih od nastanka avtorskega dela in postanejo javno dobro.; ex1V tem pogledu torej Mobitel zase ni zahteval nobenih posebnih pravic.; ex1NLRA SE JE OMEJIL NA PRAVICE DELAVCEV, DA ORGANIZIRAJO SVOJA ZDRUŽENJA IN SE KOLEKTIVNO POGAJAJO.; ex1ČLENU ZJU DOLOČA, DA PRAVICE IN DOLŽNOSTI DELODAJALCA V ORGANU DRŽAVNE UPRAVE IN V UPRAVI LOKALNE SKUPNOSTI IZVRŠUJE PREDSTOJNIK.; ex1V DRUGIH DRŽAVNIH ORGANIH PRAVICE IN DOLŽNOSTI DELODAJALCA IZVRŠUJE PREDSTOJNIK, ČE ZAKON, DRUG PREDPIS ALI SPLOŠNI AKT ORGANA NE DOLOČA DRUGAČE.; ex1DELAVKA, ZA KATERO JE BILA S SKLEPOM SKUPNOSTI POKOJNINSKEGA IN INVALIDSKEGA ZAVAROVANJA UGOTOVLJENA SPREMENJENA DELOVNA ZMOŽNOST ZARADI POSLEDIC POKLICNE BOLEZNI, IMA PRAVICO DO PRERAZPOREDITVE NA DRUGO USTREZNO DELOVNO MESTO V 15 DNEH PO DOKONČNOSTI PRAVNOMOČNOSTI SKLEPA.; ex1OBVEZNA SESTAVINA POGODBE O ZAPOSLITVI JE DOGOVOR O NAČINU URESNIČEVANJA PRAVIC IN OBVEZNOSTI IZ TEGA DELOVNEGA RAZMERJA GLEDE NA PRAVICE IN OBVEZNOSTI DELAVCA PRI DELODAJALCU, KJER JE ZAPOSLEN S POLNIM DELOVNIM ČASOM.; ex1ZVZD DOLOČA PRAVICE IN DOLŽNOSTI DELODAJALCEV IN DELAVCEV V ZVEZI Z VARNIM IN ZDRAVIM DELOM TER UKREPE ZA ZAGOTAVLJANJE VARNOSTI IN ZDRAVJA PRI DELU.; ex1ZJU UVAJA PRAVICO DO PRITOŽBE KOT SPLOŠNO PRAVICO VSAKEGA JAVNEGA USLUŽBENCA, ČE GRE ZA ODLOČITEV O PRAVICI OZIROMA OBVEZNOSTI IZ DELOVNEGA RAZMERJA JAVNEGA USLUŽBENCA IN ZOPER KRŠITEV PRAVIC IZ DELOVNEGA RAZMERJA.; ex1PRITOŽBA ZADRŽI IZVRŠITEV ODLOČITVE O PRAVICI OZIROMA OBVEZNOSTI IZ DELOVNEGA RAZMERJA JAVNEGA USLUŽBENCA, ČE ZAKON NE DOLOČA DRUGAČE.; ex2ZOPER SKLEP O PRAVICI OZIROMA OBVEZNOSTI IZ DELOVNEGA RAZMERJA JE DOVOLJENO SODNO VARSTVO PRED DELOVNIM SODIŠČEM POD POGOJEM, DA JE JAVNI USLUŽBENEC IZKORISTIL MOŽNOST PRITOŽBE.; ex2Pravico do stavke omejuje natanko toliko, kolikor jo omejuje sedanji zakon o stavki.; ex2Pravica do stavke v javnem sektorju, zlasti pa v državnih organih, mora biti omejena in je omejena v vseh državah.; ex2Tudi Mednarodna organizacija dela, ki skrbi za pravice delavcev, v svoji konvenciji vsebuje restriktivne določbe o stavki v javnem sektorju.; ex2Glede tega je ustanovna listina jasna in bi bilo v primeru napada na Irak sklicevanje na samoobrambo zloraba te pravice.; ex2Saj vendar popis ni namenjen temu, da bi pravice določali glede na število manjšincev (kot je to v navadi pri sosedih), temveč prej temu, da preverjamo dejanski položaj prebivalstva in popravimo, kar se popraviti da.; ex2Z delnicami bodo delničarji razpolagali v skladu s predpisi o izdaji delnic v nematerializirani obliki ob upoštevanju predkupne pravice delničarjev, ki so prevzeli delnice na podlagi skupščinskega sklepa.').
g(105180881,'exNapačno je mišljenje, da so mu bila vrata na vrh hrvaške glasbene scene zaradi znanega očeta in uspešne mame na široko odprta, zvezda iz sosednje države s slovenskimi koreninami odkriva, da je proti svojim ciljem moral vedno stopati po težji poti.; exMladina se zdaj trumoma pojavlja na vratih mladega duhovnika, še posebno odkar ve, da poleg težkih motorjev strastno obožuje tudi Metallico.; exPa tudi za to, da so vrata televizije do zadnjega ostala trdno zaprta za civilno-družbena gibanja in za zametke novih političnih strank.; exAmpak potiskali so kljub vsemu samo simbolično, tako da so graničarji vrata zmeraj bolj zapirali, čeprav - in tu vam bom zaupal še eno skrbno varovano nemško skrivnost tiste noči -, čeprav vrat sploh niso hoteli več zapreti.; exJaponska je pokazala, da je tudi sama pripravljena odpreti vrata svojemu območju in narediti korak iz sto let samote, samo da ne bi še naprej zaostajala za azijsko velesilo.; exSeveda so tu še druge asociacije, kot zlato vino, vinska vrata, naš veter pa tudi zmagoslavje.; exIgra teh pomenov, ki jih lahko izpeljemo iz imena, nas je spodbudila k delu, razvoju in želji, da odpremo ta vinska vrata in ponudimo naša zlata vina, je povedal Matjaž Berce, ki se je skupaj s Tadejem Pavlico in Davidom Rijavcem pred tremi leti odločil za skupen nastop na domačem in tujih trgih.').
g(105186306,'depravica vsakega odraslega državljana neke države').
g(105190106,'exAvtorsko pravo je na področju uporabe umetniških avtorskih del razmeroma enostavno: avtorske pravice ugasnejo po 70 letih od nastanka avtorskega dela in postanejo javno dobro.').
g(105190804,'exPiran - Čeprav je vodstvu piranske občine jasno, da je problem beguncev, ki jih je slovenska oblast evakuirala iz obleganega Sarajeva, predvsem stvar države, se je ob zadnjih zapletih županja Vojka Štular odločila, da jim bo občina po svojih močeh pomagala.; exVse to je čutila, vendar ni imela moči, da bi to preprečila, pa karkoli je že bilo.; exOkostje dela slehernega planinskega društva je gospodarstvo, kar vedo tudi v Kamniku, saj veliko svojih moči namenjajo oskrbovanju in vzdrževanju svojih dveh visokogorskih koč, Cojzove na Kokrskem in Kamniške na Kamniškem sedlu (oziroma na Jermanovih vratih, kot je sedlu med Brano in Planjavo ime lepo po starem).; exVseeno pa zavedanje njene moči, sposobnosti, da lahko hitro in korenito spremeni vrste (vključno z našo), ki se že tisočletja razvijajo, terja od nas, da smo skromni in previdni ter kolikor je mogoče vnaprej presojamo morebitna tveganja za naše zdravje in okolje.; exPomembno za dananšnji čas je, da je krščanstvo novačilo predvsem mlade, ki so jih odbijale neustrezne vrednote starejše generacije, ki jih ni zanimal prenos premoženja, odvisen od poroke, ki so bili utrujeni od nespametnega pehanja za bogastvom in močjo in ki se jim je gnusila družba, ki je po njihovem mnenju »uživala v spolni razuzdanosti« (tako so kristjani stereotipizirali pogansko družbo, ki so jo naposled spremenili)5.; exKadar je z našo srečo kaj narobe - največkrat zato, ker smo se preobjedli njenih dobrot - valimo krivdo za svoje nezgode na sonce, luno in zvezde; kot da smo capini po sili usode, norci, ker hočejo nebesa tako, barabe, zmikavti in izdajalci, ker smo hočeš nočeš podvrženi vplivom nebeških sfer, pijanci, lažnivci in zakonolomci zato, ker je ob našem rojstvu en planet imel večjo moč kot drugi - skratka, kakor da počnemo vse svoje grdobje, ker je pač tam zgoraj tako zapisano.; exMorda bo pripravljen priznati vašo moč.; exToda v vlogi goljufivega vaškega zdravnika, ki ljudem izbija iz glave zdravje, je neprimerljivo večja moč: sodobna medicina.; exTa temeljni preobrat v znanostih o življenju pa se ni zgodil v zgodovinskem vakuumu, temveč je spremljal spremembe v naravi in tehnologiji moči znotraj kontinuirane gonilne sile kapitalistične reprodukcije.; exDajte vse od sebe, potrudite se po najboljših močeh, delajte, kar ljubite, in življenje vam bo vrnilo v enaki meri.; ex1V drugem delu tega dejanja poleg Friderika in Jelisave nastopi še stari Herman: spregledal je sinove namere z Veroniko in jih sklene preprečiti, sina in snaho pa hoče pripraviti do sprave; v sinu hoče poleg tega okrepiti skrb za ugled in moč Celjanov, vnuk Ulrik naj bi celo zasnoval jugoslovansko državo.; ex1Pri tem je vzgojiteljevo zaupanje, da bo otrok tega sposoben, bistvenega pomena, saj se je le tako sposoben odpovedati svoji moči in avtoriteti, da o vsem odloča sam, in povabiti otroke, da odločajo, pa tudi da sprejemajo odgovornost.; ex1Hkrati je pozval predstavnike vseh strank, da navežejo stike s vodstvi strank na državni ravni in vsak po svojih močeh pomagajo pri razvoju občine, kajti čaka jih veliko dela.; ex1Tudi negujem ga po svojih močeh.').
g(105216365,'exPri bioresonančni metodi s posebnimi elektroprevodnimi elektrodami izločijo nihanja iz obolelega telesa in to informacijo po elektrodnem kablu pripeljejo v napravo, ki poljubno spreminja nihanja.; exTelo sprejme "dražljaj" in pride v resonanco s terapevtskim nihanjem.; exNaprava BICOM je torej nekakšna zbirka impulzov, oblikovanih v zdravilne programe, ki pospešujejo zdravljenje in normalizacijo presnovnih procesov v telesu, toda na koncu je vseeno od človeka, ki upravlja z aparatom, in od njegovih izkušenj odvisno, ali bo pravilno postavil diagnozo in izbral pravi program za bolnika.; exObmočje medenice je središče telesa, glavna peč, ki greje in uravnava vse telo, zato bi moralo biti vedno toplo.; ex• > Roke nato spet iztegnite ob telesu.; exRoke sproščeno počivajo ob telesu.; exCik-cak (angl. criss-cross) krepi celotno telo in razteguje hrbtenico.; exMorfologija: Ima kratko, visoko telo, daljšo zgornjo čeljust in izstopajočo brčico na spodnji čeljusti.; exMorfologija: Telo je sploščeno, diskaste oblike.; exPlavuti so razporejene podobno kot pri altlantskih sledeh; hrbtna plavut leži sredi telesa, tolščenke nima; trebušni plavuti sta na sredini med gobcem in repom; repna plavut je razcepljena.; ex1Obarvanost: Po celem telesu prevladuje srebrna barva, po hrbtu se modro svetlika, boki in trebuh so rumenkasti.; ex1Morfologija: Ima dolgo, sploščeno in eliptično oblikovano telo, široko za tretjino do polovice telesne višine.; ex1Misel, da se Cornelia II ne ziblje več ošabno na vodi, mu je pognala prijeten, skoraj čuten drget po telesu.; ex1Užival je ob predstavi, kako je razneslo telo Adama Cauliffa na drobne koščke, začenši z nenadnim spoznanjem, ki se je gotovo registriralo v Cauliffovih možganih, vedenje, da zares umira.; ex1Nadaljnjih 7 do 14 dni opazujemo, ali se je pojavil rdeč kolobar na telesu ali na mestu pika oziroma otrdel tilnik in bruhanje znak borelioze.; ex1Poskusila bom pokazati, da skupnost, kadar obstaja, disciplinira, če uporabimo Foucaultov izraz, telo in duha.; ex1Nekatere se osredotočajo na zdravljenje telesa, nekatere na pokoro.; ex1Ena od težav pri izsušitvi je ta, da je žeja slab kazalec potrebe telesa po tekočini.; ex1Sedele so, izmučenih obrazov in mlahavih teles, tako da tudi matere z otroki na rokah niso niti pomislile, da bi jih prosile za sedež; vse do mejnega prehoda, prek katerega je bilo treba peš, mimo carinikov obeh držav.; ex1Povlekel je pogled od žarnice, prevlečene s kožo, ki ga je pravkar nagovorila, in se zagledal v vrsto, ki se je vila kačasto prek vsega trga, vsi so si hoteli za dva zelena bankovca očistiti dušo in jo preložiti na očetova ramena in si za dva naslednja bankovca olajšati telo, ga ubiti v deklici.; ex2S svojim telesom sem zadovoljna.; ex2Preden začnete načrtovati nosečnost, začnite zdravo jesti in čistiti toksine iz telesa.; ex2Jopič, ki se je prilegal telesu, puli, oprijete dolge hlače, moderne kavbojske škornje.; ex2Pomembno je torej le, da oskrbimo tiste točke na telesu, ki so za neko težavo ali bolezen ključnega pomena.; ex2Na zahodu junak ubije zmaja in iz njegovega telesa zgradi svet.; ex2Otrok te vibracije poveže še z vonjem materine kože, toploto telesa.; ex2Če tega primanjkuje, poskuša ščitnica s svojim večanjem in intenzivnejšim delovanjem preprečiti njegovo izgubljanje iz telesa.; ex2Na ta način se prilagodi manjšemu vnosu joda v telo.').
