g(105538625,'exOdvisno od terapevtskega cilja nihanja informacijo oslabijo, okrepijo ali pa jo postavijo na glavo (invertirajo).; exV nadaljevanju gledam soplezalca le kot očeladeno glavo na temnem ozadju ozebnika, Mik pa se pritožuje, da nima nobene prave fotogeničnosti, ko me vidi le v podplate in sem in tja v zadnjo plat.; exRoke so iztegnjene tudi v položaju za glavo.; exNato odstranimo škrge in oči, odrežemo vratne mišice in mišice glave.; exPotem, ko smo odstranili oči, lahko skozi odprtine v lobanji odstranimo lične mišice, jezik in vsa tkiva na glavi.; exOd glave na koncu ostanejo le lobanja in čeljustne kosti.; exMorfologija: Ima dolg, vitek trup, koničasto glavo in gobec z majhnimi krajnimi usti ter precej daljšo spodnjo čeljustjo.; exIma številne koničaste kožne izrastke, pogoste predvsem na sprednjem delu prsnih plavuti, glavi in gobcu, na srednjem delu hrbta in repu.; exGlava in usta so velika.; exNekatere sladkovodne ribe, ki se hranijo s kopenskimi žuželkami, imajo zgoraj ležeča usta: usta so v zgornjem delu glave in so obrnjena navzgor.; ex1Jesetri, somi in krapi, ki se hranijo na dnu, pa imajo spodaj ležeča usta: usta so v spodnjem delu glave in so obrnjena navzdol.; ex1Ne pozabite pa na zdravje - po družabnosti rada boli glava.; ex1Luči sicer niso gorele, žaluzije so bile spuščene, vstop je bil mogoč le z vabilom, še prej pa te je tip pri vratih dobro premeril od glave do peta.; ex1Vesela bodi, da imaš glavo na ramenih in da jo znaš uprabljati.; ex1Tudi pilo se je dobro trškogorsko vino, tisto za zdravje, po katerem drugi dan glava ne boli.; ex1"Pred sprejetjem dopolnjene zakonodaje o lokalni samoupravi smo bili proti KS, sedaj jim ne nasprotujemo, če si jih ljudje želijo, vendar to ne pomeni, da je prišlo do preloma v našem mišlenju, ampak se je v tem času zakonodaja obrnila na glavo," je povedal Simončič.; ex1Nagnite se naprej in sklonite glavo, da boste povečali pritok krvi v možgane.; ex1Nastja Čeh (levo) je bil jocker, Muamer Vugdalić pa je zdržal do konca, čeprav je bila obveza na ranjeni glavi natopljena s krvjo.; ex1Fanny je našobila usta in nagnila glavo na eno stran, da bi pokazala divjakoma, kako je v svoji nenapovedljivosti močnejša.; ex1Iz zapora jo pospremi ambiciozni odvetnik Loudon Trott, ki ne sluti, da se mu bo njegov urejeni svet v kratkem obrnil na glavo.; ex2Ni se spremenila samo oblika Darwinove glave, ampak ves njegov način življenja, čutenja in razmišljanja.; ex2Enega je vložil v pištolo in jo nameril taksistu v glavo.; ex2Taksist je nasilnega mladeniča zgrabil za roko in mu poskušal vzeti orožje, med prerivanjem pa ga je S. Z. z ročajem pištole udaril po glavi in zbežal v bližnjo trgovino Noč in Dan.; ex2Spala je na spodnjem pogradu, medtem ko so ženske z zgornjih postelj mimo njene glave bruhale, kar so zaužile.; ex2Glavo tiščijo v pesek in mislijo, da bodo begunci kar odšli,« kritizira državin odnos do beguncev in uradovih predlogov Šuštar.; ex2Prišlek se je moral, tako je še danes, med vstopanjem ponižno skloniti, da se ni z glavo zadel v podboj.; ex2« Barbarossa je razburjeno pomolil glavo skozi vrata.; ex2- Preprečite zadrževanje vode - omejite porabo soli, uživajte hrano, ki vsebuje dovolj beljakovin, pijte čim več vode, ne jemljite diuretikov, ne zatekajte se k laksativom, nehajte kaditi in spite v privzdignjeni postelji - glava naj bo niže kot noge.; ex2Spominjam se otroških let pod Šmarno goro, kjer smo vedno radi prisluhnili cvrčanju po travnikih in senožetih, mu sledili in s travno bilko izbezali iz rova črno živalco z veliko glavo murna.; ex2Neučinkovito igro gostov so Goričani po podaji Paniča z desne strani in lepim strelom z glavo Ekmečića kaznovali z golom za 2:0.; ex3V 63. minuti pa je Vogrinčič opravil pravi slalom skozi desni del obrambe Celjanov, podal žogo na drugo vratnico, kjer je bil z glavo najvišji Romero in postavil končni izid.; ex3Moški so le zavijali z očmi in zmajevali z glavo.').
