g(105611302,'exToda celo zdaj, ko se je spomnil na ta sklep, mu je vztrajni glas v glavi zašepetal in ga opomnil, da se je preselil v New York tudi zato, ker je upal, da jo bo našel.; exZgodba mi ni in ni šla iz glave in sanjaril sem, da bom našel levje krilo, z njim povrnil čarovnijo vrtiljaka in se s sestro zavrtel na njem.; exTake divje stvari mi blodijo po glavi, nenehno, brez prestanka, stalno - in nihče me tega ne odreši.; exToda v vlogi goljufivega vaškega zdravnika, ki ljudem izbija iz glave zdravje, je neprimerljivo večja moč: sodobna medicina.; exNasvet: če vaša oblačila dajejo vtis, da jih ni težko sleči, mu gre to zelo težko iz glave.; exA tedaj na misijone ni mislil, haha, vse drugo mu je šlo po glavi.; exNa 19. festivalu z naslovom Turizmu pomaga lastna glava bodo učenci pod vodstvom mentoric Metke Štuhec in Jasne Markovič - Jagodič predstavili kasaške dirke.').
