g(105652593,'exDedova pripomba je bila značilna zanj: »Za božjo voljo, ne bodi tako trapasta.; exPredsednik šentjernejske SKD Jože Simončič, ki je raziskavo predstavil, meni, da je v Orehovici volja ljudi jasna, še naprej želijo sedanjo KS, v Šentjerneju pa ta interes ni tako velik.; exNa koncu objavljenega besedila sporazuma piše, da bodo tri leta po začetku njegove veljave sklicali mednarodni sestanek, na katerem bodo opredelili mehanizme za končno rešitev kosovskega vprašanja, in sicer na podlagi volje ljudstva, stališč relevantnih oblasti, prizadevanj vsake strani pri uresničevanju sporazuma in sklepne helsinške listine.; exDeklaracija iz Kanade ni po volji večine držav, toda ker so dogovor morali sprejeti s konsenzom, je na koncu zmagal Fujimori, čeprav ne manjka ocen, da to pomeni njegov poraz, ker bo moral sprejeti delegacijo, ki naj bi nato predlagala, kako naprej.; exPo nadnaravni ljubezni Bog deluje na našo voljo.; exTako se z voljo odločamo za dobro, za izpolnjevanje Božje volje.; exV spalnici švigajo ognjemeti, a če njuni volji trčita, mora Tehtnica popustiti.').
