g(105661996,'exZato je treba pri načrtovanju jezikovnega življenja EU določiti znatna dodatna sredstva za prevajalske sisteme majhnih narodov.; exZa časopis pa je bilo treba na najboljši možni način razložiti ali opisati sistem, dogajanja in znova in znova geografsko lego Slovenije.; exSplošno pa odločitev držav članic, da je potrebno Evropo urediti kot skupnost svobodnih držav ne samo presega delitev v Evropi po drugi svetovni vojni, ne zgolj med poraženci in zmagovalci ampak v obliki dveh sistemov, ki jih je nasledila, socilaističnega in demokratskega.; exDarko je do konca verjel v enopartijski sistem in vse v zvezi s civilno družbo mu je šlo neznansko na živce.; exDr. Matej Lahovnik, 31 let, docent na ljubljanski ekonomski fakulteti, je študiral, ko se je socialistični sistem sesipal; teoretično je, pove, rasel z neoliberalističnimi pogledi na gospodarstvo in družbo, ki so jih kot edino zveličavne v tistem obdobju posredovali profesorji.; exNa oddelku za gospodarske javne službe in promet ugotavljajo, da so nekateri gostinci že dodobra dojeli nov sistem.; exKot je povedal direktor Leopold Panjan, na vseh ravneh v tovarni uvajajo sistem "Planiraj, naredi, preveri, ukrepaj!').
g(105671325,'exPiran - Čeprav je vodstvu piranske občine jasno, da je problem beguncev, ki jih je slovenska oblast evakuirala iz obleganega Sarajeva, predvsem stvar države, se je ob zadnjih zapletih županja Vojka Štular odločila, da jim bo občina po svojih močeh pomagala.; exTo je seveda smešno, evropsko omrežje ekološko pomembnih območij, ki je oblikovano na podlagi dveh evropskih direktiv, seveda ni stvar lokalne politike, prav tako ni stvar državnih institucij.; exTavzes: Besede se ves čas spreminjajo, stvar redakcij in slovaropiscev pa je, koliko hitro so to zmožni sprejemati.; exBržkone ni velikega dvoma, da se je vprašanje denacionalizacije, ki sploh ni stvar acquis communautaire, to je notranjega pravnega reda EU, znašlo v letošnjem poročilu unije o Sloveniji po avstrijski zaslugi.').
g(105686955,'exUkrajinci so neugoden nasprotnik, a glede na vse težave s poškodbami in igralskimi spremembami v reprezentanci je za nas neugoden prav vsak nasprotnik.; exMandarić pravi, da je zanj največja težava pomanjkanje časa, kajti menda je polno zaposlen s projektom gradnje novega štadiona Portsmoutha.; exZa odpravo teh težav bomo v okviru zborničnih strokovnih služb in izvršilnega odbora Sekcije za cestni tovorni promet pripravili celovito analizo pogojev poslovanja in predlogov za odpravo nevzdržnih razmer na področju cestnega prevozništva.').
