g(105790944,'exOsrednji prostor, namenjen kegljanju, za malo denarja ponuja sproščeno zabavo za vso družino, ljubiteljem te igre pravo možnost za rekreacijo, zaradi velikosti najsodobnejše opremljenega računalniško vodenega 16-steznega igrišča pa tudi vadbo in vrhunska tekmovanja za profesionalce.; exDruga ne prevaja, ampak ponudi v nekaj različnih jezikih jezikovne možnosti s pomočjo izpeljanke na vpisano besedo, glagol …; exVseh izbirnikov je devet, poleg omenjenih pritisni in govori ter organizatorja so še operaterjeve storitve (WAP, GPRS), programi (igri Disco in Chic Pinball ter Translator in Size converter; te ne smejo preseči 128 kB), nastavitve (profili možnost kreiranja dveh lastnih, toni, teme, nastavitve obeh zaslonov, časa, datuma, bližnjic, glasovni ukazi, desna izbirna tipka), povezovanje (infrardeči vmesnik, GPRS), klicne nastavitve, nastavitve telefona, dodatkov, konfiguracije, nastavitve zaščitne narave), galerija (podobe, videoposnetki, teme, grafike, zvočni posnetki), predstavnost (digitalna kamera, predvajalnik, snemalnik zvoka, radio), zadnji klici (neodgovorjeni, prejeti in klicani …; exNamesto da bi država naročila vsaj predinvesticijsko študijo ali preučila možnosti, kako bi lahko pomagala podjetju in občini, je predloge že na začetku zatrla.; exSem sodijo tudi neposredne tuje naložbe (NTN), kjer so vrli slovenski oblastniki do zdaj kleno in pokončno izničili kar nekaj razvojnih možnosti in kilave zasilne nadomestke obesili na naše davkoplačevalske žepe.; exRazpon možnosti tako ni bil širok.; exDa bi stranke prepričali, da je res tako, ponujajo možnost tako imenovanega POC ( proof of concept ), ki je nekakšna predintegracija sistema, ki uporabniku pokaže, da rešitev res deluje.; exPo besedah Bojana Lučovnika, generalnega direktorja Adrie, bo družba svoje aktivnosti odslej koordinirala skupaj z ministrstvoma za promet in zunanje zadeve, torej je vendarle možnost, da Jat dovoljenja ne bo dobil.; exNjegov psihični status deluje iz dveh nasprotujočih si možnosti: iz ljubezni ali iz sovraštva.; exNajprej bomo naredili anketo in se po zbranih mnenjih odločili za neko srednjo možnost.; ex1V predstavi Kapital je zelo pomembno nekaj, kar lahko odpre v gledališču nove možnosti uprizarjanja, t. j. vrtljivi prostor, v katerem sedijo gledalci in spremljajo dogajanje okoli sebe.; ex1Dijaki z učiteljem kritično (pisno ali ustno) ocenijo uprizoritveno besedilo, opravijo prve korekture in pretehtajo možnosti postavitve.; ex1»Na izbiro pa nisem imel druge možnosti, saj me slovenski javni mediji niso podprli.; ex1Rešitev naj bi se skrivala v možnosti, da se vsak posameznik lahko prostovoljno odloči za služenje vojaškega roka ali pa da država organizira profesionalno vojsko.; ex1Iz urada trboveljskega župana so še sporočili, da župan od LDS doslej ni dobil nobenih predlogov za imenovanje podžupanov - »čeprav je njihovemu predsedniku Zoranu Gračnerju ponudil možnost za imenovanje enega; le-ta pa je v javnosti ponudbo spremenil v dejstvo, da o takšnem predlogu ne ve ničesar«.; ex1Druga možnost je, da neposrednega spoznanja sploh ne upoštevamo, ker ga ni.; ex1Avtor dela »Pisanice« časovno postavlja pred »Čašo«, »Sto ugank« in »Cicibana« uvršča med »Samogovore« in »Zarje Vidove«, prikaza proze se loteva prvi, saj je tudi prvi imel možnost pregleda čeznjo.; ex1En dan pri tistih, ki so vključeni v programe razvoja, je mnogim nakazal nekatere možnosti za delo').
