g(105809878,'exPotem je svet postal lepši.; exIz zapora jo pospremi ambiciozni odvetnik Loudon Trott, ki ne sluti, da se mu bo njegov urejeni svet v kratkem obrnil na glavo.; exNavznoter pa deluje v tem svetu še posebna logika, ki jo oblikuje denar in še zlasti njegov pomen.; exVsa druga razmerja pa prestavljajo svet prijateljstva, ljubezni in žrtvovanja: Antonio - Bassanio, Bassanio - Porzia, Lorenco - Jessica, Graziano - Nerissa...; exKaliban pa mu je hotel posiliti hči (Mirando) in se posmehuje tistemu svetu, ki ni njegov svet:; exPonižni je tudi, kadar je osramočen, dosti miren, ker se opira na Boga in ne na svet” (2,2,2).; ex/ ko sva se spoznala, se je svet spet odel v cvetje.; exTekmeca, ki so jima okoliščine onemogočile, da bi postala zaveznika, kljub temu pa je bilo za ostrimi vprašanji in odgovori prisotno neizgovorjeno razumevanje; zajeto je bilo v samoumevnosti, tisti samoumevnosti, ki edina zbliža ali odbije svetove.; exV junijski reviji Moj mali svet sem zasledila, da gospa Ana Šemrov išče pasijonko.; exDelitev na službeno in zasebno življenje je v Sloveniji vsemu družinskemu podjetništvu navkljub še zelo močna, vendar stopamo v precej drugačen svet.; ex1Podoba našega sveta nastaja po dveh poteh: prva vodi preko neposrednega spoznanja tega, kar lahko vidimo z lastnimi očmi; sistem, ki s tem nastane in v katerega informacije umeščamo, nam pomaga osmišljati vsakdanje življenje.; ex1Ljudje s seboj nosimo množico podob sveta, ki ga še nikoli nismo videli, razen morda po televiziji.; ex1Prevladujejo humoristični toni, vendar je med vrsticami izjemno humornih dialogov ves čas čutiti prisotnost resnega, skoraj filozofsko zastavljenega pogleda na svet.').
g(105810561,'exTo je najlažje storiti prek umetnosti, kjer so čutila dovzetna za številne različne odtenke barv, tonov - s to izkušnjo se oblikuje odprtost, seznanjanje z drugačnim pa utrdi strpnost ter bogati lastno doživljanje sveta in življenja.; exDanes, ko boste s plesnimi koraki stopili življenju nasproti, ste vi župani in županje tega mesta.; exDa bi spoznali življenje invalidnih otrok, so igrali sedečo odbojko ter se z zavezanimi očmi poskušali orientirati po prostoru (slika spodaj).; exPoglavitni problem je, da Leva zanima predvsem telesna, Vodnarja pa duhovna plat življenja.; exMarion je štiriletnega sina Johna dala v rejo v dobri veri, da mu bo s tem omogočila boljše življenje.; exIn ljudje si ponavadi želijo tistega, kar se jim zdi, da od življenja lahko pričakujejo.; exLouise Hay v svoji uspešnici You Can Heal Your Life (Svoje življenje lahko ozdravite sami) piše:; exDajte vse od sebe, potrudite se po najboljših močeh, delajte, kar ljubite, in življenje vam bo vrnilo v enaki meri.; exDo utelešenja potujejo mimo sfer gibljivih predmetov in se od vsakega navzameno dobrih in slabih lastnosti, kar na zemlji zahteva očiščenje življenje po strogih pravilih to pa zagotavlja vrnitev duše na svojo zvezdo in večno življenje.').
