g(105814650,'ex»Komisija verjame trditvi, da strokovni svet ni izrecno razpravljal o znamki miz, gotovo pa bi moral razpravljati o številu operacijskih miz, ki naj bi jih obnovili, in o tipu miz, ker je oboje strokovno in ne le finančno vprašanje,« je povedal Končina, minister Keber pa dodal, da gre pri mizah za potencialne potrebe približno 15 kirurških strok in strokovni svet ni pridobil mnenj posameznih kirurških strok niti o številu niti o tipu miz, ki bi jih potrebovale.; exNaj se uzakoni obvezno soglasje občin, kjer knjižnica deluje, velikih in malih, naj za velike občine predpišejo soglasje, manjše pa naj se zadovoljijo le z mnenjem o kandidatih za direktorje oziroma direktorice knjižnic, ali s tem v zvezi sploh dati občinam kakršno koli pristojnost, ko pa imajo te svoje predstavnike že v svetih knjižnic, in podobna vprašanja so včeraj ostala še brez odgovora zakonodajalca.; exPojavilo se je vprašanje, s kakšnimi novimi ukrepi bi se lahko japonska vlada spoprijela s težavami, pa se kaj bistveno novega ne more povedati.; exŠe posebej Rim in tudi Milano sta zelo zanimiva," je dejal Guti, katerega odhod v Italijo je bržčas samo še vprašanje dni.; exIzpostavil bi pravzaprav eno vprašanje.; exZdravnik, ki je tukaj govoril, je odprl celo vrsto vprašanj, katerih razrešitev je potrebna, če hočemo o tem zakonu glasovati - in vendarle ni predlagal tega, da je proti temu, da se zakon sprejme po hitrem postopku.; exZame je tu cela vrsta vprašanj; jaz se sicer ne spoznam na stvari, ampak če postavi trditev, da na eni strani tega kadra manjka, na drugi strani pa je cela vrsta ljudi, ki so na zavodu za brezposelne, potem je zame pač zelo jasno vprašanje: tem je treba več plačati, drugače jih ne bomo dobili.; exVprašanje je zelo resno.; exDanašnji tempo stvari spreminja vsak mesec, vprašanje pa je, kdaj se splača obnoviti knjižno obliko in ali je perioda petih let za to prekratka.; exŠirše vprašanje, ki preveva to kritično razčlembo, pa je, kako razviti socialistično-feministično znanost o življenju.; ex1V zraku je vprašanje, kolikšno je tveganje pri uživanju govejega mesa.').
g(105815517,'exPot do novega izdelka ali le do izboljšave je dolga vsaj leto dni in terja delo različnih strokovnjakov, raziskovalcev trga, razvojnih konstruktorjev, oblikovalcev, psihologov, strokovnjakov z določenega področja raziskav in razvoja (če gre za gospodinjstvo, sodelujejo tudi kuharji, pri osebni negi pa ne gre brez medicincev) in tudi ljudi s ceste.; exV takšni metaforiki se srečujejo zelo različna in oddaljena področja.').
g(105817743,'exV ugotovljenih primerih nezakonite posesti in nošenja orožja smo sprožili ustrezne postopke.').
g(105820620,'exV Mariboru so se zbrali praktiki s tega področja, ki jih je zanimala vladna politika o vodah v Sloveniji, predvsem pa konkretni primeri čiščenja vod pri nas.; exMorda je vaša nečakinja tak primer, ponudi s tolažljivim glasom oče in opazuje slamnik, črne trakove na vratu, kako mahajo za njenim hrbtom.; exIn na koncu še tipičen primer, kam gremo.; exKot primer poslabšanja razmer na tem področju je navedeno preganjanje prepovedane sekte Falun gong, katere dva tisoč članov so priprli ali zaprli v 40 kitajskih mestih samo v zadnjih dneh.; exSlovar je narejen po virih ene najboljših slovarskih založb Oxford University Press, njegova gesla vsebujejo med drugim tudi primere tipične uporabe besede in slovnične posebnosti.; exOb navedenih primerih rabe govorice naletimo tudi na različne kombinacije, kot so: “milostni” strel, strel iz “usmiljenja”, vendar bi tudi analiza teh zvez pokazala podobne razultate.; exOdgovora na ta vprašanja ni bilo, primer pa je pokazal, da ta »nacionalno priznana« ocenjevalca lahko ustrelita mimo prav tako, kakor so, večinoma namerno, streljali mimo toliko napadani borzni analitiki z Wall Streeta, ki so priporočali nakupe delnic korporacij tudi, ko je šla njihova vrednost navzdol.; exObčina je Lipov gaj spomeniško zaščitila, saj je eden redkih primerov ohranjenih stoletnih lip v Sloveniji.; exKot dober primer pripravljenosti, da bi v praksi lahko uresničevali akcijski program ukrepov Nacionalnega programa varstva okolja (NPVO) in strategije za ohranjevanje biotske raznovrstnosti, krajinske pestrosti ter varstva naravnih vrednot, pozivamo naslovnike, naj čimprej skličejo sestanek Ribiške družine Ribnica in izvajalcev gradbenih del ter se ob Bistrici na kraju samem dogovorijo o nadaljnih delih oz. boljšem sodelovanju.').
g(105839024,'exTudi v Sloveniji sta aerobika in fitnes med najbolj priljubljenimi oblikami rekreacije, zato bi morali posvečati več pozornosti tehniki vadbe.; exTo snov obdelujejo "koraljari", lahko bi jim rekli "morski draguljarji", izumirajoča vrsta obrtnikov, ki obdelujejo rdeče korale in iz njih izdelujejo nakit.; exPRAV IDEALIZACIJA DOLOČENIH OBLIK LEPOTE JE NA PRIMER PRISPEVALA K OBLIKOVANJU IN USTANOVITVAM NACIONALNIH PARKOV (AITCHISON 2002).; exHAERI V SVOJI PODROBNI ETNOGRAFIJI NAVAJA SEDEM RAZLIČNIH OBLIK SEKSUALNE ZAČASNE POROKE V SODOBNEM IRANU, POSEBEJ ZANIMIVI SE MI ZDITA DVE: ZAČASNA POROKA KOT ZAOBLJUBA (SIGHEH NAZRI) IN ZAČASNA POROKA SIGHEH ZARADI FINANČNE KORISTI.; exPOSEBEJ POMEMBNO PRI TEJ OBLIKI ZAČASNE POROKE JE, DA JE ŽENSKA TISTA, KI DA POBUDO ZA SKLENITEV ZVEZE IN TUDI DOLOČI POGOJE POGODBE, POGOSTO PA POGODBO TUDI PLAČA, MEDTEM KO IMA TAKŠNO VLOGO PRI DRUGIH OBLIKAH ZAČASNE POROKE MOŠKI.; exČe vsebuje pivo sedimentirane kvasovke, nehamo nalivati, še preden pridejo kvasovke v kozarec (razen pri nekaterih vrstah piva, pri katerih je sediment zaželen - na primer pšenično pivo).; exLetošnje letno poročilo evropske komisije navaja velik napredek pri postopkih za ustanavljanje podjetij, boljši dostop podjetij do elektronskega poslovanja, uvajanje različnih oblik podjetniškega izobraževanja na visokih in srednjih šolah, na drugi strani pa tudi opozarja na zanemarjanje vprašanja učinkovitega zastopanja interesov malih podjetij na nacionalni in evropski ravni.; exO primernem nadomestilu, o katerem govorijo v Jatu s komercialnim sporazumom naj bi Adria Jatu plačevala polete v jugoslovansko prestolnico v slovenskem prevozniku ne želijo nič slišati in pravijo, da se takšne vrste povračilo v Evropi že dolgo ne uporablja več in so ga nadomestili recipročni poleti.; exPri tradicionalnih oblikah vzgoje novih sort se med seboj križajo le živali ali rastline, ki so v razmeroma tesnem sorodu.; exTehnološki park je zasnovan kot oblika t. i. podjetniških inkubatorjev, kjer novoustanovljena inovacijska podjetja dobijo pomoč lokalne skupnosti ali države z namenom, da pod ugodnejšimi pogoji razvijejo in ustvarijo pogoje za samostojno delovanje.; ex1Glavni namen Priporočila o priznavanju skupnih diplom torej je, prispevati k učinkovitemu zagotavljanju pravičnega priznavanja tiste vrste kvalifi-kacij, ki imajo znaten potencial za nastajanje evropskega visokošolskega prostora, a jih v strogo pravnem pogledu Lizbonska konvencija o prizna-vanju ne ureja.; ex1- uporabiti ustrezne metode za evalvacijo in kjer je to primerno tudi za akreditacijo različnih oblik vseživljenjskega učenja.; ex1»Pomoči prve vrste ne potrebujemo, saj nas vsi tovrstni ''humanitarci'' še vedno uvrščajo v Jugoslavijo, zato smo pomoči deležni kot del nekdanje Jugoslavije, ne kot samostojna država.; ex1Nekoliko blažjo obliko take osebnosti odraža pisalna miza, ki je sicer nekoliko bolj živahna, vendar še vedno zelo strogo urejena.; ex1Marsikateri seksualno sprevrženi Kozorog se poslužuje hujših oblik sadizma, kot so denimo igrice »ujetništva«.; ex1In tudi, ko grem naprej v druge vrste ogrožanja nacionalne varnosti Republike Slovenije začne s stavkom, ki je že padel v oči predgovornikom, namreč je neposredni ali posredni nedemokratičen nazivni posegi za spremembo ustavne ureditve, ki se potem nadaljujejo s teoristično dejavnostjo, trgovanje z belim blagom in podobna grozodejstva, konča pa s stvarjo, ki me pravzaprav najbolj skrbi, namreč definicija na koncu obstajajo tudi možnosti nastajanja povsem novih oblik ogrožanja nacionalne varnosti.; ex1Zato, ker je predlagatelj zakona v 22. tezi zajel dve kategoriji kršitev, in sicer kršitve, s katerimi ima kršitelj materialno korist od kršenja členov, in druga vrsta kršitve, kjer posameznik škodi sebi oziroma s kajenjem ogroža druge in s tem nima materialne koristi.; ex1OBOJE JE TEMELJ DELOVNEMU IN USLUŽBENSKEMU KOT POSEBNE VRSTE NECIVILNOPRAVNEMU POGODBENEMU RAZMERJU.; ex1KOT OBLIKO REDNEGA DELOVNEGA RAZMERJA JE DELO NA DOMU UREJALA ŽE DO TAKRAT VELJAVNA ZAKONODAJA, VENDAR SE V VEČJEM OBSEGU NI UVELJAVILA.; ex1Zdi se, da so nove tehnologije tesno povezane z oblikami »privatizacije«, ki jih je opisal Ros Pesetsky (1981).; ex2V okviru neke vrste tehnološkega holizma so bili prvi teoretični pristopi k biološkemu telesu z vidika kibernetičnih komunikacijskih sistemov od poznih štiridesetih pa vse do konca šestdesetih nagnjeni h koordinaciji pod vplivom "krožno-kavzalnih mehanizmov povratne informacije".; ex2Unilateralna poteza, precedens neke vrste, se očitno ni obnesla.; ex2V združenju menimo, da trenutne oblike organiziranosti niso najpomembnejši razlog za razmere, v kakršnih so se znašli gospodarski subjekti s področja prevoza stvari v cestnem prometu.; ex2Agresivno vedenje pri visokih temperaturah se, kot so ugotovili z vrsto raziskav, kaže v različnih oblikah nasilnih dejanj, pri čemer je prva žrtev nedvomno družina.').
g(105840188,'exSvila za vezanje vrste Gossamer je izredno tanka svila, namenjena za vezavo najmanjših in najlažjih muh.; exRes je sicer, da se slovenska pravna ureditev razmerja med vrstami in stopnjami visokošolskega študija vsaj v splošnih obrisih nahaja znotraj zlatega trikotnika evropske univerzitetne reforme (opredelitev ustaljenega izraza the golden triangle of reforms - dvostopenjski študij, kreditni sistem, akreditacija - je povzeta po njegovih avtorjih, Guyu Haugu and Christianu Tauchu).; exPri tem seveda upošteva bolnikovo zdravstveno stanje, socialno okolje, njegove navade in vrsto dela, ki ga opravlja.; exso prvi dokument te vrste in pomenijo referenčni okvir za oblikovanje nove stopnje po drugem glavnem študijskem obdobju.; exPriporočilo poleg tega ponuja prvo ''uradno'' definicijo skupnih diplom kot generičnega pojma in klasificira glavne vrste skupnih diplom.; exVODORAVNO: 1 globoka podolgovata vdolbina v apnenčastem svetu, škraplja, 7 sunek, s katerim se kaj spravi v premikanje, 13 vrsta aminokislin, 14 pastirska igra italijanskega pesnika Torquata Tassa, 15 stari del Maribora, 16 bajtar, 18 oranje, 19 indijska praksa duhovne koncentracije, 20 pripadnik Burov, 21 krilo rimske konjenice, 22 mejna reka med Slovaško in Madžarsko, 23 groza, strah, 24 tip lahkega mitraljeza, 25 varjeni šiv, 26 egiptovsko krajevno božanstvo Memfisa, 27 ameriški filmski režiser (Martin), 28 Olaf Tufte, 29 kraljica ilirskih Ardijejcev, 31 ime pesnika Zajca, 32 notranji, osrednji del stebla, 34 umetno modro barvilo, 36 slovenski pisatelj (Ivan, V Zali), 37 iglasto drevo.; ex– NAZIV DELOVNEGA MESTA OZIROMA PODATKE O VRSTI DELA, ZA KATERO DELAVEC SKLEPA POGODBO O ZAPOSLITVI, S KRATKIM OPISOM POSLOV, KI JIH MORA OPRAVLJATI PO POGODBI O ZAPOSLITVI,; exLosjon Ceramide Defining Eye Brightener, ki ga nanašamo pod ličila, je primeren za vse vrste kože, ki se spopadajo s težavami staranja.; exTako je mogoče po treh do šestih posegih uničiti od 75 do 95 odstotkov dlačic, odvisno od njihovega tipa, vrste kože oziroma celotnega organizma.; exŠibke gospodarske subjekte, o katerih pišejo predstavniki SAS, bomo zaščitili podobno kot druge gospodarske subjekte: z znižanjem bremen, ki nam jih nalaga draga država, pa tudi z znižanjem nekaterih vrst stroškov, ki v strukturi stroškov storitve zavzemajo pomemben delež (stroški dela, pogonskih goriv, zavarovalnih premij ...; ex1Najprej se morajo uskladiti strokovnjaki, nato pa se bomo odločili za vrsto obrambe.').
