g(105867413,'exMarijan Schiffrer, poslanec SKD in predsednik parlamentarne komisije za odnose s Slovenci v zamejstvu in po svetu, v časniku Parlamentarec o tem, kaj naj bi država ponudila oziroma dobila od zamejcev in Slovencev po svetu: "Zamejci bodo naš ključni člen, če in ko vstopimo v EU.; exKakor da je to moda ali kaj, doživljamo že tretjo dokumentarno oddajo v dveh delih (na drugi del Hudečkovega portreta še čakamo).; exKRŠKO - Po informacijah, ki smo jih dobili v krški tovarni papirja in celuloze, sta v papirniškem delu v torek, ko to poročamo, obratovala dva stroja, tretjega naj bi pognali tega dne popoldne.').
g(105868051,'exPodjetje je bilo zaradi izgube jugoslovanskega trga v začetku 90. let na robu propada, vendar so vodstvo in vsi zaposleni podjetje olastninili in se za dobavo novomeškemu Revozu povezali s tujim partnerjem.; exPodobno kot velja za ostale cvetoče okrasne rastline, so tudi med okrasnimi travami takšne, ki nase opozorijo že spomladi (med prvimi so razni šaši in ločje, ki z novimi listi vnesejo svežino na vrt), večina trav pa doživi svoj višek poleti ali celo na začetku jeseni.; exNa začetku ima podatke o poziciji osebe (naslovna, glavna, stranska, pripovedovalec), nato o poklicu (nekateri med njimi imajo tudi svoje geslo, na primer učitelji, duhivniki...; exZAKONODAJA O NACIONALNIH PARKIH V ZDA JE BILA SPREJETA NA ZAČETKU PREJŠNJEGA STOLETJA, KO JE TJA PRIŠEL VEČJI VAL PRISELJENCEV, KI NISO BILI ANGLOSAKSONSKEGA POREKLA.; exNekdanji diktator, general Augusto Pinochet, ki se je izmuznil evropskemu pravosodju, je zdaj, kot pravijo, na začetku poti, ki ga utegne pripeljati pred sodišče v domovini.; exPisatelji so se podali po poteh ekspresnega vlaka sever-jug iz začetka 20. stoletja, ki je povezoval Lizbono in Sankt Peterburg.; exSicer pa naj bi vsaj v začetku DURS vračala preveč plačani davek v roku 30 do 90 dni, saj sicer obstaja nevarnost, da bi se proračun "likvidnostno zlomil".; exZdaj objekt pripravljajo za potrebe Stedekove proizvodnje, v obnovljene prostore pa naj bi se zaposleni vselili konec letošnjega oziroma na začetku prihodnjega leta.; exČe pogledamo gibanje tečaja od začetka avgusta, lahko zaznamo, da tečaj počasi končuje formacijo kljuna.; exStopil sem na začetek vrste, vendar so me sprva zavrnili, dokler nisem povedal, da me je poslal Nurejev.; ex1Na začetku leta 2002 je Svet EUA sprejel t.i. ''graške teme'', o katerih naj bi temeljiteje razpravljali še na kasnejših sestankih Sveta in na konferencah zveze.; ex1Ta članek je Alexandra Stiglmeyer hotela uporabiti za začetek svoje antologije o posilstvih kot nekakšen tematski uvod.; ex1In tu smo že pri začetku razlage o kloniranju.; ex1Drugi pomemben podatek je, da bo začel nov sistem neprofitnih najemnin veljati šele v začetku leta 2005, in sicer bo prehod tudi tedaj postopen, namreč v štirih fazah, do leta 2007.; ex1Začetek in konec tekme v Kranju sta pripadla gostom z Jesenic, ostali del Triglavanom.; ex1Vidno vlogo je imel Nemec še pred tremi leti, ko je na začetku tako močno dominiral, da je njegov najbolj nevarni tekmec Mika HŠkkinen čutil že veliko pritiska na svojih ramenih.; ex1Zdravniška združenja in farmacevtske družbe, pogosto ob podpori združenj obolelih, oznanjajo v začetku novega stoletja novo zdravilstvo, v katerem ni več prostora za zdravega človeka.; ex1VODNAR in LEV: Na začetku se zdi njuno razmerje vznemirljivo in obetavno, sčasoma pa lahko pride do prave zmešnjave.; ex1V začetku avgusta so se pod okriljem urednika Igorja Prassla (foto: Bojan Velikonja) mudili že v Dubrovniku, konec meseca pa odhajajo še v Raveno na deželni festival Festa Provinciale dell'' Unita.; ex1Med kosilom, ki ga nanagloma kombiniram iz redkih preostankov opustošenih zalog (kot šoloobvezna družina bi morali biti zdaj na smučarskih počitnicah in smo na začetku tedna tudi bili, pa sta nas otroški virozi vrnili v Ljubljano), nenehno zvoni telefon.; ex2Tudi če bo zakon o zaščiti jezika na začetku novega tisočletja sprejet, se bojim, da ga pa ne bomo izvajali.; ex2Snovanje iger ga je pritegovalo že v dijaških letih, zatem v začetku stoletja, v času prve vojne in v dvajsetih letih, misel nanje ga je obletavala še v tridesetih.; ex2Leta 1955 smo se spominjali 60-letnice začetkov slovenske Moderne, tedaj je avtor pričujoče knjige objavil svojo prvo, drobno monografijo o Župančiču in jo na naslovnici označil za »poljudno študijo«, ki naj bi s pesnikom pobliže seznanila širšo javnost.; ex2Iz daljšega Kermaunerjevega besedila o Taborijevi predstavi bom navedel samo začetek, v katerem je Taras zelo natančno razložil svoj pogled na igro in izvedbo:').
g(105868477,'exNa koncu gesla so še povezave, ki usmerjajo k literarnim likom s podobnimi lastnostmi.; exNa koncu objavljenega besedila sporazuma piše, da bodo tri leta po začetku njegove veljave sklicali mednarodni sestanek, na katerem bodo opredelili mehanizme za končno rešitev kosovskega vprašanja, in sicer na podlagi volje ljudstva, stališč relevantnih oblasti, prizadevanj vsake strani pri uresničevanju sporazuma in sklepne helsinške listine.; exPrvič so v finalu zaigrale v sezoni 1998/99, ko jih je vodil še pokojni Vinko Kandija, ki je prepričal igralke in vodstvo kluba, da gre Krim lahko do konca.').
g(105872477,'exToda entitete poznega dvajsetega stoletja, ne glede na to, ali imajo strukturo in lastnosti retoričnih objektov – infekcijski vektorji (mikrobi), elementarni delci (kvarki) in biomolekularne kode (geni) – niso romantični ali modernistični objekti z notranjimi zakoni koherence.').
