g(105933246,'exZemljo si razdelil med sinove, prgišče morja, ki ti je ostalo, si prodal za temen kot v nedokončani hiši s pogledom na vaško pristanišče.').
g(105945642,'ex»Komisija verjame trditvi, da strokovni svet ni izrecno razpravljal o znamki miz, gotovo pa bi moral razpravljati o številu operacijskih miz, ki naj bi jih obnovili, in o tipu miz, ker je oboje strokovno in ne le finančno vprašanje,« je povedal Končina, minister Keber pa dodal, da gre pri mizah za potencialne potrebe približno 15 kirurških strok in strokovni svet ni pridobil mnenj posameznih kirurških strok niti o številu niti o tipu miz, ki bi jih potrebovale.; exV teh dneh pričakujejo tudi pravno mnenje, ki je drugačno od vladnega in po katerem naj bi bilo mogoče sanacijski program spreminjati tudi večkrat.; exPo njegovem mnenju je raziskovalcem z Vinske Gore odprta pot do praktičnih spoznanj, lažjega razumevanja družbe in vključevanja v družbo odraslih.; exNaša hipoteza je namreč, da Kajn ni ubijal iz ljubosumja, ker v božjem pogledu ni bil izbran, marveč zato, ker je vedel, da bog ve, da se ga je želel znebiti.; exPonekod pa je celo popolnoma spregledal mnenja strokovnjakov in raje prisluhnil drugačnim interesom.; exMoram vas razočarati, a na podlagi teh podatkov in nasprotujočih si mnenj vam nikakor ne morem povedati, za kakšno obolenje gre.; exČeprav svojih pogledov na povojne dogodke niso mogli vsiliti niti konservativni vladi Helmuta Kohla, kaj šele socialdemokratski Gerharda Schröderja, je predsednica organizacije pregnancev Erika Steinbach dovolj glasna, da zgodovine ne pusti pri miru.; exMalečniška cesta - Gotovo je ena najbolj »zelenih« državnih cest, že v dveh do treh mesecih pa bi jo po mnenju direktorja Komunalne direkcije mag. Borisa Škerbinka lahko usposobili vsaj za enosmerni promet.; exNaj se uzakoni obvezno soglasje občin, kjer knjižnica deluje, velikih in malih, naj za velike občine predpišejo soglasje, manjše pa naj se zadovoljijo le z mnenjem o kandidatih za direktorje oziroma direktorice knjižnic, ali s tem v zvezi sploh dati občinam kakršno koli pristojnost, ko pa imajo te svoje predstavnike že v svetih knjižnic, in podobna vprašanja so včeraj ostala še brez odgovora zakonodajalca.; exPo njegovem mnenju so nova dejstva, da formalno sklepa o izključitvi sploh še niso dobili in da bi potem morali nadaljevati ligo.; ex1" Francozi so po njegovem mnenju igrali dobro tudi v obrambi.; ex1Minister za pravosodje Tomaž Marušič meni, da o kandidatih za generalnega državnega tožilca mnenje personalne komisije tožilstva ni potrebno.; ex1Pritrdite njenemu mnenju ...; ex1Škof iz Angersa je bil enakega mnenja.; ex1Ker smo bojda šli z leve bolj na desno, sem iskal desničarske lastnosti Janševih sledbenikov, ki nasprotujejo levičarskim mnenjem Ropovih gorečnikov.; ex1To pa po mnenju hrvaških pravnih strokovnjakov pomeni, da bodo vložene tudi vse obtožnice za hrvaške obtožence, ne glede na to, ali jim bodo sodila hrvaška sodišča za vojne zločine ali ne.; ex1"Po maminem mnenju sem bila deležna dovolj šolanja.; ex1Po tem mnenju ni porabništva nič teže pojasniti kot nezmožnost nadzorovanja želje po hrani ali kajenju.; ex1Pomembno za dananšnji čas je, da je krščanstvo novačilo predvsem mlade, ki so jih odbijale neustrezne vrednote starejše generacije, ki jih ni zanimal prenos premoženja, odvisen od poroke, ki so bili utrujeni od nespametnega pehanja za bogastvom in močjo in ki se jim je gnusila družba, ki je po njihovem mnenju »uživala v spolni razuzdanosti« (tako so kristjani stereotipizirali pogansko družbo, ki so jo naposled spremenili)5.; ex1Največ ovir bomo pri vsej zgodbi deležni od nas samih, naše lastne neodločnosti, nezmožnosti izpeljave korenitih reform, ki so pred nami in s katerimi po mojem mnenju odlašamo.; ex2Glavni namen Priporočila o priznavanju skupnih diplom torej je, prispevati k učinkovitemu zagotavljanju pravičnega priznavanja tiste vrste kvalifi-kacij, ki imajo znaten potencial za nastajanje evropskega visokošolskega prostora, a jih v strogo pravnem pogledu Lizbonska konvencija o prizna-vanju ne ureja.; ex2« Vsekakor pa bi po Šuštarjevem mnenju 20 milijonov dolarjev, kolikor jih beguncem namenja slovenski proračun, moralo zadostovati.; ex2Krivec za njegovo razvrednotenje je predsednik ECB, ki po mnenju valutnih trgov ne premore kredibilnosti ameriškega kolega Alana Greenspana in je edini krivec za nizek tečaj skupne evropske valute.; ex2Pa vendar ju ni, obstaja le subjektiven pogled.; ex2Težko je reči, ker ima vsak uvoznik svoje mnenje.; ex2Najprej bomo naredili anketo in se po zbranih mnenjih odločili za neko srednjo možnost.; ex2Občina sicer ima projekt oživljanja starega mestnega jedra, vendar je to po mojem mnenju pesek v oči.; ex2Po njegovem mnenju je zato družbeno najbolj sprejemljiva rešitev, da bi plačilo parkiranja uvedli na vseh javnih parkiriščih v mestu, hkrati pa bi se skrajšal čas pobiranja parkirnine.; ex2Kakšno je vaše mnenje o tem?; ex2Ne dajte ji priložnosti, da bi izrazila svoje mnenje.; ex3V imenu odbora, ki ga vodim, to je Odbora za zdravstvo, delo, družino in socialno politiko, sem dolžan stališče gospoda Mozetiča še podkrepiti z mnenjem oziroma poročilom Odbora.; ex3Učenci naj napišejo, kakšni moški so po njihovem mnenju všeč ženskam.; ex3Skratka, hrastniški občinski svetniki so bili enotnega mnenja, da bi prihod prebežnikov za njihovo občino pomenil »nezaželen politični moment«.; ex3V medijih redno spremljam razprave o novem zakonu in ne morem mimo tega, da ne bi še jaz dodal svojega mnenja.; ex3Po njegovem mnenju gre pri vojaščini za bistvene kršitve ustavnih pravic državljanov moškega spola.; ex3Po njegovem mnenju (pri pisanju pravne obtožbe naj bi zaprosil tudi za pravno pomoč) naj bi bile vsakemu človeku, ki proti svoji volji služi vojaški rok storjene krivice, kot so omejevanje svobode, vsiljevanje proti volji posameznika in izguba prihodka.; ex3Direktor Koroške banke Božo Štor pravi, da imajo premalo informacij za kakršnokoli stališče ali mnenje o tem, kaj bi lahko takšno združevanje pomenilo in kakšen vpliv bi imelo na Koroško banko.; ex3Povsem drugačnega mnenja pa so v ZŠD Ilirija.; ex3Pravzaprav smo človeka v obeh primerih ubili in ga tako po splošnem mnenju kvečjemu od-rešili vse hujših predsmrtnih muk.; ex3Avtorji grožnje na račun te firme in nekaterih njenih predstavnikov (poleg sindikatov) so tokrat tako imenovani Nuclei territoriali antiimperialisti (Protiimperialistična ozemeljska jedra), ki da so, po mnenju policije, del Protiimperialistične bojevniške fronte, ta pa naj bi bila dejansko veja Rdečih brigad.; ex4Oblikovno in vsebinsko izstopajoč oglas pa bodo opazili tudi drugi bralci in si tako ustvarili pozitivno mnenje o organizaciji.; ex4Sicer pa so mnenja, da dve, tri skodelice kave na dan skorajda ne morejo škodovati.; ex4Nadalje smo mnenja, da mu ne smete nikoli govoriti, kaj da mora ukreniti v zvezi s svojim pitjem.; ex4EU je po Bučarjevem mnenju poskus zapiranja, zato se zastavlja vprašanje, kakšno je mesto Slovenije v tem zaprtem sistemu.; ex4»Naši pogledi na lepoto,« pojasnjuje Emmanuele Janini, italijanski profesor medicinske seksologije, »so nastali kot instrument za prepoznavanje bistvenih lastnosti evolucije vrste, pri čemer so ljudje uporabljali signale, ki niso bili besedni.; ex4Študente podpirajo tako rekoč vse albanske stranke, nekatere bolj odkrito, druge manj, le najbolj množična Demokratična zveza Kosova za zdaj še ni povedala svojega mnenja o njihovih zahtevah.; ex4Teoretično bi eden izmed njiju zmagal z veliko prednostjo, če bi kolesarsko društvo Krka Telekom kandidiralo le enega, kar pa po mnenju vodstva kluba ne bi bilo pošteno, saj sta si to zaslužila oba.; ex4Kmetijski minister dr. Milan Pogačnik je o tem povedal: »Mnenja glede učinkovitosti letalske obrambe s posipavanjem srebrovega jodida so deljena.; ex4Iz daljšega Kermaunerjevega besedila o Taborijevi predstavi bom navedel samo začetek, v katerem je Taras zelo natančno razložil svoj pogled na igro in izvedbo:; ex4So pa tudi mnenja, da je odločitev povsem normalna, saj v Jugoslaviji nogometno pot krojijo slabe razmere, razen če nisi član slovitih klubov Crvene zvezde ali Partizana.; ex5Prevladuje mnenje, da so v državi od padca komunizma 1989/90 uspešno izpeljali tranzicijo, položili in utrdili temelje stabilnega in demokratičnega političnega sistema, plansko gospodarstvo iz prejšnjega režima pa je uspešno nadomestil tržni način gospodarjenja, temelječ na zavidanja vredni gospodarski rasti.; ex5Glede politike, njenih dejanj in političnega življenja na Madžarskem nasploh so mnenja prebivalcev in analitikov različna, včasih pa tudi povsem nasprotna, da o političnih nasprotnikih sploh ne govorimo.; ex5Ta nasprotna stališča pojasnjujejo predvsem z močno polarizacijo družbe, ki je po mnenju večine opazovalcev posledica ideologije Fidesz-MPP, ki temelji na ustvarjanju bipolarnega političnega sistema v državi.; ex5Šimeljček pa je pred njiju vedno znova postavljal nove in nove zahteve ter ju prepričeval, da tega ali onega nikakor ne zmoreta, ter si zamišljal poteke svojih ur jahanja po svoje, kar naj bi bilo po njegovem mnenju veliko bolje in bolj zabavno kot dolgočasne lekcije.; ex5Najbolj jih moti, da je v poročilu nekaj po njihovem mnenju netočnih podatkov.').
