g(106282651,'exRupla ne skrbi usoda slovenskega jezika v EU.; exNekatere oddaje o slovenski glasbeni kulturni so bile posnete v nemškem in angleškem jeziku ter predvajane na tujih radijskih postajah.; exPri založbi pravijo, da ga je kupilo že lepo število znanja angleškega jezika željnih Slovencev.; exO jeziku vemo, da je otrok človekovih misli, in o mislih drži, da so poosebljena svoboda.; exProfesor Osolnik iz Ljubljane, ki je bil izbran za šefa te komisije, nas je pri tem obvestil, da je Univerza v Ljubljani odobrila tri nove programe za poljski, češki in slovaški jezik.; exTi so slovenski jezik ohranili kot materni jezik in se priučili jezika okolja.; exPoleg pripovedne kompozicije zagotavljajo literarnost temu pisanju tudi lep, metaforičen jezik ter humornost in duhovitost, ki ne nazadnje tudi preprečujeta patetičnost, kakršna se v potopisih pogosto pojavlja, in avtorici omogočata, da med drugim razbija uveljavljene stereotipe o Afriki.; exUstvarjalci so posebno pozornost posvetili slovenskemu jeziku, ki je v slovarju dejansko tak, kot se pojavlja v besedilih.; exTisto, za kar gre v razpravah o modernizmu in postmodernizmu, je vzorec razmerij med telesi in jezikom ter v njih.; exTo je strašljiv pogled na razmerje med telesom in jezikom za tiste izmed nas, ki bi o realnosti še vedno radi govorili z več zaupanja, kot pa dopuščamo razpravam krščanske desnice o ponovnem Kristusovem prihodu in njihovemu očaranju nad končnim uničenjem sveta.; ex1Razliko med nemetafizično, zemeljsko in gnostično (religiozno) varianto predstav o rešitvi (milosti) ohranja pravzaprav že običajni jezik.; ex1Tudi če bo zakon o zaščiti jezika na začetku novega tisočletja sprejet, se bojim, da ga pa ne bomo izvajali.; ex1Kolikokrat smo, kadar nas je nagovoril kdo, ki je govoril z duhovnim jezikom, rekli: ''Škoda, da nimam tega, kar ima tale.; ex1Pred dvajset tisoč leti je kromanjonski človek bil sicer telesno enak nam, ni pa obvladal jezika, s katerim bi z besedami izrazil tiste značilnosti,