g(106286395,'exSpoznaval sem, morda prvič, da o vsej silni želji in hotenju, ki ga je zganila v meni, ni mogoče povedati z besedami, zato nisem niti poskusil.; ex" in spet mi je beseda za hip obstala v grlu, "tisto, o čemer nočeš nikoli pripovedovati…; exDruga ne prevaja, ampak ponudi v nekaj različnih jezikih jezikovne možnosti s pomočjo izpeljanke na vpisano besedo, glagol …; exDarujemo vdano ti svoje srce, * dejanja, besede, vse misli, želje.; exSICER NAČITANI INŠPEKTOR MORA POGLEDATI V DEBELE SLOVARJE, DA NAJDE RAZLAGO BESEDE EONIZEM, KI JO JE LETA 1928 VPELJAL SEKSOLOG HAVELOCK ELLIS V KNJIGI ŠTUDIJE O PSIHOLOGIJI SPOLNOSTI, EONIZMU IN DRUGE ŠTUDIJE.; exTedaj sem si pozorno ogledal njegove čekane v obliki mečev in bral na njih besedi, zapisani z velikimi črkami.; exNa besedi delo smo brali: Sredstvo proti poželjivosti, najmočnejše orožje proti vsem napadom hudobnega duha.; exKo je izrekla te besede, se je v prostor vrnil prejšnji mrak.; exVsakič, ko vstopim v kuhinjo, ga nežno pobožam in mu rečem kakšno lepo besedo.; exBesede je uporabljala skoraj tako, kakor da jih oblikuje.; ex1Nemški zunanji minister Joschka Fischer je v javni razpravi bistvo politike preprečevanja konfliktov povzel z besedami, da je bolje preprečiti kot zdraviti, kajti vojne je pogosto lažje preprečiti kot pa prekiniti.; ex1Veš, kaj pomeni nemška beseda natürlich?; ex1Mojo agentko je vprašala, ali bi bila jaz pripravljena spremeniti nekaj besed.; ex1Agentka ni prav dobro razmislila in je rekla: »Seveda, Susan bom prosila, naj spremeni nekaj besed, pa bo.; ex1Vsekakor bi bilo pomembno, tako mislim, da drug z drugim ravnamo bolj velikodušno, da ne tehtamo vsake besede, ki se izreče v notranjepolitičnih diskusijah; da ne reagiramo vedno takoj agresivno, kadar pri drugem odkrijemo kak negativen vidik.; ex1V 35. členu se v prvem odstavku za besedo "zasebniki" doda besedilo "razen zavezancev iz 51. a in 51. b člena tega zakona.; ex1V 78. členu se besedi "do 30. junija" nadomestita z besedama "do 