g(106387980,'exZakon o industrijski lastnini, uradno prečiščeno besedilo (Ur. list št. 7); exPodobno kot zakon o zunanjih zadevah je velika večina načelno podprla tudi besedilo novega zakona o knjižničarstvu, vendar je bilo jasno, da bo do nesoglasij med strankami prišlo v tistem delu besedila, ki določa vlogo in pristojnosti občin v zvezi s knjižnicami.; exNa koncu objavljenega besedila sporazuma piše, da bodo tri leta po začetku njegove veljave sklicali mednarodni sestanek, na katerem bodo opredelili mehanizme za končno rešitev kosovskega vprašanja, in sicer na podlagi volje ljudstva, stališč relevantnih oblasti, prizadevanj vsake strani pri uresničevanju sporazuma in sklepne helsinške listine.; exZvone Šedlbauer, režiser predstave Gorje pametnemu: Besedila smo se lotili s spoštovanjem, predvsem zaradi Vidmarjevega prevoda ta se je za nas, ki smo že nekoliko oddaljeni od izrazite forme in verzov, izkazal kot poseben izziv.; exVelikost nosilne pole z natisnjenim besedilom Arte del merletto in petnajstimi znamkami je 202 x 325mm, prebodi s posamezno znamko so veliki 48 x 40mm, tekstilni odrezki oz. znamke pa 42 x 34mm; prodajna cena pole petnajstih znamk je 42 evrov.; exV 35. členu se v prvem odstavku za besedo "zasebniki" doda besedilo "razen zavezancev iz 51. a in 51. b člena tega zakona.; exV novi 22.a) tezi ali kasneje členu pa bi se besedilo glasilo: "Z denarno kaznijo najmanj 5.000 tolarjev se kaznuje posameznik, če kadi v javnem prostoru, kjer je kajenje prepovedano ali kadi v delovnih prostorih, kjer to ni dovoljeno.; exZapisana besedila so uradno pismo, prošnja, prijavnica, naročilnica, reklama, oglas, opomin, potrdilo, račun, razglas, uradna objava, pogodba, prošnja, uradno vabilo itd.; exTako kot je besedni red v posameznih povediih zasnovan na podlagi členitve po aktualnosti, so med seboj povezane tudi povedi v besedilu.; exZveza med jedrom ene povedi in izhodiščem naslednje ustvarja vsebinsko zaokroženost besedila.; ex1V besedilu pokažejo svoje znanje, zlasti pa osebno vrednotenje obravnavane teme, saj sta izvirnost in strokovno utemeljevanje izraz osebnega intelektualnega presojanja.; ex1Seveda besedilo, ki je sicer izhodišče gledališke igre, ne sme postati igračka in predmet samovoljnih interpretativnih izmišljanj in briljiranj, ki jim dijaki, tudi v strahu pred oceno, navadno le tiho kimajo in jih ponavljajo, ne da bi jih razumeli.; ex1Literarno in dramaturško-uprizoritveno branje se medsebojno dopolnjujeta, tako da “kritično razčlenjevanje dramskega besedila lahko proizvaja sugestije za uprizoritev, ki jih lahko preskusi le gledališče, nova uprizoritev pa lahko spodbudi interpretacijo, na katero ni noben kritik niti pomislil, bi jo pa lahko ovrednotili le na podlagi primerjave z besedilom”.; ex1BESEDILO: ugotavljanje razmerij med izvirnim, avtorjevim besedilom in med uprizorjenim besedilom ter med njuno gledališko upodobitvijo (razmerja režije in igralcev do izvirnega besedila), med rečenim (leksikalni, sintaktični, referenčni pomen besed) in zamolčanim; ugotavljanje in opomenjenje uporabljenega sloga (proza/verzi, podobje, simbolika ipd.; ex1Dijaki z učiteljem kritično (pisno ali ustno) ocenijo uprizoritveno besedilo, opravijo prve korekture in pretehtajo možnosti postavitve.; ex1Ustvarjalci so posebno pozornost posvetili slovenskemu jeziku, ki je v slovarju dejansko tak, kot se pojavlja v besedilih.; ex1Kaže, da bosta utrditev in shranjevanje tega besedila človeške narave dražja kot njegov zapis.; ex1V drugem odstavku 5. člena se črta besedilo "v mesecu, v katerem je prišlo do elementarne nesreče".; ex1Iz daljšega Kermaunerjevega besedila o Taborijevi predstavi bom navedel samo začetek, v katerem je Taras zelo natančno razložil svoj pogled na igro in izvedbo:; ex1Besedilo mi je bilo zelo všeč, napisano je bilo zelo spretno, zaplete treh prijateljev okrog modernistične bele slike, je mlada avtorica izkoristila za vivisekcijo zapletenih odnosov med tremi mladimi ljudmi v odtujeni moderni družbi.').
