g(106392001,'exPodobno kot zakon o zunanjih zadevah je velika večina načelno podprla tudi besedilo novega zakona o knjižničarstvu, vendar je bilo jasno, da bo do nesoglasij med strankami prišlo v tistem delu besedila, ki določa vlogo in pristojnosti občin v zvezi s knjižnicami.; ex- Katekizemski del obsega osem strani in vključuje osnovne molitve in deset zapovedi.').
g(106398401,'exNa koncu bi vas spomnil še na slogan javne tribune 12. maja 1988 v Unionski dvorani, ko je bila ustanovljena Slovenska kmečka zveza.; exZnašel se je sredi zadnjega ceremoniala tistega dne, za konec bo župan povedal nekaj besed.; exPredlagam, da ob koncu te razprave zbor sprejme nek sklep, da se ta resolucija sproti dopolnjuje v skladu s tem, ko bodo posamezni sistemi oziroma podsistemi nacionalne varnosti dograjeni, ko se bodo pojavile neke nove zahteve in tako dalje, kar je primer na Švedskem.; exIn na koncu še tipičen primer, kam gremo.').
