g(106410904,'exSICER NAČITANI INŠPEKTOR MORA POGLEDATI V DEBELE SLOVARJE, DA NAJDE RAZLAGO BESEDE EONIZEM, KI JO JE LETA 1928 VPELJAL SEKSOLOG HAVELOCK ELLIS V KNJIGI ŠTUDIJE O PSIHOLOGIJI SPOLNOSTI, EONIZMU IN DRUGE ŠTUDIJE.; exPrvi je organiziran, ima svoj sedež, izdaja knjige in druge publikacije.; ex« V prostem času najraje lenari in prebira knjige, predvsem tiste za osebnostno rast, v katerih najde veliko odgovorov na vprašanja, ki sem mu vsak dan porajajo.; exPotem sem prebral prvo takšno knjigo, za njo so se zvrstile druge.; exNikolaj V. je, ko je nastopil papeško službo, plačal več kot 1000 funtov pesniku Francescu Filelfu, da je napisal knjigo zgodb, ki so jih opisali kot "najbolj nagnusna dela, ki jih je kdaj ustvarila surova kljubovalnost in umazana domišljija".; exLeta 2000 so kljub zatrjevanju založnikov, da prodaja knjig pada, nekatere domače založniške hiše dosegle osebne prodajne rekorde, kar potrjujejo tudi številni ponatisi.; exRanjenci, tuš, perorisba, 1946 (ilustracija za poglavje Zmagali bomo iz knjige Tone Seliškar: Zmagali bomo.; exO drugih zdravilnih lastnosti te zabele je slovenska poznavalka Meta Krese napisala knjigo Oljka in njeno olje (MK), ki je te dni že na voljo na tržišču.; exBesedila in fotografije, ki slavijo lepoto Triglava, je za knjigo Triglav, Sveta gora Slovencev, ki je izšla pri Založbi Mladinska knjiga, izbral France Stele.; ex(Delno povzeto iz avtorjeve nove knjige Imena nebesnih teles.; ex1Ko je v letu 1986 izšla njena knjiga How Institutions Think ŠKako mislijo institucijeĆ, je v predgovoru zapisala: »To bi morala biti prva knjiga, ki bi jo napisala potem, ko sem pisala o afriškem terenskem delu«18.; ex1Literarno-glasbeni maraton za srednješolce, ki ustvarjajo glasbo hip-hop in rap, bo 23. aprila 2003 v okviru Slovenskih dnevov knjige v Mariboru: Ko te napiše knjiga 2003 na Grajskem trgu v Mariboru.; ex1Učenjaki so ponovno začeli z delom in bistveno zbrali v eni sami knjigi.; ex1Bilo je jasno, da ne bo mogel prebrati knjige, zato je prosil učenjake, naj mu povedo bistvo v enem samem stavku.; ex1Gre za dvig cenzusa s 3,9 milijona tolarjev na pet milijonov (z dodatkom, da povsem enako kot za samozaposlene velja tudi za zaposlene v kulturnem sektorju), pri 113. členu zakona o dohodnini pa bi radi nakup knjig, slik in zneske za obnovo kulturnih spomenikov izvzeli kot posebno olajšavo.; ex1Na drugi razstavi, na temo Projekt - knjiga, ki so jo odprli 28. junija in bo v Chioggi na ogled do 22. avgusta, prav tako svoja dela predstavljata David Ličen in Polona Kunaver-Ličen.; ex1Študirale so literaturo in brale knjige, tudi trojico romanov, ki jih zgodovina književnosti prišteva med četverico Viginiinih osrednjih leposlovnih del, Jakobovo sobo (1922), Gospo Dalloway (1924) in K svetilniku (1927) – Valovi (1931) tedaj še niso bili napisani in Orlando (1928) je šele pravkar zapustil tiskarno; sicer pa tako in tako še ni napočil čas, ki bi to izjemno zanimivo knjigo cenil po zaslugi.; ex1Janu, s katerim se skoraj vsak dan slišita po telefonu, je na srce položila nekaj nasvetov: zabičala mu je, da nekdanjih deklet niti v knjigi niti kako drugače ne sme žaliti in da naj se spominja najlepših trenutkov z njimi, slabe pa naj pozabi.; ex1Namesto tega bere preveč knjig.; ex1Wilson in drugi vodilni pisci otroških knjig veliko časa namenijo rednemu pojavljanju, dogodkom in podpisovanju knjig.; ex2Bral sem knjigo Andrewa Chaikena o Apollu.; ex2Po obliki je v zbirki na eni strani sedem moderniziranih sonetov, na drugi skoraj enako število pesmi v prostem verzu, ki pa spadajo med daljše v knjigi, kot tretja skupina nastopajo in daleč prevladujejo kitične pesmi.; ex2To četverico je objavil pod skupnim naznanilom:»Iz zbirke Meh za smeh«, kar naj bi bil očitno prvotni naslov knjige.; ex2Pogosto je ostalo samo pri poskusih ali celó zamislih, najbolj zgodnja igra iz Krekovega krožka se je zgubila, nekaj stvari je pesnik dokončal, a so ostale v rokopisu, dve manj pomembni sta izšli v mladinskih listih, trajno veljavo so ohranila tri dela, objavljena v Ljubljanskem zvonu ali v knjigi.; ex2Leta 1955 smo se spominjali 60-letnice začetkov slovenske Moderne, tedaj je avtor pričujoče knjige objavil svojo prvo, drobno monografijo o Župančiču in jo na naslovnici označil za »poljudno študijo«, ki naj bi s pesnikom pobliže seznanila širšo javnost.; ex2O svoji ertevejevski pustolovščini sem napisal knjigo, ki bo morda nekoč izšla, tukaj bom navedel le nekaj bistvenih podatkov o tem nenavadnem obdobju mojega življenja.; ex2Preizkušali sta najrazličnejše trenerje in učitelje jahanja, prebirali knjige o umetnosti jahanja ter gledali nastope svetovne dresurne in skakalne elite.').
