g(106482401,'exZdi se mi, da obravnava gradiv, ki jih vlada pripravlja za obravnavo v državnem zboru, teče relativno v redu in da, čeprav je število točk veliko, uspemo sprejeti veliko zakonodaje, ki je na dnevnem redu.; exPrav tako se poskusite spomniti glavnih točk nedavnega pogovora s prijateljem.; exPo nekajmesečnem zavlačevanju in usklajevanju so pogovori z ameriškim poslovnežem srbskega rodu Milanom Mandarićem očitno prišli do te točke, da je lahko tudi širša javnost izvedela kaj več o njih, vendar pa končne odločitve še vedno ni.; exV sklicu seje so bile napovedane, kot možne razširitve naslednje točke:; exPod točko dva na šesti strani k 19. členu imamo amandma k prvemu odstavku tega člena.; exUgotavljam, da amandma pod točko 1, k 42. členu ni sprejet.; exNa 3. strani spodaj imamo amandma pod 1. točko predlagatelja dr. Lea Šešerka in Franca Lipoglavška.; exSprememba, ki jo predlagamo k 1. točki, opozarja na zakone s posameznih področij, ki mora natančno razmejiti oziroma mora upoštevati razmejitev nalog države in nalog lokalnih skupnosti, se pravi, ob sprejemanju teh zakonov za posamezna področja.; exTOČKA 95.; exPo ZDSS je bilo arbitražno odločbo mogoče izpodbijati zaradi kršitve prisilnih predpisov ali morale, po ZPP pa zaradi nasprotovanja javnemu redu Republike Slovenije (9. točka 477. člena ZPP).; ex1Na prvi seji so imeli svetniki v obeh občinah na dnevnem redu točke, ki so bolj ali manj značilne za vse konstitutivne seje občinskih svetov.').
