g(106532330,'ex»Ne spoznam se kaj prida na zakone, vem pa, da tole na sodišču ne velja za dokaz.; exVeč je zakonov, bolj so zapleteni, manj je prava.; ex»Zdaj boš pa nazadnje še rekel, da jim zavidaš, luftarjem, ki bi jim bilo treba z zakonom prepovedati, da se sploh razmnožujejo?; exPodobno kot zakon o zunanjih zadevah je velika večina načelno podprla tudi besedilo novega zakona o knjižničarstvu, vendar je bilo jasno, da bo do nesoglasij med strankami prišlo v tistem delu besedila, ki določa vlogo in pristojnosti občin v zvezi s knjižnicami.; exKonkretno je drugo branje tega zakona obtičalo pri vprašanju imenovanja direktorjev knjižnic.; exPoslanci bodo drugo obravnavo tega zakona nadaljevali prihodnji torek.; exSredstva bodo sicer prispela na neki sklad, do katerega ima organizacijski komite dostop, saj je neposredna pomoč organizatorjem po italijanskih zakonih prepovedana.; exNa moje poizvedovanje o vprašanju, ali se je slovenski zakon znašel znotraj evropskega modela slučajno ali načrtno, sem v strokovnih krogih resornega ministrstva dobil odgovor, da je šlo za zavestno prilagajanje evropskim merilom in načelom iz Magne Charte, ki so jo rektorji evropskih univerz podpisali v Bologni 18. septembra 1988 in ki se je izrečno zavzela za »gibljivost učiteljev in študentov« ter za splošno politiko »medsebojne ekvivalence glede statusa, nazivov, izpitov«.; exNovi zakon, ki naj bi ga poslanci obravnavali jeseni, bo, če bo seveda sprejet, med drugim določal tudi, kdo in kako bo živel v zbirnih centrih.; exŠuštar pravi, da zakon ravno zato predvideva pravico beguncev do začasnega in občasnega dela.; ex1Urad za preseljevanje in begunce bo, če bo zakon sprejet, deloval podobno kot Študentski servis.; ex1»Vlada zavlačuje s sprejetjem zakona.; ex1Zakaj bi, če že strežemo nebrzdanim apetitom po dobičku, ki tako ali tako nikoli ne gre v delavske žepe, niti po drobtinicah, ne delali ob nedeljah še sodniki, ki imajo zaostanke, pa poslanci, ki jih čaka kar nekaj zakonov, pa...; ex1Po sklepu vlade naj bi delovna skupina, ki jo vodimo, v enem mesecu pripravila antidiskriminacijski zakon.; ex1Z zakonom naj bi ustanovili takšno neodvisno institucijo, ki bo dajala mnenja in obravnavala pritožbe.; ex1Po besedah državnega sekretarja Grega Viranta, ki je na včerajšnjem srečanju z novinarji skupaj z notranjim ministrom Radom Bohincem predstavil dosedanji potek reforme, zakoni na tem področju ne prinašajo revolucije, pač pa evolucijo.; ex1Karkoli drugega bi bilo navsezadnje tudi kršitev zakona, ki zahteva, da se vsako želvo, ki se zaplete v mreže, nemudoma odnese strokovnjakom ali pa izpusti nazaj v morje.; ex1Odbor je tudi predlagal matičnemu Odboru za finance in kreditno monetarno politiko, da navedeni predlog za izdajo zakona o dohodnini z osnutkom zakona, ki pomeni dejansko uveljavitev univerzalnega otroškega dodatka, obravnava in predlaga Državnemu zboru Republike Slovenije uvrstitev na dnevni red te 8. seje zbora.; ex1Prav zato predlagatelj ne more sprejeti nekaterih očitkov, da so določene zadeve sicer zanimivo urejene v zakonu, da so primerne, vendar le za evropske razmere, za nas pa ne oziroma še ne.; ex1Ko bo zakon o družbah, prepričani smo, da bo sprejet, sprejet, se bo pravo delo šele začelo.; ex2Šele vsi ti zakoni skupaj bodo predstavljali potrebno normativno podlago za trajno tržno zasnovan gospodarski sistem.; ex2Da bomo lahko ne samo govorili o pravni državi, pa tudi da bomo imeli urejen pravni red, je seveda treba čimprej oblikovati in sprejeti, in tu Vlada že deluje v tej smeri, vse tiste zakone, ki pomenijo oblikovanje sodobnih učinkovitih, državnih in drugih organov.; ex2Gre za zakon o ustavnem sodišču, o sodiščih, o socialnih in o delovnih, o državnem tožilstvu, o računskem sodišču, o varuhu pravic državljanov, o davčni zakonodaji in drugo.; ex2Zdravnik, ki je tukaj govoril, je odprl celo vrsto vprašanj, katerih razrešitev je potrebna, če hočemo o tem zakonu glasovati - in vendarle ni predlagal tega, da je proti temu, da se zakon sprejme po hitrem postopku.; ex2Če to drži, potem menim, da ne moremo sprejemati nobenega zakona prej, preden tistega ne popravimo, ker je sicer vse brezpredmetno.; ex2Zato, ker je predlagatelj zakona v 22. tezi zajel dve kategoriji kršitev, in sicer kršitve, s katerimi ima kršitelj materialno korist od kršenja členov, in druga vrsta kršitve, kjer posameznik škodi sebi oziroma s kajenjem ogroža druge in s tem nima materialne koristi.; ex2Sprememba, ki jo predlagamo k 1. točki, opozarja na zakone s posameznih področij, ki mora natančno razmejiti oziroma mora upoštevati razmejitev nalog države in nalog lokalnih skupnosti, se pravi, ob sprejemanju teh zakonov za posamezna področja.; ex2V medijih redno spremljam razprave o novem zakonu in ne morem mimo tega, da ne bi še jaz dodal svojega mnenja.; ex2Dokupljena doba je obdobje, določeno z zakonom, v katerem zavarovanec ni vključen v obvezno ali prostovoljno pokojninsko in invalidsko zavarovanje, šteje pa se v zavarovalno dobo pod pogojem plačila prispevkov.; ex2Tudi če bo zakon o zaščiti jezika na začetku novega tisočletja sprejet, se bojim, da ga pa ne bomo izvajali.').
