g(106536853,'exPredlog zakona o DDV v drugem branju je bil v primerjavi s prvim branjem dokaj spremenjen.; exOdbor je temeljito proučil navedeni predlog zakona in soglasno podprl, da se tak predlog zakona uvrsti na dnevni red te seje Državnega zbora.; exOdbor je tudi predlagal matičnemu Odboru za finance in kreditno monetarno politiko, da navedeni predlog za izdajo zakona o dohodnini z osnutkom zakona, ki pomeni dejansko uveljavitev univerzalnega otroškega dodatka, obravnava in predlaga Državnemu zboru Republike Slovenije uvrstitev na dnevni red te 8. seje zbora.; exOdbor za kreditno monetarno politiko in finance torej ni predlagal uvrstitve na dnevni red, zato kot zainteresirano delovno telo - Odbor za zdravstvo, delo, družino in socialno politiko - predlagamo, vam spoštovane poslanke in poslanci, da uvrstimo ta predlog zakona na dnevni red.; exTOČKO DNEVNEGA REDA - PREDLOG ZAKONA O GOZDOVIH, z razpravo, h kateri imamo še nekaj prijavljenih.; exKer nihče ne želi več besede, zaključujem razpravo o predlogu zakona o gozdovih in prekinjam to točko dnevnega reda do odločanja.; exZdaj pa vzeti, edino socialno pravični, ne bom rekel edini socialno pravični, edini davčni vir, ki ima to socialno pravičnost vsebovano, se mi pa zdi nespametno in zato predlagam še enkrat oz. apeliram tudi na tiste, ki boste glasovali za ta osnutek zakona: pokažite toliko strpnosti in glasujte potem še za moj predlog.; exSpati mi namreč ne da nov predlog zakona o divjadi in lovstvu oziroma njegovi nasprotniki.').
