g(106568978,'exVsebina Večpredstavnega albuma je pričakovana; sličice, videi, zvoki (igre in programi) ter informacije o prostem spominu, ki ga je v tem strojčku za nekaj kB manj kot 2 MB.; exŠe najbolj izstopata dva že naložena programa »Size converter« in »Translator«.; exVseh izbirnikov je devet, poleg omenjenih pritisni in govori ter organizatorja so še operaterjeve storitve (WAP, GPRS), programi (igri Disco in Chic Pinball ter Translator in Size converter; te ne smejo preseči 128 kB), nastavitve (profili možnost kreiranja dveh lastnih, toni, teme, nastavitve obeh zaslonov, časa, datuma, bližnjic, glasovni ukazi, desna izbirna tipka), povezovanje (infrardeči vmesnik, GPRS), klicne nastavitve, nastavitve telefona, dodatkov, konfiguracije, nastavitve zaščitne narave), galerija (podobe, videoposnetki, teme, grafike, zvočni posnetki), predstavnost (digitalna kamera, predvajalnik, snemalnik zvoka, radio), zadnji klici (neodgovorjeni, prejeti in klicani …; exZmedo, ki nastane v takih primerih, lahko bistveno zmanjšamo, če se tuje jezike učimo s tem programom.; exToda očetu je obljubil pomoč pri preizkušanju zmogljivosti programov, zato se je sklenil soočiti s svojimi strahovi.; exProtivirusni proizvajalci uvrščajo Back Orifice v kategorijo trojanskih konjev, program pa je podobno kot Netbus sestavljen iz strežnika in odjemalca, ki medsebojno komunicirata prek protokola TCP/IP (slika 5); exVse, kar je treba narediti, je namestiti program DNKA, ki ga skupaj s preprostimi navodili najdete na naslovu http://dnka.com/.; exProgram je primeren predvsem za večje organizacije, kjer je v navezi s programom Symantec Enterprise Security Manager odličen par, saj slednji skrbi, da se vsi člani omrežja držijo iste varnostne politike oz. predpisov.').
