g(106613686,'exNa vsak način sem hotel, da bi me deklica opazila, da bi vedela, da sem glavni, da sem bil najmanj tisočkrat v kinu in da bom nekoč delal filme…; exA ne v glasbi, temveč v filmu.; exHarrisonov prijatelj Michael Palin iz ekipe Leteči cirkus Montyja Pytona mu je nekoč namreč potožil, da mu je zmanjkalo denarja za film The Life of Brian.; exNjegova producentska hiša HandMade Films je bila zaslužna za vzpon britanskega filma v osemdesetih letih, veljala pa je za eno najuspešnejših in najbolj neodvisnih produkcijskih hiš.; exZGODBE PREOBLAČENJA, KJER JE IDENTITETA PREVZETA ZA DALJŠE OBDOBJE, V FIKCIJI IN V FILMU NISO REDKOST.; exZGODBA JE BILA PRIREJENA ZA FILM BALADA O MALEM JOEJU.; exV naslednjih mesecih se nam ne obetajo podobni filmi.; exMed njimi morda film z naslovom: »Imam dve mami in dva očeta«.; exPo krajši digresiji v zgodovino filma, ki premore dosti bolj nosne in inteligentne finte, je cigo ceno spustil na 160 šilingov, kot bonus ponujal cunjasto lutkico, ter stokal o izgubi, ki mu jo prinašam, in o njegovi službi, ki jo s tem popustom postavlja na kocko.; exAvtorji se v filmu sprehajajo skozi čas in prostor, skušajo nam predstaviti bogato zgodovino in manj znano bogastvo Roga.; ex1V Ameriki so jo slavili kot največjo umetnostno drsalko na svetu, zanjo celo napisali valček Charlotte in kot prva drsalka je nastopala v filmih.; ex1Karpo Godina najde veliko idej za filme v dnevnem časopisju.; ex1Izrezuje in spravlja si vse mogoče, kar mu lahko pride prav tako pri dokumentarnih kot igranih filmih.; ex1Tudi Makavejev je izrazit zbiralec časopisov - skoraj vse ideje za svoje filme je našel v raznih črnih kronikah in podobnih zapisih.; ex1Že pred leti se je v urejenem kaosu Karpovih izrezkov znašel gospod Peter Florjančič (o njem smo lani aprila pisali v Nedelu) iz Zgodbe o gospodu P. F., dokumentarnega filma, ki bo premierno prikazan prihodnji konec tedna na Festivalu slovenskega filma v Portorožu.; ex1Telefoniral sem mu, se dobil z njim in tako je nastal ta film.; ex1Vzemite Larryja Fishburnea, slovitega surferja iz filma Apocalypse Now: v orto-črnskem filmu School Daze (1988, Spike Lee) je bil še militantno-uporniški aktivist, vdan pučistični razrešitvi »črne stvari«, zdaj v filmu Boyz''n the Hood (John Singleton) pa je dobro asimilirani oče, ki skuša svojemu sinu pokazati pedagoško pot iz geta.; ex1Filmi Straight out of Brooklyn (Matty Rich), Hangin'' with the Homeboys (Joseph Vasquez) in Jungle Fever (Spike Lee) imajo isti podton: rešitev za črnca, odraščajočega v getu, je izobrazba, odhod iz geta v šole (Fishburneov sin odide na Morehouse College, prizorišče filma School Daze).; ex1Wesley Snipes, mejaško-psihopatski narko-baron v filmu New Jack City, pa ima drugačno vizijo: v getu vse »meje« še niso osvojene, zato ga je treba preleviti v post-utopično in ultra-korporirano zaprto trgovsko državo, Enterprise (marketing & strategija, consulting & kompjuterizacija), podobno tistim iz filmov Escape from New York (Manhattan an sich), Blade Runner (L.A. an sich) in Robocop (Delta City), v kateri je »užitek« mogoč le v pogojih totalitarizma (»uživajoče« crackerje v Enterpriseu ščitijo ljudje z avtomati).; ex1Kot uspešnega letalca in poslovneža vas mediji primerjajo celo z legendarnim Howardom Hughesom, ovekovečenim v Scorsesejevem filmu, nagrajenem z oskarji.; ex2Resnično grozen hotel v še bolj groznem umetniškem filmu Jima Jarmuscha.; ex2ENI OBRAZI DO NAZGA, DRUGI ŽE MED ZVEZDAMI - Avtorji evropskega filma leta in svetovne finančne in kritiške uspešnice Do nazga so obtoženi kraje scenarija, kar jih lahko stane skoraj ves zaslužek, stotnije ameriških "filmskih delavcev" pa so pred podelitvijo oskarjev 23. marca iz dneva v dan bolj in živčne.; ex2Gledala sta nekakšen star film, ki bi ga lahko videla že pred nekaj meseci.; ex2Od treh lepotic iz prvega dela filma Charlijevi angelčki je na vlogo v nadaljevanju do zdaj pristala le Drew Barrymore, medtem ko se Lucy Liu še vedno pogaja.; ex2Nadaljevanje filma naj bi v ameriških kinematografih začeli predvajati prihodnje poletje.; ex2Tržna vrednost Cameron Diaz se je v minulih mesecih močno dvignila, saj jo bo v prihodnje mogoče videti v filmu Vanilijevo nebo (Vanilla Sky) ob Tomu Cruisu in v filmu Newyorške bande (Gangs of New York) ameriškega režiserja Martina Scorseseja.; ex2Med njimi je bila tudi znana italijanska filmska igralka Eva Grimmaldi, ki je bila tokrat prvič v Sloveniji in se pripravlja na snemanje novega francosko-italijanskega koprodukcijskega filma.; ex2"Srečna sem," je dejala, "ker toliko igram (kljub mladosti je posnela že 37 filmov), ker sem tu med vami, in nesrečna, ker bolj ko se dviga k vrhu moje profesionalno filmsko življenje, bolj se na drugi strani spušča kakovost mojega zasebnega življenja.; ex2Včasih ujameš kak kanal, ki predvaja stare črno-bele filme.').
g(106619428,'exLoka TV je bila že leto dni v hudi finančni stiski, kar je bilo za gledalce več kot očitno, saj ni bilo več lastnega programa, v glavnem so prek oddajnika na Lubniku na kanalu 51 predvajali video-strani in stare posnetke drugih lokalnih televizij.; exKot odgovorni urednik informativnega programa je bil Darko zaslužen za ustanovitev Studia Ljubljana pod vodstvom Tomaža Peroviča.').
