g(106647864,'dev matematiki pomeni prikaz, da je, pri določenih aksiomih, izjava, ki nas zanima, nujno resnična').
g(106656408,'exTo je seveda smešno, evropsko omrežje ekološko pomembnih območij, ki je oblikovano na podlagi dveh evropskih direktiv, seveda ni stvar lokalne politike, prav tako ni stvar državnih institucij.; exV Mariboru so se zbrali praktiki s tega področja, ki jih je zanimala vladna politika o vodah v Sloveniji, predvsem pa konkretni primeri čiščenja vod pri nas.; ex- Se vam zdi, da Bush nadaljuje ameriško politiko, samo z bolj ostrimi sredstvi kot Clinton, ali vodi neko povsem drugačno zunanjo politiko, ki je pogojena tudi z 11. septembrom?; exNa mirovnih pogajanjih danes pričakujejo visokega predstavnika Evropske unije za skupno zunanjo in varnostno politiko Javierja Solano.; exČlani pogajalske skupine so povedali, da je mogoče kmetijstvo ohraniti z regionalno politiko, nakar smo tudi slišali, da je slovensko kmetijstvo danes bolje zaščiteno kot kmetijstvo v vsej EU.; exBanka Slovenije bo naredila vse, da se bo v Sloveniji zadržala sedanja stopnja razvoja in da bo domača valuta še naprej dokaj stabilna, je na včerajšnjem srečanju z gorenjskimi gospodarstveniki dejal guverner Banke Slovenije dr. France Arhar, ki ob neugodnih mednarodnih razmerah pričakuje rebalans proračuna in prevlado razuma v slovenski plačni politiki.; exNa moje poizvedovanje o vprašanju, ali se je slovenski zakon znašel znotraj evropskega modela slučajno ali načrtno, sem v strokovnih krogih resornega ministrstva dobil odgovor, da je šlo za zavestno prilagajanje evropskim merilom in načelom iz Magne Charte, ki so jo rektorji evropskih univerz podpisali v Bologni 18. septembra 1988 in ki se je izrečno zavzela za »gibljivost učiteljev in študentov« ter za splošno politiko »medsebojne ekvivalence glede statusa, nazivov, izpitov«.; exZaradi prekinjenega zasedanja odbora za notranjo politiko je protestirala SDS.; exNemški zunanji minister Joschka Fischer je v javni razpravi bistvo politike preprečevanja konfliktov povzel z besedami, da je bolje preprečiti kot zdraviti, kajti vojne je pogosto lažje preprečiti kot pa prekiniti.; exO podvrženosti prava potrebam dnevne notranje politike po Golobičevih besedah priča ne le ta tožba, marveč tudi pismo Petra Jambreka o tem, da bi moral Drnovšek predati vladne posle Bajuku.; ex1Vodilnim možem Salzburga je zdaj očitno prekipelo in ne mislijo nadaljevati s politiko strpnosti.; ex1Predstavniki podpisnikov vsesplošnega kulturnega protesta proti napovedanim spremembam davčne zakonodaje (podpisana strokovna stanovska društva, združenja, zveze, sindikati skupaj štejejo več tisoč članov) so za konstruktiven dialog s politiko, zato bodo nekatere svoje predloge (in na pogajanjih večkrat poudarjena stališča) skušali v obliki amandmajev spraviti na poslanske klopi.; ex1Kaj pomeni nedavno sprejeta reforma skupne kmetijske politike EU za slovensko kmetijstvo, naj bi v javni obravnavi predstavili na letošnjem kmetijsko-živilskem sejmu avgusta v Gornji Radgoni na podlagi študije, ki jo na ministrstvu pričakujejo konec meseca.; ex1Slovenska politika je brez koncepta, kako sploh ravnati.; ex1Po prepričljivem uspehu referenduma o Natu je del vladajoče politike skušal obračunati z njim prek instrumentalizacije tožilstva.; ex1Odbor je tudi predlagal matičnemu Odboru za finance in kreditno monetarno politiko, da navedeni predlog za izdajo zakona o dohodnini z osnutkom zakona, ki pomeni dejansko uveljavitev univerzalnega otroškega dodatka, obravnava in predlaga Državnemu zboru Republike Slovenije uvrstitev na dnevni red te 8. seje zbora.; ex1Odbor za kreditno monetarno politiko in finance torej ni predlagal uvrstitve na dnevni red, zato kot zainteresirano delovno telo - Odbor za zdravstvo, delo, družino in socialno politiko - predlagamo, vam spoštovane poslanke in poslanci, da uvrstimo ta predlog zakona na dnevni red.; ex1Predstavniki žrtev spolnih zlorab duhovnikov so izrazili ogorčenje nad sprejetjem te nove politike, ki so jo primerjali s preselitvijo mestnega morilca na vas.; ex1Ne bi bilo pravično zahtevati, naj Nemčija še naprej podpira tri evropske vogale, v zameno pa bi morala Berlin in Pariz prenehati razglašati, da je njuna politika že a priori dobra za vse.; ex1Kučanu je to uspevalo predvsem s posrednim vplivom, ki ga je imel na politiko zaradi svoje popularnosti, segajoče daleč čez klasično razdelitev levo-desno.; ex2Enak vzorec za pridobivanje posrednega vpliva na politiko v bistvu uporablja tudi Drnovšek.; ex2TAKO NA PRIMER DOGOVOR O POLITIKI PLAČ ZA OBDOBJE 19992001, URADNI LIST RS, ŠT. 22-1017/99, RS 39-1963/99 (V ČASU VELJAVNOSTI ZAKONA O MINIMALNI PLAČI, O NAČINU USKLAJEVANJA PLAČ IN O REGRESU ZA LETNI DOPUST V OBDOBJU 19992001 (ZMPUPR, URADNI LIST RS, ŠT. 39-1963/99) SE NE UPORABLJAJO DOLOČBE PREDPISA, KI SO V NASPROTJU S TEM ZAKONOM), 51-2422/00 (ANEKS).; ex2KI SO GA SKLENILI VLADA REPUBLIKE SLOVENIJE, PREDSTAVNIKI DELOJEMALCEV IN PREDSTAVNIKI DELODAJALCEV (SOCIALNI PARTNERJI), OPREDELJUJE OSNOVNA NAČELA IN CILJE, KI JIH SOCIALNI PARTNERJI ŽELIJO DOSEČI NA PODROČJU POLITIKE PLAČ.; ex2DOGOVOR O POLITIKI PLAČ JE POMEMBEN INSTRUMENT IN IZRAZ DELUJOČEGA SOCIALNEGA PARTNERSTVA V RS.; ex2TEMELJI NA SKUPNEM IZHODIŠČU, DA JE PLAČNA POLITIKA ENA IZMED POMEMBNEJŠIH POLITIK O KATERI JE POTREBNO DOSEČI SOGLASJE, DA BI SE OHRANILO STABILNE POGOJE ZA OHRANJANJE DELOVNIH MEST IN DINAMIČNI RAZVOJ; KOT SE NAVAJA V DOGOVORU JE DOGOVOR O POLITIKI PLAČ, PRVI IZMED SKUPNIH DOKUMENTOV V KATERIH NAJ BI SOCIALNI PARTNERJI OPREDELILI SVOJE SKUPNE TER POSAMIČNE NALOGE IN CILJE, KI NAJ BI JIH NA EKONOMSKO SOCIALNEM PODROČJU DOSEGLI V NASLEDNJIH LETIH.; ex2Objektivnost, ki v izhodišču govori o oblikovanju primerjalne vednosti (kako poimenovati stvari, da bi bile stabilne in podobne druga drugi), postane vprašanje politike novega postavljanja meja, da bi dobili nenedolžna pogajanja in povezave.; ex2Prav zato bi bila za mnoge zmaga Valdasa Adamkusa rešilni kompromis, ki bi vladajočim konservativcem omogočil, da bi kljub porazu na predsedniških volitvah ohranili glavne zamisli svoje politike, ki jo je zastavil njihov voditelj Vitautas Landsbergis.; ex2Politiki, ki so s kratkovidno in neodgovorno politiko zakuhali tak svet, v tem peklenskem položaju povsem izgubljajo razsodnost; da bi našli opravičilo pred pretresenim ljudstvom, obljubljajo najbolj primitivne odgovore, zob za zob, krvno maščevanje ne le proti krivcem, ampak tudi proti vsej njihovi okolici, obljubljajo rasno vojno.; ex2Program je primeren predvsem za večje organizacije, kjer je v navezi s programom Symantec Enterprise Security Manager odličen par, saj slednji skrbi, da se vsi člani omrežja držijo iste varnostne politike oz. predpisov.').
