g(106722453,'exPo besedah Dermeljeve obstajajo boljše in okoljsko sprejemljivejše možnosti, kot je uporaba gensko spremenjenih organizmov.; exPo besedah podpredsednika Gospodarske zbornice Slovenije Mira Sotlarja je Slovenija z eno nogo že v Evropski uniji, ki je najpomembnejša partnerica slovenskega gospodarstva.; exMinistrstvu za okolje, prostor in energijo so pravzaprav poslali grozeče zahteve, opremljene z besedami o postopkih na ustavnem sodišču.; exPo Marušičevih besedah se komisija izreka zgolj v postopku za imenovanje vodij državnih tožilstev.; exKapitalska družba, Slovenska odškodninska družba ter Krekov pid Zvon 1 imajo v lasti po od 10 do 12 odstotkov delnic, pomembnejši lastnici sta še Nacionalna finančna družba in Atena, v rokah notranjih lastnikov, ki jih po besedah direktorja delnic Belinke večinoma ne nameravajo prodati, pa je okoli 30 odstotkov lastništva.; ex« Te besede pa zanj pravzaprav niso nič novega.; exPo besedah Bojana Lučovnika, generalnega direktorja Adrie, bo družba svoje aktivnosti odslej koordinirala skupaj z ministrstvoma za promet in zunanje zadeve, torej je vendarle možnost, da Jat dovoljenja ne bo dobil.; exO podvrženosti prava potrebam dnevne notranje politike po Golobičevih besedah priča ne le ta tožba, marveč tudi pismo Petra Jambreka o tem, da bi moral Drnovšek predati vladne posle Bajuku.; exPo besedah državnega sekretarja Grega Viranta, ki je na včerajšnjem srečanju z novinarji skupaj z notranjim ministrom Radom Bohincem predstavil dosedanji potek reforme, zakoni na tem področju ne prinašajo revolucije, pač pa evolucijo.; exPo Dergančevih besedah se ideje opirajo na cenejše ali celo brezplačno popoldansko parkiranje, čeprav del javnosti in občinski svetniki tega verjetno ne bodo sprejeli.; ex1Njegove besede ob prihodu iz klubske stavbe na Vodovodni 20, ko je dejal, da bo o celotni stvari še malce premislil, so bile torej le metanje peska v oči, saj naj bi bil že takrat odločen zapustiti Ljubljano.; ex1Rezultat referendumov so po besedah vodje poslancev DeSUS Ivana Kebriča v stranki pričakovali.; ex1Po besedah ameriških predstavnikov je bil posnet novembra, našli pa so ga v hiši v Afganistanu.; ex1Morda se jim nič od tega, kar je povedal, ni zdelo tako zelo pomembno za prihodnost Kitajske, kakor so se jim zdele usodne Busheve besede, je pa pred njimi stal idol, kakršnega bi vsekakor radi imeli na čelu svoje države.; ex1Po besedah trenerja Mira Požuna so Makedonci značilni zastopniki jugoslovanske rokometne šole z agresivno obrambo od 6-0 do 3-2-1.').
