g(106770875,'ex) Za delovno mesto stažista je moral izpolnjevati dva pogoja: ni smel biti prestar in imeti je moral univerzitetno diplomo.; exEden od pogojev, ki ga bodo morali tudi izpolnjevati, bo veterinarsko potrdilo, da je kuža zdrav.; exPotem ko je vlada konec januarja soglasno sprejela program preoblikovanja prostocarinskih prodajaln, se glavno dogajanje v zvezi s to problematiko počasi seli v parlament, saj brez njegovega žegna program ne bo mogel zares zaživeti (prvi pogoj so namreč nekatere novosti in spremembe v carinski zakonodaji).; exPOSEBEJ POMEMBNO PRI TEJ OBLIKI ZAČASNE POROKE JE, DA JE ŽENSKA TISTA, KI DA POBUDO ZA SKLENITEV ZVEZE IN TUDI DOLOČI POGOJE POGODBE, POGOSTO PA POGODBO TUDI PLAČA, MEDTEM KO IMA TAKŠNO VLOGO PRI DRUGIH OBLIKAH ZAČASNE POROKE MOŠKI.; exTehnološki park je zasnovan kot oblika t. i. podjetniških inkubatorjev, kjer novoustanovljena inovacijska podjetja dobijo pomoč lokalne skupnosti ali države z namenom, da pod ugodnejšimi pogoji razvijejo in ustvarijo pogoje za samostojno delovanje.; exSkrbi jih namreč izraz »nepridobitne dejavnosti«, ki so pogoj za neplačevanje dohodnine od prejemkov za stroške prevoza, nočitve, dnevnice osebam, ki sodelujejo (med drugim) v raznoraznih kulturnih dejavnostih.; exWesley Snipes, mejaško-psihopatski narko-baron v filmu New Jack City, pa ima drugačno vizijo: v getu vse »meje« še niso osvojene, zato ga je treba preleviti v post-utopično in ultra-korporirano zaprto trgovsko državo, Enterprise (marketing & strategija, consulting & kompjuterizacija), podobno tistim iz filmov Escape from New York (Manhattan an sich), Blade Runner (L.A. an sich) in Robocop (Delta City), v kateri je »užitek« mogoč le v pogojih totalitarizma (»uživajoče« crackerje v Enterpriseu ščitijo ljudje z avtomati).; exVeliki Žuti seveda ni mogel sprejeti takšnih pogojev, še sploh, če vemo, da naj bi mu Schollmayer v zadnjih dneh vseskozi zagotavljal, da ne bo nikakršnih problemov glede dogovora, saj naj bi bili cilji in načrti ter s tem tudi proračun kluba podobni kot lani.; exSeveda pod pogojem, da v prihodnjem obdobju ne bodo začeli iskati partnerjev v poraženem levo-liberalnem bloku.; exTA ZAKON JE IZRECNO DOLOČAL, DA SO VSI POKLICI IN POLOŽAJI V DRŽAVNIH SLUŽBAH OB IZPOLNJEVANJU ZAKONSKIH POGOJEV ENAKO DOSTOPNI VSEM DRŽAVLJANOM, TUJCI PA SO SMELI BITI SPREJETI V DRŽAVNO SLUŽBO LE PO POGODBI.; ex1PREDVSEM JE BIL NLRA UZAKONJEN Z NAMENOM, DA DELAVCI Z ZDRUŽEVANJEM V DELAVSKA ZDRUŽENJA IN S KOLEKTIVNIM POGAJANJEM PREK TEH ZDRUŽENJ REŠUJEJO MOREBITNE PROBLEME PRI DELU TER TAKO IZBOLJŠAJO DELOVNE RAZMERE IN POGOJE NA SVOJEM DELOVNEM MESTU.; ex1- Z DNEM, KO DOPOLNI 40 LET POKOJNINSKE DOBE, ČE PRISTOJNI ORGAN ORGANIZACIJE OZIROMA DELODAJALCA V SKLADU S POGOJI, KI JIH DOLOČI KOLEKTIVNA POGODBA, OZIROMA S SPLOŠNIM AKTOM NE ODLOČI, DA LAHKO NADALJUJE DELOVNO RAZMERJE.; ex1TEMELJI NA SKUPNEM IZHODIŠČU, DA JE PLAČNA POLITIKA ENA IZMED POMEMBNEJŠIH POLITIK O KATERI JE POTREBNO DOSEČI SOGLASJE, DA BI SE OHRANILO STABILNE POGOJE ZA OHRANJANJE DELOVNIH MEST IN DINAMIČNI RAZVOJ; KOT SE NAVAJA V DOGOVORU JE DOGOVOR O POLITIKI PLAČ, PRVI IZMED SKUPNIH DOKUMENTOV V KATERIH NAJ BI SOCIALNI PARTNERJI OPREDELILI SVOJE SKUPNE TER POSAMIČNE NALOGE IN CILJE, KI NAJ BI JIH NA EKONOMSKO SOCIALNEM PODROČJU DOSEGLI V NASLEDNJIH LETIH.; ex1ZOPER SKLEP O PRAVICI OZIROMA OBVEZNOSTI IZ DELOVNEGA RAZMERJA JE DOVOLJENO SODNO VARSTVO PRED DELOVNIM SODIŠČEM POD POGOJEM, DA JE JAVNI USLUŽBENEC IZKORISTIL MOŽNOST PRITOŽBE.; ex1Dokupljena doba je obdobje, določeno z zakonom, v katerem zavarovanec ni vključen v obvezno ali prostovoljno pokojninsko in invalidsko zavarovanje, šteje pa se v zavarovalno dobo pod pogojem plačila prispevkov.; ex1Zato terjatev ni verjetno izkazana in ni pogojev za izdajo začasne odredbe (sklep VDSSL, opr. št. Pdp-1353/2003 z dne 5. 9. 2003).; ex1Za odpravo teh težav bomo v okviru zborničnih strokovnih služb in izvršilnega odbora Sekcije za cestni tovorni promet pripravili celovito analizo pogojev poslo