g(107007945,'exV Moskvi žensko gledališče uprizarja igre, ki so jih o ženskah napisale ženske.; exLiterarni zgodovinarji imenujejo zadnje Shakespearove igre tudi “romance”, kar vsekakor opozarja na posebno čustveno intonacijo, pa nemara še bolj na slog, ki je bolj epičen in manj zgoščeno dramatičen.; exVODORAVNO: 1 globoka podolgovata vdolbina v apnenčastem svetu, škraplja, 7 sunek, s katerim se kaj spravi v premikanje, 13 vrsta aminokislin, 14 pastirska igra italijanskega pesnika Torquata Tassa, 15 stari del Maribora, 16 bajtar, 18 oranje, 19 indijska praksa duhovne koncentracije, 20 pripadnik Burov, 21 krilo rimske konjenice, 22 mejna reka med Slovaško in Madžarsko, 23 groza, strah, 24 tip lahkega mitraljeza, 25 varjeni šiv, 26 egiptovsko krajevno božanstvo Memfisa, 27 ameriški filmski režiser (Martin), 28 Olaf Tufte, 29 kraljica ilirskih Ardijejcev, 31 ime pesnika Zajca, 32 notranji, osrednji del stebla, 34 umetno modro barvilo, 36 slovenski pisatelj (Ivan, V Zali), 37 iglasto drevo.; exPrav tako izzivalna je zelo rafinirana zgodba drame, čeprav je bil to prvenec tega avtorja; tematsko prepoznaven in sprejemljiv za današnji čas je tudi dramatikov gnev, ki je uporaben za navezavo te igre na sodobnost.; exPrve erotične radijske igre so prebrali znani slovenski dramski igralci; exSnovanje iger ga je pritegovalo že v dijaških letih, zatem v začetku stoletja, v času prve vojne in v dvajsetih letih, misel nanje ga je obletavala še v tridesetih.; exPogosto je ostalo samo pri poskusih ali celó zamislih, najbolj zgodnja igra iz Krekovega krožka se je zgubila, nekaj stvari je pesnik dokončal, a so ostale v rokopisu, dve manj pomembni sta izšli v mladinskih listih, trajno veljavo so ohranila tri dela, objavljena v Ljubljanskem zvonu ali v knjigi.; exIz daljšega Kermaunerjevega besedila o Taborijevi predstavi bom navedel samo začetek, v katerem je Taras zelo natančno razložil svoj pogled na igro in izvedbo:').
