g(107110615,'exTako da ji je, kadar je spregovorila, porumenila glas grenkoba in prsti so ji tolkli po pasu kakor ključi.; exHotel je zakričati, jo poklicati in hkrati zavpiti na pomoč, vendar iz njegovega grla ni bilo glasu.; ex« je slednjič spregovoril z rahlim drhtenjem v glasu.; exElegično melanholičen in čutno intenziven je uvodni ''šanson'' (na glasbo Mitje Vrhovnika Smrekarja in z upesnjeno Müllerjevo partituro), ki ga odpoje antologijski glas Ditke Haberl.; exGlas Haberlove stopi na opustošeno obalo, v opustošeni svet, razsrediščen, shizofren in absolutno razbolen.').
