g(107163593,'exPredlog stališč je v obravnavo predložila Komisija za lokalno samoupravo.; exZdaj pa vzeti, edino socialno pravični, ne bom rekel edini socialno pravični, edini davčni vir, ki ima to socialno pravičnost vsebovano, se mi pa zdi nespametno in zato predlagam še enkrat oz. apeliram tudi na tiste, ki boste glasovali za ta osnutek zakona: pokažite toliko strpnosti in glasujte potem še za moj predlog.').
