g(107193596,'exVsi procesi morajo biti stalno pod nadzorom, poleg tega moramo dobavitelji imeti odgovore na vsa vprašanja o izdelkih za vgradnjo v avtomobile,« pravi predsednik uprave novomeškega TPV Vladimir Bahč.; exNa vprašanje, ali ne bi bilo bolje, da vlada uredbo spremeni, kot pa da jo (vključno ali na čelu z uradom predsednika vlade) krši, pa je Osolnikova odgovorila, da formalnopravno to sicer drži, vendar pa ocenjuje, da je bolje, da so pri napredovanju nekatere izjeme, kot pa da na splošno znižajo merila, kar vsekakor ne bi prispevalo k boljšemu delovanju vlade.; exNa vprašanja so odgovarjali vsi, a ker ne smemo povedati, kako je komu ime, tudi ni potrebe, da bi zapisali, kdo je lastnik posameznega odgovora.; exAndraž Vehovar je doživel veliko osebno razočaranje, a obenem se postavlja vprašanje, kaj bo naredila KZS, če Vehovar do konca julija, ko bo še pet tekem svetovnega pokala, zmaga vsaj na dveh tekmah in dodal kolajno na evropskem prvenstvu.; ex« V prostem času najraje lenari in prebira knjige, predvsem tiste za osebnostno rast, v katerih najde veliko odgovorov na vprašanja, ki sem mu vsak dan porajajo.; exTo je vprašanje za predsednika državnega zbora, predvsem pa je vprašanje za vodje poslanskih skupin in predsednike delovnih teles, ki se ukvarjajo s temi zadevami.; exNa moje poizvedovanje o vprašanju, ali se je slovenski zakon znašel znotraj evropskega modela slučajno ali načrtno, sem v strokovnih krogih resornega ministrstva dobil odgovor, da je šlo za zavestno prilagajanje evropskim merilom in načelom iz Magne Charte, ki so jo rektorji evropskih univerz podpisali v Bologni 18. septembra 1988 in ki se je izrečno zavzela za »gibljivost učiteljev in študentov« ter za splošno politiko »medsebojne ekvivalence glede statusa, nazivov, izpitov«.; exAntropologovo vprašanje verujočemu je, zakaj bi ga lahko zmotilo spoznanje, da ima skorajda vsako ljudstvo za boga svoj lastni opis.; exHelena Bargoltz (Švedska) je svoj prispevek k tej temi končala s vprašanjem: le kako bi reagirala ameriška vlada, če bi se njeni državljani nenadoma znašli v takšnem položaju in v takšnih razmerah, v kakršnih zdaj v Guantanamu živi teh 680 ujetnikov?; exTekmeca, ki so jima okoliščine onemogočile, da bi postala zaveznika, kljub temu pa je bilo za ostrimi vprašanji in odgovori prisotno neizgovorjeno razumevanje; zajeto je bilo v samoumevnosti, tisti samoumevnosti, ki edina zbliža ali odbije svetove.; ex1In doma postavlja tudi svoja vprašanja.; ex1(smeh) (Grega nam je na enako vprašanje odgovoril, da ga je premagal on, op. p.; ex1Vprašanje se morda zdi absurdno, vendar je nekaj vzporednic.; ex1Novinarka s sladoledasto rumenim mikrofonom je sladko žuborela, da so ali pa niso resnične trditve, po katerih je slovenska vojska z nakupom orožja v bližnjevzhodnih državah kršila brionski moratorij, in napovedala kontaktno oddajo, v kateri bodo poslušalci odgovarjali na vprašanje: »Zakaj menite, da jastogovo mesto povzroča raka?; ex1Sachsu sem hotel zastaviti stotino vprašanj, vendar nisem mogel.; ex1Ali ne bi zadoščalo, da bi ostali pri vprašanju: kateri je vaš materni jezik?; ex1Nenavadno je, da so se nasprotniki vprašanja, katere narodnosti ste, oglasili šele po objavi podatkov.; ex1Vprašanje je le, s kakšno željo po sožitju bodo tam.; ex1Vprašanje, na katero ste že večkrat v zadnjih dneh odgovorili.; ex1Odgovora na ta vprašanja ni bilo, primer pa je pokazal, da ta »nacionalno priznana« ocenjevalca lahko ustrelita mimo prav tako, kakor so, večinoma namerno, streljali mimo toliko napadani borzni analitiki z Wall Streeta, ki so priporočali nakupe delnic korporacij tudi, ko je šla njihova vrednost navzdol.; ex2Mogoče ste ga vznemirili, kar se tiče vprašanja o njegovem alkoholizmu.; ex2EU je po Bučarjevem mnenju poskus zapiranja, zato se zastavlja vprašanje, kakšno je mesto Slovenije v tem zaprtem sistemu.; ex2Dokazila v portfoliu dajejo odgovore na vprašanja: »Kdo sem?; ex2«, ključno vprašanje, ki si ga posameznik zastavlja, ko reflektira svoj napredek, pa je: »Kako to vem?; ex2Takoj je vzpostavil očesni stik z menoj in tudi odgovarjal na moja vprašanja (ime, starost, kje je doma …; ex2Smešno vprašanje, boste rekli, saj samo odpro usta in že so polne vode.; ex2Vprašanje pa lahko postavimo tudi drugače, ali so ribe kdaj žejne?; ex2Glede zadnjega dela vprašanja vam moram priznati, da o tem problemu še nisem nič slišal.; ex2Povprašal sem nekaj kolegov, ki tudi niso vedeli natančnega odgovora na vaše vprašanje.').
