g(107221094,'exSledi povzetek zgodbe ali dela zgodbe, ki je za razumevanje lika ključna.; exZGODBE PREOBLAČENJA, KJER JE IDENTITETA PREVZETA ZA DALJŠE OBDOBJE, V FIKCIJI IN V FILMU NISO REDKOST.; exPODOBNA ZGODBA JE V PRIBLIŽNO ISTEM ČASU BURILA DUHOVE V ZDA, LE DA JE ŠLO ZA ŽENSKO, KI JE SKORAJ VSE ODRASLO ŽIVLJENJE PREŽIVELA KOT MOŠKI IN SO NJEN SPOL PRAV TAKO ODKRILI ŠELE PO SMRTI.; exZGODBA JE BILA PRIREJENA ZA FILM BALADA O MALEM JOEJU.; exPiše se leto 1666, zgodba je postavljena v Novi Jeruzalem.; exKer ima vsako svojo zgodbo o stvarjenju, lastno zgodovino božjega posega, svoje predstave o tem, kaj šteje za greh, je bog skozi prizmo verskih doktrin razcepljen v nešteto refrakcij.; exOmenili smo že, da je dejanje v Beneškem trgovcu dokaj zapleteno, vsaka od navzočih zgodb bi lahko predstavljala tudi enoto zase.; exPrav tako izzivalna je zelo rafinirana zgodba drame, čeprav je bil to prvenec tega avtorja; tematsko prepoznaven in sprejemljiv za današnji čas je tudi dramatikov gnev, ki je uporaben za navezavo te igre na sodobnost.; exNekega dne sem slišal zgodbo o vrtiljaku sester usmiljenk.; exZgodba mi ni in ni šla iz glave in sanjaril sem, da bom našel levje krilo, z njim povrnil čarovnijo vrtiljaka in se s sestro zavrtel na njem.; ex1Pisateljica vedno izhaja iz osebne (popotniške) izkušnje, njeno pisanje prežemajo stvarni zgodovinski in geografski podatki, opisi afriškega okolja in komentarji, v katerih simpatizira z afriškimi domačini ter posredno ali neposredno opozarja na kvarni vpliv kolonizacije, ki je tako močno zaznamovala današnjo podobo Afrike, vendar pa vse to uokvirja v literarno oblikovano zgodbo.; ex1Ali je slišala Keza, kako mlajšim otrokom pripoveduje zgodbe, po katerih se je zdelo, da je Vrana lastnoročno rešila vse čarodeje v skupini ter obenem potolkla vsaj pol federalne vojske.; ex1Ko ga mati objame in mu zapoje pesmico ali pove kratko zgodbo, nevede otroku privzgaja občutek, da je to nekaj lepega.').
