g(107289014,'exVse bolj pa se oglašajo, ko imajo druge težave - zlasti pri učenju, v svojem razvoju in stiskah.; exOdklenkalo pa bi predvsem mazačem, ki nepošteno služijo denar, težave pacientov pa ostajajo, se večajo in celo njihovim bližnjim onemogočajo človeka vredno življenje.; exPojasnite, da vam ni nič dolžan in da upate samo to, da bo tudi on skušal pomagati drugim alkoholikom, ko se bo sam izvlekel iz težav.').
