g(107935504,'exIz ustja pristanišča je pritekala v zaliv sveža voda.; exKo potapljač koralo odlomi in prinese na kopno, se bitjeca skrijejo v notranje kanale, po katerih kroži voda, in človek vidi samo rdeče kamnito drevesce.; exKadar si umivate lase, pazite, da vam voda ne bo šlazaide voda v ušesa, zato v vsako uho vtaknite kosem vate, namočene v vazelin, ki jo potem odstranite.; exIn to v živalskem vrtu, za katerega si tako in tako plačal visoko vstopnino, ki za otroke, starejše od dveh let, stane sedemsto tolarjev, za odrasle pa čez tisoč ,in kjer voda stane 250 tolarjev, kornet pa celo malce več.; ex- Preprečite zadrževanje vode - omejite porabo soli, uživajte hrano, ki vsebuje dovolj beljakovin, pijte čim več vode, ne jemljite diuretikov, ne zatekajte se k laksativom, nehajte kaditi in spite v privzdignjeni postelji - glava naj bo niže kot noge.; exJe mož, ki zmeraj vključi svetilko in jo podrži v obraz, ki z zavihanimi rokavi štorklja po sobi in pri katerem si je treba kozarec vode šele zaslužiti.; exSmešno vprašanje, boste rekli, saj samo odpro usta in že so polne vode.; exIn tudi ob hranjenju nedvomno nekaj vode konča v ribjem želodcu.; exPREHRANA: Izogibajmo se pitju vode iz vodnjakov, uporabi ledenih kock v pijačah itn.; exČe vode ne moremo prekuhati, jo razkužimo z dodajanjem tablet joda v skladu z navodili proizvajalca ali uporabljamo filtre preko filtrov z mikrometrskimi porami.; ex1Kislega zelja nikoli ne spiramo z vodo, ker s tem odstranimo hranilne snovi.; ex1Tako imenovana endemična golšavost je bila značilna za tiste kraje, kjer v vodi in hrani primanjkuje joda.; ex1Na Lomu, okoli 300 metrov stran od sedanjega akumulacijskega jezera, so zgradili še eno, v katerem bo trikrat več vode kot v obstoječem.; ex1Jezero že polnijo z vodo, tako da bodo ob dovolj nizkih temperaturah pripravljeni za izdelavo kompaktnega snega.; ex1Udeležence že opozarjajo, naj med tekom ne jemljejo vode iz rok neznanih mimoidočih gledalcev.').
