g(107942152,'exLahko so posledica vnetja vek, ki je pogosto pri ljudeh, ki trpijo za alergijami, lahko so posledica vnetja veznic, dehidracije, stresa, preutrujenosti …; ex"Menimo, da uporaba GSO v kmetijstvu ogroža ekonomski obstoj konvencionalnih in ekoloških kmetov, poleg tega nihče ne ve, kako bo njihova uporaba dolgoročno vplivala na okolje in zdravje ljudi.; exTudi v svetu običajno na referendume hodi manj ljudi kot na volitve, morda pa imajo zato tudi manj referendumov kot volitev.; exOdvisno je le od strankarskih vodstev, od ljudi pa prav nič, volitve gor ali dol.; exPa imate dovolj znanja, ljudi in poznavanja trgov za razvoj v tujini?; exZadovoljni policisti in ljudje z območja Policijske uprave v Mariboru; exV Vipapu pripravljajo tudi program presežnih delavcev, nekatere so že prekvalificirali in zaposlili v podjetjih, s katerimi poslovno sodelujejo, kljub temu pa bo kakih 360 ljudi konec leta ostalo brez službe.; exTeden je bil poln predavanj, slikanja, petja, druženja; namen teh dejavnosti je mogoče razbrati že iz samega naziva kulturne nedobičkanosne organizacije, ki nima ne političnih ne verskih omejitev: zavedati se lastne kulture in kulture drugih ljudi, razlike, ki obstajajo med njimi, pa narediti plodne.; exMilan Kučan je dejal, da je raziskovanje ena od poti do bogate dežele in sožitja med ljudmi ter naravo.; exNekatere fotografije, ki so nam jih dali za objavo, sicer razkrivajo njihove obraze, vendar pravijo, da jih večina ljudi ne bo spoznala.; ex1Ko kateri od testnimi ljudmi zapusti sobo, v kateri mu dajo na voljo nov izdelek, na primer nov depilator, strokovnjaki lahko izvedo veliko novega.; ex1Ljudje "tehnične pomočnike" namreč različno uporabljamo, različno občutimo lagodje in bolečine, različno se lotimo dela, itd.; ex1Radi boste z ljudmi, ki bodo veseli, razigrani in vas bodo spravljali v smeh.; ex1« Rad se druži z različnimi ljudmi in uživa v dolgih pogovorih z njimi.; ex1Navdušena je bila nad samostojnim delom, sodelovanju z ljudmi z vsega sveta, v službi je veliko potovala tako po Franciji kot po svetu.; ex1V trgovinah se je trlo ljudi, na tržnicah so jabolka stala po ameriško zloščena in postavljena v čedne kupčke, na uličnih tržnicah je vladalo azijsko izobilje poceni kopij najmodernejših sončnih očal, kičastih lasnih okraskov in spodnjega perila sumljive kakovosti.; ex1Poročilo je glavni inšpektor za anatomijo Jeremy Metters predstavil po dveletni raziskavi, s katero je ugotovil, da so med leti 1970 in 2000 brez dovoljenja svojcev v raziskovalne namene skoraj 100.000 ljudem odstranili možgane in jih predali univerzam in raziskovalnim inštitutom.; ex1Evropski prvak v kategoriji Masters Rob Costa je dejal: Strinjam se, da je treba skoke v vodo približati ljudem, vendar bi na tekmovanjih rad videl dovolj visoke standarde.; ex1Med ljudmi so se širile govorice.; ex1Ko se je zgodila tragedija Jacka Frosta, so se ljudje spominjali, kako so sami kupovali slaščice pri morilcu in se pomenkovali z njim.; ex2In Resnica, ki so jo ljudje začeli kupovati, ne od prodajalcev časopisov, temveč čez vrtno ograjo, je prinesla popolno poročilo s fotografijami.; ex2Zdaj ljudje tekajo kar čez tire ali se plazijo ob strugi potoka; ex2Travma torej ni zgolj proces, ki človeka osami in naredi drugačnega od vseh drugih ljudi, temveč lahko tudi ustvarja skupnost.; ex2Vse je torej v človeku in v spletu dogodkov, ki jih povzročajo ljudje s svojimi različnimi interesi, značajskimi potezami in strastmi.; ex2O človeškem srcu govorijo Sveto pismo Stare in Nove zaveze, mistiki, pesniki in pisatelji ter ljudje v vsakdanjem pogovoru.; ex2Ljudje so nad to najino točko navdušeni.; ex2Ena od najpogostejših napačnih domnev pri ljudeh je, da denar sam po sebi prinaša le pozitivne lastnosti, večne dobičke in nič slabega.; ex2Vojni se ne morejo izogniti niti ljudje, ki živijo v bližini.; ex2Danes so vojne drugačne, ljudje in narava so se v stoletjih verjetno manj spremenili.; ex2Potem je še z nekaterimi ljudmi začela širiti govorico, da sem prosrbsko usmerjena.; ex3Golf v Evropi in svetu še zdaleč ni šport elite, saj ga igra okrog 70 milijonov ljudi, kar ga uvršča med najbolj množične športe.; ex3Ta je grškim bogovom ukradel ogenj in ga dal ljudem ter s tem ustvaril človeštvo.; ex3Ima jo približno en odstotek ljudi.; ex3Seveda je že slišal imena, ki jih je rdečebradec tako maziljeno našteval, poznal je palače in muzeje, ki so se imenovali po njih, toda o ljudeh s tem imenom ni vedel ničesar.; ex3• V EVROPSKI UNIJI ŽIVI 50 MILIJONOV LJUDI V REVŠČINI, 5 MILIJONOV JE BREZDOMCEV.; ex3V ZDA KAR 30 MILIJONOV LJUDI NIMA DOVOLJ HRANE.; ex3Se ne bi mogli ljudje v medijih, pisatelji, gospodarstveniki povezati, da bi stran za stranjo prelistali preteklost, tudi temne strani, da bi pred nas tako objektivno razgrnili predstave o zgodovini in zgodovinske interpretacije, ki jih imamo, da pretrgamo z njimi?; ex3Wesley Snipes, mejaško-psihopatski narko-baron v filmu New Jack City, pa ima drugačno vizijo: v getu vse »meje« še niso osvojene, zato ga je treba preleviti v post-utopično in ultra-korporirano zaprto trgovsko državo, Enterprise (marketing & strategija, consulting & kompjuterizacija), podobno tistim iz filmov Escape from New York (Manhattan an sich), Blade Runner (L.A. an sich) in Robocop (Delta City), v kateri je »užitek« mogoč le v pogojih totalitarizma (»uživajoče« crackerje v Enterpriseu ščitijo ljudje z avtomati).; ex3Ljudem, ki so živeli v Jugoslaviji, je dajala eno samo skupno identiteto, in ta je bila socialistična.; ex3Ljudi je družil komunizem.; ex4Liberalno demokratsko stranko pa je tudi v poslovni svet zapustila peščica dovolj opaznih ljudi (recimo Igor Bavčar, Zoran Thaler, Igor Omerza, Jože Lenič in nazadnje Gregor Golobič), da je javnost postala pozorna.; ex4Toda v vlogi goljufivega vaškega zdravnika, ki ljudem izbija iz glave zdravje, je neprimerljivo večja moč: sodobna medicina.; ex4Dvojčki imajo namreč drugačen odnos do vedenja drugih ljudi, kot ga imajo do lastnega.; ex4Zame je tu cela vrsta vprašanj; jaz se sicer ne spoznam na stvari, ampak če postavi trditev, da na eni strani tega kadra manjka, na drugi strani pa je cela vrsta ljudi, ki so na zavodu za brezposelne, potem je zame pač zelo jasno vprašanje: tem je treba več plačati, drugače jih ne bomo dobili.; ex4Sedaj, ali se hoče kompenzacijo s tem narediti - če teh ljudi manjka - da se jim da višji "titel"; ne vem, kako to skupaj gre.; ex4Urad za priseljevanje beguncev je namreč v dogovoru z republiškim prehodnim domom za tujce v Hrastniku že leta 1997 naselil tudi ljudi brez statusa začasnega begunca - največ s Kosova, tedanji varuh človekovih pravic Ivan Bizjak pa je ob obisku centra jasno povedal, da želi država v Hrastniku urediti eno od izpostav prehodnega doma za tujce in da v bližnji prihodnosti še ne razmišljajo o tem, da bi hrastniško lokacijo zaprli.; ex4« Čisto možno je, da se je večina ljudi v restavraciji lepo držala navodil, naj se ne gane, pri čemer je hlastala za zrakom, razbijala šipe in plezala na mize, da ne bi zgorela.; ex4Če se bo uresničila napoved o koncertu, bo gotovo zapel tudi za ljudi v jugovzhodni Aziji.; ex4Ljudje so razumeli, da se morajo imeti radi med seboj in da morajo bolj čuvati vero, ki so jo prejeli.; ex4In ljudje si ponavadi želijo tistega, kar se jim zdi, da od življenja lahko pričakujejo.; ex5Ljudje te drobne bele pikice, lahko je le ena ali pa jih je več, imenujejo tudi afte.; ex5Inštitut za varovanje zdravja namreč ocenjuje, da presežena predpisana meja ne predstavlja nevarnosti za zdravje ljudi.; ex5Ljudje so začeli kričati.; ex5To primerjavo Gorenjske z drugimi regijami oziroma s slovenskim povprečjem so napravili v omenjenem zavodu na podlagi ugotovitev raziskave o vedenjskem slogu ljudi, povezanem z zdravjem, ki je bila napravljena na reprezentančnem vzorcu prebivalcev iz vseh slovenskih regij v starosti od 25 do 65 let.; ex5Ljudje s seboj nosimo množico podob sveta, ki ga še nikoli nismo videli, razen morda po televiziji.; ex5Ljudje časopise, kot je vaš, ponavadi pripisujejo brezdomcem, ki jih v glavnem tudi prodajajo.; ex5Bolezen norih krav (BSE - Bovine Spongiforme Enzephalophatie) vsesplošno vznemirja ljudi tako po svetu kot tudi pri nas.; ex5Kakih sedem metrov niže sem pred seboj zagledal rov, ki so ga ljudje izkopali že pred 180 leti.; ex5Vse to so izdolbli v strjen peščenec ljudje, oboroženi le z dleti, katerih sledovi so tu in tam še zdaj vidni na stenah, in čvrsto odločnostjo, da dobro opravijo svoje delo.; ex5»Naši pogledi na lepoto,« pojasnjuje Emmanuele Janini, italijanski profesor medicinske seksologije, »so nastali kot instrument za prepoznavanje bistvenih lastnosti evolucije vrste, pri čemer so ljudje uporabljali signale, ki niso bili besedni.; ex6Čeprav je jasno, da je manananggal plod bujne domišljije, je takrat mnogo ljudi trdno verjelo, da obstaja, in še po toliko letih se ga še vedno bojijo.; ex6Po hodnikih so že hodili ljudje in se pogovarjali.; ex6TEHNIK - EKONOMSKI (splošni); Ž; mariborska;; MARIBOR; 1987; Agencija RS za plačilni promet;; računovodstvo, plačilni promet, sposobnost vodenja in javnega nastopanja, delo z ljudmi, terensko delo, poznavanje dela na računalniku;; banka, pisarniško delo kjerkoli;; programirano, kreativno; administrativno, strokovno; neposredni izvajalec, nižji vodja, srednji vodja; 31292; ex6Nujno pomoč je potrebovalo 48 ljudi, 21 jih je pristalo na internem oddelku.; ex6Kot so na hitro našteli stanovalci, biva v ulici, ali bolje na območju, ki pogreša omenjeni pločnik in razsvetljavo, več kot 30 ljudi.; ex6Ni čudno, če ljudje ne utegnejo izklopiti televizije, preden zaspijo.; ex6Ta mu je tudi osebno grozil, od ljudi pa je slišal, da je obtoženi govoril, »da bo vse v luft spustil«.').
g(107948314,'exPot do novega izdelka ali le do izboljšave je dolga vsaj leto dni in terja delo različnih strokovnjakov, raziskovalcev trga, razvojnih konstruktorjev, oblikovalcev, psihologov, strokovnjakov z določenega področja raziskav in razvoja (če gre za gospodinjstvo, sodelujejo tudi kuharji, pri osebni negi pa ne gre brez medicincev) in tudi ljudi s ceste.').
