g(108049401,'exZačetki muzeja so povezani z izjemno zbirateljsko vnemo učitelja Bogdana Žolnirja (1908-1998), ki ga je okrajna organizacija Zveze borcev leta 1949 postavila za predsednika t. i. zgodovinske komisije, ob uradni ustanovitvi muzeja leta 1951 pa za prvega ravnatelja Okrajnega muzeja NOB.; exPri tem sta jim v veliko pomoč, na Kokrsko sedlo iz Konca in na Kamniško z Jermance, ki pa lahko varno obratujeta le brezhibno vzdrževani, kar je velik in zahteven zalogaj, pravi predsednik Dušan Štefula, ki ve, kaj govori, saj je pri Planinski zvezi Slovenije zadolžen za nadzor nad vsemi tovornimi žičnicami v naših gorah.; exReprezentanca je zame dokončna, saj je izbrana po kriterijih Kajakaške zveze Slovenije.; exVčeraj se je vnovič sestal izvršni odbor Hokejske zveze Slovenije, ki naj bi razpravljal o spremembi tekmovalnega sistema za naslov državnega prvaka, potem ko so iz lige izključili ekipo Acroni Jesenic.; exZategadelj si s svojim trenerjem, ki so ga v Avstraliji neutemeljeno očrnili zaradi domnevne dopinške afere (Tureckij zato zdaj toži avstralsko plavalno zvezo), želi predvsem miru v prijetnem okolju švicarskih Alp.; exDanes ljudje, ki so delovali v nekdanji Jugoslaviji, ob meni še Jani Koman in Jože Mikeln, v strokovnih organizacijah zveze nimamo nobene vloge.; exPredstavniki podpisnikov vsesplošnega kulturnega protesta proti napovedanim spremembam davčne zakonodaje (podpisana strokovna stanovska društva, združenja, zveze, sindikati skupaj štejejo več tisoč članov) so za konstruktiven dialog s politiko, zato bodo nekatere svoje predloge (in na pogajanjih večkrat poudarjena stališča) skušali v obliki amandmajev spraviti na poslanske klopi.; exNa koncu bi vas spomnil še na slogan javne tribune 12. maja 1988 v Unionski dvorani, ko je bila ustanovljena Slovenska kmečka zveza.; exGre za najdaljšo kazen zaradi kokaina, ki jo je izrekla italijanska nogometna zveza.; ex"Pagotto ni želel sodelovati pri raziskavi primera, zato je kazen tako ostra," so pojasnili na zvezi.; ex1Seveda pa bi bilo fantastično, da slovenska zveza dobi povabilo.; ex1Zvezo komunistov so že zgodaj, kmalu po vojni, zapuščali najbolj premeteni, ki so potem navadno končali kot direktorji uspešnih podjetij.; ex1- Mednarodna atletska zveza (IAAF) je potrdila datume mitingov za zlato ligo prihodnje leto.; ex1Pričakovanja Šahovske zveze Slovenije so na načelni ravni zelo velika, vendar pa mladi igralci od nje nimamo pravih spodbud.; ex1V pokalu evropske plavalne zveze LEN bosta nastopila dva slovenska kluba.; ex1Študente podpirajo tako rekoč vse albanske stranke, nekatere bolj odkrito, druge manj, le najbolj množična Demokratična zveza Kosova za zdaj še ni povedala svojega mnenja o njihovih zahtevah.').
g(108049989,'deskupnost samostojnih suverenih držav, ki so bile skoraj vse bivši teritoriji oz. kolonije Britanskega imperija').
g(108050678,'exV deželni vladi so uredili Urad za narodnostne manjšine in jim dali vedeti, da so za njih pomembne in da spoštujejo ter podpirajo njihova hotenja, njihovo identiteto v kulturnem in jezikovnem smislu.; exNa vprašanje, ali ne bi bilo bolje, da vlada uredbo spremeni, kot pa da jo (vključno ali na čelu z uradom predsednika vlade) krši, pa je Osolnikova odgovorila, da formalnopravno to sicer drži, vendar pa ocenjuje, da je bolje, da so pri napredovanju nekatere izjeme, kot pa da na splošno znižajo merila, kar vsekakor ne bi prispevalo k boljšemu delovanju vlade.; exPotem ko je vlada konec januarja soglasno sprejela program preoblikovanja prostocarinskih prodajaln, se glavno dogajanje v zvezi s to problematiko počasi seli v parlament, saj brez njegovega žegna program ne bo mogel zares zaživeti (prvi pogoj so namreč nekatere novosti in spremembe v carinski zakonodaji).; exPredstavniki vlade pa opozarjajo, da Bruselj pri čakanju na naše ukrepe vse pogosteje gleda na uro.; exNič slabega ni, če se znotraj vlade pojavljajo alternativni predlogi.; exTo prakticirajo tudi v drugih vladah.; exČeprav svojih pogledov na povojne dogodke niso mogli vsiliti niti konservativni vladi Helmuta Kohla, kaj šele socialdemokratski Gerharda Schröderja, je predsednica organizacije pregnancev Erika Steinbach dovolj glasna, da zgodovine ne pusti pri miru.; exPod vplivom bavarske CSU je lani evropski parlament pozval k preklicu Beneševih dekretov, pridružil se mu je avstrijski parlament, nemški opozicijski stranki CDU in CSU pa sta na vlado v Berlinu naslovili peticijo, naj stori enako.; exNemci so postali bolj previdni in govorijo, da predlogi niso predlogi nemške vlade, temveč razmišljanja v socialdemokratskem okolju; exZdi se mi, da obravnava gradiv, ki jih vlada pripravlja za obravnavo v državnem zboru, teče relativno v redu in da, čeprav je število točk veliko, uspemo sprejeti veliko zakonodaje, ki je na dnevnem redu.; ex1V zadevo se je na koncu vpletel še predsednik Mednarodnega olimpijskega komiteja Jacques Rogge, ki je vlado v Rimu zaprosil za pomoč.; ex1Zdi se torej, da je slovenski zakonodajalec sledil tudi zahtevi iz Magne Charte, da je »svoboda raziskovanja, poučevanja in študija temeljno načelo v življenju univerz; zato morajo vlade in univerze v okviru svojih pristojnosti zagotoviti spoštovanje te temeljne zahteve«.; ex1Na srečo slovenski vladi in zakonodajalcu ni treba hiteti z reformami pred Berlinom - po njem pa bo mogoče in potrebno premišljeno in odločno vstopiti tudi na tega od evropskih vlakov.; ex1"Dejstvo, da so se predlagatelji vlade dr. Andreja Bajuka odločili za tožbo, pove več stvari.; ex1"Ko predlagatelji Bajukove vlade ocenjujejo, da v državnem zboru ne morejo doseči več kot 45 glasov, torej glas premalo, se zatekajo na vrhovno sodišče, kjer skušajo najti tisto, česar v državnem zboru niso dobili," je dejal Golobič.; ex1Pojavilo se je vprašanje, s kakšnimi novimi ukrepi bi se lahko japonska vlada spoprijela s težavami, pa se kaj bistveno novega ne more povedati.; ex1Predvsem sta zdaj predlagani dve stopnji davka, in sicer po uklajevanju na vladi 19 in 8 odstotkov.; ex1DDV z omenjenima stopnjama in trošarine, katerih uvedbo tudi predlaga vlada, naj bi s stališča proračunskih prilivov zagotovili toliko sredstev (skupaj 13,7 odstotka BDP), kot jih zdaj zagotavlja prometni davek.; ex1»Vlada zavlačuje s sprejetjem zakona.; ex1Po sklepu vlade naj bi delovna skupina, ki jo vodimo, v enem mesecu pripravila antidiskriminacijski zakon.; ex2Ali bo zmogla tudi slednje, pa je veliko vprašanje tudi zato, ker tako rekoč vsi odgovorni v vladi hkrati sami sedijo na visokošolskih stolih.; ex2Vlada ob tem ugotavlja, da so v zaključnih fazah tudi vsi drugi, za izvajanje zakona o gospodarskih družbah pomembni oziroma z njim neločljivo povezani drugi zakonski projekti: revidiranje, notariat, sodelovanje delavcev pri upravljanju, trg vrednostnih papirjev, sanacija, tečaj in podobno.; ex2Da bomo lahko ne samo govorili o pravni državi, pa tudi da bomo imeli urejen pravni red, je seveda treba čimprej oblikovati in sprejeti, in tu Vlada že deluje v tej smeri, vse tiste zakone, ki pomenijo oblikovanje sodobnih učinkovitih, državnih in drugih organov.; ex2Prejeli ste tudi mnenje Vlade Republike Slovenije in Sekretariata za zakonodajo in pravne zadeve.; ex2Vlada ne podpira.; ex2Vlada podpira.; ex2Odbor amandma podpira, Vlada amandmaja ne podpira.; ex2Odbor amandmaja ne podpira, ker podpira amandma Vlade k temu členu.; ex2Vlada vsebinsko podpira, vendar zaradi jasnejše dikcije predlaga svoj amandma.; ex2Glasoval bom za ta amandma, seveda s tem, da bi opozoril, da ta amandma predvideva zakonsko zavarovanje ogroženih vrst in da v dosedanji praksi prihaja do stalnih pritiskov na Vlado, naj dela izjeme, naj dovoljuje določene odstrele, poboje in tako naprej, kar se tudi dogaja v Vladi, ker je veliko lažje delati izjeme, ali pa vsaj zaradi pritiskov se to dogaja, kot se bo to dogajalo v parlamentu.; ex3Najprej bomo glasovali o predlogu poslanca, gospoda Saša Lapa, ki se glasi: Državni zbor ne sprejema poročila v delu, kjer javni pravobranilec Republike Slovenije predlaga Vladi Republike Slovenije, da presodi utemeljenost oziroma smotrnost eventualne spremembe 145. člena zakona o izvajanju kazenskih sankcij.; ex3Vsak dan ob štirih zjutraj jih razpadajoči vlak, ki ga je vlada leta 1937 rabljenega kupila od Nemcev, odpelje na delo v osemdeset kilometrov oddaljeni Rio.; ex3Izvoljenih je bilo tudi sedem ministrov sedanje vlade premiera Jean-Pierra Raffarina, med njimi notranji minister Nicolas Sarkozy in minister za socialne zadeve Francois Fillon.; ex3Socialni demokrati so takoj po objavi prvih volilnih rezultatov sporočili, da se s komunistično stranko nikakor ne nameravajo dogovarjati o sestavi večinske levičarske vlade, dokler se ne bo odpovedala komunističnemu imenu in se opravičila za zločine komunističnega režima.; ex3Takšno razmerje sil, ki je posledica nasprotovanja Zahoda vstopu pravašev v vlado, onemogoča vodji HDZ Sanaderju, da bi Hrvaško kmečko stranko (HSS) izsiljeval z argumentom, da v primeru njihovih pretiranih zahtev lahko sestavi koalicijo s HSP.; ex3Čeprav so bili kmetje pod vodstvom Zlatka Tomčića na volitvah poraženi, saj je število njihovih mandatov padlo s šestnajst na devet, si bodo lahko izborili vpliven položaj v vladi.; ex3Z izjemo obrobne koalicije HSLS-DC s tremi poslanci je HSS za HDZ edina resnejša politična sila, s katero lahko gredo sestavljati vladi.; ex3KI SO GA SKLENILI VLADA REPUBLIKE SLOVENIJE, PREDSTAVNIKI DELOJEMALCEV IN PREDSTAVNIKI DELODAJALCEV (SOCIALNI PARTNERJI), OPREDELJUJE OSNOVNA NAČELA IN CILJE, KI JIH SOCIALNI PARTNERJI ŽELIJO DOSEČI NA PODROČJU POLITIKE PLAČ.; ex3Na brniškem letališču ga je z vojaškimi častmi sprejel gostitelj, predsednik slovenske vlade Janez Drnovšek.; ex3Gre za prvi uradni obisk poljskega premiera v Sloveniji in hkrati prvi uradni dvostranski Buzekov obisk v tujini po imenovanju poljske vlade lansko jesen.; ex4Tehnologijo je razvil svetovalec kanadske vlade dr. Norman L. Arrison, ki je drugim povedal, da v osmih državah po svetu že deluje 27 projektov s tovrstno tehnologijo.; ex4Avstrijska vlada je bila v soboto na odmevnem potepu ob avstrijsko-slovenski meji; ex4Vlada Republike Slovenije je odgovorna za prevoz osebja slovenskega kontingenta, njihovega orožja in opreme brez stroškov za Nato iz določenega kraja do njihovega štaba na območju operacij in vrnitve v skladu z medsebojno določenim razporedom kroženja.; ex4Toda v minulih dveh tednih smo, res ne pretirano javno, pripravljali ukrepe, ki jih je vlada zdaj sprejela.; ex4Čakanje je povzročilo nekaj nervoze, ki se je izražala v različnih pismih predsedniku vlade in drugim ministrom.; ex4Tako jih je brez zadržkov podprla kosovska albanska vlada v pregnanstvu, pridružil pa se jim je tudi Forum albanskih razumnikov iz Prištine.; ex4Ob tej priložnosti je dejal, da želi vlada izboljšati pogoje za delovanje obrtnikov in podjetništva v državi in resno razmišlja o tem, kako odpraviti različne administrativne ovire.; ex4Letos je vlada izdala dovoljenje za letalsko obrambo do 30. septembra in do takrat bomo določili ukrepe za prihodnje leto.').
g(108052227,'deprvobitno pomenilo, mesto s katerega je sultan spremljal spore in opravljal državniške posle').
g(108056873,'deplanirana skupnost z visoko stopnjo socialne interakcije v Izraelu').
g(108058098,'exSlovenska razvojna družba (SRD) je včeraj sprejela enotno ponudbo pooblaščenih investicijskih družb za nakup delnic, tistih, ki še nimajo porabljenih vseh lastniških certifikatov.; exNekaj je je bilo v zadnjih letih, vendar so, zlasti na Koroškem, ta podjetja žalostno propadla.; exV Vipapu pripravljajo tudi program presežnih delavcev, nekatere so že prekvalificirali in zaposlili v podjetjih, s katerimi poslovno sodelujejo, kljub temu pa bo kakih 360 ljudi konec leta ostalo brez službe.; exNamesto da bi država naročila vsaj predinvesticijsko študijo ali preučila možnosti, kako bi lahko pomagala podjetju in občini, je predloge že na začetku zatrla.; exZdravilišče Laško je lanske prihodke povečalo za 22 odstotkov, na 2,4 milijarde tolarjev, dobiček družbe pa bo po prvih ocenah znašal približno 75 milijonov tolarjev, kar je štiriodstotna donosnost na kapital.; exSkupina TPV je nastala iz nekdanjega IMV, kjer so proizvajali dostavna in vojaška vozila, danes pa združuje več podjetij z domačim in mešanim kapitalom.; exPodjetje je bilo zaradi izgube jugoslovanskega trga v začetku 90. let na robu propada, vendar so vodstvo in vsi zaposleni podjetje olastninili in se za dobavo novomeškemu Revozu povezali s tujim partnerjem.; exPri nas pomanjkanje časa (verjetno) še ni tako pereče, da bi v kakšnem izmed podjetij že razmišljali o tem, da bi učinkovitost dela proizvodnega in vodstvenega kadra izboljševali s takimi metodami.; exČeprav je zaostajanje za časom pogost problem naših podjetij, pa v primeru spanja na delovnih mestih temu ni tako.; exVnovično uvajanje »pridobitev socializma« bi bilo namreč zelo nevarno za produktivnost, konkurenčnost in s tem povezan obstoj naših podjetij.; ex1Vodja projekta Phare in predstavnik danskega tehnološkega inštituta Ib Sejersen pa je dejal, da slovenska podjetja večinoma že ravnajo v skladu z evropskimi predpisi, čeprav ta za zdaj še niso zavezujoča.; ex1»Pozna uveljavitev zahtevane tehnične zakonodaje za majhna in srednje velika podjetja bo pomenila izgubo koristi, ki jih bo prinesel skupni evropski trg,« je poudaril vodja delegacije Evropske komisije v Sloveniji Erwan Fouere.; ex1»Ko podjetje postane tarča prevzema, lahko menedžment zelo hitro vpliva na zaposlene, prav ta podpora je nujna, saj je integracija podjetja kasneje veliko uspešnejša.; ex1Najmanj uspešne so združitve enakih podjetij, ker se pojavi težava, kdo bo prevzel vodilno vlogo v podjetju, katera blagovna znamka bo prevladala.; ex1»Če so naša podjetja tarča, so vedno zadržana, vprašanju vlaganj in prevzemov na tujem pa so naklonjena.; ex1Pivovarna Laško je ugotovila, da multinacionalne družbe z nakupom podjetja dobijo tudi lokalni tržni delež, zato je skušala braniti svoj položaj doma in postati sama prevzemnik z nakupom Unionovih delnic.; ex1Mag. Franc Avberšek, direktor velenjskega podjetja, ki je skupaj s Kulturnim centrom Ivana Napotnika iz Velenja in z mentorji zasnoval raziskovalni tabor, je zelo zadovoljen z letošnjim potekom tabora, udeleženci in z njihovimi dosežki.; ex1»Gospa Ryan je potrdila, da je njen mož Jimmy, zaposlen pri gradbenem podjetju Sama Krausa, danes nameraval na sestanek na ladjico Cornelia II,« je govoril Brennan.; ex1»Nell, ko je Jimmy zaprosil za službo v podjetju vašega moža, se nista srečala -- o tem sem prepričana.; ex1- Francosko-slovenski klub CFME-ACTIM je v sodelovanju s francoskim veleposlaništvom v Sloveniji in podjetjem Aquasystems d.o.o. organiziral konferenco o čiščenju odpadnih vod.; ex2V Ameriki imajo že kar v 40 odstotkih podjetij za potencialne kandidate pred sprejemom v službo pripravljene teste na drogo.; ex2Tudi pravilniki podjetij vključujejo ukrepe za delavce, ki bi bili na delovnem mestu pod vplivom mamil.; ex2Do tega je upravičen le upravljalec javne poti (občina, komunalno podjetje), kamor naslovite vaš zahtevek.; ex2Dolenjske gospodarstvenike je zanimalo, ali bi bilo mogoče pri urejanju tehnične regulative v skupnosti priti do rešitev, ki bi enotno veljale za vse države hkrati, kajti Trimo mora za vsako državo dobiti posebne certifikate, kar trebanjskemu podjetju jemlje veliko časa in denarja.; ex2Izkazalo se je, da so slovenska podjetja slabo organizirana, da bi lahko konkurirala za ta denar.; ex2Lastniška struktura Belinke se v zadnjih dveh mesecih, razen rahlega povečevanja števila delnic, do katerih je z novimi nakupi prišla Krekova družba, ni bistveno spremenila.; ex2Kapitalska družba, Slovenska odškodninska družba ter Krekov pid Zvon 1 imajo v lasti po od 10 do 12 odstotkov delnic, pomembnejši lastnici sta še Nacionalna finančna družba in Atena, v rokah notranjih lastnikov, ki jih po besedah direktorja delnic Belinke večinoma ne nameravajo prodati, pa je okoli 30 odstotkov lastništva.; ex2Letošnje letno poročilo evropske komisije navaja velik napredek pri postopkih za ustanavljanje podjetij, boljši dostop podjetij do elektronskega poslovanja, uvajanje različnih oblik podjetniškega izobraževanja na visokih in srednjih šolah, na drugi strani pa tudi opozarja na zanemarjanje vprašanja učinkovitega zastopanja interesov malih podjetij na nacionalni in evropski ravni.; ex2Roland Waeyaert, direktor belgijskega združenja malih in srednjih podjetij UNIZO (foto M. K.); ex2Prav to je glavni adut opterona, saj bo podjetjem in razvijalcem, še posebno v poslovnem svetu, tako omogočeno varčevanje.; ex3Družba Primorje Ajdovščina je prevzela Gradis gradbeno podjetje Ljubljana (GPL), prevzem je v avgustu odobrila tudi Agencija za trg vrednostnih papirjev.; ex3Sledile so zamenjave v upravi, saj je nadzorni svet Gradis GPL za novega predsednika uprave družbe s petletnim mandatom imenoval Tomaža Rojsa, za člana uprave pa Damjana Trošta.; ex3Rojs je zamenjal dosedanjega prvega človeka družbe Stojana Ložarja, odpoklicali pa so tudi njegovega namestnika Iztoka Zupančiča.; ex3Kopica kaznivih dejanj, o katerih policija še dobiva obvestila, povezana s podjetji; ex3Po besedah Bojana Lučovnika, generalnega direktorja Adrie, bo družba svoje aktivnosti odslej koordinirala skupaj z ministrstvoma za promet in zunanje zadeve, torej je vendarle možnost, da Jat dovoljenja ne bo dobil.; ex3Če ga bodo do pomladi našli, bodo z gradnjo nadaljevali, sicer pa bodo podjetje, ki so ga ustanovili za gradnjo in upravljanje s smučiščem, pahnili v bankrot.; ex3Direktor podjetja Steve Jobs, ki je v zadnjih treh letih podjetje vodil izjemno uspešno, je napovedal nove programske in strojne izdelke.; ex3Ti naj bi dolgoročno zaznamovali usmeritev podjetja predvsem v izdelavo večpredstavnih vsebin za zdaj za MP3 in DVD.; ex3Podjetje, ki v Šaleški dolini in delu Zgornje Savinjske doline skrbi za odvoz teh materialov, v svojo dejavnost vključuje okoli 14.000 gospodinjstev.; ex3Zelo nizka številka po eni strani, po drugi pa za podjetje ugodna.; ex4Tako morajo slovenska komunalna podjetja najemati drage tuje firme, ki naše odpadke potem izvozijo, domača podjetja pa morajo plačati okoli 400 tolarjev za kilogram teh odpadkov.; ex4Tako se večkrat zgodi, da so podjetja še vesela, če občani ne zberejo kaj dosti teh odpadkov, saj bi sicer račun kaj hitro pokazal rdeče številke.; ex4Tehnološki park je zasnovan kot oblika t. i. podjetniških inkubatorjev, kjer novoustanovljena inovacijska podjetja dobijo pomoč lokalne skupnosti ali države z namenom, da pod ugodnejšimi pogoji razvijejo in ustvarijo pogoje za samostojno delovanje.; ex4Miroslav Cerar ml. meni, da za sporno financiranje niso odgovorna samo podjetja, ampak tudi stranke; ex4Tudi poslovni rezultati družbe Philips Electronics so boljši od pričakovanih, kar je bila posledica boljše prodaje polprevodnikov.; ex4Pričakujemo, da bo za naša srednje velika mesarska podjetja še dve ali tri leta po vstopu v Unijo veljala zakonodaja, ki ureja delovanje malih mesarskih obratov.; ex4Ta podjetja namreč rabijo več časa, da bodo lahko povečala proizvodne zmogljivosti, dodatno izobrazila zaposlene itd.; ex4S preiskavo bodo skušali odkriti, kakšen je notranji in zunanji nadzor kakovosti v vrhunsko zavarovanem podjetju.; ex4Vsaka družba si namreč želi dobro poslovati in tega, da bi pri uresničevanju njene razvojne vizije sodelovali tudi lastniki.; ex4Med številnimi ponudniki kmetijske tehnike smo v Veroni odkrili tudi podjetje Bonino.; ex5Lahko se pozanimate pri proizvajalcu Bonino, Via Torino 173, 12048 Sommariva Bosco, Italija tel., faks: (0039) 0172 54132 ali pri naših podjetjih, ki sodelujejo z Italijo.; ex5Sredi osemdesetih pa je v kritiki samoupravnega podjetja razvil teorijo dinamične zmožnosti podjetja, v katere središče je postavil produkcijski faktor podjetništva.; ex5Institucije civilne družbe (na primer Svetovni slovenski kongres) bi morale pozvati k bojkotu nasilnih trgovinskih središč, ki z zvenečimi avstrijskimi imeni ustvarjajo nelojalno konkurenco domačim podjetjem, denar pa prelivajo tja, od koder prihajajo najmočnejši sunki protislovenske politike, to je v Avstrijo.; ex5Zvezo komunistov so že zgodaj, kmalu po vojni, zapuščali najbolj premeteni, ki so potem navadno končali kot direktorji uspešnih podjetij.; ex5Seveda postane plakatniška ošabnost bolj jasna s podatkom, da naročnik plakata, hvalabogu, ni kakšna ženska organizacija, ampak kar plakatniško podjetje, ki v poletni suši naročil pač noče puščati belih lis, ampak si narediti nekaj samopromocije.; ex5Ko bo zakon o družbah, prepričani smo, da bo sprejet, sprejet, se bo pravo delo šele začelo.; ex5Gre namreč za popolno seznanjanje z njegovo celotno vsebino, tako znotraj podjetij, znotraj državnih organov in znotraj drugih institucij.; ex5Namreč, to je sicer splošno določilo, vendar so mi pa mnogi pravni strokovnjaki tolmačili ta člen tako, da bi za to, ker je tukaj jasno navedeno, katere so republiške javne službe, lahko bilo tem podjetjem, ki bi, recimo, imela službe incineracije, onemogočeno to aktivnost, to dejavnost tudi opravljati.; ex5Povedati vam moram to, da mnoga podjetja že sama skrbijo za to, da bi odstranjevala svoje odpadke, ki jih zelo dobro poznajo in da imajo mnoga podjetja že odprte investicije v tem smislu in ne bi bilo prav, da bi jim takšna dikcija, kot jo predlagatelj predlaga, to onemogočila ali pa, da bi jih privedla v dvom, če to sploh lahko počnejo ali ne.; ex5Zato bi vas prosila, da to podprete; torej v korist tistim podjetjem, ki so sama, ne glede na to, da bi jih kdo prisiljeval, že začela investicije in so vložila precejšnja sredstva za odstranjevanje lastnih odpadkov, ki jih najbolje poznajo.; ex6Hkrati sodeluje tudi z mnogimi podjetji kot svetovalec pri razvoju novih tehnik menedžmenta, ki predvidevajo srečne in zadovoljne uslužbence kot glavni razlog za uspešno in dobičkonosno poslovanje.; ex6LJUBLJANA Ministrstvo za zdravje je s šestmesečno odločbo javnemu podjetju Vodovod- kanalizacija (VO-KA) dovolilo uporabo pitne vode, in sicer kljub prekoračeni vsebnosti nekaterih pesticidov, na primer atrazina, desetilatrazina in 2,6-diklorobenzamida.; ex6Kot smo že poročali, je ustavno sodišče zavrnilo pritožbo gradbenih podjetij SCT in Impregilo.; ex6Kako so lahko vodilni marketinški delavci perutninarskega vele podjetja, ki svojo strategijo uspešnega nadaljnjega poslovanja gradijo menda prav na izpolnjevanju želja in sanj (ne le potreb) potrošnikov, zagrešili tako veliko napako, še danes ni jasno nikomur, bilo pa je slišati kar precej ciničnih na ta račun.; ex6Ali je NLB pripravljena pomagati slovenskim podjetjem, da uspejo na zahtevnem madžarskem trgu, podobno kot počnejo avstrijske in druge banke za njihova podjetja?; ex6- Slovenska plinska družba Geoplin je nastala iz Petrolovega sozda Zemeljski plin in krenila po lastni poti, a vsaj kar se tiče vpisa v sodni register, še ni končana.; ex6Geoplin je namreč še vedno med zadnjimi na Agenciji za privatizacijo in prestrukturiranje in se mu lahko zgodi, da bo prešel v last Slovenske razvojne družbe.; ex6To podjetje je nekakšen mejni primer, ki ga neposredno ne urejata niti zakon o lastninskem preoblikovanju podjetij niti zakon o javnih gospodarskih družbah, vrednost nominalnega družbenega kapitala z znanimi lastniki na dan 1. januarja 1993 pa bo bržčas treba ugotoviti tako, kot so to morali storiti v vseh podjetjih, ki so šla skozi postopek lastninskega preoblikovanja.; ex6Objavljen razpis je prvi stik med organizacijo in kandidatom in vpliva na oblikovanje ugodnega ali neugodnega vtisa o podjetju.; ex6Iz podjetja, ki sem ga sam ustanovil, so me na lep način izrinili, tako da sem se moral sprijazniti s splošnim tapetništvom, ki sem ga opravljal v lokalčku na zadnji strani svoje hiše.; ex7Inženir Kikelj, asistent na letalskem oddelku Strojne fakultete, je prispeval ključne aerodinamične in trdnostne izračune, zmanjševanje teže letala do najnižje možne točke pa je delo Saša Kolarja, medtem ko je Celjan Črt Rojnik v svojem svetovno uveljavljenem podjetju letalskih instrumentov in letalske opreme LX Navigation izdelal instrumente zanj.; ex7To je vse posledica dejstva, razmišlja Murko, da je Maribor ekonomsko izčrpan, tam ni novih podjetij, ni služb, v zraku visijo grožnje stečajev.; ex7A zgolj ena zgrešena investicija je bila dovolj, da je mogočnežev medijski in nepremičninski imperij Qintex propadel, v pogubo pa je skupaj z njim zdrsnilo še nekaj avstralskih podjetij in bank.; ex7Ob mojem prihodu je bila edina perspektiva za podjetje ustaviti krčenje števila zaposlenih in povečati prodajo naših visoko kakovostnih izdelkov.; ex7S približno temi besedami nam je Jernej Zajec, direktor projektov iz podjetja Hosting (poleg Petra Vesenjaka, direktorja Hostinga, je glavni pobudnik akcije o »stranskih poteh«), pojasnil, kaj v resnici pomeni to ime.; ex7Potem ko se je Milan Zorman upokojil, je ostal v podjetju kot dragocen strokovni svetovalec oziroma siva eminenca.').
g(108059870,'exNjegova producentska hiša HandMade Films je bila zaslužna za vzpon britanskega filma v osemdesetih letih, veljala pa je za eno najuspešnejših in najbolj neodvisnih produkcijskih hiš.; exKajpak biatlon še dolgo pri naših severnih sosedih ne bo dosegel takšne priljubljenosti kot v Nemčiji - nacionalni TV hiši ZDF in ARD sta že dan pred štartom sezone izčrpno poročali s prenovljenega štadiona, medtem ko domače ORF ni bilo še niti blizu - a posebni vlaki za obiskovalce iz Salzburga in Innsbrucka naj bi Avstrijcem vendarle približali to športno panogo.; exČe se prav spominjam, je kot opravičilo navajal, da je prezaposlen v matični hiši.').
g(108072837,'exDružba Primorje Ajdovščina je prevzela Gradis gradbeno podjetje Ljubljana (GPL), prevzem je v avgustu odobrila tudi Agencija za trg vrednostnih papirjev.; exVlada ob tem ugotavlja, da so v zaključnih fazah tudi vsi drugi, za izvajanje zakona o gospodarskih družbah pomembni oziroma z njim neločljivo povezani drugi zakonski projekti: revidiranje, notariat, sodelovanje delavcev pri upravljanju, trg vrednostnih papirjev, sanacija, tečaj in podobno.').
