g(108168978,'exGlede vključitve Slovenije v EU je sogovornik dejal, da si to želijo, saj si zaradi trenutnih dogajanj na Balkanu morajo prizadevati, da bi mirovna skupnost Evrope vključevala tudi države, ki so se šele pred nekaj leti osvobodile komunizma.; exJe pa opozoril tudi na pogoje, ki jih morajo te države izpolnjevati (tako je bilo tudi pri Španiji, Portugalski in Grčiji).; exPriročno za vse, ki veliko kupujete v drugih državah.; ex»In smo potencialnega vlagatelja tudi našli je iz ene od držav EU, vendar nam je takoj povedal, da morajo biti za to tudi drugi, med temi tudi naša država,« je dejal Molan.; exKaj bo Ircem državljanstvo v državi NSK, in to prav zdaj?; exS svojim programom je predvidel poldrugo milijardo dolarjev pomoči, ki jo Srbija nujno potrebuje za korenite spremembe v gospodarstvu in delovanju države.; exVse to pa je bilo postavljeno z žulji tolminskih kmetov in denarjem slovenske države.; exKaže, da se samo ob takšnih nepriljubljenih ukrepih država prebudi...; exNapačno je mišljenje, da so mu bila vrata na vrh hrvaške glasbene scene zaradi znanega očeta in uspešne mame na široko odprta, zvezda iz sosednje države s slovenskimi koreninami odkriva, da je proti svojim ciljem moral vedno stopati po težji poti.; exMalih sej so se udeležili samo predstavniki petih velesil, splošne so bile namenjene vsem sodelujočim državam.; ex1Profesor Myer je poudaril, da je zelo pomembno, da bi morale države podpisnice konvencije upoštevati vse evropske minimalne standarde in hkrati tudi tradicijo.; ex1Omenil je tudi, kaj se dogaja v posameznih državah, ki so podpisnice konvencije, ki je najbolj pomemben dokument o človekovih pravicah, in da noben pravni sistem ni popoln, kar kažejo tudi sodbe evropskega sodišča.; ex1Poročila temeljijo na poročilih posameznih držav članic ter bilateralnih sestankih, ki jih je imela komisija z oblastmi posameznih držav.; ex1Deklaracija iz Kanade ni po volji večine držav, toda ker so dogovor morali sprejeti s konsenzom, je na koncu zmagal Fujimori, čeprav ne manjka ocen, da to pomeni njegov poraz, ker bo moral sprejeti delegacijo, ki naj bi nato predlagala, kako naprej.; ex1Tehnološki park je zasnovan kot oblika t. i. podjetniških inkubatorjev, kjer novoustanovljena inovacijska podjetja dobijo pomoč lokalne skupnosti ali države z namenom, da pod ugodnejšimi pogoji razvijejo in ustvarijo pogoje za samostojno delovanje.; ex1Pa pustimo to, predvsem velja, da v demokratičnih državah šolskih prenov ne nadzorujejo politično angažirani uslužbenci ministrstev in ministrovi svetovalci.; ex1Splošno pa odločitev držav članic, da je potrebno Evropo urediti kot skupnost svobodnih držav ne samo presega delitev v Evropi po drugi svetovni vojni, ne zgolj med poraženci in zmagovalci ampak v obliki dveh sistemov, ki jih je nasledila, socilaističnega in demokratskega.; ex1Zato so se med drugim devizne rezerve države močno povečale.; ex1V Kolumbiji je kakšnih 15 nezaslišano bogatih družin, ki so dejanske lastnice države, te bi morale več narediti za odpravo revščine.; ex1Vključevanje visokošolskih zavodov v programe skupnih stopenj je treba spodbuditi in podpreti v vseh državah, podpisnicah Bolonjske dekla-racije, in zlasti v tistih, ki do sedaj še niso dejavno sodelovale.; ex2Prva je moralna in politična obveznost mednarodnih ustanov in držav, druga pa je manj odmevna, toda veliko bolj koristna.; ex2»Pomoči prve vrste ne potrebujemo, saj nas vsi tovrstni ''humanitarci'' še vedno uvrščajo v Jugoslavijo, zato smo pomoči deležni kot del nekdanje Jugoslavije, ne kot samostojna država.; ex2»V Natovskih državah pozorno spremljajo pisanje slovenskih medijev, je pristavil minister, ogledujejo si ilustracije na naslovnih straneh časnikov, za nekatere celo sodijo, da so neokusne.; ex2CAPETOWN - Policija v južnoafriškem mestu De Doornsu v zvezni državi West Cape trdi, da še ni imela tako groznega in bizarnega načina posilstva kakor zdaj.; ex2Države članice EU morajo v skladu z direktivo določiti poseben organ za pospeševanje enakega obravnavanja vseh oseb brez diskriminacije na podlagi rasnega ali etničnega izvora.; ex2Zaporniki, med katerimi so tudi »teroristi« iz devetih držav članic Sveta Evrope (Azerbajdžan, Belgija, Danska, Francija, Rusija, Španija, Švedska, Turčija in Britanija), živijo v nemogočih razmerah.; ex2Sicer pa so na tej znamki iz modrega blaga poleg vezene rožice še napis države izdajateljice, nominala, letnica izida in kratici IPZS in AC, ki samovšečno in prav nič skromno predstavljata nosilca izvedbe (tiskarno Instituto Poligrafico e Zecca dello Stato in tekstilno tvrdko Gruppo Tessile Arnaldo Caprai, ki je opravila vezenje).; ex2Sedele so, izmučenih obrazov in mlahavih teles, tako da tudi matere z otroki na rokah niso niti pomislile, da bi jih prosile za sedež; vse do mejnega prehoda, prek katerega je bilo treba peš, mimo carinikov obeh držav.; ex2Wesley Snipes, mejaško-psihopatski narko-baron v filmu New Jack City, pa ima drugačno vizijo: v getu vse »meje« še niso osvojene, zato ga je treba preleviti v post-utopično in ultra-korporirano zaprto trgovsko državo, Enterprise (marketing & strategija, consulting & kompjuterizacija), podobno tistim iz filmov Escape from New York (Manhattan an sich), Blade Runner (L.A. an sich) in Robocop (Delta City), v kateri je »užitek« mogoč le v pogojih totalitarizma (»uživajoče« crackerje v Enterpriseu ščitijo ljudje z avtomati).; ex2Ustvarjajo namreč velike zaslužke, iz katerih se posredno ali neposredno financira avstrijska država.; ex3To pa ne velja samo za prebivalce Slovenije, temveč tudi za vse Slovence, ki živijo zunaj geografskih in političnih meja naše države: za zamejske Slovence, delavce v tujini in izseljence.; ex3Ker je naša država že v prvem krogu dobila več kot polovico glasov, drugi krog glasovanja (če v prvem nobena država ne dobi večine, gresta vanj dve kandidatki z najvišjim številom glasov) sploh ni bil potreben.; ex3Dolgo časa sem omahoval, ali bi napisal pismo, v katerem bi strnil svoje bojazni, pa vendar sem se tolažil, da država in državljani niso tako nerazumni, da bi podlegli egoističnim težnjam posameznikov in ozkih skupin.; ex3O tem navsezadnje zgovorno priča v dobrega pol stoletja porabljen bilijon dolarjev, ki revščine ne le niso omilili, ampak so jo ponekod še poglobili, ker so imele od porabljenega denarja večidel koristi skorumpirane in nesposobne gospodarsko-politične kaste v slabo upravljanih in vodenih državah v razvoju, kakršnih je okrog sedemdeset.; ex3- Tukaj so imeli dvodnevni programski sestanek vodilni sindikalisti kovinsko predelovalne in elektro industrije držav Višegrajske skupine in iz bivših republik Jugoslavije, le črnogorski sindikalist je poslal samo spodbudne telegramske pozdrave.; ex3Premiera sta imela na letališču krajši pogovor, vnovič pa se bosta srečala danes, ko bosta Buzeka sprejela tudi predsednik države Milan Kučan in predsednik državnega zbora Janez Podobnik.; ex3Medtem ko je japonski premier Džuničiro Koizumi v svojem uradu v Tokiu nedavno prisrčno gostil voditelje desetih držav Aseana, se je moral zavedati, da vse milijarde dolarjev, ki jim jih je obljubil za izobraževanje strokovnjakov ali razvoj bazena reke Mekong, ne bodo dovolj za vzpostavitev prijetnega družinskega ozračja.; ex3Nekaj dni prej je odobril odhod japonskih vojakov v Irak in čeprav vsi na tem območju po svoje razumejo japonsko žejo po bližnjevzhodni nafti, so sosedje zaradi prvega odhoda vojakov iz države osuplo privzdignili obrvi.; ex3Pravica do stavke v javnem sektorju, zlasti pa v državnih organih, mora biti omejena in je omejena v vseh državah.; ex3V zagrebški dvorani Vatroslav Lisinski se je zbralo več kot 2000 strankinih odposlancev iz države in tujine.; ex4Po ustanovni listini Združenih narodov lahko članica ZN uporabi silo v samoobrambi brez odobritve VS sicer res legalno in legitimno, a samo, če jo država, pred katero se brani, napade z oboroženo silo.; ex4Se bo zdaj ko bo odločitev o začasni odložitvi embarga morala spoštovati tudi Avstrija - čeprav vemo celo za primere, ko skušajo države to v praksi zaobiti - tiho umaknila?; ex4Vsak državni uslužbenec na ministrstvih državo letno "stane" okoli 450.000 šilingov (okoli 6,030.000 tolarjev).; ex4Novo zaposlena delovna sila je proračun sosednje države ob vstopanju v EU kratkoročno obremenila z dodatnimi 72 milijoni šilingov (964 milijoni tolarjev) na leto.; ex4Zaposlen človek v naši državi je v povprečju, po podatkih iz leta 1999, na dopustu 17 delovnih ur na mesec.; ex4V drugem delu tega dejanja poleg Friderika in Jelisave nastopi še stari Herman: spregledal je sinove namere z Veroniko in jih sklene preprečiti, sina in snaho pa hoče pripraviti do sprave; v sinu hoče poleg tega okrepiti skrb za ugled in moč Celjanov, vnuk Ulrik naj bi celo zasnoval jugoslovansko državo.; ex4Finančne obveznosti za sodelovanje vaše države v SFOR-ju so naslednje:; ex4Murska Sobota - Kmetijsko gospodarstvo Rakičan je na največji prašičji farmi v državi v Nemščaku, na kateri letno spitajo 85 tisoč prašičev, začelo graditi čistilne kanale za reciklažo gnojevke, katere količino bodo po končani naložbi zmanjšali za 30 do 40 odstotkov.; ex4To pa so pospešitev notranje demokratizacije v državi in z njo povezano vključevanje Litve v evropske povezave.; ex4Ob tej priložnosti je dejal, da želi vlada izboljšati pogoje za delovanje obrtnikov in podjetništva v državi in resno razmišlja o tem, kako odpraviti različne administrativne ovire.; ex5Ravno v soboto, ko so nameravali imeti zabavo, so zaradi smrti uglednega jugoslovanskega politika v državi razglasili žalovanje.; ex5Na ustavno sodišče sem vložil zahtevek za presojo zakonitosti tega ukrepa in po šestih mesecih me je najvišje sodišče v državi vrnilo na položaj prvega moža slovenskega radia in televizije, članom sveta pa dalo poduk, ki ga najbrž niso niti prebrali.; ex5Morda se jim nič od tega, kar je povedal, ni zdelo tako zelo pomembno za prihodnost Kitajske, kakor so se jim zdele usodne Busheve besede, je pa pred njimi stal idol, kakršnega bi vsekakor radi imeli na čelu svoje države.; ex5Na vsak način se v Jeličićevi zgodbi ni moč izogniti naslednjemu dejstvu: da se je kot obetaven fant - tudi za jugoslovanske razmere - odločil za pot v Slovenijo, ki ne slovi kot država naklonjena mladim nogometašem, še zlasti tujim ne.; ex5Prevladuje mnenje, da so v državi od padca komunizma 1989/90 uspešno izpeljali tranzicijo, položili in utrdili temelje stabilnega in demokratičnega političnega sistema, plansko gospodarstvo iz prejšnjega režima pa je uspešno nadomestil tržni način gospodarjenja, temelječ na zavidanja vredni gospodarski rasti.; ex5Ta nasprotna stališča pojasnjujejo predvsem z močno polarizacijo družbe, ki je po mnenju večine opazovalcev posledica ideologije Fidesz-MPP, ki temelji na ustvarjanju bipolarnega političnega sistema v državi.; ex5Hkrati so predstavili statistične kazalce (mimogrede, večina jih je strogo zaupna, zato jih ne moremo predstaviti), ki nas uvrščajo v povprečje ali celo med najuspešnejše evropske države (gre za kazalce, ki kažejo uspešnost regulacije trga).; ex5Najbolje je začeti s skrajno desnim, kjer je treba izbrati našo državo in format PAL-B ali PAL-G.').
