g(108178547,'exPiran - Čeprav je vodstvu piranske občine jasno, da je problem beguncev, ki jih je slovenska oblast evakuirala iz obleganega Sarajeva, predvsem stvar države, se je ob zadnjih zapletih županja Vojka Štular odločila, da jim bo občina po svojih močeh pomagala.; exMarijan Schiffrer, poslanec SKD in predsednik parlamentarne komisije za odnose s Slovenci v zamejstvu in po svetu, v časniku Parlamentarec o tem, kaj naj bi država ponudila oziroma dobila od zamejcev in Slovencev po svetu: "Zamejci bodo naš ključni člen, če in ko vstopimo v EU.; exV sindikatu, kot nam je povedal njegov predsednik Roman Molan, sicer še vedno upajo, da jim bo do konca leta le uspelo prepričati ljudi v ministrstvu za gospodarstvo in za okolje, da je proizvodnja celuloze pomembna ne le za Krško, ampak tudi za celo papirno-predelovalno industrijo, slovenske gozdove in državo sploh.; exSicer pa se mu zdi, da je država oziroma ministrstvo za gospodarstvo s to odločitvijo pokazala, da je razvoj papirno-predelovalne industrije ne zanima oziroma da ji ni v interesu vanjo sploh še kaj vlagati.; exNamesto da bi država naročila vsaj predinvesticijsko študijo ali preučila možnosti, kako bi lahko pomagala podjetju in občini, je predloge že na začetku zatrla.; exNjihov bes je bil nedvoumen, država bi morala plačati stroške presoje vplivov na okolje, če se kakšna lokalna skupnost z začrtanim območjem Nature 2000 ne bi strinjala, bi morale biti meje popravljene, predvsem pa bi morala Slovenija »posebna varstvena območja določiti v maksimalnem obsegu, ki bi bil v odstotkih enak povprečju tovrstnih območij v EU (14,3 odstotka)«.; ex»Ne govorimo na pamet, ker predvidevamo, da bi država v prvem letu dobila 350 milijonov dolarjev pomoči za lastninjenje, nato pa je treba začeti reforme bančnega sistema, uravnotežiti državni proračun in utrditi tečaj dinarja,« pojasnjuje Dinkić.; exŠe posebej, ker bo koristila predvsem delničarjem pidov in državi, ne pa le upravljalkam pidov.; ex"Na to sem vam že odgovoril s trditvijo, da je država prenormirana in zbirokratizirana.; exDržava potemtakem mora uvesti nove davke, če hoče ohraniti zatečeno stanje, ali pa zaposlene v javnem sektorju odpuščati.; ex1DDV naj ne bilo treba plačevati tudi ob izvozu blaga in storitev, država pa naj bi neto izvoznikom vračala plačani davek najkasneje v roku 30 dni.; ex1Slovenci svoji državi često očitajo požrešnost.; ex1Država očitke preprosto požre.; ex1Mislim, da se vsi strinjamo, da če to država odstopi, poveča.; ex1Sprememba, ki jo predlagamo k 1. točki, opozarja na zakone s posameznih področij, ki mora natančno razmejiti oziroma mora upoštevati razmejitev nalog države in nalog lokalnih skupnosti, se pravi, ob sprejemanju teh zakonov za posamezna področja.; ex1Urad za priseljevanje beguncev je namreč v dogovoru z republiškim prehodnim domom za tujce v Hrastniku že leta 1997 naselil tudi ljudi brez statusa začasnega begunca - največ s Kosova, tedanji varuh človekovih pravic Ivan Bizjak pa je ob obisku centra jasno povedal, da želi država v Hrastniku urediti eno od izpostav prehodnega doma za tujce in da v bližnji prihodnosti še ne razmišljajo o tem, da bi hrastniško lokacijo zaprli.; ex1Prav to,»tiho« spremembo namembnosti begunskega centra v prehodni dom za tujce, kot so jo v Hrastniku takrat poimenovali, so Hrastničani, še posebno pa njihova SNS, najbolj zamerili pristojnim na državi.; ex1S 1. členom zakona o vojaški dolžnosti pa država dela razlike med moškim in ženskim spolom, saj vojaško dolžnost izvajajo v miru in vojni moški državljani, skladno z zakonom pa lahko sodelujejo tudi ženske.; ex1Država s tem priznava, da je prostovoljnih vojakov premalo, če ne kar nič.; ex153. člen ustave pravi, da država varuje družino, v 31. členu zakona o vojaški dolžnosti pa piše, da se služenje vojaškega roka lahko odloži, če je vojaški obveznik edini hranilec družine, zaradi tega pa bi njegova družina zašla v težak materialni položaj, vendar najkasneje do konca septembra.; ex2In kako varuje država družino po septembru?; ex2Rešitev naj bi se skrivala v možnosti, da se vsak posameznik lahko prostovoljno odloči za služenje vojaškega roka ali pa da država organizira profesionalno vojsko.; ex2Civilni dialog je temelj sodelovanja med državo in NVO Na prvi nacionalni konferenci so predstavili strateške dokumente; ex2Nekaterim od njih država obljublja nadomestno gradnjo na zemljišču, ki naj bi si ga sami izbrali, hkrati pa jih pri tem tudi ovira.; ex2Sindikat azbestnih bolnikov se širi tudi na Štajersko - Nad odnosom države so razočarani, saj izplačila odškodnin zamujajo - Bodo celo tožili državo?; ex2Šibke gospodarske subjekte, o katerih pišejo predstavniki SAS, bomo zaščitili podobno kot druge gospodarske subjekte: z znižanjem bremen, ki nam jih nalaga draga država, pa tudi z znižanjem nekaterih vrst stroškov, ki v strukturi stroškov storitve zavzemajo pomemben delež (stroški dela, pogonskih goriv, zavarovalnih premij ...; ex2Če pa bo slovenska država želela tudi v prihodnje dosegati z domsko vzgojo dobre rezultate, bo morala, kot pravi sedanji direktor doma Marjan Grahut, več vlagati v bivalne razmere in sodobnejšo tehnologijo.').
