g(108189659,'exV povprečju za odstotek višje cene v skupini prevozov so posledica višjih cen storitev, povezanih z vzdrževanjem in popravili vozil, te so se zvišale za 2,9 odstotka, kot tudi za 1,2 odstotka višje cene osebnih avtomobilov.; exSkupina TPV je nastala iz nekdanjega IMV, kjer so proizvajali dostavna in vojaška vozila, danes pa združuje več podjetij z domačim in mešanim kapitalom.; exTo je vprašanje za predsednika državnega zbora, predvsem pa je vprašanje za vodje poslanskih skupin in predsednike delovnih teles, ki se ukvarjajo s temi zadevami.; exOsrednje telo bolonjskega procesa v dveletnih obdobjih med ministrskimi srečanji je t.i. Skupina za spremljanje bolonjskega procesa (BFUG), katere jedro sestavljajo (nacionalni) predstav-niki vseh podpisnic.; exPo drugi svetovni vojni se je izkazalo, da ženevska konferenca ne varuje pripadnike osvobodilnih in podtalnih skupin, kar je bilo še posebej očitno med protikolonialnimi vojnami.; exDolgo časa sem omahoval, ali bi napisal pismo, v katerem bi strnil svoje bojazni, pa vendar sem se tolažil, da država in državljani niso tako nerazumni, da bi podlegli egoističnim težnjam posameznikov in ozkih skupin.; exVSI POKLICI CIVILNIH URADNIKOV SO BILI RAZDELJENI NA POLOŽAJNE SKUPINE, DOLOČENE Z RAZPREDELNICO.; exURADNIKI SO BILI RAZVRŠČENI NA DESET SKUPIN, S TEM DA SO IMELE PRVE TRI SKUPINE ZNOTRAJ PO DVE DO TRI STOPNJE.; exZAKON JE UVEDEL OBVEZNO OCENJEVANJE ZA VSE URADNIKE DO TRETJE SKUPINE Z IZJEMO SODNIKOV, UČITELJEV VSEH ŠOL IN USLUŽBENCEV DIPLOMATSKO-KONZULARNIH ZASTOPNIŠTEV.; ex- Tukaj so imeli dvodnevni programski sestanek vodilni sindikalisti kovinsko predelovalne in elektro industrije držav Višegrajske skupine in iz bivših republik Jugoslavije, le črnogorski sindikalist je poslal samo spodbudne telegramske pozdrave.; ex1Koroška banka, ki je lani vstopila v bančno skupino NLB skupaj še z nekaterimi bankami, je v tem povezovanju videla prednosti.; ex1Na namige, da Kopaču podporo odrekajo tudi nekateri poslanci 