g(108256968,'exPodobno kot zakon o zunanjih zadevah je velika večina načelno podprla tudi besedilo novega zakona o knjižničarstvu, vendar je bilo jasno, da bo do nesoglasij med strankami prišlo v tistem delu besedila, ki določa vlogo in pristojnosti občin v zvezi s knjižnicami.; exKritiki sistema to najpogosteje prikazujejo s teoretičnim modelom, po katerem bi stranka, ki bi v vseh okrajih dobila poslance z 51 odstotki glasov, zasedla ves DZ.; exSistem torej omogoča prevlado ene ali dveh strank in s tem bipolarizacijo političnega prostora.; exUbogljivi in od vodilne stranke poslušni minister Jelko Kacin je s svojo operativno udarno enoto (šest oboroženih pripadnikov Voma) opravil še zadnje kadrovske zamenjave in prerazporeditve in tako brigadi zadal še zadnji smrtni udarec.; exNekatere stranke se zavzemajo tudi za kazenske ovadbe zoper tiste, ki naj bi po vojni obračunavali zoper kolaborante.; exDa bi v ljudski stranki nastala zaradi spornih finančnih poslov kakšna posebna notranja trenja, ki bi bila lahko nevarna za Podobnikov predsedniški stolček, namreč za zdaj ni pričakovati.; exTako je kmečka Ljudska stranka (PSL) lani ustvarila največji dohodek (okoli 27 milijonov dolarjev), ko je prodala več kot 80 objektov in lokalov.; exPredstavniki Ljudske stranke so namreč iz državnega proračuna dobili malo denarja, saj so v poročilih o financiranju volilne kampanje naredili nekaj nedopustnih napak.; exPa tudi za to, da so vrata televizije do zadnjega ostala trdno zaprta za civilno-družbena gibanja in za zametke novih političnih strank.; exV soboto je SLS, ki se šteje za naslednico zgodovinske Slovenske ljudske stranke, s slavnostno akademijo v Koloseju proslavila svojo 110. obletnico.; ex1Na slovesnosti so javno povedali, da bo stranka na predsedniških volitvah podprla neodvisnega kandidata Franceta Arharja, nekdanji guverner Banke Slovenije, ki se je slavnostne akademije tudi udeležil, pa se je zbranim zahvalil za podporo.; ex1Po dogovoru med strankami v Franciji v drugem krogu nastopita le dva kandidata na volilno okrožje, druge stranke pa izrečejo podporo enemu od njiju.; ex1Takšno razmerje sil, ki je posledica nasprotovanja Zahoda vstopu pravašev v vlado, onemogoča vodji HDZ Sanaderju, da bi Hrvaško kmečko stranko (HSS) izsiljeval z argumentom, da v primeru njihovih pretiranih zahtev lahko sestavi koalicijo s HSP.; ex1Rezultat referendumov so po besedah vodje poslancev DeSUS Ivana Kebriča v stranki pričakovali.; ex1Prekinitev stavke je dopustna, če se stranki KDS, ki se želita pogajati in doseči sporazum, prav zaradi tega dogovorita za njeno prekinitev (zadeva VIII-Ips-48/2003).; ex1Študente podpirajo tako rekoč vse albanske stranke, nekatere bolj odkrito, druge manj, le najbolj množična Demokratična zveza Kosova za zdaj še ni povedala svojega mnenja o njihovih zahtevah.; ex1Hkrati je pozval predstavnike vseh strank, da navežejo stike s vodstvi strank na državni ravni in vsak po svojih močeh pomagajo pri razvoju občine, kajti čaka jih veliko dela.; ex1Budimpešta - Leto 2000, v katerem je Madžarska poleg drugega praznovala svojo tisočletnico, ocenjujejo državljani, politične stranke in mednarodne institucije na moč različno.; ex1Ne velik prepad med strankami kaže tudi njihova ocena minulega leta.; ex1Ena od tem današnjega koalicijskega sestanka naj bi bil tudi očitek ljudske stranke, ki ga je izrekla na petkovem sestanku SLS v Dragatušu, da naj bi liberalna demokracija večkrat prekršila koalicijsko pogodbo kot ljudska stranka; to naj bi se zgodilo vsaj petkrat, medtem ko naj bi jo ljudska stranka prekršila samo enkrat, in sicer pri glasovanju za interpelacijo o delu šolskega ministra Slavka Gabra.; deorganizacija, ki si prizadeva priti na oblast ali vsaj dobiti čim večji vpliv na izvajanje državne oblasti').
