g(108264897,'exLiga prvakov, 3. krog, skupina C: Real Madrid - Bayern 2:4 (1:3), Dinamo Kijev - Rosenborg 2:1 (2:0); vrstni red: Bayern 7 točk, Real 6, Dinamo 3, Roseborg 1; skupina D: Lazio - Feyenoord 1:2 (1:0), Olympique Marseille - Chelsea 1:0 (1:0); vrstni red: Feyenoord 6 točk, Chelsea in Lazio po 4, Marseille 3.; exVreme je obetalo najbolje in v petici je bilo dovolj materiala tudi za zadnjo skupino.; exTo je po rekreativnem odmoru in jutranji skupini, avtorskem antropohigienskem konceptu svetovalne pomoči za razvoj zdrave osebnosti, moj tretji projekt, ki naj bi zmanjšal število neuspešnih učencev.; exVerjetno je skupina D najtežja, saj se bodo tam spopadale Italija, Rusija in Grčija, je takoj po žrebu razmišljal selektor slovenske košarkarske reprezentance Boris Zrinski.; ex«19 Institucija je za Mary Douglas sprejetje določenega miselnega sloga, prevzetje skupnih definicij za določene kategorije, kar daje vtis, da institucije mislijo same od sebe in nato posameznike in postopke, ki potekajo v instituciji, dejansko poenotijo in iz raznoličnih posameznikov naredijo skupino.; exVodilna slovenska teniška igralka Katarina Srebotnik je dosegla v vlogi nosilke druge skupine pomembno zmago v osmini finala turnirja Tippmix grand prix v Budimpešti, ko je premagala rusko igralko Ekaterino Bičkovo po dramatičnem maratonskem dvoboju z 2:6, 7:6 (13:11), 6:3.; exBesediloAnton Tomaž Linhart: Županova Micka (odlomek)Ciljna skupinaNadaljevalna, izpopolnjevalnaPotek dejavnosti- motivacijaUčitelj razdeli prisotne v dve skupini: eno sestavljajo učenke, drugo pa učenci.; exNato skupini prebereta in primerjata svoje odgovore.; exManj možnosti za napredovanje ima Koper, saj sta favorita v skupini Brescia (Italija) in Szentes (Madžarska).; exSpored Dnevnikovega turnirja v malem nogometu, skupina C, jutri ob 15. uri: Tiskarna Januš - Recinko Kočevje, ob 15.35: Ruski car - Pinesta Kranj, ob 16.10: Poljane Gemax - Aškerčeva Celje, ob 16.45: M-Express - Tango Šiber.').
