g(108272961,'exČlani pogajalske skupine so povedali, da je mogoče kmetijstvo ohraniti z regionalno politiko, nakar smo tudi slišali, da je slovensko kmetijstvo danes bolje zaščiteno kot kmetijstvo v vsej EU.; exV Banki Slovenije menijo, da se je Rant, sicer diplomirani ekonomist in diplomirani romanist in član skupin za pogajanja z Evropsko unijo in sukcesijo, izkazal s svojim dosedanjim delom.; exMoja skupina nima nič z mamili.; exNa amaterskem posnetku je videti sproščenega in smejočega se bin Ladna, ki sedi in se pogovarja s skupino somišljenikov.; exMajhna organizirana skupina lahko veliko neorganizirano skupino pripravi do poslušnosti.').
