g(108310949,'ex»Komisija verjame trditvi, da strokovni svet ni izrecno razpravljal o znamki miz, gotovo pa bi moral razpravljati o številu operacijskih miz, ki naj bi jih obnovili, in o tipu miz, ker je oboje strokovno in ne le finančno vprašanje,« je povedal Končina, minister Keber pa dodal, da gre pri mizah za potencialne potrebe približno 15 kirurških strok in strokovni svet ni pridobil mnenj posameznih kirurških strok niti o številu niti o tipu miz, ki bi jih potrebovale.; exMoskva - V sredo so za novega predsednika sveta federacije, zgornjega doma ruskega parlamenta, skoraj soglasno izvolili 48-letnega Sergeja Mironova .; exNaj se uzakoni obvezno soglasje občin, kjer knjižnica deluje, velikih in malih, naj za velike občine predpišejo soglasje, manjše pa naj se zadovoljijo le z mnenjem o kandidatih za direktorje oziroma direktorice knjižnic, ali s tem v zvezi sploh dati občinam kakršno koli pristojnost, ko pa imajo te svoje predstavnike že v svetih knjižnic, in podobna vprašanja so včeraj ostala še brez odgovora zakonodajalca.; exSvet za radiodifuzijo še naprej opozarja na kršitve pravil o televizijskem oglaševanju; exStarostni svet puritanske družbe jo ožigosa.; exNa začetku leta 2002 je Svet EUA sprejel t.i. ''graške teme'', o katerih naj bi temeljiteje razpravljali še na kasnejših sestankih Sveta in na konferencah zveze.; exZaporniki, med katerimi so tudi »teroristi« iz devetih držav članic Sveta Evrope (Azerbajdžan, Belgija, Danska, Francija, Rusija, Španija, Švedska, Turčija in Britanija), živijo v nemogočih razmerah.; exKmalu se je v spremstvu vodnikov, mestnega zgodovinarja Gabriela Muiesa in zastopnika liverpoolskega mestnega sveta Petra O''Briana, spustil v podzemlje.; exPREDSEDNIK V BOLNICI - Predsednika Državnega sveta Toneta Hrovata so direktor novomeške bolnišnice dr. Tone Starc in predstojniki oddelkov seznanili s problemi zaradi nedokončane nove bolnice.; exKo sem bil že šest mesecev generalni direktor, me je svet zavoda odstavil, ne da bi za to navedli en sam razlog.').
