g(108322981,'exČe bi iskali povprečnega člana F21, bi bil ta včlanjen v kak lions klub, opravljal bi direktorske posle, ob tem pa bi sedel še v enem nadzornem svetu.; exSledile so zamenjave v upravi, saj je nadzorni svet Gradis GPL za novega predsednika uprave družbe s petletnim mandatom imenoval Tomaža Rojsa, za člana uprave pa Damjana Trošta.; exNadzorni svet pa je včeraj odločal tudi o podaljšanju pogodbe z Gorenjem trgovino do konca leta, tako da bi ta dobavitelj pripeljal še 150.000 ton premoga.').
g(108324514,'exPoleg omenjenih firm in predavateljev so zanimivo strokovno srečanje organizirali komisija za kmetijstvo pri občini Gorišnica, ptujska kmetijska svetovalna služba in znani kmetovalec Branko Majerič, ki je bil pobudnik tega strokovnega večera in ob koncu tudi družabnega srečanja.; exMarijan Schiffrer, poslanec SKD in predsednik parlamentarne komisije za odnose s Slovenci v zamejstvu in po svetu, v časniku Parlamentarec o tem, kaj naj bi država ponudila oziroma dobila od zamejcev in Slovencev po svetu: "Zamejci bodo naš ključni člen, če in ko vstopimo v EU.; ex»Komisija verjame trditvi, da strokovni svet ni izrecno razpravljal o znamki miz, gotovo pa bi moral razpravljati o številu operacijskih miz, ki naj bi jih obnovili, in o tipu miz, ker je oboje strokovno in ne le finančno vprašanje,« je povedal Končina, minister Keber pa dodal, da gre pri mizah za potencialne potrebe približno 15 kirurških strok in strokovni svet ni pridobil mnenj posameznih kirurških strok niti o številu niti o tipu miz, ki bi jih potrebovale.; exZačetki muzeja so povezani z izjemno zbirateljsko vnemo učitelja Bogdana Žolnirja (1908-1998), ki ga je okrajna organizacija Zveze borcev leta 1949 postavila za predsednika t. i. zgodovinske komisije, ob uradni ustanovitvi muzeja leta 1951 pa za prvega ravnatelja Okrajnega muzeja NOB.; ex»Pozna uveljavitev zahtevane tehnične zakonodaje za majhna in srednje velika podjetja bo pomenila izgubo koristi, ki jih bo prinesel skupni evropski trg,« je poudaril vodja delegacije Evropske komisije v Sloveniji Erwan Fouere.; exLeta 1993 je bila predlagana za delegatko v generalni skupščini glasbenih ekspertov EBU, na plenarnem zasedanju leto kasneje pa je bila izvoljena v evropsko glasbeno komisijo.; exTa teden bo o duty freejih razpravljala parlamentarna komisija za evropske zadeve, pred dnevi pa je razpravo o tem začel (in jo bo še nadaljeval) tudi parlamentarni odbor za gospodarstvo.; exMinister za pravosodje Tomaž Marušič meni, da o kandidatih za generalnega državnega tožilca mnenje personalne komisije tožilstva ni potrebno.; exPo Marušičevih besedah se komisija izreka zgolj v postopku za imenovanje vodij državnih tožilstev.; exV skladu s priporočili listine se je evropska komisija obvezala, da bo letno poročala o doseženem napredku pri izvajanju v listini zastavljenih ciljev.; ex1Poročila temeljijo na poročilih posameznih držav članic ter bilateralnih sestankih, ki jih je imela komisija z oblastmi posameznih držav.; ex1Letošnje letno poročilo evropske komisije navaja velik napredek pri postopkih za ustanavljanje podjetij, boljši dostop podjetij do elektronskega poslovanja, uvajanje različnih oblik podjetniškega izobraževanja na visokih in srednjih šolah, na drugi strani pa tudi opozarja na zanemarjanje vprašanja učinkovitega zastopanja interesov malih podjetij na nacionalni in evropski ravni.; ex1Projekt Literarni vlak Evropa 2000 poteka pod pokroviteljstvom Evropske komisije.; ex1V tem kontekstu bi celo tvegal trditev, da bomo večino pogajanj opravili doma, da bo manj pomemben delpogajanj z komisijo EU, čewprav tega ne podcenjujem, še zlasti ghlede vprašanj glede Luke Koper.; ex1Med tem priprav-ljalnim delom je EUA spomladi 2003 sprejela tudi svoj odgovor na sporočilo Evropske komisije The role of universities in the Europe of knowledge, ki je postal še eno od izhodišč za kasnejše razprave v Gradcu.; ex1Tako je predsednik komisije učenjakov skrčil bistvo zgodovine človeštva v en sam stavek: Živeli so, trpeli in umrli; kar je vredno in preživi, je ljubezen.; ex1Potovalni stroški bodo majhni, je pa res, da smo v prvo vrsto takoj postavili organizacijo tekme, saj dobro vemo, kakšni so odnosi navijačev obeh klubov," je po žrebu, ki se ga je udeležil skupaj s članom sanacijske komisije Mitjo Hlastecem, dejal sekretar Maribora Pivovarne Laško Uroš Jurišič in nadaljeval: "Doma pričakujemo razprodan štadion.; ex1Profesor Osolnik iz Ljubljane, ki je bil izbran za šefa te komisije, nas je pri tem obvestil, da je Univerza v Ljubljani odobrila tri nove programe za poljski, češki in slovaški jezik.; ex1Predlog stališč je v obravnavo predložila Komisija za lokalno samoupravo.; ex1Želi besedo poročevalec komisije?; ex2Želi o predlogih sklepa Mandatno-imunitetne komisije glede imunitete gospoda mag. Jožeta Protnerja kdo razpravljati?; ex2Predlagatelj je Komisija za spremljanje in nadzor lastninskega preoblikovanja družbene lastnine.; ex2Jaz sem kot član te Komisije za lokalno samoupravo v nekoliko nenavadni situaciji, ker sem ves čas pri nastajanju teh stališč zraven in sem se tudi precej trudil v zvezi z njimi, kot bi se temu reklo.; ex2Peking - Šest mednarodnih organizacij za zaščito človekovih pravic (vključno z Amnesty International) je pozvalo EU, naj na naslednjem zasedanju komisije za človekove pravice ZN v Ženevi podpre resolucijo, s katero bi obsodili LR Kitajsko za preganjanje političnih aktivistov in verskih skupnosti.; ex2V Občini Polzela so že sklicali občne zbore, na katerih so krajani predlagali člane krajevnih odborov, potrdil pa jih bo občinski svet na predlog komisije za mandatna vprašanja, volitve in imenovanja.; ex2Izvajalca, ki sta skupaj sodelovala na javnem razpisu za graditev predora Trojane, a dela nista dobila, sta izpodbijala sklep državne revizijske komisije, ki jima ni dovolila vpogled v dokumentacijo konkurenčnega ponudnika, italijanskega Grassetta.; ex2Komisija je zahtevo za revizijo postopka zavrnila z razlago, da v reviziji postopka oddaje javnega naročila ni mogoče oddati začasne odredbe.; ex2Stroga komisija v sestavi vseh treh organizatorjev, ki jo je presenetil velik odziv, še bolj pa izjemna ustvarjalnost in domiselnost najmlajših likovnih talentov, se je odločila nagraditi 22 učencev in njihove mentorje.; ex2Vsem napovedim navkljub je bruseljska komisija na sestanku veterinarskega odbora sredi tedna nenadoma umaknila predlog embarga.; ex2Tožnica je bila pred odpovedjo pogodbe o zaposlitvi seznanjena z mnenjem invalidske komisije, da je delovno mesto, za katero ji je delodajalec ponudil novo pogodbo o zaposlitvi, ustrezno glede na njeno delovno zmožnost, tožnica pa se je že prej lahko izrekla o primernosti novega delovnega mesta.; ex3Izbruhnil je velik škandal, disciplinska komisija združenja ameriškega nogometa pa je sporočila, da proti osumljenim igralcem ne bo ukrepala, dokler svojega ne bo povedalo sodišče.; ex3V moški konkurenci je bil izid zelo tesen, saj so o športniku leta odločili glasovi enega samega člana strokovne komisije.; ex3Oziroma se ti ne skladajo s podatki, ki so jih dali komisiji.').
