g(108457976,'exPrvi v vrsti so Igre in aplikacije.; exTo je bil glavni motiv za lov, za zbirko bistrih, lepih, nadarjenih žensk in celo za dolgo vrsto umorov.; exTudi tu se v slogu srečujemo z nepretrgano vrsto slikovitih metafor, ki pa niso več tako obetajoče svetle kakor v prvem dejanju, temveč izražajo trpko razpoloženje in zle slutnje, nekaj jih je spet liturgičnega ali biblijskega izvora.').
g(108462320,'exMangan zaradi omejenih dostopnih podatkov ni priporočene zgornje mejne vrednosti.; exNa začetku ima podatke o poziciji osebe (naslovna, glavna, stranska, pripovedovalec), nato o poklicu (nekateri med njimi imajo tudi svoje geslo, na primer učitelji, duhivniki...; exA medtem v Velenju še vedno niso določeni ekološki otoki, tako da zbiranje odpadkov v mestu še vedno ni ločeno, zgovoren pa je tudi podatek o zbiranju nevarnih odpadkov.; exPoleg Zavoda za zdravstveno zavarovanje Slovenije je 1. junija letos premije za prostovoljno zdravstveno zavarovanje za doplačila do polne vrednosti zdravstvenih storitev podražila tudi Zavarovalna družba Adriatic, vendar smo v včerajšnji številki Dnevnika objavili napačen podatek o tem, za koliko.; exČe so podatki resnični, je ta številka 20-krat večja kot v Ameriki.; exSeveda postane plakatniška ošabnost bolj jasna s podatkom, da naročnik plakata, hvalabogu, ni kakšna ženska organizacija, ampak kar plakatniško podjetje, ki v poletni suši naročil pač noče puščati belih lis, ampak si narediti nekaj samopromocije.; exOba športnika sta predstavljena tudi z osebnimi podatki in športnimi dosežki.; exKatere podatke ste si zapomnili o prvem, katere o drugem športniku?; exPisateljica vedno izhaja iz osebne (popotniške) izkušnje, njeno pisanje prežemajo stvarni zgodovinski in geografski podatki, opisi afriškega okolja in komentarji, v katerih simpatizira z afriškimi domačini ter posredno ali neposredno opozarja na kvarni vpliv kolonizacije, ki je tako močno zaznamovala današnjo podobo Afrike, vendar pa vse to uokvirja v literarno oblikovano zgodbo.; ex– NAZIV DELOVNEGA MESTA OZIROMA PODATKE O VRSTI DELA, ZA KATERO DELAVEC SKLEPA POGODBO O ZAPOSLITVI, S KRATKIM OPISOM POSLOV, KI JIH MORA OPRAVLJATI PO POGODBI O ZAPOSLITVI,; ex1Več tehničnih podatkov o letalu, s katerim se bo na pot odpravil Matevž Lenarčič, smo v Gei objavili decembra lani (Gea XI., 12/6).; ex1Zanimiv je podatek, da so po donosu v zadnjem letu od petih vzajemnih skladov s sedežem v Mariboru kar štirje na prvih štirih mestih - Delniški (26,51-odstotni letni donos), Alfa (26,25), Skala (21,67) in SPD (21,12), edino sklad Hrast (14,73) je "šele" na desetem mestu.; ex1O sami religiji se je ohranilo le nekaj podatkov: verniki ob spoznavanju verskih resnic napredujejo po lestvici sedmih stopenj, vsaki pripada eden izmed planetov.; ex1O svoji ertevejevski pustolovščini sem napisal knjigo, ki bo morda nekoč izšla, tukaj bom navedel le nekaj bistvenih podatkov o tem nenavadnem obdobju mojega življenja.; ex1Ta seveda posega v zasebnost in le lokalno dosegljivost podatkov, vendar v nadzorovanem okolju to verjetno ni težava.; ex1Več podatkov o specifikacijah in moči novih grafičnih procesorjev še ni znanih.').
