g(108497294,'exNa tem področju bo treba še marsikaj postoriti.; exOb 50-letnici delovanja odpira Koroški pokrajinski muzej priložnostno razstavo s pregledom razvoja in delovanja muzeja od ustanovitve Okrajnega muzeja NOB leta 1951 do zadnjega desetletja delovanja, ko so težišče dela preusmerili na skrb za varstvo premične kulturne dediščine na območju Koroške v Republiki Sloveniji.; exMuzej je teritorialno pokrival ozemlje današnje Koroške v Republiki Sloveniji (območje Mežiške, Mislinjske in zgornji del Dravske doline) in zamejsko Koroško, kjer živijo Koroški Slovenci.; exVsebinsko so se njihove raziskave ukvarjale z nacistično okupacijo in odporom na omenjenem območju, pri čemer so raziskave časovno segale tudi v predvojno in povojno obdobje.; exRazširjenost: V severnem Atlantiku živi več ločenih populacij, njeno naselitveno področje se razteza zahodno in vzhodno od Grenlandije, proti jugu do Virginije, na vzhodu od Spitzbergov do Španije.; exŽupane je zmotila Natura 2000, evropsko omrežje posebnih varstvenih območij, ki jih je pet minut pred 1. majem začrtala tudi Slovenija.; exNjihov bes je bil nedvoumen, država bi morala plačati stroške presoje vplivov na okolje, če se kakšna lokalna skupnost z začrtanim območjem Nature 2000 ne bi strinjala, bi morale biti meje popravljene, predvsem pa bi morala Slovenija »posebna varstvena območja določiti v maksimalnem obsegu, ki bi bil v odstotkih enak povprečju tovrstnih območij v EU (14,3 odstotka)«.; exTo je seveda smešno, evropsko omrežje ekološko pomembnih območij, ki je oblikovano na podlagi dveh evropskih direktiv, seveda ni stvar lokalne politike, prav tako ni stvar državnih institucij.; exNatura 2000 je evropski projekt, katerega namen je ohranjanje biotske raznovrstnosti, vzpostavljanje takšnih območij pa je mednarodna obveza Slovenije, pravzaprav je to njena odgovornost s pravnega in še s kakšnega drugega vidika.; exTa akcija, ki jo Dolenjska banka že 16. leto izvaja na Dolenjskem in v Beli krajini, ima dober odziv, saj se več kot polovica staršev odloči za obisk v banki in varčevanje za svojega otroka; z otvoritvijo ekspoziture Dolenjske banke v Krškem in Brežicah se akcija širi tudi na območje Posavja.; ex1Slovenija bo skupaj s Hrvaško pripravila posebno strokovno študijo o razvoju obmejnega območja v letih 2002 do 2006.; ex1Za tovrstne projekte je Slovenija namenila 80 milijonov tolarjev, kar seveda ni veliko, vendar je denar namenjen za majhne projekte, ki bodo zagotavljali gospodarsko oživitev v demografsko ogroženih področjih.; ex1K sreči je brežiški poslanec DZ Jože Avšič (LDS) uspel kolege prepričati v škodljivost tega določila, ki bi močno skrčil območje pridelave cvička.; ex1Zagovornici selitve, predstavnica mesta Francka Trobec, načelnica mestnega oddelka za predšolsko vzgojo, izobraževanje in šport ter ravnateljica glasbene šole Lučka Winkler-Kurent, sta prepričevali starše, da je selitev smotrna, saj bi se glasbena dejavnost za to področje lahko odvijala v enem glasbenem centru v Reboljevi ulici v adaptiranih prostorih vrtca Ciciban in kasneje še v prizidku OŠ Milana Šušteršiča, ki se nahaja v bližini, ne pa da je razbita po sedmih različnih lokacijah.; ex1Na polotoku Kola na oddaljenem področju blizu Murmanska poslovnim ženskam pomaga 2.000-članski kongres žensk.; ex1V 82. členu se doda nov drugi odstavek, ki se glasi: "Zavezanec, ki se mu ugotavlja dobiček z upoštevanjem normiranih odhodkov, vloži napoved prihodkov, doseženih pri domači fizični osebi ter tuji pravni in fizični osebi, do 15. v mesecu za pretekli mesec pri davčnem organu občine, na območju katere je vpisan v register zasebnikov.; ex1Če register vodi republiški upravni organ, vlaga zavezanec napoved pri davčnem organu občine, na območju katere ima stalno prebivališče.; ex1Na podlagi teh in drugih proučevanih podatkov je hrvaški Jadran uvrščen med prednostna področja za proučevanje in zaščito glavatih želv v okviru načrta zaščite morskih želv Mediterana organizacije UNEP.; ex1Kot primer poslabšanja razmer na tem področju je navedeno preganjanje prepovedane sekte Falun gong, katere dva tisoč članov so priprli ali zaprli v 40 kitajskih mestih samo v zadnjih dneh.; ex1Nekaj dni prej je odobril odhod japonskih vojakov v Irak in čeprav vsi na tem območju po svoje razumejo japonsko žejo po bližnjevzhodni nafti, so sosedje zaradi prvega odhoda vojakov iz države osuplo privzdignili obrvi.; ex2Japonska je pokazala, da je tudi sama pripravljena odpreti vrata svojemu območju in narediti korak iz sto let samote, samo da ne bi še naprej zaostajala za azijsko velesilo.; ex2Prav vzajemno rivalstvo obe sosedi sili v objem - celotno območje pa mora iz tega potegniti čim večjo korist.; ex2Izraelski zunanji minister Šimon Peres je včeraj med obiskom v Helsinkih izrazil previden optimizem glede morebitnega vnovičnega začetka bližnjevzhodnega mirovnega procesa po odločitvi Izraela, da se postopno umakne z območja Gaze in Betlehema.; ex2Med ustavljenimi vozniki je bil rekorder tisti, ki je na območju Slovenskih Konjic vozil s 3,1 g/kg alkohola v organizmu.; ex2Prispelo je skoraj 60 izdelkov osnovnošolcev iz 12 šol širšega ptujskega območja.; ex2Vlada Republike Slovenije je odgovorna za prevoz osebja slovenskega kontingenta, njihovega orožja in opreme brez stroškov za Nato iz določenega kraja do njihovega štaba na območju operacij in vrnitve v skladu z medsebojno določenim razporedom kroženja.; ex2Naslovil jo je na tamkajšnje Srbe, mednarodno skupnost in začasnega upravitelja tistega območja, generala Jacquesa Kleina.; ex2Fotografija kaže velikansko sipinsko območje Al Kidan na vzhodu Savdske Arabije, kjer skoraj nikoli ne dežuje.; ex2Ker so vzorci sipin od območja do območja različni, lahko vesoljci pri preletu ugotavljajo, za katero puščavo gre.; ex2Umeščena je bila sredi razmeroma malo obljudene pokrajine in je mogla ponujati svoje tržno posredovanje razmeroma majhnemu območju.; ex3Kmalu pa so druga področja v sosedstvu z ugodnejšim zemljepisnim, prometnim, gospodarskim in tržnim položajem pridobivala pomen in Kostanjevica je postopoma kot mesto drsela ter končno zdrsnila v večstoletno mrtvilo.; ex3Kljub temu mu je doma uspelo dobiti le 70 do 80 odst. od 60.000 ton letno potrebne surovine, zato se zdaj spet vrača na stara nabavna območja.').
