g(108513718,'exSeveda je prvi pogoj za uspeh točen met, oziroma met na mesto, kjer ščuka dejansko je.; ex- Balzam za ustnice z zaščitnim faktorjem nikar ne pozabite na kožo na tem občutljivem mestu.; exNa mesto ugriza položimo hladen obkladek.; exNadaljnjih 7 do 14 dni opazujemo, ali se je pojavil rdeč kolobar na telesu ali na mestu pika oziroma otrdel tilnik in bruhanje znak borelioze.; ex* Vzemite sredstvo proti bolečinam ali na prizadeto mesto nanesite pripravek, ki vsebuje ibuprofen (gl.; exEno najprimernejših mest za odlaganje jajc bi bila v hrvaškem delu Jadrana lahko peščena plaža na Lopudu, vendar se ji želve zaradi obilice kopalcev pač izogibajo.; exTe pesmi je dodal na vsebinsko ustreznih mestih pesmim iz prve in druge izdaje in tako je 1932. izšel tretji »Ciciban« s 35 enotami.').
g(108521267,'denavidezna vrteča se krogla, ki ima svoje središče v središču Zemljo, na kroglo pa so preslikana vsa nebesna telesa').
