g(108566028,'exKo je deklica videla, da oba s starim gospodom že sediva, se je tudi ona plaho usedla in se takoj zazrla navzgor v sivkasto in na mnogih koncih strgano projekcijsko platno…; exPearl je sedela na koncu pomola in uživala ob slastnih grižljajih ribe, ki jo je našla, Frances se je vrnila v San Antonio in Juanita mu je kuhala kavo.; exPostrvi imajo krajna ali terminalna usta, ki so na koncu gobca.; exPrisiljen je bil tekati z enega na drugi konec poveljniškega mostu, da bi vsi slišali njegove ukaze.; exNaslednja pesem se odvije v molku, vsak na svojem koncu s slušalko v roki, Kaja ponovno v nanizanki, Lut med kitarami pod stropom.').
