g(108567235,'ex"Menimo, da uporaba GSO v kmetijstvu ogroža ekonomski obstoj konvencionalnih in ekoloških kmetov, poleg tega nihče ne ve, kako bo njihova uporaba dolgoročno vplivala na okolje in zdravje ljudi.; exMednarodne dneve mineralov, fosilov in okolja.; exV sindikatu, kot nam je povedal njegov predsednik Roman Molan, sicer še vedno upajo, da jim bo do konca leta le uspelo prepričati ljudi v ministrstvu za gospodarstvo in za okolje, da je proizvodnja celuloze pomembna ne le za Krško, ampak tudi za celo papirno-predelovalno industrijo, slovenske gozdove in državo sploh.; exRibe, ki živijo v bližini obal ali v sladkih vodah, so zgoraj bolj zelenkaste ali olivno zelene barve, kar za okolje, v katerem živijo, predstavlja varovalno barvo.; exMinistrstvu za okolje, prostor in energijo so pravzaprav poslali grozeče zahteve, opremljene z besedami o postopkih na ustavnem sodišču.; exNjihov bes je bil nedvoumen, država bi morala plačati stroške presoje vplivov na okolje, če se kakšna lokalna skupnost z začrtanim območjem Nature 2000 ne bi strinjala, bi morale biti meje popravljene, predvsem pa bi morala Slovenija »posebna varstvena območja določiti v maksimalnem obsegu, ki bi bil v odstotkih enak povprečju tovrstnih območij v EU (14,3 odstotka)«.; exKer meje ohranjanja naravnega okolja niso enake mejam lokalnih političnih skupnosti, zahteve nekaterih županov kažejo na popolno nerazumevanje načel varovanja narave.; exZategadelj si s svojim trenerjem, ki so ga v Avstraliji neutemeljeno očrnili zaradi domnevne dopinške afere (Tureckij zato zdaj toži avstralsko plavalno zvezo), želi predvsem miru v prijetnem okolju švicarskih Alp.; exVseeno pa zavedanje njene moči, sposobnosti, da lahko hitro in korenito spremeni vrste (vključno z našo), ki se že tisočletja razvijajo, terja od nas, da smo skromni in previdni ter kolikor je mogoče vnaprej presojamo morebitna tveganja za naše zdravje in okolje.; exObčani naj bi čim več odpadkov zložili in prinesli v za to pripravljene večje zabojnike, z akcijami, v katere so vključene tudi osnovne šole, pa želijo predvsem ozavestiti mlade, kako pomembno je čisto okolje.; ex1Dr. Andrej Umek (1938), SKD, SLS, znanost (96 97), okolje in prostor (00 00), danes profesor na Fakulteti za gradbeništvo; ex1Lokalne skupnosti so namreč lahko z dodatnim projektom kandidirale za nagrado 10.000 britanskih funtov, ki je namenjena sofinanciranju točno določenega projekta, ki je vezan na upravljanje z okoljem.; ex1Mestna občina Celje se je prijavila s projektom celostnega komuniciranja za odgovorno ravnanje z okoljem, lokalno agendo 21, in med vsemi lokalnimi skupnostmi prepričljivo zmagala, je povedal.; ex1Direktor zavoda za varstvo okolja dr. Marko Notar pa je pojasnil, zakaj je škoda, ki jo naredijo odjemalci gramoza, nepopravljiva za okolje.; ex1Pisateljica vedno izhaja iz osebne (popotniške) izkušnje, njeno pisanje prežemajo stvarni zgodovinski in geografski podatki, opisi afriškega okolja in komentarji, v katerih simpatizira z afriškimi domačini ter posredno ali neposredno opozarja na kvarni vpliv kolonizacije, ki je tako močno zaznamovala današnjo podobo Afrike, vendar pa vse to uokvirja v literarno oblikovano zgodbo.; ex1V našem okolju ni vinogradov, zato tudi ni nihče nikdar omenjal črička.; ex1Muzej je postavljen v avtentično okolje jaška Škale, kjer se je premogovništvo v Šaleški dolini tudi začelo.; ex1Zaradi suhega vremena je slovenska uprava za zaščito in reševanje ragzlasila veliko požarno ogroženost naravnega okolja v treh primorskih občinah; ex1Kot dober primer pripravljenosti, da bi v praksi lahko uresničevali akcijski program ukrepov Nacionalnega programa varstva okolja (NPVO) in strategije za ohranjevanje biotske raznovrstnosti, krajinske pestrosti ter varstva naravnih vrednot, pozivamo naslovnike, naj čimprej skličejo sestanek Ribiške družine Ribnica in izvajalcev gradbenih del ter se ob Bistrici na kraju samem dogovorijo o nadaljnih delih oz. boljšem sodelovanju.').
