g(108619795,'exPrisotni v sobi so se že napolnili s tremi dvojnimi odmerki vodke, kot običajno so pognali po grlu eno za drugo, takoj nato pa prižgali vsak svoj zavitek - to je bil hkrati trenutek, ko je glasba s svojimi temnimi toni preplavila hišo in se razlila prek trga, tako da so nekje na polovici zvitka zaslišali trkanje po vratih pameti, le trenutek zatem pa sta jo pijača in dim zavzela v enem samem naskoku in jo zdrobila v prah.; exPovlekel je pogled od žarnice, prevlečene s kožo, ki ga je pravkar nagovorila, in se zagledal v vrsto, ki se je vila kačasto prek vsega trga, vsi so si hoteli za dva zelena bankovca očistiti dušo in jo preložiti na očetova ramena in si za dva naslednja bankovca olajšati telo, ga ubiti v deklici.; exPognal se je skozi vrsto na spodnji trg.; exMlačni poletni veter se je podil po trgu in s seboj nosil mastni vonj hotdogov s sladkastim zenfom.; exTisto kar bo ostalo od Libeskindovega načrta, sta spektakularna mestna trga, kakršna sta na Manhattnu popolnoma neznana, vzpenjajoči se obris Vrtov sveta na nebu in najbolj inteligenten spomenik, ki ga je bilo mogoče postaviti žrtvam 11. septembra.').
g(108620061,'exA Za podaljšanje meta od točke X do točke Y sprostimo toliko vrvice (1), da z njo dosežemo cilj.; exLimbarska gora nad Moravčami je za številne obiskovalce vedno bolj priljubljena izletniška točka.; exNjegovo urarstvo je že desetletja ena nepogrešljivih točk v mestnem središču.; exnevrolog in akupunkturolog iz Toplic Dobrna razlaga: Seveda iglice niso edini pripomoček za stimulacijo akupunkturnih točk.; exPomembno je torej le, da oskrbimo tiste točke na telesu, ki so za neko težavo ali bolezen ključnega pomena.').
g(108621598,'exS kuponom za žrebanje v Timesovi šolski prilogi in na spletni strani Bloomsburyja so povabili učitelje - samo učitelje - naj se v imenu svojih učencev prijavijo za mesta med publiko, in to največ za 50 na šolo.; exStranko pregleda zdravnik, označi mesta dlakavosti, izvor dlak (posledica morebitnega hormonskega delovanja) ter določi postopek njihovega odstranjevanja in moč nastavitve laserja.').
