g(108630039,'exČe ne, položite tople roke na spodnji del trebuha (spolni center) in dihajte vanj.; exV komolčni sklep prihaja z zgornjega dela nadlahtnica, s spodnje strani pa koželjnica in podlahtnica.; exZanimive so že lokacije bienalov sodobne umetnosti, ki se pojavljajo na različnih koncih sveta, v metropolah, ki so prenaseljene, se dvigajo v razkošju in hkrati dušijo v številkah visoke brezposelnosti.; exMuzej je teritorialno pokrival ozemlje današnje Koroške v Republiki Sloveniji (območje Mežiške, Mislinjske in zgornji del Dravske doline) in zamejsko Koroško, kjer živijo Koroški Slovenci.; exRazširjenost: Razširjena je v severovzhodnem delu Južne Amerike in večjem delu porečja Amazonke.; exObarvanost: Hrbet in zgornji del bokov sta temna z zelenkastimi in modrimi odtenki, spodnji del bokov in trebuh pa srebrna.; exHrbtni plavuti imata IX, 14 plavutnic (Prvi del je jasno ločen od zadnjega, kar je eden od razpoznavnih znakov za določanje te vrste.; exObarvanost: Po hrbtu je temno zelene ali sive barve, po bokih nekoliko svetlejši, srebrn, spodnji del bokov je zlate barve s sedmimi temnimi vzdolžnimi progami, trebuh pa je bel.; exMorfologija: Ima podolgovat, jajčast, v hrbtnem delu sploščen trup, majhna usta, v niz razporejene slabotne zobce v zgornji čeljusti, skorajda brezzobo spodnjo čeljust in v nekakšno vrsto plošč sestavljene goltne zobe.; exObarvanost: Po hrbtu je modrikaste barve, spodnji del bokov in trebuh sta srebrna.; ex1Ima številne koničaste kožne izrastke, pogoste predvsem na sprednjem delu prsnih plavuti, glavi in gobcu, na srednjem delu hrbta in repu.; ex1Na prednjem delu repa ima veliko bodico.; ex1Nekatere sladkovodne ribe, ki se hranijo s kopenskimi žuželkami, imajo zgoraj ležeča usta: usta so v zgornjem delu glave in so obrnjena navzgor.; ex1Jesetri, somi in krapi, ki se hranijo na dnu, pa imajo spodaj ležeča usta: usta so v spodnjem delu glave in so obrnjena navzdol.; ex1Po drugi strani se podoživljanju teh dogodkov človek ne more izogniti, tudi če bi se preselil na drugi konec zemlje.; ex1Podjetje, ki v Šaleški dolini in delu Zgornje Savinjske doline skrbi za odvoz teh materialov, v svojo dejavnost vključuje okoli 14.000 gospodinjstev.; ex1Gospodarski kolobociji pa piskrčke pristavljajo politiki in vojska z južnega dela azijske celine z jedrskimi poskusi, tako da je destabilizacijska slika celotne regije začrtana.; ex1»Pomoči prve vrste ne potrebujemo, saj nas vsi tovrstni ''humanitarci'' še vedno uvrščajo v Jugoslavijo, zato smo pomoči deležni kot del nekdanje Jugoslavije, ne kot samostojna država.; ex1VODORAVNO: 1 globoka podolgovata vdolbina v apnenčastem svetu, škraplja, 7 sunek, s katerim se kaj spravi v premikanje, 13 vrsta aminokislin, 14 pastirska igra italijanskega pesnika Torquata Tassa, 15 stari del Maribora, 16 bajtar, 18 oranje, 19 indijska praksa duhovne koncentracije, 20 pripadnik Burov, 21 krilo rimske konjenice, 22 mejna reka med Slovaško in Madžarsko, 23 groza, strah, 24 tip lahkega mitraljeza, 25 varjeni šiv, 26 egiptovsko krajevno božanstvo Memfisa, 27 ameriški filmski režiser (Martin), 28 Olaf Tufte, 29 kraljica ilirskih Ardijejcev, 31 ime pesnika Zajca, 32 notranji, osrednji del stebla, 34 umetno modro barvilo, 36 slovenski pisatelj (Ivan, V Zali), 37 iglasto drevo.; ex1V drugem delu mesta, v stari hiši ob spodnjem trgu.; ex2Krimovke so namreč proti nekdanjim evropskim prvakinjam, vrsti Hypa iz južnega dela avstrijske prestolnice, pokazale najbolj navdušujočo igro v letošnji sezoni.; ex2Eno najprimernejših mest za odlaganje jajc bi bila v hrvaškem delu Jadrana lahko peščena plaža na Lopudu, vendar se ji želve zaradi obilice kopalcev pač izogibajo.; ex2Organizatorji so prepričani, da bo plesna kultura, ki je že osvojila južni del Slovenije, pritegnila na podobne prireditve tudi ostale Slovence.; ex2Bike močno vzburijo strastni poljubi in nežni ljubezenski ugrizi po hrbtnem delu vratu.; ex2Obiskovalce v podzemni del muzeja pospremi vodnik, ki jih sprejme v »prezivnici«, prostoru, kjer so prej rudarji čakali na spust v globino.; ex2Ob pogledu v preteklost in na potek dogodkov na tem delu Slovenije je mogoče o predmetu razpravljanja razmišljati v naslednji temeljni smeri.; ex2Še do leta 1965 so v spodnjem delu Čezsoče kmetje imeli okrog 75 glav goveje živine, kot kaže, pa je zaslužek boljši v industriji in turizmu kot pa v kmetijstvu, čeprav je v Čezsoči veliko ravnih površin.').
g(108642037,'exTo je turističen kraj.; exNe samo v kraju, kjer živite, povprašajte tudi v ostalih drevesnicah in vrtnarijah po Sloveniji, saj vam številne vrtnarije naročeno tudi pošljejo.; exKRAJ JE RHODES POIMENOVAL "RAZGLED NA SVET".; exTa kraj pozna kot lastno dlan, saj je z družino tja zahajala zadnja tri desetletja.; exPametni telefoni so se sicer pojavili tudi v naših krajih, le da večina ne ve, kaj bi z njimi.; exČe bi obveljalo določilo o nadmorski višini, bi se namreč dogajalo, da gostinci v Kostanjevici, Šentjerneju, Čatežu ob Savi in drugih nižinskih krajih cvička ne bi smeli več točiti.; exKljub vročini in velikemu strahu pred kačami, ki jih v teh krajih ne manjka, sem se odločil, da si ogledam vsaj del poti okoli gore.; exSem pride malo turistov, pa še to so po večini bogati Francozi, ki se umaknejo iz mrzle domovine v rajske kraje in od tod vodijo posle doma.; exNa ulici je precej samotno, bliža se poldan in z njim nova prigoda pri romanju v El Toboso, v kraj, kjer naj bi bila živela don Kihotova izvoljenka Dulcineja.; exZ vojnami, ki so pustošile okoli Jezusovega rojstnega kraja, so vrata postajala manjša, deležna prezidav …; ex1Da bi bilo cerkvi prizaneseno in ne zaradi spoštovanja, izkazovanja ponižnosti s priklonom pred svetim krajem …; ex1V torek zvečer je v kraju Kalše prišlo do požara v starejši stanovanjski hiši.; ex1Na drugi strani pa muslimanom protektorat nad najsvetejšim krajem, kamor Judje nimajo vstopa, daje precej samozavesti.; ex1Tudi Guti bi se raje kot k večnim tekmecem preselil na Apeninski polotok: "Rad spoznavam nove kraje.; ex1Osnovna šola iz kraja, od koder prihajam, ima v sedanjih prvih petih razredih po tri paralelke.; ex1»Mi, ki prebivamo v teh krajih, po vsej dolini do Čedada?; ex1Minister, pristojen za pravosodje, lahko na utemeljen predlog Notarske zbornice Slovenije imenuje notarja na prosto mesto v drugem kraju brez razpisa.; ex1HDZ - v Splitu je zanimiv grafit »HDZ - pokret za Jugoslaviju« - v Šibeniku in Splitu kljub uspehom zahteva zamenjave načelnikov policijskih uprav v teh dveh krajih, ker naj bi bila star partijski kader, kontaktirala naj bi s četniki in podobno.; ex1Navrgel sem ti zato, da ne boš mislil, da gre za kakšen neliterarni izraz, ker besedo v naših krajih veliko uporabljajo.; ex1No, tudi Slovenci smo nekdaj pri poimenovanju tujih krajev kar pošteno pokazali svojo domišljijo.; ex2Nekaj časa ste živeli v različnih krajih po svetu.; ex2Tako imenovana endemična golšavost je bila značilna za tiste kraje, kjer v vodi in hrani primanjkuje joda.; ex2Davek obračuna pristojni davčni organ v kraju sedeža oziroma stalnega prebivališča davčnega zavezanca.; ex2Enajst učencev osmega razreda osnovne šole Križevci pri Ljutomeru so v turističnem krožku razmišljali, kako privabiti v svoj kraj še več obiskovalcev in turistov.').
