g(108649345,'exNa desni strani je bila v zlatih črkah legenda imen in lokacij različnih nepremičnin.; exOčitno ji je nekdo na drugi strani razložil, da je zavarovalnica predlog umaknila.; ex« In je spet naštevala, kaj vse se naj onemu na oni strani posuši.; exŽivimo v družbi, katere člani so zmožni samo še minimalnih dogovorov, na primer, po kateri strani ceste naj vozimo.; exTako je velika, korenine je razrasla na vse strani, pravi, in tako razkošatila krošnjo, da meče senco celo na bližnjo njivo koruze.; exPodpira me in mi stoji ob strani.; exKar tako, da malo razbijemo sivino razvoja mobilnikov na tej strani oceana.; exSlovensko cesto so zaprli že ob 12. uri, prvi maturanti pa so na prizorišče začeli prihajati malo po 14. uri, ko so se na obeh straneh ceste že začeli zbirati tudi prvi radovedneži.; exFanny je našobila usta in nagnila glavo na eno stran, da bi pokazala divjakoma, kako je v svoji nenapovedljivosti močnejša.; exVolanski obroč je štirikrak, podprt s servoojačevalnikom, merilniki so okrogli in dovolj pregledni, obvolanske ročice in stikala so na dosegu roke, tudi tista na levi strani volanskega obroča.; ex1Morje je nepretrgoma valovilo in pljuskalo vanje z vseh strani, na obzorju pa se ni pokazala niti najmanjša ladja.; ex1In Lut na drugi strani sobe čuti, da bi resnično storil.; ex1Na primer narečja jugovzhodne Francije in italijanska narečja na drugi strani meje so si tako podobna, da bi lahko spadala v isti jezik.; ex1Vendar so tvoje oči, tvoja ušesa, tvoje srce za zmeraj na drugi strani!; ex1Neučinkovito igro gostov so Goričani po podaji Paniča z desne strani in lepim strelom z glavo Ekmečića kaznovali z golom za 2:0.; ex1Romantični in modernistični naravno-tehnični objekti vednosti v znanosti in drugih kulturnih praksah stojijo na eni strani tega razcepa.; ex1Postmodernistično oblikovanje stoji na drugi strani s svojim “protiestetskim” za vedno razcepljenih, problematiziranih, vedno umikajočih se in odloženih “objektov” vednosti in prakse, vključno z znaki, organizmi, sistemi, jazi in kulturami.; ex1Ta "konzervativna" razsežnost pri Wilsonu in številnih drugih sociobiologih je bila predmet ostre kritike s strani evolucijskih teoretikov, ki so si upali mnogo dlje pri procesu denaturiranja koordinacijskih načel na vseh stopnjah biotske organizacije v organski biologiji od genskih fragmentov do ekosistemov.; ex1Prvi višek rokometnega dneva v Rdeči dvorani bo ob 14.30, ko se bosta pomerili ženska reprezentanca Slovenije in selekcija tujk, ki si rokometni kruh služijo na sončni strani Alp.; ex1Enako jih imenujejo tudi zdravniki, opisujejo pa kot drobne ulkuse razjede, ki se lahko pojavljajo posamezno ali v skupinah na notranji strani lic, ustnic ali pod jezikom.; ex2Na desni strani spalnice je na tleh zaškripala deska.; ex2Ob neki priložnosti je celo dejala, da sumi, da Moorova na drugi strani žice ni sama in da si nekdo zapisuje njun pogovor.; ex2Center za vodenje, nadzor in varnost celotnega premostitvenega objekta je v terminalu pri Lernackernu na švedski strani, kjer je tudi cestninska postaja.; ex2Na drugo stran se lahko v 35 minutah prepeljejo z vlaki, ki vozijo v 20-minutnih presledkih in so prilagojeni tudi za prevoz koles.; ex2"V teh težkih časih mi je stala ob strani, podarila pa mi je tudi Alice.').
