g(108652970,'exOsrednji prostor, namenjen kegljanju, za malo denarja ponuja sproščeno zabavo za vso družino, ljubiteljem te igre pravo možnost za rekreacijo, zaradi velikosti najsodobnejše opremljenega računalniško vodenega 16-steznega igrišča pa tudi vadbo in vrhunska tekmovanja za profesionalce.; exOb praznovanju obletnice na šoli že vse leto številne kulturne prireditve in strokovna srečanja - V novi sodobno opremljeni knjižnici bo prostor tudi za občasne razstave in manjše kulturne prireditve; exZdaj pa je že začelo zmanjkovati prostora, zato se obrača na jugovzhod.; exMinistrstvu za okolje, prostor in energijo so pravzaprav poslali grozeče zahteve, opremljene z besedami o postopkih na ustavnem sodišču.; exKo je izrekla te besede, se je v prostor vrnil prejšnji mrak.; exDr. Andrej Umek (1938), SKD, SLS, znanost (96 97), okolje in prostor (00 00), danes profesor na Fakulteti za gradbeništvo; exAvtorji se v filmu sprehajajo skozi čas in prostor, skušajo nam predstaviti bogato zgodovino in manj znano bogastvo Roga.; exV novi 22.a) tezi ali kasneje členu pa bi se besedilo glasilo: "Z denarno kaznijo najmanj 5.000 tolarjev se kaznuje posameznik, če kadi v javnem prostoru, kjer je kajenje prepovedano ali kadi v delovnih prostorih, kjer to ni dovoljeno.; exKOT DELO NA DOMU SE ŠTEJE OPRAVLJANJE DELA NA DOMU DELAVCA ALI V PROSTORIH PO NJEGOVI IZBIRI, VENDAR ZUNAJ DELOVNIH PROSTOROV DELODAJALCA.; exObiskovalce v podzemni del muzeja pospremi vodnik, ki jih sprejme v »prezivnici«, prostoru, kjer so prej rudarji čakali na spust v globino.; ex1Po večerji je predvidena zabava v klubskih prostorih, z didžejem, vstop vanje bo mogoč po polnoči tudi naključnim obiskovalcem (za 2000 tolarjev na osebo), je naštel Simon Soklič iz Asa.; ex1Povem vam, da bivanje na tako zoženem prostoru in ob tolikšnem hrupu ne bo več možno, saj je že sedaj domala neznosno.').
