g(108664443,'exVse več je ledu po žlebovih, ki se mu umikava v težka, včasih previsna mesta.; exV tem času se lososi ustalijo na enem kraju, izgubijo značilno srebrno in dobijo bakreno rdečo barvo, shujšajo in izgubijo mišično moč.; exCECIL RHODES JE BIL TAKO OČARAN NAD MATOBOM, DA SI JE TU IZBRAL PROSTOR ZA SVOJ GROB.; exV Evropi je pust ohranil določene prvobitne prvine, odvisno od kraja do kraja in od države do države.; exBoja bom našla, še preden ga v tem obupnem kraju pobere pljučnica ali tuberkuloza.; exTako obstaja na primer kriminalistično pravilo: Storilca zmeraj vleče nazaj na kraj zločina.; exDanes so mestne nekropole prenapolnjene kljub prekopavanju in premeščanju ‘nevzdrževanih’ ostankov v skupna grobišča: v Berlinu je treba čakati skoraj dva meseca, da se najde prostor na katerem si bodi od 116 pokopališč; na Japonskem smejo biti v Tokiu pokopani samo člani cesarske rodbine; znamenito washingtonsko pokopališče Arlington, ki premore 145 000 grobov, že deset let sprejema samo še ameriške predsednike in vojne heroje.; exVlada Republike Slovenije je odgovorna za prevoz osebja slovenskega kontingenta, njihovega orožja in opreme brez stroškov za Nato iz določenega kraja do njihovega štaba na območju operacij in vrnitve v skladu z medsebojno določenim razporedom kroženja.; exKot dober primer pripravljenosti, da bi v praksi lahko uresničevali akcijski program ukrepov Nacionalnega programa varstva okolja (NPVO) in strategije za ohranjevanje biotske raznovrstnosti, krajinske pestrosti ter varstva naravnih vrednot, pozivamo naslovnike, naj čimprej skličejo sestanek Ribiške družine Ribnica in izvajalcev gradbenih del ter se ob Bistrici na kraju samem dogovorijo o nadaljnih delih oz. boljšem sodelovanju.; exPodatki iz sistema omogočajo gospodarne odločitve o tem, kakšna prenapetostna zaščita električnih naprav je na posameznih območjih potrebna, lažje pa je tudi odkrivanje krajev poškodb zaradi strele.').
