g(109224911,'exTisto, za kar gre v razpravah o modernizmu in postmodernizmu, je vzorec razmerij med telesi in jezikom ter v njih.; exTo je strašljiv pogled na razmerje med telesom in jezikom za tiste izmed nas, ki bi o realnosti še vedno radi govorili z več zaupanja, kot pa dopuščamo razpravam krščanske desnice o ponovnem Kristusovem prihodu in njihovemu očaranju nad končnim uničenjem sveta.; exV okviru neke vrste tehnološkega holizma so bili prvi teoretični pristopi k biološkemu telesu z vidika kibernetičnih komunikacijskih sistemov od poznih štiridesetih pa vse do konca šestdesetih nagnjeni h koordinaciji pod vplivom "krožno-kavzalnih mehanizmov povratne informacije".; exV petdesetih letih so biološka telesa postala tehnološki komunikacijski sistemi, a se pri tem še niso povsem rekonstituirala kot prostori "razlik" v postmodernem smislu - kot igra označevalcev in replikatorjev v strateškem polju, katerega pomen je le z zelo problematičnega vidika odvisen od zunanjega sveta.').
g(109225146,'exRazširjenost: Prvotno je bil razširjen v Severni Ameriki, predvsem v jezerih in toplejših odsekih tekočih vod.; exVečja jata daje pod vodo vtis rdečkasto rjave barve.; exD Kadar se riba odloči, da se spusti v globljo vodo, ji ribič ne nasprotuje, nasloni se na naslonjalo stola, z zapetim pasom pa vzdržuje potreben položaj palice in si v kratkem predahu nabira novih moči.; exMisel, da se Cornelia II ne ziblje več ošabno na vodi, mu je pognala prijeten, skoraj čuten drget po telesu.; exNato je pomislil na truplo, ki ga trga na drobne koščke, meče v zrak, nato pa pade v vodo -- to predstavo je vedno znova podoživljal v mislih in vsakič mu je bila bolj všeč.; exV Mariboru so se zbrali praktiki s tega področja, ki jih je zanimala vladna politika o vodah v Sloveniji, predvsem pa konkretni primeri čiščenja vod pri nas.; exPo našem merjenju časa je preteklo po strugi Donave veliko vode do ponovnega utelešanja.; exEvropski prvak v kategoriji Masters Rob Costa je dejal: Strinjam se, da je treba skoke v vodo približati ljudem, vendar bi na tekmovanjih rad videl dovolj visoke standarde.; exZa srčne operacije že uporabljajo umetne mišične strukture in v uporabi so že "čitalci" očesne roženice, ki ni enaka niti pri dveh osebah in jih uporabljajo kot PIN kodoZ vodo v Evropo; exTudi bosanje v primernem potočku ali plitvejši vodi okrepi krvni obtok in segreje noge.; ex1Iz daljave se je, podoben pošasti, ki bi z vrtoglavo hitrostjo divjala po vodi, bližal tornado.; ex1Zato strokovnjaki Oceanografskega inštituta iz Dubrovnika domnevajo, da te jadranske morske želve pravzaprav gnezdijo v Grčiji, od koder del populacije redno migrira v hrvaške vode, kjer se tudi naseli in se do grških obal vrača le v času gnezdenja.; ex1Še preden je padel v vodo, je Roe slišala, kako je zakričal.; ex1Teči skozi visok gost plevel je bilo, kakor da bi brodila po vodi.; ex1Jure: Mlinček voda poganja, ko gre tud pod vodo, pa vodo zajame.').
