g(109270894,'exZanimive so že lokacije bienalov sodobne umetnosti, ki se pojavljajo na različnih koncih sveta, v metropolah, ki so prenaseljene, se dvigajo v razkošju in hkrati dušijo v številkah visoke brezposelnosti.; exKasneje so ga množično naselili po vsem svetu.; exNavdušena je bila nad samostojnim delom, sodelovanju z ljudmi z vsega sveta, v službi je veliko potovala tako po Franciji kot po svetu.; exZato pa držimo pesti, da bodo čimprej, če sploh kdaj, luč sveta ugledali »evropski« pametniki - takšni, ki poznajo Microsoftov pocketPC, ali tisti drugi iz tabora, ki podpira operacijski sistem symbian.; exTik pred začetkom je približno dva tisoč plesnih parov nagovorila tudi županja Vika Potočnik: Pozdravljeni v najmlajšem mestu na svetu.; exKo sem v sedemdesetih letih svojim italijanskim znancem v Rimu povedal, da se nameravam preseliti v Jugoslavijo, so me pogledali s takšnim sočutjem, kot da odhajam v deželo dinozavrov, saj se ve, da se za prenekatere današnje Rimljane svet začenja in konča na okoliških gričih.; exNa prelomu zadnjega tisočletja je bilo zelo popularno razpredati o koncu sveta, o globalni katastrofi, o vseh mogočih svetovnih nesrečah, ki jih bodo povzročili hudi potresi, vulkanski izbruhi, poplave, premiki zemeljskih polov, celo o bližajočem se kometu so vsi znali kaj povedati.; exVendar je vedela in se nasmehnila, ker je bil svet majhna kristalna žoga.; exSvojčas je bil to najhitrejši vlak na svetu, saj je pot opravil v 84 urah.; exNa otoke me je pritegnilo več kot 3000 endemičnih rastlin in pa zelo ogrožena vrsta ptiča kagu, na svetu jih živi le še okoli 200.; ex1Ko se »naberejo« nove generacije, se rodovna struktura ne poveča, temveč Nueri »pozabijo« nekatere od starejših generacij, tako da jih zmerom ostane samo deset do dvanajst: »In če imamo prav, ko domnevamo, da se rodovna struktura nikoli ne poveča, iz tega izhaja, da razdalja med začetkom sveta in današnjim dnem ostaja nespremenljiva.; ex1Med naravnimi spomeniki velja omeniti najnižje ležeči nasad smreke v Evropi, najvišje bukve na svetu in evropske živalske posebnosti, kot je medved ali ris.; ex1(Foto 6: Slika, ki je obšla svet.; ex1V italijanskem mestu Chiogga, kjer sta potekala dva mednarodna natečaja za otroško ilustracijo, je na prvem, katerega tema je bila Skrivnostni vzhod, med 450 ilustratorji iz vsega sveta tretje mesto zasedel Slovenec David Ličen, Andreja Burin pa je dobila posebno pohvalo.; ex1Nekateri bogati kmetavzarji so namreč poboj svojih živali vzeli za najbolj zabavno igro na svetu in svoje ovčke, po ukazu veterinarjev, streljali z vsem mogočim orožjem, na vse mogoče načine.; ex1V Ameriki so jo slavili kot največjo umetnostno drsalko na svetu, zanjo celo napisali valček Charlotte in kot prva drsalka je nastopala v filmih.; ex1V zadnjih treh letih je Real dobil namreč kar nekakšen monopol nad kupovanjem najboljših nogometašev na svetu.; ex1»Potem pa naj gre po svetu, kdor hoče.; ex1Pevec skupine U2 Bono je znan po humanitarni pomoči žrtvam katastrof po vsem svetu.; ex1To je strašljiv pogled na razmerje med telesom in jezikom za tiste izmed nas, ki bi o realnosti še vedno radi govorili z več zaupanja, kot pa dopuščamo razpravam krščanske desnice o ponovnem Kristusovem prihodu in njihovemu očaranju nad končnim uničenjem sveta.; ex2Rade bi mislile, da so naši pozivi k realnim svetovom več kot le obupan odmik od cinizma in dejanje vere, podobno kakšnemu drugemu kultu, ne glede na to, koliko prostora radodarno namenimo bogatim in vedno zgodovinsko specifičnim posredovanjem, s katerimi moramo me in vsi drugi spoznavati svet.; ex2Po mojem pač ni naloga komentatorke, da podcenjuje igralke in igralce, temveč, da nas vsaj malo popelje z zanimivostmi v ozadje najbolj uglednega teniškega turnirja na svetu.; ex2Do leta 2015 naj bi bilivsi otroci sveta v šolah; ex2Za nekaj pomežikov je verjela, da je v hotelu, za katerega pa se ni mogla za nič na svetu spomniti, da bi se v njem prijavila.; ex2Tisto kar bo ostalo od Libeskindovega načrta, sta spektakularna mestna trga, kakršna sta na Manhattnu popolnoma neznana, vzpenjajoči se obris Vrtov sveta na nebu in najbolj inteligenten spomenik, ki ga je bilo mogoče postaviti žrtvam 11. septembra.; ex2Ne tako davnega leta 1992 je mesto Manila zajela panika, ki jo je povzročilo verjetno najbolj čudno leteče bitje na svetu.; ex2S številnimi muzeji, galerijami, gledališči in univerzami, z rasno in narodnostno pisanostjo ter z največjoskupnostjo gejev na svetu San Francisco danes slovi kot najbolj odprto, gostoljubno in svetovljansko mesto ZDA').
