g(109480809,'exPoročilo je razburilo duhove po vsem svetu; eni so podvig peterice občudovali, nasprotniki so jih sovražili, v Sovjetski zvezi pa so Sorgeevo ime zavili v molk.; exMarijan Schiffrer, poslanec SKD in predsednik parlamentarne komisije za odnose s Slovenci v zamejstvu in po svetu, v časniku Parlamentarec o tem, kaj naj bi država ponudila oziroma dobila od zamejcev in Slovencev po svetu: "Zamejci bodo naš ključni člen, če in ko vstopimo v EU.; exTudi v svetu običajno na referendume hodi manj ljudi kot na volitve, morda pa imajo zato tudi manj referendumov kot volitev.; exČim boljše bo v Sloveniji znanje tujih jezikov, tem bolje se bo Slovenija sporazumevala s svetom.; exBrez slovenščine ni Evrope in sveta.; exTo je najlažje storiti prek umetnosti, kjer so čutila dovzetna za številne različne odtenke barv, tonov - s to izkušnjo se oblikuje odprtost, seznanjanje z drugačnim pa utrdi strpnost ter bogati lastno doživljanje sveta in življenja.; exČeprav nas žarki sonca ne bodo mogli ogreti, bo že njegova svetloba dovolj, da bomo pozabili na sivino, ki nas čaka, in tudi pogled na svet okoli nas bo veliko lepši.; exKRAJ JE RHODES POIMENOVAL "RAZGLED NA SVET".; exNavdušena je bila nad samostojnim delom, sodelovanju z ljudmi z vsega sveta, v službi je veliko potovala tako po Franciji kot po svetu.; exTako, počitnice so tu, nekateri ste že doma, drugi še naprej letamo po svetu in bližnji okolici.; ex1Nova Kaledonija je dežela, ki se še do danes ni otresla Francozov in je ostala nekakšna zadnja kolonija modernega sveta.; ex1Jugoslavija je bila zibelka namiznega tenisa v Evropi in svetu.; ex1Je pa res, da je tudi v svetu pogost odstop od tožbe ali poravnava, ker se med procesom zgodijo spremembe ali pa preprosto ugotovijo, da bodo krivdo težko dokazali.; ex1Golf v Evropi in svetu še zdaleč ni šport elite, saj ga igra okrog 70 milijonov ljudi, kar ga uvršča med najbolj množične športe.; ex1VODORAVNO: 1 globoka podolgovata vdolbina v apnenčastem svetu, škraplja, 7 sunek, s katerim se kaj spravi v premikanje, 13 vrsta aminokislin, 14 pastirska igra italijanskega pesnika Torquata Tassa, 15 stari del Maribora, 16 bajtar, 18 oranje, 19 indijska praksa duhovne koncentracije, 20 pripadnik Burov, 21 krilo rimske konjenice, 22 mejna reka med Slovaško in Madžarsko, 23 groza, strah, 24 tip lahkega mitraljeza, 25 varjeni šiv, 26 egiptovsko krajevno božanstvo Memfisa, 27 ameriški filmski režiser (Martin), 28 Olaf Tufte, 29 kraljica ilirskih Ardijejcev, 31 ime pesnika Zajca, 32 notranji, osrednji del stebla, 34 umetno modro barvilo, 36 slovenski pisatelj (Ivan, V Zali), 37 iglasto drevo.; ex1Odgovor se ponuja sam: svet bi se po Afganistanu in Iraku očitno znašel pred novo vojno.; ex1»e se pri tem poveča teža prihodnosti v subjektivnem gospodinjenju z izkušnjami, je to zagotovo povezano s tehnično-industrijsko preoblikovanim svetom, ki človeka sili k vedno krajšim časovnim obdobjem, ko lahko nabira nove izkušnje in se lahko prilagodi vedno hitreje izzvanim spremembam.; ex1Nekatere duše potrebujejo več potrpežljivosti, razumevanja in nežnosti, da zmorejo prve korake v svet.; ex1Ja, se je nasmehnil Florijan in obmiroval s pogledom na skupinici kaplanov iz okoliških mestec in vasi, ki so se hranili ob obloženi mizi sredi prostora, ampak svet je ne glede na muke zadnjih dni odrešen.; ex1Upam, da podjetni turistični delavci, medtem ko bodo širili Pohorje, ne bodo pozabili na to, da je svet že zdavnaj izumil kabelsko televizijo.; ex2Tržaški župan Roberto Dipiazza je nekajkrat izrazil pripravljenost občine, da bi izvajala določila zakona o zaščiti manjšine na robu kraške planote, ki sodi v vzhodno- in zahodnokraški rajonski svet, mesto pa naj bi ostalo izvzeto iz zaščitnih norm.; ex2V petdesetih letih so biološka telesa postala tehnološki komunikacijski sistemi, a se pri tem še niso povsem rekonstituirala kot prostori "razlik" v postmodernem smislu - kot igra označevalcev in replikatorjev v strateškem polju, katerega pomen je le z zelo problematičnega vidika odvisen od zunanjega sveta.; ex2Kot intonacija celote, nemara spomin na nekdanji ''dan ljubezni'' s svetom.; ex2Glas Haberlove stopi na opustošeno obalo, v opustošeni svet, razsrediščen, shizofren in absolutno razbolen.; ex2Tehnologijo je razvil svetovalec kanadske vlade dr. Norman L. Arrison, ki je drugim povedal, da v osmih državah po svetu že deluje 27 projektov s tovrstno tehnologijo.; ex2Bolezen norih krav (BSE - Bovine Spongiforme Enzephalophatie) vsesplošno vznemirja ljudi tako po svetu kot tudi pri nas.; ex2Nekaj časa ste živeli v različnih krajih po svetu.; ex2Na zahodu junak ubije zmaja in iz njegovega telesa zgradi svet.; ex2Oskrbnik gradu takole pomodruje ob mladem Frideriku: nenavadno strasten je, na sebi zbere vso grešnost, zaradi njega je svet bolj čist.; ex2Politiki, ki so s kratkovidno in neodgovorno politiko zakuhali tak svet, v tem peklenskem položaju povsem izgubljajo razsodnost; da bi našli opravičilo pred pretresenim ljudstvom, obljubljajo najbolj primitivne odgovore, zob za zob, krvno maščevanje ne le proti krivcem, ampak tudi proti vsej njihovi okolici, obljubljajo rasno vojno.; ex3Med 180 vzorci sovinjona oz. muškatnega silvanca iz 14 držav z vsega sveta je najvišjo oceno dobil vzorec iz Krškega.; ex3V sodni dvorani je dejal, da nima več vstopa na njihov svet in naj pusti otroka pri miru.').
