g(109632518,'exV Vipapu pripravljajo tudi program presežnih delavcev, nekatere so že prekvalificirali in zaposlili v podjetjih, s katerimi poslovno sodelujejo, kljub temu pa bo kakih 360 ljudi konec leta ostalo brez službe.; exTudi pravilniki podjetij vključujejo ukrepe za delavce, ki bi bili na delovnem mestu pod vplivom mamil.; exProti njej sta pričala dva delavca, ki sta živela v njeni hiši.; exZa delavce zaposlene pri zasebnih delodajalcih (120. člen ZDR) - samostojni podjetniki - je višina nadomestila za prehrano med delom lahko določena le v kolektivni pogodbi in pogodbi o zaposlitvi.; exUpam, da podjetni turistični delavci, medtem ko bodo širili Pohorje, ne bodo pozabili na to, da je svet že zdavnaj izumil kabelsko televizijo.; exVlada ob tem ugotavlja, da so v zaključnih fazah tudi vsi drugi, za izvajanje zakona o gospodarskih družbah pomembni oziroma z njim neločljivo povezani drugi zakonski projekti: revidiranje, notariat, sodelovanje delavcev pri upravljanju, trg vrednostnih papirjev, sanacija, tečaj in podobno.; exTo pa ne velja samo za prebivalce Slovenije, temveč tudi za vse Slovence, ki živijo zunaj geografskih in političnih meja naše države: za zamejske Slovence, delavce v tujini in izseljence.; exTako bo nekaj manj kot dva milijona najslabše plačanih delavcev v Britaniji čez dobrih sedem mesecev zaslužilo 3,70 funta na uro.; exNLRA SE JE OMEJIL NA PRAVICE DELAVCEV, DA ORGANIZIRAJO SVOJA ZDRUŽENJA IN SE KOLEKTIVNO POGAJAJO.; exPREDVSEM JE BIL NLRA UZAKONJEN Z NAMENOM, DA DELAVCI Z ZDRUŽEVANJEM V DELAVSKA ZDRUŽENJA IN S KOLEKTIVNIM POGAJANJEM PREK TEH ZDRUŽENJ REŠUJEJO MOREBITNE PROBLEME PRI DELU TER TAKO IZBOLJŠAJO DELOVNE RAZMERE IN POGOJE NA SVOJEM DELOVNEM MESTU.; ex1– NAZIV DELOVNEGA MESTA OZIROMA PODATKE O VRSTI DELA, ZA KATERO DELAVEC SKLEPA POGODBO O ZAPOSLITVI, S KRATKIM OPISOM POSLOV, KI JIH MORA OPRAVLJATI PO POGODBI O ZAPOSLITVI,; ex1RAZPOREJANJE DELAVCEV UREJA TUDI 24.; ex1ČLEN KPND, KI DOLOČA, DA JE DELAVCA MOGOČE RAZPOREDITI V DRUG ZAVOD, ORGANIZACIJO OZIROMA K DRUGEMU DELODAJALCU, ČE JE TO POTREBNO ZARADI NEMOTENEGA OPRAVLJANJA NALOG, IN SICER:; ex1KO DELAVEC ČAKA NA PRERAZPOREDITEV, DELODAJALEC PROTI NJEMU NE MORE IZVAJATI NOBENIH SANKCIJ, ČE NE OPRAVLJA DELA.; ex1KOT DELO NA DOMU SE ŠTEJE OPRAVLJANJE DELA NA DOMU DELAVCA ALI V PROSTORIH PO NJEGOVI IZBIRI, VENDAR ZUNAJ DELOVNIH PROSTOROV DELODAJALCA.; ex1ODPOVEDNI ROKI SO DOLOČENI RAZLIČNO, ČE POGODBO ODPOVEDUJE DELAVEC ALI ČE ODPOVEDUJE DELODAJALEC.; ex1ČE POGODBO O ZAPOSLITVI ODPOVEDUJE DELAVEC, JE MINIMALNI ODPOVEDNI ROK 30 DNI.; ex1PROGRAMA RAZREŠEVANJA PRESEŽNIH DELAVCEV NI TREBA SPREJETI, ČE JE SAMO EN DELAVEC PRESEŽEK.; ex1JAVNIH GOSPODARSKIH ZAVODIH TER PRI DRUGIH UPORABNIKIH PRORAČUNA I1 STROKOVNI DELAVCI; ex1DELODAJALEC MORA DELAVCU NADURNO DELO ODREDITI V PISNI OBLIKI (IZJEMOMA TUDI USTNO, V TEM PRIMERU SE PISNO ODREDITEV VROČI DELAVCU NAKNADNO, VENDAR NAJKASNEJE DO KONCA DELOVNEGA TEDNA PO OPRAVLJENEM NADURNEM DELU).; ex2OBVEZNA SESTAVINA POGODBE O ZAPOSLITVI JE DOGOVOR O NAČINU URESNIČEVANJA PRAVIC IN OBVEZNOSTI IZ TEGA DELOVNEGA RAZMERJA GLEDE NA PRAVICE IN OBVEZNOSTI DELAVCA PRI DELODAJALCU, KJER JE ZAPOSLEN S POLNIM DELOVNIM ČASOM.; ex2POGODBA O ZAPOSLITVI ZA DOPOLNILNO DELO PRENEHA VELJATI PO POTEKU DOGOVORJENEGA ČASA (IZ ČESAR IZHAJA, DA JE TAKŠNO POGODBO DOPUSTNO SKLENITI TUDI ZA DOLOČEN ČAS, LAHKO PA TUDI ZA NEDOLOČEN ČAS) ALI ČE JE UMAKNJENO SOGLASJE DELODAJALCA, KJER JE DELAVEC ZAPOSLEN S POLNIM DELOVNIM ČASOM.; ex2ZVZD DOLOČA PRAVICE IN DOLŽNOSTI DELODAJALCEV IN DELAVCEV V ZVEZI Z VARNIM IN ZDRAVIM DELOM TER UKREPE ZA ZAGOTAVLJANJE VARNOSTI IN ZDRAVJA PRI DELU.; ex2Tudi Mednarodna organizacija dela, ki skrbi za pravice delavcev, v svoji konvenciji vsebuje restriktivne določbe o stavki v javnem sektorju.; ex2Uvedba sistema magnetnih listkov bi pomenila, da bi se število zaposlenih zmanjšalo za okoli 35 delavcev.; ex2V njej bi bilo zaposlenih deset delavcev, stroški vzdrževanja sistema pa naj ne bi presegli sedem odstotkov naložbene vrednosti na letni ravni.; ex2Oblast pravzaprav meni, da so se Rdeče brigade s svojimi izpostavami prebudile, da začenjajo biti objektivno nevarne, kakor beremo, in da si prizadevajo okrepiti svoje vrste z delavci, zaposlenimi v posameznih tovarnah.; ex2Kako so lahko vodilni marketinški delavci perutninarskega vele podjetja, ki svojo strategijo uspešnega nadaljnjega poslovanja gradijo menda prav na izpolnjevanju želja in sanj (ne le potreb) potrošnikov, zagrešili tako veliko napako, še danes ni jasno nikomur, bilo pa je slišati kar precej ciničnih na ta račun.; ex2V tem primeru delodajalec delavcu ni bil dolžan omogočiti zagovora, saj so obstajale okoliščine, zaradi katerih bi bilo od delodajalca neupravičeno pričakovati, da delavcu to omogoči.; ex2ENI OBRAZI DO NAZGA, DRUGI ŽE MED ZVEZDAMI - Avtorji evropskega filma leta in svetovne finančne in kritiške uspešnice Do nazga so obtoženi kraje scenarija, kar jih lahko stane skoraj ves zaslužek, stotnije ameriških "filmskih delavcev" pa so pred podelitvijo oskarjev 23. marca iz dneva v dan bolj in živčne.; ex3Takrat Slovenci še nismo poznali statusa svobodnega kulturnega delavca, za naše male in utesnjene socialne razmere se je zdel nemogoč, osamljeni zgled Ivana Cankarja iz bližnje preteklosti ni bil posebno vabljiv.; ex3Starejši otroci lahko reflektivni zapis pripravijo sami, v vrtcu pa priporočamo, da zapis pripravi strokovni delavec v obliki opisnega poročila, ki naj bo povzetek vseh opažanj o razvoju in napredku posameznega otroka, o njegovih navadah in aktivnostih, ki jih je usvojil v nekem daljšem časovnem obdobju (navadno v enem letu).; ex3", vzpostavljajo neposredne stike z delavci, jih poskušajo motivirati in izbrskati njihovo iniciativnost.; ex3Na vse ravni so uvedli tudi sistem planiranja ter sestanke z delavci, kjer se seznanijo s cilji in s svojo vlogo pri tem.').
