g(109917593,'exTudi zato s tovrstnim nasiljem ne ravnatelji ne učitelji nimajo izkušenj in ravnateljica ljubljanske šole je ravnala prav, ko se je nemudoma po pomoč obrnila na Svetovalni center za otroke, mladostnike in starše.; exDr. Bojan Dekleva: "Tudi če otrok po naravi ni najbolj odločen, se lahko nauči nasilju reči ''ne''.; exRodney je malce razdraženo pribil: »Dragi moj otrok, le za kakšnega me imaš.; exPri tem vsak otrok živi v svojem okolju doma ter v družbi svojih vrstnikov v šoli in zunaj nje.; exČe otroka piči čebela, osa ali sršen, ga skrbno opazujemo zaradi znakov preobčutljivostne reakcije, kot so huda bolečina, oteklina, oteženo dihanje.; exČe tak otrok ne dobi ustrezne nujne prve pomoči, je lahko naslednji pik usoden.; exCatherine Voisin, ki je v 17. stoletju delovala v pariški aristokraciji, si je izmislila črne maše, perverzno parodijo katoliškega obreda, obsegajočo spolne »vaje« in žrtvovanje otrok na oltarju.; exDel otrok in staršev, vajen barantanja, je začel zavirati, čeprav je projekt potrdil tudi Zavod za šolstvo in ga bo jeseni tudi eksterno ocenil.; exLeta 1966 je bila ta 26 umrlih žensk na 100.000 živorojenih otrok, leta 2000 pa se je ta številka še povečala, na 27,8 umrle ženske na enako število živorojenih otrok.; exVključevanje otrok v varčevanje se nadaljuje preko cicibanskih in šolskih hranilnic.; ex1S takim načinom spodbujanja otrok pa želimo spodbuditi otrokov občutek za odpovedovanje.; ex1Da bi spoznali življenje invalidnih otrok, so igrali sedečo odbojko ter se z zavezanimi očmi poskušali orientirati po prostoru (slika spodaj).; ex1Iz lanskoletnih izkušenj smo ugotovili, da imajo otroci raje bolj sprostitvene delavnice.; ex1Ker spadam v generacijo, ki so ji rekli »otroci cvetja« (ali kot piše na nekem beograjskem zidu »Otroci hiše cvetja«), se seveda spominjam, da smo vsi, brez izjeme, od najbolj pravovernih do najbolj brezvernih, za bogato obloženo mizo pridno »praznovali« prav vse praznike.; ex1Sploh, če se zavedamo, da otrokom težko razložiš, da ne gre na vlakec, ker je popolnoma neumno plačevati za kaj takšnega.; ex1In to v živalskem vrtu, za katerega si tako in tako plačal visoko vstopnino, ki za otroke, starejše od dveh let, stane sedemsto tolarjev, za odrasle pa čez tisoč ,in kjer voda stane 250 tolarjev, kornet pa celo malce več.; ex1Žrtev tolpe otrok!; ex1Včasih sem se priplazil sem in opazoval bogataške otroke, ki so se igrali na njem.; ex1In nazaj naj bi jo dobil z igro, ki je nisem poznal - v nasprotju s temi izkoreninjenimi otroki, ki niti z očesom ne trenejo, ko se poslavljajo od svojih mater!; ex1Kaj naj si mislimo o igri takšnih otrok?; ex2Ali so vedeli, da se tako delajo otroci?; ex2Kot otrok sem brcal žogo pred blokom, nato pa je prišla zamisel, da bi začel trenirati v nogometnem klubu in prišlo je do vpisa v Primorje.; ex2Danes mi je nekako usojeno, da govorimo o ogroženih skupinah, o nekadilcih, otrocih in tako naprej.; ex2Po osmih letih »sobivanja« s tujci - po podatkih hrastniškega občinskega vodstva je v centru trenutno nastanjenih 35 odraslih in dvanajst otrok - se zato v tej zasavski občini branijo vsakršnih novih priseljencev; tokrat pa gre po njihovem sploh za »popolnoma novo kategorijo«.; ex2Izprijenci bodo zanesljivo našli priložnost za nadlegovanje otrok, je menil predstavnik Mreže preživelih spolnega zlorabljanja duhovnikov Mark Serrano.; ex2V Veliki Britaniji vsak teden zaradi zlorabe umreta dva otroka.; ex2Ker nista hotela razkriti, kateri od njiju mu je zadal smrtni udarec, so ju obsodili na zgolj osem let zapora zaradi okrutnosti do otrok.; ex2Do leta 2015 naj bi bilivsi otroci sveta v šolah; ex2Za njimi trpijo otroci, razpon let, ko razjede po statistiki najpogosteje nastajajo, pa je med 10. in 40. letom starosti.; ex2Ekranizacije Dickensovega Oliverja Twista dajo orto-genetikom & agentom dednostne teorije vedno raison d''être: aristokratski otrok, zavržen ob rojstvu, govori - navkljub cockney-proletarskemu odraščanju - visoko angleščino.; ex3Na dan so otroci potegnili le paštetko, kuli in rumeno majico, nikjer pa ni bilo pričakovane, niti tiste najmanjše, med otroki zelo priljubljene klobase Poli.; ex3Kot da otroci niso potrošniki njihovih izdelkov.; ex3Če bi med številnimi raziskavami tržišča naredili še kakšno o tem, bi jim postalo kaj hitro jasno, da je večina klobas Poli v hladilnikih le zato, ker jih imajo radi otroci - kategorija potrošnikov, ki jo bodo v PP morali vzeti bolj resno kot doslej.; ex3Otroka poskusimo hraniti z mleki, ki imajo hidrolizirano beljakovino kazein.; ex3- V sredo okrog 18. ure se je v naselju Ivanjševci pri Prosenjakovcih na Goričkem pripetila tragična prometna nesreča, v kateri je izgubil življenje dveletni otrok.; ex3»Ostanita tukaj, otroka!; ex3»Nana, prosim, pazi na otroka!; ex3Navzočih je več sto otrok.; ex3Akupunktura je kot način zdravljenja in preprečevanja bolezni primerna tako za odrasle kot za otroke.; ex3Morda boste pomislili, da zabadanje iglic ni ravno primerno za otroke, vendar pa Emil Čater, dr. med., spec.; ex4V svojo najboljšo zbirko otroških je Župančič pritegnil nekaj pesmi, ki so nastale v letih 1900-1914 ter izšle predvsem v Zvončku ali zbirki »Lahkih nog naokrog« (Breza in hrast, Turek, Pastirčki, Otroci spuščajo mehurčke, Ples kralja Matjaža, Zeleni Jurij).; ex4Pred dvajset tisoč leti je kromanjonski človek bil sicer telesno enak nam, ni pa obvladal jezika, s katerim bi z besedami izrazil tiste značilnosti, zaradi katerih še danes kako osebo ocenimo kot privlačno: znamenja plodnosti pri ženski, pri moških pa sposobnost vzdrževanja družine in vodenje otrok.; ex4Navajanje na aktivno sodelovanje otrok zahteva od vzgojitelja, da obvladuje strategije za spodbujanje otrok k reflektiranju lastnega razvoja in za razvijanje njihove zmožnosti postavljanja lastnih ciljev in oblikovanja lastnih kriterijev in standardov.; ex4Pri tem je vzgojiteljevo zaupanje, da bo otrok tega sposoben, bistvenega pomena, saj se je le tako sposoben odpovedati svoji moči in avtoriteti, da o vsem odloča sam, in povabiti otroke, da odločajo, pa tudi da sprejemajo odgovornost.; ex4Vsak portfolio se zaključi z zapisom »poti, ki jo je otrok prehodil«, ki se ga pripravi s pomočjo prelistavanja portfolia oz. vsega, kar je bilo vloženo vanj.; ex4Starejši otroci lahko reflektivni zapis pripravijo sami, v vrtcu pa priporočamo, da zapis pripravi strokovni delavec v obliki opisnega poročila, ki naj bo povzetek vseh opažanj o razvoju in napredku posameznega otroka, o njegovih navadah in aktivnostih, ki jih je usvojil v nekem daljšem časovnem obdobju (navadno v enem letu).; ex4Priprava opisnega poročila je vzgojitelju v pomoč pri presoji, ali je proces učenja načrtoval, spremljal in izvajal tako, da ima dovolj dokazil o napredku posameznega otroka na pomembnih področjih razvoja, ki so v skladu z referenčnim okvirom.; ex4Opisno poročilo olajša komunikacijo s starši in preprečuje, da bi posameznikove značilnosti, navade, napredek in težave posploševali, ker bi se nam izgubile v množici otrok v skupini.; ex4- Maksimalno, vendar realno upoštevajmo vlogo otroka pri oblikovanju in vodenju njegovega portfolia kar je mogoče, delajmo skupaj v vrtcu.; ex4Najbolj priljubljen zimski svetnik je Miklavž, še posebej pri otrocih, saj jih obdaruje, za pridnost nagrajuje, poredne in nemarne pa prepusti kaznim spremljevalcev, parkeljnov.; ex5Najbrž odtod izhaja šega, da otrokom ponoči prinaša darove v nastavljene posode, odtod tudi tri jabolka, ki jih na podobah nosi s seboj in so pravzaprav tri kepe zlata, le da jih je ljudska domišljija spremenila po svoje; rdeča jabolka sodijo zato z orehi vred med obvezne darove, ki jih dobri svetnik prinaša pridnim otrokom v noči od 5. na 6. december.; ex5Ali je slišala Keza, kako mlajšim otrokom pripoveduje zgodbe, po katerih se je zdelo, da je Vrana lastnoročno rešila vse čarodeje v skupini ter obenem potolkla vsaj pol federalne vojske.; ex5Ali se je, ne meneč se za Vrano in Daniela, osredotočila na otroka pred seboj.; ex5Največkrat so prispeli borih nekaj trenutkov pred CRP in otroci so jim bili hvaležni.').
g(109918248,'exS čestitko ob rojstvu otroka in vpisom simboličnega zneska v hranilno knjižico novorojenčka povabi Dolenjska banka starše, naj varčujejo za svojega otroka in ga že v zgodnjem otroštvu navajajo na varčevanje.; exTa akcija, ki jo Dolenjska banka že 16. leto izvaja na Dolenjskem in v Beli krajini, ima dober odziv, saj se več kot polovica staršev odloči za obisk v banki in varčevanje za svojega otroka; z otvoritvijo ekspoziture Dolenjske banke v Krškem in Brežicah se akcija širi tudi na območje Posavja.; exIn drugače kot katerikoli otrok iz drobovja popolnoma moja.; exPopoldnevi tam predstavljajo naši družini velik užitek in predvsem otroci vsakič znova - smo zelo redni obiskovalci - z užitkom kukajo čez ograje k tigrom, slonom in žirafam, torej živalim, ki niso ravno del našega vsakdanjika.; exA da morajo starši dati štiristo tolarjev, da lahko njihovi otroci deset minut skačejo po novem trampolinu, in potem še, da se lahko peljejo krog z mini vlakcem, se mi pa zdi prehudo tržno naravnano.; exNeka psihologinja mi je rekla, da moram živeti le zase in za svojega otroka, sestro pa moram enostavno odmisliti, če me ne posluša.; exPreden prideta drugi in morda tretji otrok, so prvorojenci kakor edinci in uživajo vse njihove prednosti.; ex/ ko imaš otroka, si preprosto sploh ne moreš zamišljati, da bi ga; exSedele so, izmučenih obrazov in mlahavih teles, tako da tudi matere z otroki na rokah niso niti pomislile, da bi jih prosile za sedež; vse do mejnega prehoda, prek katerega je bilo treba peš, mimo carinikov obeh držav.; exIn ponovno ponavljam: do 90% oziroma do 93, 94% davkoplačevalcev dobi tukaj 2.800 tolarjev za prvega otroka med letom.; ex1Otrokoma pa to ni prav nič všeč.; ex1Prepričan sem, da moram rešiti svoja otroka; v bistvu pa sta me reševala onadva, tako da sta mi preprečevala, da bi obupal.; ex1Če so lahko ženske rojevale in vzgajale otroke brez priročnikov, ne vem, zakaj bi bilo zdaj kaj drugače.; ex1Ker si želim, da bi se med nosečnostjo dobro počutila, kar je pomembno zame in za otroka, rada poslušam glasbo in pišem dnevnik, v katerega si zapišem tudi podatke s pregleda z ultrazvokom.; ex1Roditi želim po naravni poti brez lajšanja bolečin, ker menim, da bolečina poveže mamo in otroka.; ex1Zdaj ko ni več t. i. kadrovskih štipendij, socialno šibke družine namreč nimajo denarja za domsko bivanje svojih otrok.; ex1Pravi, da kadarkoli ga kličejo otroci, v telefonski slušalki vse cvili, cvrči in hrešči, tako da sliši vse drugo, samo svojih otrok ne.; ex1Otrok te vibracije poveže še z vonjem materine kože, toploto telesa.; ex1Ko ga mati objame in mu zapoje pesmico ali pove kratko zgodbo, nevede otroku privzgaja občutek, da je to nekaj lepega.; ex1Čustveno prizadeto je pričala tudi Barbara P. iz sosednje vasi, s katero naj bi Godnov imel otroka.; ex2Govorila je o prestanem strahu, prosila je, da bi ona in njen otrok imela mir in da se kaj takega ne bi več ponovilo.; ex2V sodni dvorani je dejal, da nima več vstopa na njihov svet in naj pusti otroka pri miru.').
