g(110080869,'exMama in oče tudi.; exSmreka se dotika stropa in oče mora odrezati vrh.; exPotem, v nekakšnem pol snu vidim babico, kako prihaja v sobo in me poljublja na čelo, za njo prideta še oče in mama.; exMimo se je pripeljala deklica na triciklu, za katerim je stopal oče s psičkom.; exOče je bil še zelo mlad, oblečen v pulover in suknjič iz tvida.; ex»Strahotno žaluje za očetom,« ji je rekla Evansova.; exNapačno je mišljenje, da so mu bila vrata na vrh hrvaške glasbene scene zaradi znanega očeta in uspešne mame na široko odprta, zvezda iz sosednje države s slovenskimi koreninami odkriva, da je proti svojim ciljem moral vedno stopati po težji poti.; exObisk ameriškega predsednika Georgea W. Busha bo tako s seboj nosil tudi simboliko, saj je administracija njegovega očeta, predsednika Georgea H. W. Busha, leta 1991 nasprotovala osamosvojitvi Slovenije in potihem pristala na posredovanje JLA.; exMlada nemška deklica z imenom Hildegund je bila oblečena kot fant, ko je z očetom romala v Jeruzalem.; exOče ji je med potjo umrl in morala je poskrbeti sama zase, zato je šla v samostan.; ex1Med njimi morda film z naslovom: »Imam dve mami in dva očeta«.; ex1Moj oče me je zaplodil z mojo materjo pod zmajevim repom, rodil sem se pa v znamenju velikega medveda - zato sem robat in razuzdan.; ex1»Moj oče je velik strateg in velik osvajalec, dostojen dedič Velikega kana.; ex1Morda je vaša nečakinja tak primer, ponudi s tolažljivim glasom oče in opazuje slamnik, črne trakove na vratu, kako mahajo za njenim hrbtom.; ex1Merila sta se izpod čela, oče je dvignil skodelico in spustil po grlu zadnji požirek kave.; ex1Cigareta je zaplavala med njimi, sprejel jo je tudi oče, ponižno, vdano; zmehčala je prostor, misli, Kaja se je kmalu zatem prvič nasmehnila, seveda še vedno zbegana,; ex1Vzemite Larryja Fishburnea, slovitega surferja iz filma Apocalypse Now: v orto-črnskem filmu School Daze (1988, Spike Lee) je bil še militantno-uporniški aktivist, vdan pučistični razrešitvi »črne stvari«, zdaj v filmu Boyz''n the Hood (John Singleton) pa je dobro asimilirani oče, ki skuša svojemu sinu pokazati pedagoško pot iz geta.; ex1Moj oče se je tako trudil, da bi me obvaroval pred tatinskimi karakterji v otroškem počitniškem taboru - in kljub temu se je zgodilo: Postal sem žrtev teh tatov!; ex1" me je vprašal oče.; ex1Povsem Stasi-oče!; ex2Darja: Mojemu očetu recimo so naše trenutne smernice noro všeč, verjamem pa, da kakemu drugemu petdesetletniku ne zveni tako zelo poslušljivo (smeh){#8230} Kakor za koga!; ex2Oče mi je podaril kamero super osem.; ex2Zato so na župana naslovili prošnjo, ki jo je podpisalo 69 mater oziroma očetov, naj v prvih razredih omogoči skupinsko pedagoško delo.; ex2»V sedmi vrstici imenuje svojega očeta kalina.; ex2Tako naj bi trem hčeram siromašnega očeta ponoči skozi okno porinil tri kepe zlata in jim tako priskrbel potrebno doto.; ex2Toda očetu je obljubil pomoč pri preizkušanju zmogljivosti programov, zato se je sklenil soočiti s svojimi strahovi.; ex2Tudi njen oče Marjan P. ne želi imeti več opravka z Godnovim.; ex2Kakšno grozno leto je bilo to: najprej je umrla njegova mama Luciana Pavarottija Adela, 86, kmalu zatem oče Fernando, 89, naposled pa je sloviti italijanski tenorist Luciano Pavarotti točil grenke solze še za svojim sinom Ricardom, ki je umrl ob porodu.').
