g(110260706,'exGospodar, sem odgovoril, lahko gospoduje nad dejanji služabnika, ne pa tudi nad njegovim življenjem.; exVojne poleg tega terjajo velikansko ceno v človeških življenjih, razdejanju in psiholoških posledicah, ki se celijo več generacij.').
