g(110289039,'exSamo sedla je, kot sede človek, kadar prvič pride na obisk in se trudi, da ne bi bil preveč vsiljiv.; exOn ni bil uslišan, njegova daritev je bila zavrnjena, in tu že ne gre drugače, kot da se je človek vprašal, kaj zdaj to pomeni.; exKo potapljač koralo odlomi in prinese na kopno, se bitjeca skrijejo v notranje kanale, po katerih kroži voda, in človek vidi samo rdeče kamnito drevesce.; exTudi sam trdim, da bolan človek, odvisen od alkoholne omame, nima močne volje in da z njim lahko manipulirajo njemu enaki in vsi močnejši, saj sem to okusil na lastni koži.; exOdklenkalo pa bi predvsem mazačem, ki nepošteno služijo denar, težave pacientov pa ostajajo, se večajo in celo njihovim bližnjim onemogočajo človeka vredno življenje.; exZato ker je družba vedno bolj permisivna, vse dopuščajoča, se vedno manj državljanov drži pravil, ki so temeljni pogoj za rast človeka in civilizacije.; exPo drugi strani se podoživljanju teh dogodkov človek ne more izogniti, tudi če bi se preselil na drugi konec zemlje.; exVes blaten in lačen, moker in naveličan čakanja sem bil ob srečanju s kagujem nenadoma najsrečnejši človek.; exGensko spreminjanje tako rastlin kot živali uporablja človek že tisočletja, vse odkar jih je začel udomačevati, saj vsako križanje in izboljšanje lastnosti neke živali ali rastline pomeni spreminjanje njenega genskega materiala.; exTole gotovo ni darilce, kakršnega bi si človek želel ob začetku novega leta: Anna Nicole Smith, slačipunca, kvazimanekenka in igralka, očitno le ne bo bajno bogata vdova!').
