g(110787470,'exA veste, koliko žensk takole zapusti svoje partnerje in se potem vrnejo…; exO ženskah na pomembnih položajih pa pravi: "Še zmeraj nam je bistveno težje kot moškim, zaradi tega nas je tako malo v politiki, gospodarstvu, javnem sektorju...; exŽenskam se je težje odločiti za tako pot, ker sta naše odrekanje in slaba vest drugačna kot pri moških.; exŠe vedno obstaja neka ustaljena podoba ženske, s katero smo vsi obremenjeni, in dileme so zaradi tega hujše.; exLisa, ki je črpala moč iz poguma, ki je bil večji, kot si je mislila, se je nagnila naprej, stegnila roko čez mizo in prijela drugo žensko za roko.; exŽENSKA SE ZAOBLJUBI V SVOJEM ALI HČERINEM IMENU, DA BO SKLENILA SIGHEH Z VERSKIM VODJEM, NAJVEČKRAT S SAYYIDOM, KI JE PREROKOV POTOMEC.; exPOSEBEJ POMEMBNO PRI TEJ OBLIKI ZAČASNE POROKE JE, DA JE ŽENSKA TISTA, KI DA POBUDO ZA SKLENITEV ZVEZE IN TUDI DOLOČI POGOJE POGODBE, POGOSTO PA POGODBO TUDI PLAČA, MEDTEM KO IMA TAKŠNO VLOGO PRI DRUGIH OBLIKAH ZAČASNE POROKE MOŠKI.; exV SPEČEM ŽIVLJENJU RUTH RENDELL INŠPEKTORJU WEXFORDU USPE RAZVOZLATI MISTERIOZNI PRIMER UMORA ŠELE S POMOČJO HČERINE PRIPOMBE, DA BI MORALE ŽENSKE PRAKTICIRATI EONIZEM, ČE BI HOTELE BITI ENAKOPRAVNE.; exIZRAZ EONIZEM JE IZPELJAN IZ IMENA CHARLESA EONA DE BEAUMONTA, KI SE JE V ZGODNJEM DEVETNAJSTEM STOLETJU TRIINTRIDESET LET USPEŠNO PREOBLAČIL V ŽENSKO.; exNJEGOV SPOL SO ODKRILI ŠELE PO SMRTI, ČEPRAV JE ŽE VRSTO LET ŽIVEL Z ŽENSKO, KI PA TUDI NI VEDELA ZA NJEGOV SPOL.; ex1PODOBNA ZGODBA JE V PRIBLIŽNO ISTEM ČASU BURILA DUHOVE V ZDA, LE DA JE ŠLO ZA ŽENSKO, KI JE SKORAJ VSE ODRASLO ŽIVLJENJE PREŽIVELA KOT MOŠKI IN SO NJEN SPOL PRAV TAKO ODKRILI ŠELE PO SMRTI.; ex1ODPRAVILA SE JE NA POTOVANJE IN TAKOJ ODKRILA, DA KOT SAMSKA, NEZAVAROVANA ŽENSKA NE BO MOGLA PREŽIVETI, SAJ SO JO NAJPREJ SPOLNO NAPADLI IN NATO ŠE PRODALI.; ex1Odbor Združenih narodov za odpravo diskriminacije žensk je izrazil zaskrbljenost zaradi visoke maternalne umrljivosti v Sloveniji.; ex1Henrik je sklical sinodo šestindvajsetih nemških škofov, in ta je Gregorja odstavila; ena od obtožb je bila njegovo vsem znano "škandalozno druženje z ženskami", zlasti z grofico Matildo.; ex1Neki vitez je zanikal obtožbe sodomije med templjarji, "ker so lahko dobili vsako čedno in elegantno žensko, ki jim je bila všeč, in vzeli so si jih pogosto, ko so bili bogati in dovolj močni, da so si to lahko privoščili".; ex1V njem je bilo med drugim zapisano: "Po Rimu se vlačuge sprehajajo kot poročene ženske ali jezdijo na mulah, iz srca mesta pa jim sledijo plemenitaši in kleriki iz hiše kardinalov.; ex1Vrstni red; ženske: 1.; ex1Predvsem o tisti, ki ženskam »lajša« delo v hiši.; ex1Da bi sedela sama v dnevni sobi, obdana z razgaljenimi ženskami v diamantih.; ex1"Vendar to ne bo vplivalo na koledar ženske, ki bo rodila v decembru," je rekla Teodora Goodman.; ex2"Kakšna škoda," je rekla gospa Rapallo, "ker je bila Glorija samozavestna ženska in je imela svoj slog v pisanju pisem.; ex2Spala je na spodnjem pogradu, medtem ko so ženske z zgornjih postelj mimo njene glave bruhale, kar so zaužile.; ex2Na polotoku Kola na oddaljenem področju blizu Murmanska poslovnim ženskam pomaga 2.000-članski kongres žensk.; ex2V Sibiriji so feministke ustanovile časopis za ženske.; ex2V Moskvi žensko gledališče uprizarja igre, ki so jih o ženskah napisale ženske.; ex2Večina potnikov so bile ženske, oblečene v preprosta nabrana krila in rožaste bluze, na kolenih in pod sedežem pa so tovorile košare, cekarje in mreže, polne dobrot.; ex2Nekaj študentk dveh angleških ženskih kolidžev je zaprosilo Virginio Woolf za predavanje o Ženskah in leposlovju.; ex2In ker je bila Virginia Woolf nedvomno ženska, so logično sklepale, da bo o ponujeni temi – Ženske in leposlovje – znala kaj zanimivega povedati.; ex2Morda so potrebovale tudi malo spodbude: kar nekaj se jih je želelo poskusiti z ustvarjalnim pisanjem, pa so čutile, da je vse, kar napiše ženska, deležno skoraj nevoljnega ocenjevanja, kot bi v »pravi« književnosti nekako ne imelo mesta.; ex2Bržčas pa so si tudi želele iz oči v oči videti žensko, pisateljico, ki si je vendarle zagotovila trdno mesto na sočasni literarni sceni.; ex3Najljubše so mu ženske, ki se okusno oblačijo, imajo dolge lase in napol priprte, rahlo vlažne ustnice.; ex3Tehtnice – moški in ženske – so zelo ponosni na svoje kulinarične sposobnosti.; ex3Tudi to je način, kako žensko vzburiti.; ex3Morda je ravno v njeni ljubezni do narave iskati razlog, zakaj toliko žensk, rojenih v tem znamenju, rado zahaja na nudistične plaže.; ex3Učenci naj napišejo, kakšni moški so po njihovem mnenju všeč ženskam.; ex3Napenjal je oči, ničesar ni bilo mogoče videti, ženska je hlipala v čisto nasprotnem kotu, in ker se je bal, da bo vsak hip spet zakričala, se ni upal premakniti.; ex3»Počakajte, slabo vidim,« reče ženska in se nagne k Hansu.; ex3Moški se bodo za zlate palice merili v teku na 200 m, 800 m, 1500 m, 400 m z ovirami, troskoku in metu diska, ženske pa na 100 m, 400 m, 1500 m, 3000 ali 5000 m, 100 m z ovirami in v skoku v višino.; ex3S 1. členom zakona o vojaški dolžnosti pa država dela razlike med moškim in ženskim spolom, saj vojaško dolžnost izvajajo v miru in vojni moški državljani, skladno z zakonom pa lahko sodelujejo tudi ženske.; ex3Če so lahko ženske rojevale in vzgajale otroke brez priročnikov, ne vem, zakaj bi bilo zdaj kaj drugače.; ex4»Viš, to je prinesla preklemana ženska!; ex4NEW YORK - Končno so raziskali, zakaj ženske tako rade telefonirajo, da imajo slušalko v roki ure in ure.; ex4Vedel sem, da je govorila o Casanovi in o strašni hiši, kjer je zadrževal druge ženske.; ex4Zelo zanimiva ženska.; ex4To je bil glavni motiv za lov, za zbirko bistrih, lepih, nadarjenih žensk in celo za dolgo vrsto umorov.; ex4Očividci prometne nesreče so si namreč dokaj dobro zapomnili ženski, ki sta se kobacali iz njegovega razbitega vozila in vse, ki so jima hoteli pomagati, prepričevali, da ne potrebujeta pomoči.; ex4Neka raziskava je tako dokazala, kako je pogostnost nasilja nad ženskami v neposredni povezavi z zunanjo temperaturo; največ žensk je pretepenih med poletno vročino.').
g(110788852,'exA vidiš, raje nimam ženske, dovolj mi teži sin in bivša!; exPo podatkih notranjega ministrstva so leta 1993 samo možje, ljubimci ali bivši partnerji umorili 14.000 žensk.; exTa ima možnosti za to, sovražnikove ženske ima pred nosom.; exŽensko položi na posteljo, zapestja in gležnje ji priklene na posteljne stranice in se nad njo sadistično izživlja.').
