g(113250542,'exOdklenkalo pa bi predvsem mazačem, ki nepošteno služijo denar, težave pacientov pa ostajajo, se večajo in celo njihovim bližnjim onemogočajo človeka vredno življenje.; ex»Vendar nisva imela denarja, Ibrahim pa zaradi rasizma tudi ni mogel dobiti ustrezne zaposlitve.; exProdala sva ves moj nakit in ko denarja ni bilo več, se je Ibrahim domislil, da bi dala časopisni oglas.; exNadzorujte porabo svojega denarja, spomnite se, kje in kako ste ga porabili, odkar ste bili nazadnje v banki.; exNismo proti zasebni lastnini in zdi se nam prav, da imajo nekateri več denarja, vendar si želimo več pravičnosti.; exEna od najpogostejših napačnih domnev pri ljudeh je, da denar sam po sebi prinaša le pozitivne lastnosti, večne dobičke in nič slabega.; exKot da mu ne gre za denar ali dragocenost, ki jo hoče prodati ...; exResda ste mi odsvetovali, da fanta iščem na tak način, in priznam, da z denarjem pritegneš raznovrstno svojat, ampak plakate bom vseeno obesila, ob vsakem kanalu, v vsakem baru, vsaki kavarni in muzeju.; exInstitucije civilne družbe (na primer Svetovni slovenski kongres) bi morale pozvati k bojkotu nasilnih trgovinskih središč, ki z zvenečimi avstrijskimi imeni ustvarjajo nelojalno konkurenco domačim podjetjem, denar pa prelivajo tja, od koder prihajajo najmočnejši sunki protislovenske politike, to je v Avstrijo.; exNjegov ostri, analitični razum zna razvozlati še tako zapleten problem, zato zna odlično upravljati z denarjem.; ex1Misel, da imata v rokah nekaj, česar ni odkril še nihče drug, le onadva, ju je tako vznemirila, da tudi naslednjega dne nista odšla v Portorož zapravljat denarja.').
