g(113464820,'exTa reakcija upočasnjuje razvoj vina in mu daje kompleksnost v barvi in okusu.; exVse bolj pa se oglašajo, ko imajo druge težave - zlasti pri učenju, v svojem razvoju in stiskah.; exPritisk na mlade je dandanes velik: najprej jih obremenjuje že njihov lastni razvoj, nato vse hujše zahteve šole, preobilica učne snovi, zahtevni urniki, vse ostrejši boj za čim boljše ocene in uvrstitev v razredu ter včasih tudi pretirana pričakovanja staršev.; exTo je po rekreativnem odmoru in jutranji skupini, avtorskem antropohigienskem konceptu svetovalne pomoči za razvoj zdrave osebnosti, moj tretji projekt, ki naj bi zmanjšal število neuspešnih učencev.; exNavajanje na aktivno sodelovanje otrok zahteva od vzgojitelja, da obvladuje strategije za spodbujanje otrok k reflektiranju lastnega razvoja in za razvijanje njihove zmožnosti postavljanja lastnih ciljev in oblikovanja lastnih kriterijev in standardov.; exStarejši otroci lahko reflektivni zapis pripravijo sami, v vrtcu pa priporočamo, da zapis pripravi strokovni delavec v obliki opisnega poročila, ki naj bo povzetek vseh opažanj o razvoju in napredku posameznega otroka, o njegovih navadah in aktivnostih, ki jih je usvojil v nekem daljšem časovnem obdobju (navadno v enem letu).; exDokazila in zapisi v portfoliu vzgojitelju pomagajo, da pripravi izčrpen in zanimiv zapis o različnih področjih otrokovega razvoja, ki temelji na dokazilih v portfoliu in ki je edinstven, kakor je izjemen vsak posameznik.; exPriprava opisnega poročila je vzgojitelju v pomoč pri presoji, ali je proces učenja načrtoval, spremljal in izvajal tako, da ima dovolj dokazil o napredku posameznega otroka na pomembnih področjih razvoja, ki so v skladu z referenčnim okvirom.; exHkrati je pozval predstavnike vseh strank, da navežejo stike s vodstvi strank na državni ravni in vsak po svojih močeh pomagajo pri razvoju občine, kajti čaka jih veliko dela.').
