g(113610162,'exLiga prvakov, 3. krog, skupina C: Real Madrid - Bayern 2:4 (1:3), Dinamo Kijev - Rosenborg 2:1 (2:0); vrstni red: Bayern 7 točk, Real 6, Dinamo 3, Roseborg 1; skupina D: Lazio - Feyenoord 1:2 (1:0), Olympique Marseille - Chelsea 1:0 (1:0); vrstni red: Feyenoord 6 točk, Chelsea in Lazio po 4, Marseille 3.; exSlovenijo seveda najbolj zanima Kinder, ki je zmagal tudi v Montecatiniju s 93:80 (Smodiš - 15 minut, 7 točk, za dve 3-1, za tri 1-1, prosti meti 2-2, 4 skoki, 2 izgubljeni žogi).; exV derbiju 24. kroga italijanskega prvenstva je Benetton premagal Scavolini z 91:90 (Nachbar - 5 minut, 2 točki, za dve 2-1, Tušek po poškodbi še okreva), Snaidero je izgubil pri Rosetu (Alibegović - 34 minut, 17 točk, za dve 11-6, prosti meti 7-5, 3 skoki, 1 asistenca, po 2 pridobljeni in izgubljeni točki), Siena pri Pafu s 66:76 (Gorenc - 37 minut, 17 točk, za dve 11-4, za tri 5-2, prosti meti 4-3, 4 skoki, po 2 pridobljeni in izgubljeni žogi) in Avellino doma s Cantujem s 75:76 (Hafnar - 17 minut, 6 točk, za dve 3-1, za tri 2-1, prosti meti 2-1, 1 skok, 4 pridobljene in 2 izgubljeni žogi).; ex»Ah, končno sem dočakala te presnete točke,« je malce po prihodu v cilj dejala tekmovalka, ki se je k slovenski biatlonski reprezentanci preselila iz vrst hrvaških nordijcev pred sezono 2000/01.; exReprezentantka doma iz okolice Reke se je hitro vključila v novo okolje, v naši vrsti so prijazno novinko lepo sprejeli, sama je čakala le še na višje dosežke od tistih, ki so ji v najboljšem primeru odpirali pota na zasledovalno tekmo, a nikdar med dobitnice točk.; exVladimir Stepania, gruzijski košarkar s slovenskim potnim listom, je za Miami igral sedem minut, v tem času pa dosegel štiri točke.; exToda na koncu bi lahko rekli, da so točko izgubili domači hokejisti.; exGoričani so se iz Ljudskega vrta vrnili brez treh točk in treh igralcev, toda optimizma jim ne manjka; exMet za tri točke: Geoplin Slovan 19-5, Union Olimpija 18-8.').
