g(113981403,'exKako to vse skupaj spominja na tisto, kar se je dogajalo v drugi svetovni vojni in tudi v zadnji vojni na Balkanu...; exRazlika je samo v tem, da v zadnji vojni Muslimani in Hrvati niso bili zavezniki proti Srbom, temveč so se tokrat množično pobijali tudi med seboj.; exPo vojni službuje v Ljubljani, najprej v gledališču, nato pretežno kot likovna pedagoginja do upokojitve.; exNekatere stranke se zavzemajo tudi za kazenske ovadbe zoper tiste, ki naj bi po vojni obračunavali zoper kolaborante.; exPo drugi svetovni vojni se je izkazalo, da ženevska konferenca ne varuje pripadnike osvobodilnih in podtalnih skupin, kar je bilo še posebej očitno med protikolonialnimi vojnami.; exMislim, da to vojno razumem.; exVendar ima to stanje »niti vojne niti miru« čudne učinke na Srbijo.; exDežela je polna neverjetne agresivnosti do Hrvatov, po Vojvodini pohajkujejo rezervisti, na vsakem koraku govorijo o Srbiji in vojni, o žrtvah, zločinih in junaštvih.; exHkrati pa ni nikjer tistih tako očitnih zunanjih znakov patriotizma, ki govorijo o deželi v vojni.; exKakor da se mobilizacija dogaja ponoči, vojna pa v Ameriki.; ex1Vojne ni, vendar je zelo težko najti Srba, ki dvomi, da bo v njej Srbija zmagala.; ex1Zvezo komunistov so že zgodaj, kmalu po vojni, zapuščali najbolj premeteni, ki so potem navadno končali kot direktorji uspešnih podjetij.; ex1Njeno zgodbo mu je povedala madame Bertin, stara čarovnica, ki je kljub vojni znala čez Kanal pretihotapiti obleke po najnovejši modi.; ex1S 1. členom zakona o vojaški dolžnosti pa država dela razlike med moškim in ženskim spolom, saj vojaško dolžnost izvajajo v miru in vojni moški državljani, skladno z zakonom pa lahko sodelujejo tudi ženske.; ex1Že pred drugo vojno so kupili novo brizgalno, ki je veljala takrat 5 do 6 parov dobrih volov.; ex1Med vojno so jo shranili v sosedski hiši, tako da leta 1944, ko je pogorel dom, ni končala v ognju.; ex1Snovanje iger ga je pritegovalo že v dijaških letih, zatem v začetku stoletja, v času prve vojne in v dvajsetih letih, misel nanje ga je obletavala še v tridesetih.').
