g(114408086,'exV prijetni družbi boste izvedeli, kar boste želeli, in to vam bo veliko pomagalo pri premagovanju vaših finančnih težav.; exPojavilo se je vprašanje, s kakšnimi novimi ukrepi bi se lahko japonska vlada spoprijela s težavami, pa se kaj bistveno novega ne more povedati.; exPogajanj ne podcenjujem tudi vizavi težav, s katerimi se unija v tgem trenutku spopada, ko diskutira in premleva vprašanja notranjih reform.').
