g(114513259,'exNemci so postali bolj previdni in govorijo, da predlogi niso predlogi nemške vlade, temveč razmišljanja v socialdemokratskem okolju; exRazlika ni nepomemba tedaj, ko pust ob preganjanju duhov in čarovnic postane v meščanskem okolju tudi satira vsakdanjega življenja in predvsem priložnost za karikiranje dnevne politike in politikov ter ironiziranje njihovega delovanja.; exUdeleženci helsinškega seminarja so se tako zavzeli za skupno referenčno ogrodje (»common denominators for a Master Degree in the EHEA«), to pa naj bo dovolj fleksibilno, da bo dopuščalo variacije v nacionalnih okoljih in na posameznih visoko-šolskih zavodih, obenem pa tudi dovolj jasno, da bo uporabno kot skupna definicija.; exTa seveda posega v zasebnost in le lokalno dosegljivost podatkov, vendar v nadzorovanem okolju to verjetno ni težava.').
g(114514039,'ex« »V prepričanju, da vzpostavitev evropskega visokošolskega prostora zahteva stalno podporo, nadzor in prilagajanje nenehno razvijajočim se potrebam, smo sklenili, da se čez dve leti znova srečamo, da bi presodili, kakšen je napredek, in ugotovili, kaj je še treba storiti.; exTa sklep je že dokaj konkretno nakazoval usmeritev k oblikovanju skupnega ogrodja za kvalifikacije v evropskem visoko-šolskem prostoru.; exGlavni namen Priporočila o priznavanju skupnih diplom torej je, prispevati k učinkovitemu zagotavljanju pravičnega priznavanja tiste vrste kvalifi-kacij, ki imajo znaten potencial za nastajanje evropskega visokošolskega prostora, a jih v strogo pravnem pogledu Lizbonska konvencija o prizna-vanju ne ureja.').
