g(115113229,'exVsebinsko so se njihove raziskave ukvarjale z nacistično okupacijo in odporom na omenjenem območju, pri čemer so raziskave časovno segale tudi v predvojno in povojno obdobje.; exNa razstavi avtorja Marka Košana in njegovih sodelavcev bodo predstavljeni motivi iz 40-letnega delovanja muzeja NOB, rekonstrukcija delovnega prostora iz obdobja ravnatelja Žolnirja, literatura, ki je nastajala v muzeju in z muzejem, delovanje muzeja v zadnjem desetletju pa bo prikazano z diaprojekcijo.; exZlasti čudno je bilo tudi zato, ker je ob času nakupa Vandermeerova graščina še stala in še vedno imela status zgodovinske znamenitosti.; exGre za umrljivost med nosečnostjo, ob porodu in v poporodnem obdobju.; exGuverner BS dr. France Arhar bo zato, kot smo izvedeli v DZ, državnemu zboru predlagal, da imenuje Andreja Ranta za viceguvernerja tudi za obdobje naslednjih šest let.; exV teh sanjah se je Pastirica prikazala kot gospa, ki mu je nakazala nova obdobja Oratorija: običajen travnik (travnik Filippi); končno stalni kraj bolj severno (Valdocco).; exNekatere vrste imajo pozimi obdobja počitka, ko se ne prehranjujejo.; exKo so lani ravno ob takem času (te dni to počnejo v Zgornji Savinjski dolini) zbirali posebne odpadke, se je odzvalo le 256 gospodinjstev.; exOsrednje telo bolonjskega procesa v dveletnih obdobjih med ministrskimi srečanji je t.i. Skupina za spremljanje bolonjskega procesa (BFUG), katere jedro sestavljajo (nacionalni) predstav-niki vseh podpisnic.; exSklepi in priporočila s tega seminarja Prim. v Dodatku B. V tem dokumentu se izraz master degree uporablja za opis vseh visokošolskih stopenj po drugem glavnem študijskem obdobju, ne glede na njihova različna imena v nacionalno določenih strokovnih in/ali znanstvenih naslovih.; ex1so prvi dokument te vrste in pomenijo referenčni okvir za oblikovanje nove stopnje po drugem glavnem študijskem obdobju.; ex1Shakespearov opus je sicer (zaradi preglednosti) porazdeljen na posamezna obdobja in zvrsti, vendar je kljub razlikam med posameznimi deli med seboj povezan z mnogimi temeljnimi vprašanji o človeku in njegovem statusu na planetu Zemlja.; ex1V kmetijstvu Poljska ne zahteva splošnega prehodnega obdobja, kot sta ga, denimo, Španija in Portugalska.; ex1Avtorji se v filmu sprehajajo skozi čas in prostor, skušajo nam predstaviti bogato zgodovino in manj znano bogastvo Roga.; ex1Ocenjevalno obdobje za sodnike začetnike bo podaljšano z dveh na štiri leta.; ex1»Jutri ob tem času kitajskega cesarstva ne bo več,« je zavpil Bajan, da bi preglasil trušč.; ex1Dr. Matej Lahovnik, 31 let, docent na ljubljanski ekonomski fakulteti, je študiral, ko se je socialistični sistem sesipal; teoretično je, pove, rasel z neoliberalističnimi pogledi na gospodarstvo in družbo, ki so jih kot edino zveličavne v tistem obdobju posredovali profesorji.; ex1Seveda pod pogojem, da v prihodnjem obdobju ne bodo začeli iskati partnerjev v poraženem levo-liberalnem bloku.; ex1- ZAPOSLITEV ZA DOLOČEN ČAS ZARADI DELA V PRILAGODITVENEM OBDOBJU NA PODLAGI DOKONČNE ODLOČBE IN POTRDILA PRISTOJNEGA ORGANA, IZDANE V POSTOPKU PRIZNAVANJA KVALIFIKACIJ PO POSEBNEM ZAKONU,; ex1TAKO NA PRIMER DOGOVOR O POLITIKI PLAČ ZA OBDOBJE 19992001, URADNI LIST RS, ŠT. 22-1017/99, RS 39-1963/99 (V ČASU VELJAVNOSTI ZAKONA O MINIMALNI PLAČI, O NAČINU USKLAJEVANJA PLAČ IN O REGRESU ZA LETNI DOPUST V OBDOBJU 19992001 (ZMPUPR, URADNI LIST RS, ŠT. 39-1963/99) SE NE UPORABLJAJO DOLOČBE PREDPISA, KI SO V NASPROTJU S TEM ZAKONOM), 51-2422/00 (ANEKS).; ex2Na primer uspešne in že vsepovsod navzoče finske in v zadnjem obdobju - pred leti z Miko Kojonkoskim, zdaj pa s Hannujem Lepistöjem - z njo že oplemenitene avstrijske.; ex2Odločitev mu je pomagal sprejeti kar Černomirdin sam, ki je odstopil od kandidature, ker ne želi biti "jabolko" spora v kriznem obdobju, ki ta hip vlada v Rusiji.; ex2Na domačih tekmah zaenkrat nimamo sreče, a se bo to s časom spremenilo.; ex2Dokupljena doba je obdobje, določeno z zakonom, v katerem zavarovanec ni vključen v obvezno ali prostovoljno pokojninsko in invalidsko zavarovanje, šteje pa se v zavarovalno dobo pod pogojem plačila prispevkov.; ex2Ugotovljeno je bilo, da so s podjetniško KP kršene določbe o usklajevanju plač iz Zakona o minimalni plači, o načinu usklajevanja plač in o regresu za letni dopust za obdobje 19992001.; ex2Zato je morala nasprotna udeleženka uskladiti izhodiščne plače za obdobje, ki je bilo določeno v izreku sodbe sodišča prve stopnje.; ex2LJUBLJANA - Do 22. decembra letos je zaradi prometnih nesreč na slovenskih cestah umrlo 13,67 odstotkov manj oseb kot v enakem obdobju lani, letos torej 303, lani pa 351.; ex2Od 1. maja letos, ko je bil sprejet nov zakon o varnosti cestnega prometa, do 22. decembra je umrlo 188 oseb, kar je za dobro četrtino manj kot v enakem obdobju lani.; ex2Inkubacijska doba, to je obdobje od okužbe do pojava kliničnih znakov bolezni, je lahko dolga nekaj mesecev ali nekaj let.; ex2V času, ko sem imel vaje v Ateljeju 212, sem se sprijateljil z dramaturgom Jocom, kot smo imenovali Mirino desno roko Jovana Ćirilova, ki je bil pozneje direktor v Jugoslovanskem dramskem gledališču.; ex3Gre, to mislim čisto resno, za zgodovinski dokument, ki napoveduje konec vznemirljivega, pa tudi dramatičnega obdobja slovenskega teatra, hkrati pa govori o globoki človeški stiski enega izmed največjih slovenskih igralcev vseh časov.; ex3O svoji ertevejevski pustolovščini sem napisal knjigo, ki bo morda nekoč izšla, tukaj bom navedel le nekaj bistvenih podatkov o tem nenavadnem obdobju mojega življenja.; ex3V obdobju precejšnje konkurence,je potrebno imeti veliko samozavesti, da si upaš ustvariti oziroma izdelati nekaj povsem novega, drugačnega…; ex3No, tudi to obdobje je minilo in konj se je prenehal usedati.').
g(115119536,'exNavkljub vsem tem govoricam in prerokbam vseh mogočih prerokov od davnine do današnjega časa moramo z zadovoljstvom ugotoviti, da se ni zgodilo nič kaj takega.; exPrav tako izzivalna je zelo rafinirana zgodba drame, čeprav je bil to prvenec tega avtorja; tematsko prepoznaven in sprejemljiv za današnji čas je tudi dramatikov gnev, ki je uporaben za navezavo te igre na sodobnost.').
g(115120528,'exZato je vprašanje javnega nadzora nad uporabo tveganih tehnologij temeljno vprašanje demokracije sodobnega sveta.').
g(115122231,'exNo, mislim, če sta se zadnje čase prepirala?; exNjegovi strokovnjaki so svetovali, naj oba fanta nekaj časa ne prideta v šolo, medtem pa se bodo pogovorili z razredom in razredničarko.; exSprejeta sicer še ni, saj se bodo z njo nekaj časa ukvarjali na medvladni konferenci, a ker bi ji to polletje predsedujoči Italijani radi dali ime po Rimu, si bodo prizadevali za čim manj poseganja v njeno vsebino.; exV tem času se lososi ustalijo na enem kraju, izgubijo značilno srebrno in dobijo bakreno rdečo barvo, shujšajo in izgubijo mišično moč.; exČe je tudi okolica jezera oligotrofna, lahko jezero ostane v takem stanju (beri čisto) dolgo časa.; exTo je čas bahavega cvetenja velikih, visokoraslih trav, kakršni so miskanti, pampaške trave in druge.; exTudi ta njena polurna pot je bila splet recitacij; drugega ji tudi ni preostalo, ko pa je režiser Bojan Labovič hotel pokazati čim več v čim krajšem času.; ex»Sicer je res, da je bilo v letu in pol na ministrstvu in drugod opravljeno ogromno delo, a za takšno nalogo je bilo časa absolutno premalo.; exMenim, da so bile strokovne podlage za razglasitev Nature 2000 narejene kakovostno, zmanjkalo pa je časa za boljše komuniciranje z javnostjo in z občinami.; exZGODBE PREOBLAČENJA, KJER JE IDENTITETA PREVZETA ZA DALJŠE OBDOBJE, V FIKCIJI IN V FILMU NISO REDKOST.; ex1PODOBNA ZGODBA JE V PRIBLIŽNO ISTEM ČASU BURILA DUHOVE V ZDA, LE DA JE ŠLO ZA ŽENSKO, KI JE SKORAJ VSE ODRASLO ŽIVLJENJE PREŽIVELA KOT MOŠKI IN SO NJEN SPOL PRAV TAKO ODKRILI ŠELE PO SMRTI.; ex1Potem je za nekaj časa utihnila.; ex1"Pred sprejetjem dopolnjene zakonodaje o lokalni samoupravi smo bili proti KS, sedaj jim ne nasprotujemo, če si jih ljudje želijo, vendar to ne pomeni, da je prišlo do preloma v našem mišlenju, ampak se je v tem času zakonodaja obrnila na glavo," je povedal Simončič.; ex1Dolenjske gospodarstvenike je zanimalo, ali bi bilo mogoče pri urejanju tehnične regulative v skupnosti priti do rešitev, ki bi enotno veljale za vse države hkrati, kajti Trimo mora za vsako državo dobiti posebne certifikate, kar trebanjskemu podjetju jemlje veliko časa in denarja.; ex1Otroška leta in čas osnovnošolskega šolanja preživi v Brežicah.; ex1Zadnje čase veliko razmišljam o moderni tehnologiji.; ex1Že dolgo časa jo je nepopisno jezila kratka, žehteča sapa Aljoše Sergeja.; ex1V tem času lahko tudi obnavljajo notranje organe.; ex1Član Valencie je bil v reprezentanci dolgo časa v senci, zdaj pa je eden nosilcev njene igre.; ex1Nekoliko čudno bi bilo, če bi v času od novembra morali kaj bistvenega spreminjati.; ex2Ta podjetja namreč rabijo več časa, da bodo lahko povečala proizvodne zmogljivosti, dodatno izobrazila zaposlene itd.; ex2V zadnjem času število nekoliko narašča, trenutno poznam dvanajst primerov, ki so aktualni.; ex2Namesto da bi posredovali tajno in hitro kot npr. kriminalisti, se šele čez dalj časa odzovejo na intervencijski klic z »marico«, na kateri na veliko piše Policija, pri tem pa v veliko veselje objestnih razgrajačev še pojačajo žaromete, tako da jih že od daleč opazijo in se pravočasno poskrijejo, po njihovem odhodu pa nadaljujejo svoj peklenski ples petard.; ex2- Ali konj z izkazanim veseljem ter zadovoljstvom pričakuje in v relativno kratkem času zaužije obrok krme, ki mu ga položite?; ex2Ideja o zaprtju mestnega središča za promet je že pred časom povzročila pravo razburjenje med lastniki trgovskih, gostinskih in drugih lokalov na eni ter stanovalci na drugi strani.; ex2Čez čas sem izvedel, da se je vrnil na Bled.; ex2Če so v njihovem času obstajale na primer tri mesece, jih bodo astronomi mogli opazovati skoraj osem let!; ex2Z rokami na kozarcih in zdrobljen na koščke je videl, da si je spisal vlogo nekakšnega odrešitelja, nekakšnega zmagovalca, vlogo zablodelega viteza, don Kihota, ki je zgrešil čas in vrata in na svojem vrancu prijezdil v sobo.; ex2V veliko veselje predsednika sekcije za kunčerejo pri SZDGPMŽ Marjana Ernestla je bila tako po dolgem času ponovno presežena številka 500 živali.; ex2Večino časa so bili boljši nasprotnik in v zadnji tretjini so vodili že s 4:1.; ex3Biologi so pojasnili, da glavate želve poletje preživijo v Grčiji, v vzhodni Jadran pa se podajo pozimi, ko iščejo toplejše morske tokove in peščene plaže, ki bi bile primerne za odlaganje jajc, ko je čas za to.; ex3Zato strokovnjaki Oceanografskega inštituta iz Dubrovnika domnevajo, da te jadranske morske želve pravzaprav gnezdijo v Grčiji, od koder del populacije redno migrira v hrvaške vode, kjer se tudi naseli in se do grških obal vrača le v času gnezdenja.; ex3« Jan, ki je že nekaj časa razmišljal o tem, da bi bilo mogoče dobro skrajšati jadra, je sicer zasikal nekaj kot vse je pod kontrolo, vendar je že trenutek pozneje na glas oznanil: »Pripravite se za krajšavo genove!; ex3Čas se med tem spremeni, stare rešitve pa potem pridejo navzkriž z novimi razmerami.; ex3Virk, Tomo: »Čas kratke zgodbe«.; ex3V: Čas kratke zgodbe.; ex3Osnovna hrana papagajev amadin, zlasti v času odraščanja mladičev, je mehka jajčna hrana, mokarji, kaljeno travniško, žitno in riževo seme.; ex3Na možnost izigravanja pravil, o kateri bomo pisali tokrat, smo bili opozorjeni že pred časom, točneje z začetkom 2. lige MNZ Ljubljana, ko je ekipa Factor-Šmartno odigrala prvo tekmo proti Belinki, toda treba je bilo zbrati dovolj dokazov o tem, da se v eni od lig MNZ Ljubljana res dogaja nekaj čudnega, da ne rečemo nepravilnega.; ex3Dolgo časa sem omahoval, ali bi napisal pismo, v katerem bi strnil svoje bojazni, pa vendar sem se tolažil, da država in državljani niso tako nerazumni, da bi podlegli egoističnim težnjam posameznikov in ozkih skupin.; ex3Maja-Káli: Še nekaj časa so se takole lovili z opico po paravanskem otoku.; ex4POGODBA O ZAPOSLITVI ZA DOPOLNILNO DELO PRENEHA VELJATI PO POTEKU DOGOVORJENEGA ČASA (IZ ČESAR IZHAJA, DA JE TAKŠNO POGODBO DOPUSTNO SKLENITI TUDI ZA DOLOČEN ČAS, LAHKO PA TUDI ZA NEDOLOČEN ČAS) ALI ČE JE UMAKNJENO SOGLASJE DELODAJALCA, KJER JE DELAVEC ZAPOSLEN S POLNIM DELOVNIM ČASOM.; ex4iz Kopra, ki ji je v tem času dal za uživanje najmanj 20 tablet ecstasyja.; ex4Saj veste, da imajo tablete le prehoden učinek, sami pa potrebujete nekaj, kar vas bo poživilo za dalj časa.; ex4»Zelo redka bolezen v teh časih.; ex4Gozdarsko kmetijska zadruga Srednja vas je že dalj časa v težavah Večja sprememba v klavnici - Usmeritev na trajne izdelke; ex4V tistem času se mi ni zdelo, da bi bilo v njem kaj tudi zame.; ex4Nekaj časa ste živeli v različnih krajih po svetu.; ex4V tem času je prevedel Kreidolfovo prozo s podobami »Palčki Poljanci«; snoval izvirne stihe za »Abecedo«, ki naj bi se jim pridružile izvirne slike; samostojno obdelal Meisejeve verze s podobami Casparijeve »Lahkih nog naokrog«; graškemu prof. Karlu Štreklju poslal za zbirko »Slovenske narodne pesmi« vrsto otroških nagajivk, ki jih je poznal iz Dragatuša in Vinice.; ex4Strokovnjak za poslovanje z nepremičninami iz Maribora, direktor nepremičninske agencije Dodoma in predsednik Nepremičninske zbornice Jože Murko, pravi, da je ta čas ponudba na slovenskem stanovanjskem trgu bistveno večja od povpraševanja.; ex4Gre, to mislim čisto resno, za zgodovinski dokument, ki napoveduje konec vznemirljivega, pa tudi dramatičnega obdobja slovenskega teatra, hkrati pa govori o globoki človeški stiski enega izmed največjih slovenskih igralcev vseh časov.; ex5S predstavo naj bi proslavili petintrideseto obletnico ustanovitve Male drame, ki sem jo pred polčetrtim desetletjem s Štihovo podporo postavil na noge in jo nekaj časa tudi uspešno vodil.; ex5Prevladujejo humoristični toni, vendar je med vrsticami izjemno humornih dialogov ves čas čutiti prisotnost resnega, skoraj filozofsko zastavljenega pogleda na svet.; ex5A v času, ko kajenje v Sloveniji sicer upada - smo namreč v evropskem vrhu po vedno nižjem, zdaj že 23,7-odstotnem deležu kadilcev, kar je mogoče pripisati tudi precej restriktivni zakonodaji, po hudih »bojih« in neverjetnem lobiranju tobačne industrije sprejeti leta 1996 -, se povečuje število kadilcev med mladimi in med ženskami.; ex5In prav zato bi bil potreben resen razmislek o škodljivosti početja, ki se mu je vendarle mogoče odreči in si s tem bistveno izboljšati kakovost življenja ter seveda podaljšati čas bivanja na tem planetu.; ex5Možno bi bilo, da bi z uporabo tehnične soli, ki se pozimi uporablja za soljenje cest ali v kemični industriji, uživali sol brez joda, kar pa bi po daljšem času vodilo v golšavost pod pogojem, da bi bila naša prehrana zelo enostranska.').
g(115123115,'exV teh dneh pričakujejo tudi pravno mnenje, ki je drugačno od vladnega in po katerem naj bi bilo mogoče sanacijski program spreminjati tudi večkrat.; exTa teden bo o duty freejih razpravljala parlamentarna komisija za evropske zadeve, pred dnevi pa je razpravo o tem začel (in jo bo še nadaljeval) tudi parlamentarni odbor za gospodarstvo.; exV tujini je zdržal le leto dni.; exToda tiskovna predstavnica haaškega tožilstva Florence Hartmann je potrdila, da bodo tožilci vložili vse obtožnice proti obtožencem za vojne zločine, ki so jih pripravili, ne glede na to, ali bo sodišče obstajalo le še leto dni ali dlje.; exO drugih zdravilnih lastnosti te zabele je slovenska poznavalka Meta Krese napisala knjigo Oljka in njeno olje (MK), ki je te dni že na voljo na tržišču.; exKo so lani ravno ob takem času (te dni to počnejo v Zgornji Savinjski dolini) zbirali posebne odpadke, se je odzvalo le 256 gospodinjstev.; exKo se »naberejo« nove generacije, se rodovna struktura ne poveča, temveč Nueri »pozabijo« nekatere od starejših generacij, tako da jih zmerom ostane samo deset do dvanajst: »In če imamo prav, ko domnevamo, da se rodovna struktura nikoli ne poveča, iz tega izhaja, da razdalja med začetkom sveta in današnjim dnem ostaja nespremenljiva.; exLoka TV je bila že leto dni v hudi finančni stiski, kar je bilo za gledalce več kot očitno, saj ni bilo več lastnega programa, v glavnem so prek oddajnika na Lubniku na kanalu 51 predvajali video-strani in stare posnetke drugih lokalnih televizij.; exZ včerajšnjim padcem smo drugič v zadnjih dneh zaznali preboj srednjeročnega drsečega povprečja od zgoraj navzdol.; exTako je bogato obložena miza teden dni spremljala pustne norčije tja do zaključnega romanja na Ptuj, kjer so bili pustni krofi in drugo pecivo zakon.; ex1On, ki je rekel v trenutkih globokega veselja, v dneh svojega zemeljskega življenja: Slavim te, Oče, Gospod neba in zemlje, da si prikril to modrim in razumnim in razodel malim (Lk 10,21), je hotel na meni pokazati svoje usmiljenje.; ex1Pišem vam, ker me je obisk ljubljanskega živalskega vrta pred nekaj dnevi pošteno razjezil.; ex1Toda spet jih je presenetil, ko je v bliskovitem manevru na dagestansko-čečenski meji zajel 22 ruskih policistov, ki jih je potem čez nekaj dni izpustil.; ex1Autosport poroča, da je posel sklenjen, čaka se le še na uradno potrditev, ki naj bi prišla v naslednjih dneh.; ex1V Italiji je pred nekaj dnevi izšla znamka nominale 2,80 evra, ki jo reklamirajo kot umetnost čipke.; ex1Zanimanje za Beckhama sta ob koncu minule sezone kazala tudi italijanska kluba Inter in AC Milan, pred tednom dni pa je United sporočil, da se je dogovoril za možnost prodaje nogometaša v Barcelono.; ex1Še posebej Rim in tudi Milano sta zelo zanimiva," je dejal Guti, katerega odhod v Italijo je bržčas samo še vprašanje dni.; ex1Svojega bogatega nogometnega znanja prav tako ne bo več prikazoval na slovenskih zelenicah, temveč zelo verjetno na Hrvaškem pri Inkerju, s katerim naj bi v teh dneh podpisal svojo bržčas zadnjo pogodbo v dolgoletni karieri.; ex1Veliki Žuti seveda ni mogel sprejeti takšnih pogojev, še sploh, če vemo, da naj bi mu Schollmayer v zadnjih dneh vseskozi zagotavljal, da ne bo nikakršnih problemov glede dogovora, saj naj bi bili cilji in načrti ter s tem tudi proračun kluba podobni kot lani.; ex1Tudi sicer je moč zlahka ugotoviti, da je v Sredozemlju na sploh z vsakim dnem manj primernih peščenih plaž, na katerih bi morske želve lahko odlagale svoja jajca.; ex2Kot primer poslabšanja razmer na tem področju je navedeno preganjanje prepovedane sekte Falun gong, katere dva tisoč članov so priprli ali zaprli v 40 kitajskih mestih samo v zadnjih dneh.; ex2Za že ustanovljene avtošole sicer še velja dveletni prehodni rok, v katerem morajo uskladiti svoje delovanje z novim zakonom, za tiste, ki nastajajo v teh dneh, pa je novi zakon že obvezujoč.; ex2V nekaj dneh je skozi vrata Bloomsburyja pridrlo več sto kuponov; rezultati žrebanja bodo znani kmalu in 4000 šolarjev bo zelo srečnih.; ex2Vprašanje, na katero ste že večkrat v zadnjih dneh odgovorili.; ex2Slavnemu Salzburgu smo njega dni rekli Solnograd, bahavemu Münchnu Monakovo, umetniškemu biseru Italije, Firenzam, Florenca, mestu na lagunah Veneziji pa Benetke.; ex2Občutki so nepozabni in se jih še nekaj dni po jahanju rada spominjam.; ex2Ob koncu novembra, tako pravi, bo šel s prijateljico Nicoletto Mantovani, 33, pred matičarja (če bo seveda do takrat ozdravel, saj je pred dnevi zaradi obolelosti odpovedal koncert v Panami in se odpravil na preiskavo na neko kliniko).').
