g(115129927,'exRazstavo bo v petek, 7. maja, ob 19. uri odprl Ivo Bizjak, varuh človekovih pravic.; exVseh izbirnikov je devet, poleg omenjenih pritisni in govori ter organizatorja so še operaterjeve storitve (WAP, GPRS), programi (igri Disco in Chic Pinball ter Translator in Size converter; te ne smejo preseči 128 kB), nastavitve (profili možnost kreiranja dveh lastnih, toni, teme, nastavitve obeh zaslonov, časa, datuma, bližnjic, glasovni ukazi, desna izbirna tipka), povezovanje (infrardeči vmesnik, GPRS), klicne nastavitve, nastavitve telefona, dodatkov, konfiguracije, nastavitve zaščitne narave), galerija (podobe, videoposnetki, teme, grafike, zvočni posnetki), predstavnost (digitalna kamera, predvajalnik, snemalnik zvoka, radio), zadnji klici (neodgovorjeni, prejeti in klicani …; exTelefon po 20. uri (063) 443-127.; exZa odhod smo določili četrto uro zjutraj.; exOb osmi uri sva se zagnala ob vrveh v kamin kot obsedena.; exUra je štiri zjutraj in na vzhodu se začenja daniti.; exV drugem delu, ki se bo začel ob 18. uri, bodo na portoroški ploščadi izvedli krajši program v spremstvu fanfar, po devetnajsti uri pa bo v restavraciji hotela Slovenija slavnostni program, ki ga bodo v celoti pripravili študentje.; exDanes ob dvajseti uri bo večer branja za branje, na katerem bodo nastopili Aleš Debeljak, Manca Košir, Ivanka Mestnik, Andreja Pleničar, Jože Zupan in študijski krožek širjenja bralne kulture razvojnoraziskovalnega centra Novo mesto.; exV petek, 12. maja, ob 18. uri bo medobčinsko srečanje najmlajših literatov in mladih literatov začetnikov.; exPo našem merjenju časa je preteklo po strugi Donave veliko vode do ponovnega utelešanja.; ex1Slovensko cesto so zaprli že ob 12. uri, prvi maturanti pa so na prizorišče začeli prihajati malo po 14. uri, ko so se na obeh straneh ceste že začeli zbirati tudi prvi radovedneži.; ex1Točno ob 15. uri so pari zaplesali četvorko, čeprav je ravno takrat začelo deževati.; ex1Občina Žalec v sodelovanju z žalskim Zavodom za kulturo za ponedeljek, 8. marca, ob 19. uri v dvorani Doma II. slovenskega tabora vabi na predstavitev zgoščenke Alenke Lesjak z naslovom Korak v življenje, s katero želi počastiti spomin na pesnico rojakinjo Meto Rainer.; ex1Vse dodatne informacije dobite po tel.: 02/576-12-05, po 15. uri, Dezider Baligač.; ex1Start med 7. in 10. uro pri Plečnikovem spomeniku v Litiji.; ex1Liga Hypo, danes ob 19. uri: Elektra - Helios, Rogla - Koper, Zagorje Banka Zasavje - Loka kava, ob 20. uri: Savinjski Hopsi - Alpos Kemoplast, Kraški zidar - Triglav,; ex1- Ko sta šla policista iz Most v soboto nekaj pred 14. uro mimo gostinskega lokala Sladki greh na Brodarjevem trgu, sta opazila neznanca, ki je imel za pasom na hrbtu pištolo.; ex1Pri Repanškovih na Homcu bo v nedeljo, 6. julija, spet veselo, saj bodo godci z diatonično harmoniko od 15. ure dalje igrali na vsakoletnem tekmovanju.; ex1Klub LokalPatriot iz Novega mesta v soboto ob 17. uri prireja večer, posvečen ženskim željam in potrebam.; ex1Vadi od 8. ure zjutraj do 14. ure popoldan, potem pa spet od 15.30 do 19. ure.; ex2Reli je bil super, konkurenca zelo močna, kar se vidi tudi po doseženih časih.; ex2OTOČEC - V soboto, 11. maja, od 15. ure dalje se bo restavracija Tango na Otočcu spremenila v pravi plesni center.; ex2Prav nič se mi ni mudilo, da bi bila ura še enkrat 9.18.; ex2Če želite preizkusiti izdelke Elizabeth Arden, ste od 23. do 28. septembra med 10. in 18. uro vabljeni v prodajalne Müller v centru Ljubljane in v BTC-ju, v Novem mestu, Murski Soboti, Kranju in Kopru ter v kranjsko parfumerijo Limoni.; ex2- V sredo okrog 18. ure se je v naselju Ivanjševci pri Prosenjakovcih na Goričkem pripetila tragična prometna nesreča, v kateri je izgubil življenje dveletni otrok.; ex2Mladinski kulturni center Maribor ob podpori Študentske organizacije Univerze v Mariboru pripravlja danes ob 19. uri v galeriji Abruni v Mariboru galerijski literarni večer.; ex2Po vsej verjetnosti zaradi petard pa je v Izoli istega dne ob 21. uri zagorelo v zabojniku na Bazoviški ulici.; ex2Spored Dnevnikovega turnirja v malem nogometu, skupina C, jutri ob 15. uri: Tiskarna Januš - Recinko Kočevje, ob 15.35: Ruski car - Pinesta Kranj, ob 16.10: Poljane Gemax - Aškerčeva Celje, ob 16.45: M-Express - Tango Šiber.; ex2Licitacija bo v nedeljo, 27.12.1998, ob 9. uri v prostorih PE Agroservis, Knafelčeva 2, Novo mesto.; ex2Ogled vozil bo v četrtek, 24.12.1998, od 8. do 15. ure ter eno uro pred začetkom licitacije.; ex3Za vozila pod zaporedno številko 11 - 15 je ogled samo v četrtek, 24.12., od 8. do 9. ure.; ex3V razredu do 500 ccm je bila dirka začasno prekinjena, zato so čase seštevali').
