g(115136453,'exOna je lahko spala največ pet ur, tako, da je revica bila večino dneva sama.; exKRŠKO - Po informacijah, ki smo jih dobili v krški tovarni papirja in celuloze, sta v papirniškem delu v torek, ko to poročamo, obratovala dva stroja, tretjega naj bi pognali tega dne popoldne.; exV celuloznem obratu so tega dne še opravljali remont, stroje pa naj bi pognali še pred koncem tega tedna.; exDan ne bi bil popoln, če ne bi sklenila enega od najinih dogovorov.').
g(115140405,'exLahko je spal deset, dvanajst ur, žena mu je vedno rekla, da bo prespal življenje…; exVeš, koliko najinega skupnega življenja gre zaradi tvojega spanca v nič?; exPridejo prijatelji (kasneje so izginili iz življenja naše družine).; exVsakega zobatca, ki ga bomo ujeli in pojedli , se bomo spominjali vse življenje.; exStrinjam se, da je v prispevku dobro napisano, kaj vse in kako vpliva na človeško življenje.; exTudi s tem, da zaradi svojega slabega razmišljanja, negativne naravnanosti in nepravilnega delovanja v življenju zapademo v katero koli bolezen, lahko tudi v odvisnost.; exOdklenkalo pa bi predvsem mazačem, ki nepošteno služijo denar, težave pacientov pa ostajajo, se večajo in celo njihovim bližnjim onemogočajo človeka vredno življenje.; exOd nekdaj ga je zanimalo, kako si v življenju organiziraš tisto, kar si želiš, in si sam, neodvisno od drugih, krojiš usodo.; exV zadnjem predhodnem življenju je bila moškega spola.; exZdi se torej, da je slovenski zakonodajalec sledil tudi zahtevi iz Magne Charte, da je »svoboda raziskovanja, poučevanja in študija temeljno načelo v življenju univerz; zato morajo vlade in univerze v okviru svojih pristojnosti zagotoviti spoštovanje te temeljne zahteve«.; ex1Mary Douglas vse življenje spremlja teorija institucij.; ex1On, ki je rekel v trenutkih globokega veselja, v dneh svojega zemeljskega življenja: Slavim te, Oče, Gospod neba in zemlje, da si prikril to modrim in razumnim in razodel malim (Lk 10,21), je hotel na meni pokazati svoje usmiljenje.; ex1Storilec je neki trinajstletni lokalni deček, žrtev pa ženska, ki je vstopila v stoto leto življenja.; ex1Epileptični napadi se lahko začnejo kadar koli v življenju, najpogosteje pa se pojavi prvi napad v prvih treh letih življenja ali med puberteto.; ex1« Prvi se je odzval poslušalec z Vrhnike, ki je zbranemu občinstvu oznanil, da že vse življenje je samo krvavice, pa mu nič ne manjka, čisto nič, če razumete, kaj hočem reči, a ne da ne, Mutti, veste, naša Mutti se tako rada pocrklja.; ex1Poleg tega rodiš dvakrat, morda trikrat v življenju, zato je treba vse čutiti.; ex1Imam pač takšno prepričanje, da v življenju ni nič podarjeno.; ex1Tad prepričuje Dixie, naj ne žaluje vse življenje za mrtvim bratom, ampak naj nekaj ljubezni prihrani za tiste, ki so še živi.; ex1Na slikah smo videvali Luciana Pavarottija, za katerega se je zdelo, da ne bo zdržal udarcev usode Zdaj pa se zdi, da je veliki Pavarotti le prebrodil dolino solz in se na jesen svojega življenja nadeja nove sreče.').
