g(115155220,'ex"Tistega večera sem preveč popil, zgodilo se je mesec dni po tem, ko sem izvedel, da me žena vara.; exKaj se je zgodilo, sem izvedel šele naslednjega dne iz časopisja," je v intervju za Stampo iz Torina izjavil morilec.; exPredvideni datum letošnje osrednje dirke je sovpadal z dnevom pogreba papeža Janeza Pavla II.; exDan pogreba se je križal tudi z načrti angleške kraljeve družine, ki je načrtovala poroko princa Charlesa in Camille Parker Bowles.; exTako sta bili dirka in poroka istega dne.; exKajpak biatlon še dolgo pri naših severnih sosedih ne bo dosegel takšne priljubljenosti kot v Nemčiji - nacionalni TV hiši ZDF in ARD sta že dan pred štartom sezone izčrpno poročali s prenovljenega štadiona, medtem ko domače ORF ni bilo še niti blizu - a posebni vlaki za obiskovalce iz Salzburga in Innsbrucka naj bi Avstrijcem vendarle približali to športno panogo.; exTo bo bivak, vreden zadnjih dni.; ex»Dva, tri dni.; exOpazil je novo jahto, ki je prejšnji dan še ni bilo v pristanišču.; exAdam je skoraj vedno odhajal v pisarno ob pol osmih, ona je skušala biti najpozneje ob osmih v delovni sobi, kjer je pisala kolumno za naslednji dan.; ex1In zdaj je, prav tako kakor prejšnje dni, sedel in z drobnim nasmehom na ustnicah strmel čez Hudson.; ex1Ko se je s taksijem peljala sem, je pomislila, da bi si prav lahko vzela čas in pregledala Adamovo pisalno mizo, toda ko se je ozrla okrog sebe, je nagonsko vedela, da danes ni pravi dan za to.; ex1Tudi pilo se je dobro trškogorsko vino, tisto za zdravje, po katerem drugi dan glava ne boli.; ex1Pot do novega izdelka ali le do izboljšave je dolga vsaj leto dni in terja delo različnih strokovnjakov, raziskovalcev trga, razvojnih konstruktorjev, oblikovalcev, psihologov, strokovnjakov z določenega področja raziskav in razvoja (če gre za gospodinjstvo, sodelujejo tudi kuharji, pri osebni negi pa ne gre brez medicincev) in tudi ljudi s ceste.; ex1Nadaljnjih 7 do 14 dni opazujemo, ali se je pojavil rdeč kolobar na telesu ali na mestu pika oziroma otrdel tilnik in bruhanje znak borelioze.; ex1« V prostem času najraje lenari in prebira knjige, predvsem tiste za osebnostno rast, v katerih najde veliko odgovorov na vprašanja, ki sem mu vsak dan porajajo.; ex1Najtežja pa je bila prav gotovo vrnitev pred letom dni, po štirih letih odsotnosti.; ex1Ko je prišel Henrik, resnično skesan, ga je pred trojnim obzidjem grofičine trdnjave pustil čakati tri dni v januarskem mrazu, čeprav je nosil samo spokorno obleko.; ex1Volilne so mi že prvi dan prinesle sive lase, saj so moji francoski prijatelji na svoji televiziji zasledili poročilo o slovenskem političnem preobratu in navalili z zasliševanji o tem, kaj se je preobrnilo.; ex1* Da bi preprečili širjenje infekcijskega konjunktivitisa, ne uporabljajte istih brisač kot drugi družinski člani ter in vsak dan zamenjajte brisačo in prevleko za blazino.; ex2Pogosto se zgodi, da zdravnik za boljše zdravje svetuje tudi kozarček ali dva vina na dan.; ex2Dokler vino pijemo v zmernih količinah, na primer kozarček na dan po obroku, nas vino res krepi, ko pa prestopimo mejo zmernega uživanja, ima vino ravno nasprotni učinek na naše zdravje.; ex2Tako da želeno blago lahko dostavimo še isti dan.; ex2Seveda pa to ni dosti pomagalo, saj je že drugi dan objava japonske brezposelnosti razblinila še tisto malo upanja na bolje.; ex2Starši, ki so bili navzoči na sestanku, so bili ogorčeni, ker jih je vodstvo šole o namerah selitve obvestilo šele deset dni pred vpisom v novo šolsko leto.; ex2DDV naj ne bilo treba plačevati tudi ob izvozu blaga in storitev, država pa naj bi neto izvoznikom vračala plačani davek najkasneje v roku 30 dni.; ex2Sicer pa naj bi vsaj v začetku DURS vračala preveč plačani davek v roku 30 do 90 dni, saj sicer obstaja nevarnost, da bi se proračun "likvidnostno zlomil".; ex2Cena ne bo ravno visoka, predvidoma bo treba za hrano in bivanje plačevati po 500 SIT na dan.; ex2Prizadevamo si, da bi bili do dneva vstopa v Unijo pripravljeni na vse zahteve enotnega trga.; ex2Joško Joras je sicer poleti zaradi neizplačanih denarnih kaznih 15 dni presedel v hrvaških zapornih.; ex3Naslednjega dne, v ponedeljek, 17. maja, si spet ogledujem trgovine in spominke.; ex3Za vstop in bivanje na tem otoku sem plačal 34 funtov in še vsak dan plačam po en funtek za feri.; ex3Pa vendar ne morem izbrisati sestrinega bednega življenja iz sebe, vsak dan znova mislim na nje.; ex3Ko je vse to prišlo na dan, sem mislila, da razpadam na koščke, dokončno pa je razpadla tudi moja iluzija o njem.; ex3Podobno se je istega dne zgodilo tudi z 39-letnim B. H. iz Metlike.; ex3Tako sta minila dva dneva, nato pa je luna obsijala temno gladino oceana, kakor da je beli dan.; ex3Dnevi so minevali.; ex3»Dan je ugoden za napad.; ex3Nekega dne sem slišal zgodbo o vrtiljaku sester usmiljenk.; ex3Še dve leti sem nastopala kot manekenka, trdno odločena, da se bo to nekega dne spremenilo.; ex4Ja, se je nasmehnil Florijan in obmiroval s pogledom na skupinici kaplanov iz okoliških mestec in vasi, ki so se hranili ob obloženi mizi sredi prostora, ampak svet je ne glede na muke zadnjih dni odrešen.; ex4Goran je z nemirno kretnjo, ki so bile v zadnjih dneh stalnica v njegovem obnašanju, pograbil cigarete z mize, prižgal in se nemo zagledal v televizijo.; ex4Znašel se je sredi zadnjega ceremoniala tistega dne, za konec bo župan povedal nekaj besed.; ex4" Tako smo se po zaslugi njenega prepričevanja proti grozeči zanemarjenosti oborožili še z drugim sesalcem, če bi se zgodilo, da bi morali naš 1100-vatni sesalec nekega dne dati v popravilo.; ex4Celo človeštvo je rezultat neštetih fukov - in jaz, Klaus z naslovnice, mladi znanstvenik, ki se je vsak dan bolj bližal njemu določeni Nobelovi nagradi, ni ničesar vedel o tem!; ex4Vsak dan ob štirih zjutraj jih razpadajoči vlak, ki ga je vlada leta 1937 rabljenega kupila od Nemcev, odpelje na delo v osemdeset kilometrov oddaljeni Rio.; ex4Celo več, prvi dnevi po izvalitvi so brez tega lahko celo usodni za večino teh in sorodnih vrst.; ex4Vsaj prvih 7 do 8 dni rabijo mladiči izredno veliko živalskih beljakovin, zato se varčevanje z njimi ne izplača.; ex4Janu, s katerim se skoraj vsak dan slišita po telefonu, je na srce položila nekaj nasvetov: zabičala mu je, da nekdanjih deklet niti v knjigi niti kako drugače ne sme žaliti in da naj se spominja najlepših trenutkov z njimi, slabe pa naj pozabi.; ex4Cerklje - Starši prvošolcev v občini Cerklje niso zadovoljni, ker učiteljici pri pouku ne pomaga vsak dan vzgojiteljica.; ex5Sledil bo miting na olimpijskem štadionu v Rimu (2. julij), nato bodo atleti in atletinje tekmovali v Parizu (23. julij), 14 dni kasneje v Zürichu (to bo tudi zadnji test pred OI v Atenah), 3. septembra v Bruslju, zadnji miting zlate lige pa bo 12. septembra v Berlinu.; ex5DELAVKA, ZA KATERO JE BILA S SKLEPOM SKUPNOSTI POKOJNINSKEGA IN INVALIDSKEGA ZAVAROVANJA UGOTOVLJENA SPREMENJENA DELOVNA ZMOŽNOST ZARADI POSLEDIC POKLICNE BOLEZNI, IMA PRAVICO DO PRERAZPOREDITVE NA DRUGO USTREZNO DELOVNO MESTO V 15 DNEH PO DOKONČNOSTI PRAVNOMOČNOSTI SKLEPA.; ex5- Z DNEM, KO DOPOLNI 40 LET POKOJNINSKE DOBE, ČE PRISTOJNI ORGAN ORGANIZACIJE OZIROMA DELODAJALCA V SKLADU S POGOJI, KI JIH DOLOČI KOLEKTIVNA POGODBA, OZIROMA S SPLOŠNIM AKTOM NE ODLOČI, DA LAHKO NADALJUJE DELOVNO RAZMERJE.; ex5ČE POGODBO O ZAPOSLITVI ODPOVEDUJE DELAVEC, JE MINIMALNI ODPOVEDNI ROK 30 DNI.; ex5S POGODBO O ZAPOSLITVI ALI KOLEKTIVNO POGODBO JE LAHKO DOGOVORJEN DALJŠI ODPOVEDNI ROK, VENDAR NE DALJŠI KOT 150 DNI.; ex5- Z DNEM PRENEHANJA VELJAVNOSTI DELOVNEGA DOVOLJENJA POGODBA O ZAPOSLITVI, KI JO SKLENE TUJEC ALI OSEBA BREZ DRŽAVLJANSTVA, PRENEHA VELJATI PO SAMEM ZAKONU.; ex5SPREJET JE BIL PRED KRATKIM; VELJATI JE ZAČEL 28. 7. 1999 (PETNAJSTI DAN PO OBJAVI V URADNEM LISTU RS 13. 7. 1999).; ex5S TEM DNEM PRENEHAJO VELJATI ZAKON O VARSTVU PRI DELU (URADNI LIST SRS, ŠT. 32/74, 16/80 IN 25/86), RAZEN 48.; ex5Nekaj dni prej je odobril odhod japonskih vojakov v Irak in čeprav vsi na tem območju po svoje razumejo japonsko žejo po bližnjevzhodni nafti, so sosedje zaradi prvega odhoda vojakov iz države osuplo privzdignili obrvi.; ex5Kot intonacija celote, nemara spomin na nekdanji ''dan ljubezni'' s svetom.; ex6Strah me je tega, da se lahko tisti, ki ima trenutno večino, čeprav samo enega glasu in čeprav samo za en dan, v trenutku polasti poleg vsega, kar demokratični politični oblasti gre, tudi vsega tistega, česar demokratična politična oblast sploh nikdar ne bi smela dobiti v roke.; ex6Opozorilno okrožnico v zvezi s to grožnjo je te dni razposlal tudi minister za delo Roberto Maroni.; ex6Državnemu zboru majske seje ni uspelo končati v dveh dneh; ex6Na dan so otroci potegnili le paštetko, kuli in rumeno majico, nikjer pa ni bilo pričakovane, niti tiste najmanjše, med otroki zelo priljubljene klobase Poli.; ex6Misel, da imata v rokah nekaj, česar ni odkril še nihče drug, le onadva, ju je tako vznemirila, da tudi naslednjega dne nista odšla v Portorož zapravljat denarja.; ex6To podjetje je nekakšen mejni primer, ki ga neposredno ne urejata niti zakon o lastninskem preoblikovanju podjetij niti zakon o javnih gospodarskih družbah, vrednost nominalnega družbenega kapitala z znanimi lastniki na dan 1. januarja 1993 pa bo bržčas treba ugotoviti tako, kot so to morali storiti v vseh podjetjih, ki so šla skozi postopek lastninskega preoblikovanja.; ex6Na leto pa, tako ugotavlja zadnji letopis, je v povprečju vsak odsoten v službi 5,3 dneva zaradi bolezni.; ex6Opr. št.: BAG 2 AZN 401/89, sklep z dne 25. 10. 1989; ex6Zato terjatev ni verjetno izkazana in ni pogojev za izdajo začasne odredbe (sklep VDSSL, opr. št. Pdp-1353/2003 z dne 5. 9. 2003).; ex6ENI OBRAZI DO NAZGA, DRUGI ŽE MED ZVEZDAMI - Avtorji evropskega filma leta in svetovne finančne in kritiške uspešnice Do nazga so obtoženi kraje scenarija, kar jih lahko stane skoraj ves zaslužek, stotnije ameriških "filmskih delavcev" pa so pred podelitvijo oskarjev 23. marca iz dneva v dan bolj in živčne.; ex7Sicer pa so mnenja, da dve, tri skodelice kave na dan skorajda ne morejo škodovati.; ex7To se je zgodilo komaj nekaj dni prej, kot pišemo tole (1939).; ex7Telefonski pogovori med njima so se nadaljevali naslednje tri dni.; ex7Vladni in zasebni strokovnjaki za arabščino so po naročilu Bele hiše več dni prevajali bin Ladnove komentarje dogajanja v New Yorku in Washingtonu.; ex7Bela hiša je nekaj dni po napadu dejala, da sta po njenem za napade odgovorna bin Laden in njegova mreža Al Kaida.; ex7Peter Mankoč je že prvi dan postal evropski prvak na 200 mešano v kratkih bazenih.; ex7- Sorodniki, ki so v soboto zvečer prišli k 70-letnemu Ivanu Lenarčiču in njegovi leto dni starejši ženi Antoniji v hišo št. 21 v naselju Studeno, so naleteli na grozljiv prizor.; ex7Dekle je zadevo prijavilo dan potem, ko se je zgodila.; ex7Po vsej verjetnosti zaradi petard pa je v Izoli istega dne ob 21. uri zagorelo v zabojniku na Bazoviški ulici.; ex7S 1. julijem so vzajemni skladi obvezani poročati podatke o donosu v zadnjih šestih mesecih, letu dni in v zadnjih treh letih.; ex8Premier dr. Janez Drnovšek je včeraj dopoldan na celjskem sejmišču odprl 34. mednarodni obrtni sejem, na katerem se bo v desetih dneh predstavilo 1758 razstavljavcev iz 30 držav, zvrstilo pa se bo okoli 130 obsejemskih prireditev.; ex8Velika svečanost po mitraičnem koledarju se je odvijala 25. decembra, vsak 16. dan v mesecu je bil posvečen Mitru.; ex8Prvi dan v mesecu je bil posvečen soncu, h kateremu so se obračali verniki zjutraj, opldne in zvečer.; ex8Čez most naj bi se prepeljalo 11.000 vozil na dan, med katera ne smemo prišteti koles.; ex8Skoraj tako lepo diši, kot je dišalo tiste praznične dni doma.; ex8En dan pri tistih, ki so vključeni v programe razvoja, je mnogim nakazal nekatere možnosti za delo; ex8Isti dan, ko smo nagnali JLA iz Slovenije, so šele avstrijske obrambne sile zaznale prelet jugoslovanskega bojnega letala čez Slovenijo (kaj pa je delala protitočna abramba press); ex8»Potrebovala bi prenočišče za nekaj dni.; ex8Davek iz drugega odstavka 3. člena tega zakona se plača v roku 15 dni od nastanka davčne obveznosti.; ex8Mineva leto dni, odkar me je pot vodila v Spodnji Gasteraj k družini Bohak, Jožici, Zarji in Ernestu.').
g(115157225,'exMednarodne dneve mineralov, fosilov in okolja.; exZAGREB Na zagrebškem Trgu hrvaških velikanov sinočnje srečanje protifašistov ob dnevu zmage ni minilo povsem mirno.; exLiterarno-glasbeni maraton za srednješolce, ki ustvarjajo glasbo hip-hop in rap, bo 23. aprila 2003 v okviru Slovenskih dnevov knjige v Mariboru: Ko te napiše knjiga 2003 na Grajskem trgu v Mariboru.; exKer je neuspeli predsedniški kandidat in »edini slovenski politični zapornik« Joško Joras na dan državnosti na svoji hiši spet obesil slovenski zastavo, so jo hrvaški policisti odstranili, sodniku za prekrške pa poslali kazensko ovadbo.; exOsnovno sporočilo plesnih in glasbenih nastopov ter recitalov je bilo, da je merilo vseh stvari človek, ne glede na drugačnost, s čimer so se spomnili dneva strpnosti in splošne deklaracije človekovih pravic.; exZASTAVE - Vsak predšolski otrok bi z lahkoto preštel tistih nekaj zastav, ki so ob dnevu samostojnosti visele v Črnomlju.').
