g(115164957,'exDan se nagiba v zaton, ko načenjava nekoliko lažji del stene.; exDan je bil prekrasen.; exTakrat ne prijemljejo za vabo, ribolov sredi belega dne postane preganjanje dolgčasa in ne da pravega učinka.; exMorda nas bo še razvese-ljeval s sončnimi dnevi.; exZ uvedbo alternativnega zdravljenja pa bi bili mnogi zdravniki razbremenjeni, saj so tudi oni samo ljudje z dobrimi in slabimi dnevi.; exOdkrili bi dokaj veliko in zanimivo ponudbo na eni ter nenavadno majhno število obiskovalcev na drugi strani, vendar nas je prehitel dan.; exSibirski poletni dnevi so bili presenetljivo vroči, ob dolgih, toplih in svetlih večerih, ko se je začelo nočiti šele proti polnoči, pa so se na bregovih reke Angare zbirale množice kratkokrilih in dolgonogih deklet z obvezno steklenico piva v rokah, ki so privlačile množice mladih fantov, prav tako s pivi v rokah.; ex* Redno jejte, da boste ves dan ohranjali enakomerno raven energije.; exTo je sicer popolnoma očitno, a pri iskanju živali lahko prehitro pozabimo na cesto in si uničimo prelep dan v naravi s prometno nesrečo.; exNAPOVED - Danes bo pretežno jasno, čez dan občasno zmerno oblačno.; ex1So 10 Ves dan za sadje in zelenjavo s plodovi; ex1Ko sem ga zadnji teden čakal, da konča šolo, in sem imel po sezoni več časa, sva vsak dan igrala ena na ena in trenirala skupaj.; ex1Dvojčki ljubijo klepet in opravljive čenče, zato pogumno na dan s sočnimi novicami, ki ste jih prebrali v časopisu, reviji ali jih slišali pri prijateljih in znancih.; ex1Prvi višek rokometnega dneva v Rdeči dvorani bo ob 14.30, ko se bosta pomerili ženska reprezentanca Slovenije in selekcija tujk, ki si rokometni kruh služijo na sončni strani Alp.; ex1Žal pa je mnogo členov njegove vere, ki so zanj jasni kot beli dan, jaz pa jih ne morem sprejeti za zveličavne.').
