g(115169873,'exMogoče teden.; exZa šeststo pezet lahko počakam en teden.; exŠele ko se je poročil s poljsko grofico Evo Hansko (1849), se je rešil dolgov, ker je bil nekaj tednov pozneje že mrtev.; exVeč kot 3000 potepuških psov je v dveh tednih dobesedno izginilo z atenskih ulic.; ex* Pazite, da boste imeli med zdravljenjem in še nekaj tednov po njem ušesa vedno suha.; exTako je bogato obložena miza teden dni spremljala pustne norčije tja do zaključnega romanja na Ptuj, kjer so bili pustni krofi in drugo pecivo zakon.; exZa osebno higieno imajo na voljo 15 minut dnevno (brez tuširanja), za razgibavanje pa jim je odmerjenih dvakrat po 15 minut na teden.; exV enem tednu sem se preselila v Los Angeles, naredila vozniški izpit, kupila avto, poiskala hišo, najela stanovanje, poiskala igralskega agenta in začela hodit na avdicije.; exV enem tednu se je spremenilo vse moje življenje.; exV tednu in pol sem napredoval za 40 stopinj," pravi Kavtičnik, ki je zvezda tudi med preostalimi gosti Šmarjeških Toplic, pravzaprav je najbolj znan gost in fant, ki prinaša veselje.; ex1Zanimanje za Beckhama sta ob koncu minule sezone kazala tudi italijanska kluba Inter in AC Milan, pred tednom dni pa je United sporočil, da se je dogovoril za možnost prodaje nogometaša v Barcelono.; ex1Vse sodne instance so tožilsko zahtevo za preiskavo zavrnile, generalna državna tožilka pa se je pred tedni znašla med kandidati za nove ministre.; ex1Delovna praksa je po navadi organizirana ob koncu šolskega leta, praktični pouk pa poteka že med šolskim letom, enkrat ali večkrat na teden.; ex1Anno je opazoval že skoraj dva tedna.; ex1Šele nekaj tednov je bil tam, pa je že odkril, da je tu po vsej verjetnosti več alkoholikov na kvadratni kilometer kot v kateremkoli drugem velemestu v deželi.; ex1TELIČKA č.b., starega 1 teden, prodam.; ex1TELIČKO sivko, staro 3 tedne, prodam.; ex1BIKCA simentalca, starega 9 tednov, prodam.; ex1TELIČKO, črnobelo, od dobre molznice, staro 3 tedne prodam ali zamenjam za smreko