g(115203791,'exNa voljo naj bi imeli blizu milijardo tolarjev (10 milijonov DEM) več kot pred petimi leti; exS tem naj bi pridobila prednost na trgu banan pred evropsko konkurenco, obenem pa bo lahko z bananami zadovoljila lastno tržišče za več let.; exPoudaril je, da je bila to, ko je pred desetimi leti postal deželni glavar, dokazano najboljša doba za narodnostne manjšine.; exGlede vključitve Slovenije v EU je sogovornik dejal, da si to želijo, saj si zaradi trenutnih dogajanj na Balkanu morajo prizadevati, da bi mirovna skupnost Evrope vključevala tudi države, ki so se šele pred nekaj leti osvobodile komunizma.; exSeveda pa je gospod Lamut v svoji rani mladosti, in še kasneje, v svojih zrelih letih, zelo dobro spal.; exIn tudi naslednjega ne in tako vsa leta…; exBil sem star kakšna tri, štiri leta.; exNjegova producentska hiša HandMade Films je bila zaslužna za vzpon britanskega filma v osemdesetih letih, veljala pa je za eno najuspešnejših in najbolj neodvisnih produkcijskih hiš.; ex"Zato smo že septembra lani prek Gospodarske zbornice Slovenije predlagali obdavčitev vseh javnih poštnih storitev, ker bi s tem po naših izračunih imeli pozitivni finančni učinek okrog 850 milijonov tolarjev na leto.; exNekaj je je bilo v zadnjih letih, vendar so, zlasti na Koroškem, ta podjetja žalostno propadla.; ex1Toda razvoj še ni bil končan: leta 1960 so na agronomskem oddelku vpeljali študij živinoreje, to je danes oddelek za zootehniko.; ex1Ob razformiranju Prirodoslovne matematične fakultete so k FAGV pridružili še študij biologije in jeseni leta 1961 se je ustanova preoblikovala v Biotehniško fakulteto.; ex1Jeseni 1971 se je začel redni študij živilske tehnologije kot smer agronomskega oddelka in leta 1965 kot samostojen študij živilstva.; ex1Za raziskovalno, pedagoško in svetovalno delovanje je BTF skupaj s Kmetijskim inštitutom ustanovila Kmetijski poskusni center Jable, leta 1967 pa Raziskovalno postajo za živinorejo Rodica (Groblje) in leta 1974 se je agronomskemu oddelku pridružil Zavod za sadjarstvo v Mariboru (ust.; ex1Le tako bi bil dokument pripravljen pred koncem leta.; ex1Celo evropske volitve so kljub zvenečemu imenu klavrna podoba evropske demokracije - vsakih pet let pritegnejo vedno manj volivcev, ki se jim že dolgo zdi zamalo, kako se odloča, kdo bo sedel v strasbourški ali bruseljski palači evropskega parlamenta.; ex1Celje se je v zadnjih letih zelo razvilo, to vidi vsak, ki se pelje skozi mesto.; ex1Časopis v revialni obliki, ki je dolga leta izhajal štirikrat, zdaj pa le še dvakrat na leto, ni le dokument časa, temveč odlična domoznanska zbirka Raven in tudi vse Mežiške doline.; ex1Pred dvema letoma je ta tukaj zablestela s senzacionalno štafetno zmago, lani se je Avstrija spet oddaljila od svetovnega vrha.; ex1Djordje Žebeljan, državni podsekretar za energetiko, je po sestanku razložil, da so se pogovarjali o več različicah, saj status JE Krško v prihodnjem letu še ni dokončno opredeljen.; ex2Prve ponudbe za uvoz električne energije v letu 2002 so na podlagi Elesovega razpisa že dobili.; ex2Ob 50-letnici delovanja odpira Koroški pokrajinski muzej priložnostno razstavo s pregledom razvoja in delovanja muzeja od ustanovitve Okrajnega muzeja NOB leta 1951 do zadnjega desetletja delovanja, ko so težišče dela preusmerili na skrb za varstvo premične kulturne dediščine na območju Koroške v Republiki Sloveniji.; ex2Začetki muzeja so povezani z izjemno zbirateljsko vnemo učitelja Bogdana Žolnirja (1908-1998), ki ga je okrajna organizacija Zveze borcev leta 1949 postavila za predsednika t. i. zgodovinske komisije, ob uradni ustanovitvi muzeja leta 1951 pa za prvega ravnatelja Okrajnega muzeja NOB.; ex2Kasneje se je preselil v drugo nastropje nekdanje mestne hiše na Glavnem trgu 24, kjer je še danes sedež muzeja, ob širitvi strokovnega dela in stalnih zbirk, pa je med letoma 1974-81 pridobil še drugo nadstropje sosednje hiše na Glavnem trgu 26.; ex2Leta 1986 je vzniknila ideja o preoblikovanju muzeja iz posebnega v splošni pokrajinski muzej, ki naj bi skrbel za varstvo premične kulturne dediščine, njeno realizacijo pa je prinesla sprememba financiranja muzeja leta 1990.; ex2Danes skrbi muzej ob svojem rednem delu še za leta 1992 postavljeno zbirko v cerkvi sv. Jurija na Legnu ter leta 1994 postavljeno razstavo o koroškem plebiscitu v župnišču v Libeličah.; ex2Očitno pa se nama je vrstni red raztežajev po tolikih letih nekoliko zmedel.; ex2Obenem tudi ugotoviva, da sva dosegla toliko pričakovano škrbino, kjer se je Marjanu pred šestimi leti stojišče enostavno podrlo pod nogami.; ex2V Vipapu pripravljajo tudi program presežnih delavcev, nekatere so že prekvalificirali in zaposlili v podjetjih, s katerimi poslovno sodelujejo, kljub temu pa bo kakih 360 ljudi konec leta ostalo brez službe.; ex2V sindikatu, kot nam je povedal njegov predsednik Roman Molan, sicer še vedno upajo, da jim bo do konca leta le uspelo prepričati ljudi v ministrstvu za gospodarstvo in za okolje, da je proizvodnja celuloze pomembna ne le za Krško, ampak tudi za celo papirno-predelovalno industrijo, slovenske gozdove in državo sploh.; ex3Podjetje je bilo zaradi izgube jugoslovanskega trga v začetku 90. let na robu propada, vendar so vodstvo in vsi zaposleni podjetje olastninili in se za dobavo novomeškemu Revozu povezali s tujim partnerjem.; ex3Ker smo se »spanja« na delovnih mestih bolezni, ki nas je (menda) pestila skoraj petdeset let šele dobro ozdravili, je malo verjetno, da se bodo kavči, zofe in podobni kosi pohištva kmalu vrnili v naše pisarne.; ex3Je zelo pomembna športnoribolovna vrsta, lovimo jo vse leto, na različne načine: z brega ali čolna z blestivko, naravnimi vabami in posebnimi trnki jig (jigging).; ex3Idriart international (francoska okrajšava za - Pobuda za razvoj medkulturnih povezav skozi tokove umetnosti) je letos uspešno zaključil že 14. mednarodni poletni festival v Sloveniji, ki je bil četrto leto na omenjenem gradu.; ex3Nekaj let po stekleničenju vina (eno do tri) je očitna sprememba okusa vina predvsem z vidika taninskih snovi.; ex3Veter nato prenese ecidiospore na smrdljivi brin, kjer se okužba izvrši skozi zelene luskice, nato pa čez dve leti na lubju vejic nastanejo rumene sluzaste obloge - ležišča zimskih spor.; ex3Leta 1993 je bila predlagana za delegatko v generalni skupščini glasbenih ekspertov EBU, na plenarnem zasedanju leto kasneje pa je bila izvoljena v evropsko glasbeno komisijo.; ex3Geslo je sestavljeno iz glave (ime literarnega junaka), zaglavja (avtor in naslov dela, leto prve izdaje ali uprizoritve, literarna vrsta) ter geselskega članka.; ex3Ustavno sodišče je zavrnilo zahtevo mestne občine Slovenj Gradec, ki je konec lanskega leta zahtevala oceno ustavnosti in zakonitost vladnega sklepa, ki so ga sprejeli oktobra lani v zvezi s predlogom izračuna primerne porabe občin in zneskov finančne izravnave za leti 1999 in 2000.; ex3Z združevanjem sodobnih komunikacij, telekomunikacij, medmrežja in vsakdanjega življenja strokovnjaki že nekaj let pripravljajo načrte o uresničevanju zamisli, da bi živeli bolje, lepše in predvsem bolj enostavno.; ex4»Zahteve po mednarodnih objavah se na UL v zadnjem desetletju zaostrujejo, zato marsikdo, ki je bil pred 20 leti izvoljen v naziv rednega profesorja, zdaj ne bi izpolnjeval niti pogojev za izvolitev v docenta.; ex4Bilo je kakor v ilegali, razpoloženje je bilo podobno tistemu ob koncu 80. let, ko so sovjetski umetniki pripravljali performanse zaprtega tipa, ker jih je policija sicer že pustila pri miru, a javno še niso smeli nastopiti.; ex4»Sicer je res, da je bilo v letu in pol na ministrstvu in drugod opravljeno ogromno delo, a za takšno nalogo je bilo časa absolutno premalo.; ex4« Bežno se je nasmehnil ob neumnem izrazu, ki ju je zabaval v najstniških letih.; ex4»Ne govorimo na pamet, ker predvidevamo, da bi država v prvem letu dobila 350 milijonov dolarjev pomoči za lastninjenje, nato pa je treba začeti reforme bančnega sistema, uravnotežiti državni proračun in utrditi tečaj dinarja,« pojasnjuje Dinkić.; ex4Ekonomski inštituti in analitiki mednarodnih organizacij še vedno znižujejo svoje napovedi stopenj gospodarske rasti, ki so glede na dobro leto nazaj pravzaprav že prepolovljene.; ex4Leta 1820 je bil že v Parizu, kjer mu je madam de Berny omogočila, da se je smel gibati v umetniških krogih.; ex4Že leta 1831 mu je uspel preboj z romanom Šagrinova koža, zatem pa se je lotil velikega projekta s skupnim naslovom Človeška komedija, ki ga zaradi prezgodnje smrti ni uresničil v celoti, a dolgovi niso nič manj pogoltno pritiskali nanj.; ex4Njegova vdova je potrebovala nekaj let, da je poravnala vse Balzacove dolgove.; ex4Ob trideseti obletnici ansambla, pred tremi leti, so Slavko Podboj, Janez Pavlin in Henček Burkat pripravili v Novem mestu veliki koncert, ki je pokazal na izjemno priljubljenost Henčkovega ansambla in veliko priljubljenost njegove muzike.; ex5Pri nas sicer niso delali podobnih poskusov, a v Ameriki so se potrudili in pri 2500 zaposlenih, ki so kadili hašiš, ugotovili, da se je število delovnih nezgod (dr. Bilban je za potrebe stroke izračunal, da je zaradi poškodb na delu v Sloveniji toliko škode, da bi lahko na leto zgradili 150 kilometrov avtocest) povečalo za 85 odstotkov.; ex5Koči so zgradili že davno pred prvo svetovno vojno ter ju pozneje dograjevali in posodabljali, sedanjo podobo pa je dobila Kamniška leta 1983 in Cojzova pet let pozneje.; ex5Gospa Katarina je kuharica že 34 let: "Kot kmečko dekle nisem imela možnosti za šolanje in začela sem kot pomivalka, potem pa sem se šolala ob rednem delu.; ex5Pot do novega izdelka ali le do izboljšave je dolga vsaj leto dni in terja delo različnih strokovnjakov, raziskovalcev trga, razvojnih konstruktorjev, oblikovalcev, psihologov, strokovnjakov z določenega področja raziskav in razvoja (če gre za gospodinjstvo, sodelujejo tudi kuharji, pri osebni negi pa ne gre brez medicincev) in tudi ljudi s ceste.; ex5Nemčija in Češka sta sicer leta 1997 podpisali dokument, v katerem zavračata obremenjevanje današnjih odnosov in prihodnosti z zgodovinskimi zamerami.; ex5Toda petinpetdeset let pozneje ne moremo popravljati tega, kar se je tedaj zgodilo.; ex5Če Tina Pisnik v svojem teniškem življenju pri kateri stvari ni imela sreče, so bile to poškodbe: najprej hrbta, nato gležnja, zaradi katerih bi članica zmagovalne slovenske vrste, ki je osvojila naslov svetovnih prvakinj do 14 in do 16 let, teniški lopar skoraj postavila v kot.; ex5SKORAJ SEDEMDESET LET KASNEJE JANEY MITCHELL PODOBNO OZNAČI DVA POSKUSA POSILSTVA, KATERIH ŽRTEV JE BILA.; ex5SICER NAČITANI INŠPEKTOR MORA POGLEDATI V DEBELE SLOVARJE, DA NAJDE RAZLAGO BESEDE EONIZEM, KI JO JE LETA 1928 VPELJAL SEKSOLOG HAVELOCK ELLIS V KNJIGI ŠTUDIJE O PSIHOLOGIJI SPOLNOSTI, EONIZMU IN DRUGE ŠTUDIJE.; ex5IZRAZ EONIZEM JE IZPELJAN IZ IMENA CHARLESA EONA DE BEAUMONTA, KI SE JE V ZGODNJEM DEVETNAJSTEM STOLETJU TRIINTRIDESET LET USPEŠNO PREOBLAČIL V ŽENSKO.; ex6NJEGOV SPOL SO ODKRILI ŠELE PO SMRTI, ČEPRAV JE ŽE VRSTO LET ŽIVEL Z ŽENSKO, KI PA TUDI NI VEDELA ZA NJEGOV SPOL.; ex6V zadnjih 20 letih so se ti cilji stalno spreminjali.; ex6Evropske smernice za zdravljenje bolnikov s povišano ravnijo holesterola v krvi se že nekaj let spreminjajo, tako da je postalo priporočljivo zdraviti bolnike čimprej, ko je holesterola komaj malo več, kot je normalno.; ex6Šest let je že, odkar sva se spoznala na fitnesu na Jesenicah.; ex6Leta 1966 je bila ta 26 umrlih žensk na 100.000 živorojenih otrok, leta 2000 pa se je ta številka še povečala, na 27,8 umrle ženske na enako število živorojenih otrok.; ex6Najtežja pa je bila prav gotovo vrnitev pred letom dni, po štirih letih odsotnosti.; ex6V revni družini se je rodil deček, ki ga je že v otroških letih očaral vojaški stan.; ex6Ta akcija, ki jo Dolenjska banka že 16. leto izvaja na Dolenjskem in v Beli krajini, ima dober odziv, saj se več kot polovica staršev odloči za obisk v banki in varčevanje za svojega otroka; z otvoritvijo ekspoziture Dolenjske banke v Krškem in Brežicah se akcija širi tudi na območje Posavja.; ex6Pričetek sodelovanja banke in Splošne bolnišnice Brežice so zabeležili ob 200-tem rojstvu v njihovi porodnišnici v tem letu.; ex6Slovenija bo skupaj s Hrvaško pripravila posebno strokovno študijo o razvoju obmejnega območja v letih 2002 do 2006.; ex7Prababica Olga, ki si je prišla pogledat svojo vnukinjo, je postala nostalgična: To me spominja na moj maturantski ples, glasba in četvorka sta me popeljali v moja najstniška leta.; ex7Rupel je tudi dejal, da je v ZDA, zlasti v zunanjem ministrstvu, vse do konca 90. let živela ideja o tem, kako lepo bi bilo, če bi Jugoslavija ostala skupaj.; ex7Obisk ameriškega predsednika Georgea W. Busha bo tako s seboj nosil tudi simboliko, saj je administracija njegovega očeta, predsednika Georgea H. W. Busha, leta 1991 nasprotovala osamosvojitvi Slovenije in potihem pristala na posredovanje JLA.; ex7To počnem še danes, saj se mi vedno znova primeri, da me kdo iz časopisne redakcije povpraša na primer, kakšna je časovna razlika med Madridom in Ljubljano ali pa, kot me je nekdo z več kot srednješolsko izobrazbo pred leti vprašal, kakšen letni čas je tam v Sloveniji, prepričan, da sem na drugi polobli.; ex7Ko sem v sedemdesetih letih svojim italijanskim znancem v Rimu povedal, da se nameravam preseliti v Jugoslavijo, so me pogledali s takšnim sočutjem, kot da odhajam v deželo dinozavrov, saj se ve, da se za prenekatere današnje Rimljane svet začenja in konča na okoliških gričih.; ex7Največja kršiteljica človekovih pravic je bila Italija, največ postopkov ima zaradi kršitve pravice do sojenja v razumnem roku, saj traja v Italiji sodni postopek v povprečju sedem let.; ex7Na koncu objavljenega besedila sporazuma piše, da bodo tri leta po začetku njegove veljave sklicali mednarodni sestanek, na katerem bodo opredelili mehanizme za končno rešitev kosovskega vprašanja, in sicer na podlagi volje ljudstva, stališč relevantnih oblasti, prizadevanj vsake strani pri uresničevanju sporazuma in sklepne helsinške listine.