ani 2,5-odstotni letni rasti do leta 2020 letna poraba električne energije narasla s sedanjih 12 na 17 tisoč GWh.; ex9Med igralkami do 16 let je zmagala Diana Nakič (ŠTK Velenje), rojena leta 1988.; ex9Slovenski tenis je imel v finalu še enega predstavnika, in sicer v kategoriji fantov do 16 let.; ex9V finalu deklic in dečkov do 14 let Slovenija ni imela predstavnikov.; ex9Poročilo je glavni inšpektor za anatomijo Jeremy Metters predstavil po dveletni raziskavi, s katero je ugotovil, da so med leti 1970 in 2000 brez dovoljenja svojcev v raziskovalne namene skoraj 100.000 ljudem odstranili možgane in jih predali univerzam in raziskovalnim inštitutom.; ex9Analitične Parižane sem nekako zadovoljil šele s stavkom, da so pač tisti, ki so, s kratko pavzo, Sloveniji vladali 12 let, zdaj šli v opozicijo, tisti, ki so bili v opoziciji, pa na oblast.; ex9Toda tiskovna predstavnica haaškega tožilstva Florence Hartmann je potrdila, da bodo tožilci vložili vse obtožnice proti obtožencem za vojne zločine, ki so jih pripravili, ne glede na to, ali bo sodišče obstajalo le še leto dni ali dlje.; ex9Ko je Teodora sedela z generalom na vrtu, se ji je zdelo, da sta skupaj opazovala, kako je lezel mimo polž, s skupnimi očmi, s katerimi sta merila centimetre skozi mnogo let.; ex10Na splošno, če pregledamo teh 22 let, vidimo, da se je mariborski gledališki ansambl iz svojih začetnih uspehov dvigal vedno više.; ex10Piše se leto 1666, zgodba je postavljena v Novi Jeruzalem.; ex10Brizgači lahko živijo od 5 do 10 let.; ex10Prvi dve leti po potovanju označuje kot najbolj delovni v vsej svoji karieri.; ex10Skupaj z znanstveniki, ki so ga navdušeni vabili v svoje vrste, je pregledoval in urejal gradivo, ki ga je vsa ta leta pošiljal z odprave.; ex10Takrat je bil vitez žalostnega obraza prvič na poti, in kljub svojim skoraj petdesetim letom s seboj ni nosil rezervnih srajc in spodnjic.; ex10Ali bo Duplica sedem let po pripojitvi h Kamniku spet samostojno naselje?; ex10Direktor podjetja Steve Jobs