ex28A v času, ko kajenje v Sloveniji sicer upada - smo namreč v evropskem vrhu po vedno nižjem, zdaj že 23,7-odstotnem deležu kadilcev, kar je mogoče pripisati tudi precej restriktivni zakonodaji, po hudih »bojih« in neverjetnem lobiranju tobačne industrije sprejeti leta 1996 -, se povečuje število kadilcev med mladimi in med ženskami.; ex29Budimpešta - Leto 2000, v katerem je Madžarska poleg drugega praznovala svojo tisočletnico, ocenjujejo državljani, politične stranke in mednarodne institucije na moč različno.; ex29Ne velik prepad med strankami kaže tudi njihova ocena minulega leta.; ex29Za koalicijo je bilo leto 2000 uspešno, medtem ko levičarska in liberalna opozicija govorita o težavnem letu, polnem političnih škandalov, ki so hudo omajali »ugled parlamenta«.; ex29Ker je stara le osemnajst let, ji natakarji nočejo postreči z alkoholom, in takrat postane zares besna.; ex29Vse skupaj je presenečeno opazovala skupina moških srednjih let, ki so sedeli za sosednjo mizo, in razdražena Lindsay se je lotila še njih, pripoveduje isti vir.; ex29Igra teh pomenov, ki jih lahko izpeljemo iz imena, nas je spodbudila k delu, razvoju in želji, da odpremo ta vinska vrata in ponudimo naša zlata vina, je povedal Matjaž Berce, ki se je skupaj s Tadejem Pavlico in Davidom Rijavcem pred tremi leti odločil za skupen nastop na domačem in tujih trgih.; ex29Tako je vodstvu Galerije Božidar Jakac, ki danes domuje za samostanskimi zidovi, v minulih letih med drugim uspelo povsem obnoviti porušeno samostansko cerkev ter nekatere druge močno poškodovane objekte, lani pa so končali obsežno delo, prekrili so streho, obnovili baročno kuliso ter začeli z večjimi obnovitvenimi deli v nekdanjem samostanskem mlinu.; ex29Zdaj je Smart rešen, od prihodnjega leta pa v programu ostajata še Fortwo in Forfour.; ex29Motomontaži je že septembra istega leta uspelo pridobiti pogodbo za montažo avtomobilov DKW v Jugoslaviji.; ex29Mineva leto dni, odkar me je pot vodila v Spodnji Gasteraj k družini Bohak, Jožici, Zarji in Ernestu.; ex30Kot so zapisali v svojem uvodu, v Prlekiji ni ne piramid ne morja ne Triglava, je pa dediščina, ki so jo mladim zapustili njihovi pradedje in se ohranja že 130 let: to so kasaške dirke.; ex30Tak izlet pripravijo zdaj že nekaj let zapovrstjo in zlasti najmlajši člani organizacije se ga nadvse veselijo.; ex30Kakšno grozno leto je bilo to: najprej je umrla njegova mama Luciana Pavarottija Adela, 86, kmalu zatem oče Fernando, 89, naposled pa je sloviti italijanski tenorist Luciano Pavarotti točil grenke solze še za svojim sinom Ricardom, ki je umrl ob porodu.; ex30Da, pevec z "angelskim glasom", kot je dejal nekoč Herbert von Karajan, ki je svojo publiko ganil do solz, je v letošnjem letu doživljal same osebne drame.').
g(115204297,'exOb praznovanju obletnice na šoli že vse leto številne kulturne prireditve in strokovna srečanja - V novi sodobno opremljeni knjižnici bo prostor tudi za občasne razstave in manjše kulturne prireditve; exNa Osnovni šoli Fužine jih je še posebej veliko, bistveno več kot drugje: kar tretjina v enem letu ne konča prvega letnika srednje šole.; exV prvenstvu so osvojili šele tretje mesto in tudi osvojena pokalna lovorika ni mogla spremeniti ocene, da mora biti prihajajoče tekmovalno leto uspešnejše.').
g(115206296,'ex"Tistega večera sem preveč popil, zgodilo se je mesec dni po tem, ko sem izvedel, da me žena vara.; exDogodki v prihodnjih mesecih pa bodo pokazali, ali bo morilcu iz Ankarana tokrat uspelo prepričati italijanske pravosodne oblasti.; exZačetek izvajanja programa je odvisen od podpisa sporazuma z republiškim zavodom za zdravstveno zavarovanje, po napovedih pa bi se naj to zgodilo prihodnji mesec.; exDevetindvajsetletni Matevž Hribernik je v Bruslju preživel pet mesecev kot stažist na generalnem direktoratu za zaposlovanje in socialne zadeve.; exNa mesec so mu plačali 735 evrov, polovico je dal za najemnino.; exStaremu predsedniku Jegorju Strojevu, ki je zaradi zakona o nezdružljivosti funkcij kak mesec omahoval, ali naj ostane tretji najmočnejši človek Ruske federacije ali pa naj se povsem posveti guvernerskim opravilom v orlovski oblasti, je predsednik Vladimir Putin za slovo podelil red zaslug za domovino.; exZdelo se mu je, kakor da je dolge mesece živel v temnem mraku grozeče nevihte, zdaj pa je nevihta minila, pritisk je popustil in spet lahko svobodno diha.; ex»Prihodnji mesec se boste poročili z njim.; exGloboko v želodcu in več kot tri mesece.; exA v štirih mesecih do nastopa v Sydneyju se lahko zgodi še marsikaj.; ex1Malečniška cesta - Gotovo je ena najbolj »zelenih« državnih cest, že v dveh do treh mesecih pa bi jo po mnenju direktorja Komunalne direkcije mag. Borisa Škerbinka lahko usposobili vsaj za enosmerni promet.; ex1Lastniška struktura Belinke se v zadnjih dveh mesecih, razen rahlega povečevanja števila delnic, do katerih je z novimi nakupi prišla Krekova družba, ni bistveno spremenila.; ex1Besni so kmetje, ki jim erozija uničuje polja in travnike, na pravo ekološko nesrečo opozarjajo gozdarji, inšpekcijske službe več kot tri mesece iščejo odgovorne, ti pa pravijo, da jim je enostavno zmanjkalo denarja.; ex1Odločitev, ki so jo sodniki sprejeli že prejšnji mesec, za zdaj še ni pravnoveljavna, kajti generalovi odvetniki so napovedali, da bodo vložili priziv na čilsko vrhovno sodišče.; ex1Pred kakšnim mesecem smo večkrat pisali o krompirjevi ogorčici, ki je prizadela pridelovalce semenskega krompirja v Libeličah.; ex1Ob uvedbi DDV pa vsaj dva meseca teh prihodkov ni mogoče pričakovati.; ex1Ob koncu leta so znašale tako že nekaj več kot 5,7 milijarde ameriških dolarjev in so se samo v nekaj mesecih povečale za približno milijardo dolarjev.; ex1V naslednjih mesecih se nam ne obetajo podobni filmi.; ex1Po sklepu vlade naj bi delovna skupina, ki jo vodimo, v enem mesecu pripravila antidiskriminacijski zakon.; ex1Če so v njihovem času obstajale na primer tri mesece, jih bodo astronomi mogli opazovati skoraj osem let!; ex2Samo meni so dolžni plačo za dva meseca, poleg tega tudi premije za celo sezono in tako naprej.; ex2Tako bo nekaj manj kot dva milijona najslabše plačanih delavcev v Britaniji čez dobrih sedem mesecev zaslužilo 3,70 funta na uro.; ex2Današnji tempo stvari spreminja vsak mesec, vprašanje pa je, kdaj se splača obnoviti knjižno obliko in ali je perioda petih let za to prekratka.; ex2V zadnjih mesecih smo bili prek sredstev javnega obveščanja seznanjeni še z nekaterimi primeri, kjer se je dolgotrajno nasilje končalo s tragedijo.; ex2V drugem odstavku 5. člena se črta besedilo "v mesecu, v katerem je prišlo do elementarne nesreče".; ex2Danes so mestne nekropole prenapolnjene kljub prekopavanju in premeščanju ‘nevzdrževanih’ ostankov v skupna grobišča: v Berlinu je treba čakati skoraj dva meseca, da se najde prostor na katerem si bodi od 116 pokopališč; na Japonskem smejo biti v Tokiu pokopani samo člani cesarske rodbine; znamenito washingtonsko pokopališče Arlington, ki premore 145 000 grobov, že deset let sprejema samo še ameriške predsednike in vojne heroje.; ex2Zaposlen človek v naši državi je v povprečju, po podatkih iz leta 1999, na dopustu 17 delovnih ur na mesec.; ex2Gledala sta nekakšen star film, ki bi ga lahko videla že pred nekaj meseci.; ex2Tržna vrednost Cameron Diaz se je v minulih mesecih močno dvignila, saj jo bo v prihodnje mogoče videti v filmu Vanilijevo nebo (Vanilla Sky) ob Tomu Cruisu in v filmu Newyorške bande (Gangs of New York) ameriškega režiserja Martina Scorseseja.; ex2K rasti so veliko pripomogli julijski donosi - tako je bil v prejšnjem mesecu donos Alfe 7,40 odstotka, sledita ji sklada Dolenjski (7,27) in Delniški (6,52) - ter dodatna vplačila, tako je samo Probankin sklad Alfa povečal obseg sredstev s 708 na 796 milijonov tolarjev.; ex3S 1. julijem so vzajemni skladi obvezani poročati podatke o donosu v zadnjih šestih mesecih, letu dni in v zadnjih treh letih.; ex3V ta namen vsake tri mesece podelijo denarne nagrade tistim, ki so dali koristne predloge.; ex3Na vseh delovnih mestih se zavarovalna doba šteje tako, da se za vsakih 12 mesecev dela šteje 16 mesecev pokojninske dobe.; ex3Inkubacijska doba, to je obdobje od okužbe do pojava kliničnih znakov bolezni, je lahko dolga nekaj mesecev ali nekaj let.; ex3Bolezenski znaki se pojavijo dolgo po okužbi, ker se živali večinoma okužijo zelo zgodaj, največkrat kmalu po rojstvu ali v prvih mesecih po rojstvu.; ex3Približno dva meseca pozneje, 18. novembra 1969, je Stane Sever naslovil vodstvu Drame dopis, s katerim je ta veliki umetnik sklenil svojo izjemno bogato in pomembno umetniško pot.; ex3Ko sem bil že šest mesecev generalni direktor, me je svet zavoda odstavil, ne da bi za to navedli en sam razlog.; ex3Na ustavno sodišče sem vložil zahtevek za presojo zakonitosti tega ukrepa in po šestih mesecih me je najvišje sodišče v državi vrnilo na položaj prvega moža slovenskega radia in televizije, članom sveta pa dalo poduk, ki ga najbrž niso niti prebrali.; ex3Že čez nekaj mesecev se je začela nova gonja proti meni.; ex3Bil sem povsem prepričan, da se bo to res zgodilo, zato sem že nekaj mesecev pred tem začel načrtovati svojo vrnitev v teater.; ex4Lastnica Jožica Bohak mi je ob prvem obisku prijazno predstavila zgodovino islandskih konj in mi tako ponudila pomoč ob veliki travmi, ki sem jo doživela pred nekaj meseci.; ex4Čez nekaj mesecev pa se je odločil, da se dresure in preskakovanja zaprek ne bo več šel, zato se je ob vsakem poskusu lastnic, da bi začeli s treningom, enostavno usedel na zadnje noge ter obsedel v idealni pozi cirkuškega konja.').
