g(115209413,'exŠe posebno pa je ta 773 metrov visok vrh obiskan eno od nedelj v mesecu marcu, ko tu pripravijo tradicionalno prireditev Pohod po nagelj.; exPri več kot 6-odstotni rasti, kakršno smo imeli lani in v prvih štirih mesecih letos, bi bila še veliko večja.; exMesec maj je tudi v Šaleški dolini namenjen čiščenju in pospravljanju odpadkov, večjo pozornost namenjajo posebnim in velikim, kosovnim odpadkom.; exUgotavljamo, da smo v zadnjih treh mesecih minulega leta, ko se je to najbolj dogajalo, prejeli za več kot 800 milijonov evrov dodatnih pritokov v tujih valutah.; exPravilen odgovor je bil Grad Podčetrtek, nagrajenki čestitamo in ji sporočamo, da je za nagrado dobila enodnevni izlet za dve osebi po Sloveniji, ki bo predvidoma v mesecu oktobru 1996.; exKaj pomeni nedavno sprejeta reforma skupne kmetijske politike EU za slovensko kmetijstvo, naj bi v javni obravnavi predstavili na letošnjem kmetijsko-živilskem sejmu avgusta v Gornji Radgoni na podlagi študije, ki jo na ministrstvu pričakujejo konec meseca.; exMateja Kocjan pa je povedala, da inšpekcija, predvsem v poletnih mesecih, prejme tudi po več kot eno prijavo dnevno.; exV 82. členu se doda nov drugi odstavek, ki se glasi: "Zavezanec, ki se mu ugotavlja dobiček z upoštevanjem normiranih odhodkov, vloži napoved prihodkov, doseženih pri domači fizični osebi ter tuji pravni in fizični osebi, do 15. v mesecu za pretekli mesec pri davčnem organu občine, na območju katere je vpisan v register zasebnikov.; exV začetku avgusta so se pod okriljem urednika Igorja Prassla (foto: Bojan Velikonja) mudili že v Dubrovniku, konec meseca pa odhajajo še v Raveno na deželni festival Festa Provinciale dell'' Unita.; exDecember je vesel in zadovoljen mesec, saj se sprosti in razgali vse ljudstvo, zabave pa postanejo vsakodnevni moto.; ex1December pa je tudi mesec obletnic in daril.; ex1Z Boštjanom sva se prvič srečala konec meseca avgusta.; ex1Kljub temu že v zadnjih mesecih letošnjega leta pričakujejo prve ladje premoga nanovo izbranega dobavitelja, od katerega bo v treh letih TE-TOL skupno kupila do 1,450 milijona ton premoga.; ex1Velika svečanost po mitraičnem koledarju se je odvijala 25. decembra, vsak 16. dan v mesecu je bil posvečen Mitru.; ex1Prvi dan v mesecu je bil posvečen soncu, h kateremu so se obračali verniki zjutraj, opldne in zvečer.; ex1Konec meseca naj bi zavrteli naprave tudi v smučarskem središču Cerkno.').
