g(115224486,'exIvje, led ali tanka snežna prevleka so nove razsežnosti, ki jih okrasnim travam doda zimski čas.; exVladimir Stepania, gruzijski košarkar s slovenskim potnim listom, je za Miami igral sedem minut, v tem času pa dosegel štiri točke.; exTudi zato, ker sem v tem času pravkar končala ljubezensko razmerje.; exJaz sem kot član te Komisije za lokalno samoupravo v nekoliko nenavadni situaciji, ker sem ves čas pri nastajanju teh stališč zraven in sem se tudi precej trudil v zvezi z njimi, kot bi se temu reklo.; ex- ZAPOSLITEV ZA DOLOČEN ČAS ZARADI DELA V PRILAGODITVENEM OBDOBJU NA PODLAGI DOKONČNE ODLOČBE IN POTRDILA PRISTOJNEGA ORGANA, IZDANE V POSTOPKU PRIZNAVANJA KVALIFIKACIJ PO POSEBNEM ZAKONU,; exDELAVKINA ODSOTNOST Z DELA V TEM ČASU SE ZATO NE MORE ŠTETI KOT NEOPRAVIČENA IN PROTI NJEJ NE MORE BITI IZREČEN DISCIPLINSKI UKREP PRENEHANJA DELOVNEGA RAZMERJA; exTAKO NA PRIMER DOGOVOR O POLITIKI PLAČ ZA OBDOBJE 19992001, URADNI LIST RS, ŠT. 22-1017/99, RS 39-1963/99 (V ČASU VELJAVNOSTI ZAKONA O MINIMALNI PLAČI, O NAČINU USKLAJEVANJA PLAČ IN O REGRESU ZA LETNI DOPUST V OBDOBJU 19992001 (ZMPUPR, URADNI LIST RS, ŠT. 39-1963/99) SE NE UPORABLJAJO DOLOČBE PREDPISA, KI SO V NASPROTJU S TEM ZAKONOM), 51-2422/00 (ANEKS).; exTUDI SICER JE BIL ZRP JZDOLS PRESEŽEN IN ZARADI TOGOSTI DOLOČANJA RAZMERIJ OSNOVNIH PLAČ TER OMEJENIH MOŽNOSTI NAGRAJEVANJA POSAMEZNEGA ZAPOSLENEGA V SKLADU Z REZULTATI NJEGOVEGA DELA ZA DANAŠNJI ČAS ZASTAREL.; exPOGODBA O ZAPOSLITVI ZA DOPOLNILNO DELO PRENEHA VELJATI PO POTEKU DOGOVORJENEGA ČASA (IZ ČESAR IZHAJA, DA JE TAKŠNO POGODBO DOPUSTNO SKLENITI TUDI ZA DOLOČEN ČAS, LAHKO PA TUDI ZA NEDOLOČEN ČAS) ALI ČE JE UMAKNJENO SOGLASJE DELODAJALCA, KJER JE DELAVEC ZAPOSLEN S POLNIM DELOVNIM ČASOM.; exVeselo pričakovanje v otroških očeh, ki so bile ves čas slavnostnih nagovorov vodilnega moža PP in KK PP, dr. Romana Glaserja in Reneja Glavnika, usmerjene v pisane nagradne vrečke Poli s skrivnostno vsebino,pa se je kar vidno zmanjšalo, ko so ročice segle v velike vrečke.; ex1Vaša vloga »pivota«, krožne napadalke, je malce nenavadna: večino časa ste obrnjeni s hrbtom proti golu, ki ga napadate.').
g(115227846,'exLahko je spal deset, dvanajst ur, žena mu je vedno rekla, da bo prespal življenje…; exOna je lahko spala največ pet ur, tako, da je revica bila večino dneva sama.; ex: Ker se bom čez pol ure sam naslikal pri Vas, ne pretipkavajte, bom prinesel disketo.; exFrancoza sta odšla naprej, Nemci pa kar nekaj "čarajo" cele pol ure, preden lahko nadaljujeva.; exKo smo skušali zaspati, je bilo pred nami pet ur noči, potem pa se bo začel tudi za našo trojko veliki dan zmage ali poraza.; exV skledo damo rezine, sok, pomarančni liker, pokrijemo in pustimo stati pol ure.; exV zadnjih petih urah sva se premaknila za slabe pol milje.; exDobiš ga čez kakšni dve uri.; exSeje kongresa so se začele šele zvečer in so trajale tri do štiri ure.; exSvojčas je bil to najhitrejši vlak na svetu, saj je pot opravil v 84 urah.; ex1Nekaj ur kasneje župan na igrišču za golf opazuje svojega sina Andrewa, ki igra golf s Tigerjem Woodsom.; ex1Trajalo je sicer nekaj ur, da sem dojel, kaj se mi je primerilo - ampak potem se je znenada pojavilo ogorčenje.; ex1Tako bo nekaj manj kot dva milijona najslabše plačanih delavcev v Britaniji čez dobrih sedem mesecev zaslužilo 3,70 funta na uro.; ex1Pred lokali nimajo vsevprek parkiranih avtomobilov, zato lahko gostje tam ustavijo, 100 tolarjev več za uro parkiranja pa tudi zlahka dajo.; ex1Priložimo na koščke narezano jušno zelenjavo in pečemo v pečici približno uro.; ex1NEW YORK - Končno so raziskali, zakaj ženske tako rade telefonirajo, da imajo slušalko v roki ure in ure.; ex1Ogled vozil bo v četrtek, 24.12.1998, od 8. do 15. ure ter eno uro pred začetkom licitacije.; ex110-odst. vplačila sprejemamo eno uro pred začetkom licitacije.; ex1Po mnogih poskusih je Babica ugotovila, da se potica najlepše speče pri 325° Fahrenheita, eno uro.').
g(115228378,'exPo njegovem mnenju je zato družbeno najbolj sprejemljiva rešitev, da bi plačilo parkiranja uvedli na vseh javnih parkiriščih v mestu, hkrati pa bi se skrajšal čas pobiranja parkirnine.; exPortfolio se mora integrirati v vsakodnevno dogajanje v vrtcu in naj ne postane dodatno breme vzgojiteljice v poznih večernih urah doma.').
