g(115245515,'exV petek po jutranji zmedi, ko nekaterim še vedno ni šlo v račun, da evro ni nad 90 centov, in nekaj tehničnih namigih, da je čas za pozitivno korekcijo evra, se je trgovanje vendarle umirilo okoli 0,8910 EUR/USD.; exSkrajni čas je, da se odločite, komu boste naklonili svoja čustva.; exPribližno leto in pol po prvi igralski izkušnji sem začutila, da je napočil pravi čas.; exŠtudirale so literaturo in brale knjige, tudi trojico romanov, ki jih zgodovina književnosti prišteva med četverico Viginiinih osrednjih leposlovnih del, Jakobovo sobo (1922), Gospo Dalloway (1924) in K svetilniku (1927) – Valovi (1931) tedaj še niso bili napisani in Orlando (1928) je šele pravkar zapustil tiskarno; sicer pa tako in tako še ni napočil čas, ki bi to izjemno zanimivo knjigo cenil po zaslugi.; exSkrajni čas je, da članice EU spet začnejo bolj poslušati druga drugo in hkrati bolj misliti na Evropo.; exVsakoletni pregled spolnih organov in še pogostejši, če pogosto menjate spolne partnerje, bi moral odkriti navzočnost SPB v času, ko je mogoče še preprečiti nepopravljivo škodo, zato nikoli ne zanemarite bolečine v medenici ali vaginalne infekcije.; exV teh letih je tudi pravi čas, da uredite vsakršne hormonalne težave, ki lahko vplivajo na plodnost, na primer sindrom policističnih ovarijev.; exČas za prijave na ministrstvo za kulturo je pač, vsi sprašujejo, kaj prijaviti in kako.').
g(115249236,'exV zgodovinskih delih recimo beremo o samih začetkih satanizma, segajočih v čase Sončnega kralja.; exVsem študijam je skupna ugotovitev, da se je izziv prihodnosti stopnjeval toliko, kolikor je bil lastni čas izkušan kot zmeraj novi čas, kot ‘novi vek’.; exNe dvomim v srečnejšo prihodnost kot v času prvega NEP, saj ne računam na skorajšnji nastop kakega Stalina.; exZgodovinar dr. Peter Vodopivec je z nekaj manjšimi netočnostmi pri preverjanju posameznih odličij opisal delo lože Valentin Vodnik, predstavil znani ljubljanski predpasnik in omenil odličja škotskega reda iz časov francosko-ilirske lože, kar pomeni, da so nekateri slovenski prostozidarji tudi doma imeli višje stopnje, torej večje prostozidarsko znanje, odgovornost in ugled.; exSnovanje iger ga je pritegovalo že v dijaških letih, zatem v začetku stoletja, v času prve vojne in v dvajsetih letih, misel nanje ga je obletavala še v tridesetih.; exTakratna odločitev Bernarda II., da Kostanjevica postane vsestransko središče Dolenjske, je razumljiva, saj v tem času ni bilo naselbine, ki bi v negotovih razmerah visokega srednjega veka lahko prevzela to vlogo.').
