g(115265518,'exZačetki muzeja so povezani z izjemno zbirateljsko vnemo učitelja Bogdana Žolnirja (1908-1998), ki ga je okrajna organizacija Zveze borcev leta 1949 postavila za predsednika t. i. zgodovinske komisije, ob uradni ustanovitvi muzeja leta 1951 pa za prvega ravnatelja Okrajnega muzeja NOB.; exŽe od začetkov delovanja šteje muzej za svoji depandansi partizansko bolnišnico Trška gora na Legnu in gestapovske zapore v Dravogradu.; exV zgodovinskih delih recimo beremo o samih začetkih satanizma, segajočih v čase Sončnega kralja.; exPogoji za začetek avtomobilske industrije v Novem mestu so bili ustvarjeni.').
g(115266911,'exLe tako bi bil dokument pripravljen pred koncem leta.; exV sindikatu, kot nam je povedal njegov predsednik Roman Molan, sicer še vedno upajo, da jim bo do konca leta le uspelo prepričati ljudi v ministrstvu za gospodarstvo in za okolje, da je proizvodnja celuloze pomembna ne le za Krško, ampak tudi za celo papirno-predelovalno industrijo, slovenske gozdove in državo sploh.; exBilo je kakor v ilegali, razpoloženje je bilo podobno tistemu ob koncu 80. let, ko so sovjetski umetniki pripravljali performanse zaprtega tipa, ker jih je policija sicer že pustila pri miru, a javno še niso smeli nastopiti.; exAndraž Vehovar je doživel veliko osebno razočaranje, a obenem se postavlja vprašanje, kaj bo naredila KZS, če Vehovar do konca julija, ko bo še pet tekem svetovnega pokala, zmaga vsaj na dveh tekmah in dodal kolajno na evropskem prvenstvu.; exProfesionalizem je sila kruta stvar in marsikdaj se športniku po robu postavijo številne okoliščine, skoraj nepremostljive, ko se pojavijo tudi razmišljanja o predčasnem koncu kariere.; exV celuloznem obratu so tega dne še opravljali remont, stroje pa naj bi pognali še pred koncem tega tedna.; exRupel je tudi dejal, da je v ZDA, zlasti v zunanjem ministrstvu, vse do konca 90. let živela ideja o tem, kako lepo bi bilo, če bi Jugoslavija ostala skupaj.; exDo konca sezone bo še nekaj močnih dirk.; exRes pa je, da nas je vse nekoliko presenetil obseg zamenjave bivših evropskih valut v evre ob koncu leta.; exOb koncu leta so znašale tako že nekaj več kot 5,7 milijarde ameriških dolarjev in so se samo v nekaj mesecih povečale za približno milijardo dolarjev.; ex1Zanimanje za Beckhama sta ob koncu minule sezone kazala tudi italijanska kluba Inter in AC Milan, pred tednom dni pa je United sporočil, da se je dogovoril za možnost prodaje nogometaša v Barcelono.; ex1Delovna praksa je po navadi organizirana ob koncu šolskega leta, praktični pouk pa poteka že med šolskim letom, enkrat ali večkrat na teden.; ex1Na esej pri poklicni maturi se pripravljajo vsa šolska leta, intenzivneje proti koncu šolanja.; ex153. člen ustave pravi, da država varuje družino, v 31. členu zakona o vojaški dolžnosti pa piše, da se služenje vojaškega roka lahko odloži, če je vojaški obveznik edini hranilec družine, zaradi tega pa bi njegova družina zašla v težak materialni položaj, vendar najkasneje do konca septembra.; ex1DELODAJALEC MORA DELAVCU NADURNO DELO ODREDITI V PISNI OBLIKI (IZJEMOMA TUDI USTNO, V TEM PRIMERU SE PISNO ODREDITEV VROČI DELAVCU NAKNADNO, VENDAR NAJKASNEJE DO KONCA DELOVNEGA TEDNA PO OPRAVLJENEM NADURNEM DELU).; ex1V okviru neke vrste tehnološkega holizma so bili prvi teoretični pristopi k biološkemu telesu z vidika kibernetičnih komunikacijskih sistemov od poznih štiridesetih pa vse do konca šestdesetih nagnjeni h koordinaciji pod vplivom "krožno-kavzalnih mehanizmov povratne informacije".; ex1Nadzorni svet pa je včeraj odločal tudi o podaljšanju pogodbe z Gorenjem trgovino do konca leta, tako da bi ta dobavitelj pripeljal še 150.000 ton premoga.; ex1Gre, to mislim čisto resno, za zgodovinski dokument, ki napoveduje konec vznemirljivega, pa tudi dramatičnega obdobja slovenskega teatra, hkrati pa govori o globoki človeški stiski enega izmed največjih slovenskih igralcev vseh časov.; ex1To naj bi se zgodilo konec junija 1996, čeprav bi moj mandat potekel šele proti koncu 1997. leta.; ex1S Kraljevičem sem neposredno sodeloval že ob koncu osemdesetih let, ko sem bil kot režiser v službi v Mestnem gledališču.; ex2Ob koncu novembra, tako pravi, bo šel s prijateljico Nicoletto Mantovani, 33, pred matičarja (če bo seveda do takrat ozdravel, saj je pred dnevi zaradi obolelosti odpovedal koncert v Panami in se odpravil na preiskavo na neko kliniko).').
g(115270431,'exV bolnišnici so že pred časom pripravili vse potrebno za negovanje bolnikov, pri katerih je bilo zdravljenje končano.; exKončina je vzel pod drobnogled še trditve strokovnega direktorja KC Zorana Arneža, ki ves čas zatrjuje, da je bil nakup miz strokovno upravičen, da pa se ni spuščal v poslovne plati zadeve.; exČasopis v revialni obliki, ki je dolga leta izhajal štirikrat, zdaj pa le še dvakrat na leto, ni le dokument časa, temveč odlična domoznanska zbirka Raven in tudi vse Mežiške doline.; exTekmujeva s časom.; exPostajava nestrpna, kajti podoba je, da bova ves čas vzpona čakala na stojiščih, da se bodo najini predhodniki spravili naprej.; exPri nas pomanjkanje časa (verjetno) še ni tako pereče, da bi v kakšnem izmed podjetij že razmišljali o tem, da bi učinkovitost dela proizvodnega in vodstvenega kadra izboljševali s takimi metodami.; exČeprav je zaostajanje za časom pogost problem naših podjetij, pa v primeru spanja na delovnih mestih temu ni tako.; exMet začnemo z dviganjem vrvice, ki jo dvigamo toliko časa, da se izravna in je brez vozlov.; exKo se je s taksijem peljala sem, je pomislila, da bi si prav lahko vzela čas in pregledala Adamovo pisalno mizo, toda ko se je ozrla okrog sebe, je nagonsko vedela, da danes ni pravi dan za to.; exTo pomeni, da ves čas ugotavljamo, da je treba začeti zdraviti s statini že pri rahlem povišanju ravni holesterola v krvi.; ex1Ob duhovniškem delu je dušnemu pastirju ostalo še dovolj časa, da je v fari ustanovil nogometno ekipo in pripravil nekaj večjih srečanj ljubiteljev težkih motorjev.; ex1Vzela si bom čas tudi za brskanje po svetovnem spletu, sicer pa dogodkov ne načrtujem preveč vnaprej, saj se bom rajši pustila presenetiti.; ex1Nimam časa.; ex1V istem Terezijinem delu lahko preberemo: “Vrtnar, ki goji kak sad s prav izredno skrbnostjo, da bi mu dozorel pred časom, ima pri tem poseben namen.; ex1Poraženci za kaj takega nimajo časa, saj se morajo umikati.; ex1V običajnih okoliščinah do časa, ko začutimo žejo, izgubimo že približno odstotek telesne teže s tekočino, to je pri 75 kilogramov težkem človeku 75 dekagramov.; ex1Njen predsednik John Howett je potrdil, da so pogajanja v teku, da pa sodelovanje v prihodnjem letu še ne pride v poštev, saj je premalo časa za reorganizacijo.; ex1Baumgartner si bo zdaj vzel nekaj prostega časa za uživanje v najljubših športih, kot je na primer jadralno padalstvo.; ex1Možje večina jih sploh ni spala so si začeli pošiljati signale z ladje na ladjo; upali so, da se bo vsak čas izza pene pojavilo veliko kitajsko ladjevje.; ex1Za nastop na tem reliju smo se odločili dokaj pozno, zato tudi nismo imeli časa za optimalno pripravo.; ex2Ko sem ga zadnji teden čakal, da konča šolo, in sem imel po sezoni več časa, sva vsak dan igrala ena na ena in trenirala skupaj.; ex2Mandarić pravi, da je zanj največja težava pomanjkanje časa, kajti menda je polno zaposlen s projektom gradnje novega štadiona Portsmoutha.; ex2Imam celo čas, da to opazim.; ex2Nisem imel prav veliko časa: v nasprotju z videokasetami je film super osem trajal samo 3 minute in ni dopuščal napak, nič nisi mogel popravljati, napake so bile nepopravljive.; ex2Vzemite si čas za ponovno skladiščenje stvari, ki vas spravljajo v bes.; ex2Wilson in drugi vodilni pisci otroških knjig veliko časa namenijo rednemu pojavljanju, dogodkom in podpisovanju knjig.; ex2Kot so nam pred časom, ko smo o uporabi novega inštituta kazenske zakonodaje poročali podrobneje, povedali na ljubljanskem okrožnem državnem tožilstvu, v takih primerih tožilec ob vložitvi obtožnice ali obtožnega predloga sodišču predlaga, da zadevo obravnava prednostno.').
