g(300183053,'exNa voljo naj bi imeli blizu milijardo tolarjev (10 milijonov DEM) več kot pred petimi leti; exGre za vozilo, ki bo kupcem na voljo za več namenov, hkrati pa bo lahkotno za vožnjo.; exNa voljo je več modelov, teže se gibljejo med 180 g (ultra lahko) in 900 g (težko za morski ribolov), navijalna hitrost je med 0,4 m do o,9 m pri enkratnem navoju z ročko.; exKo kateri od testnimi ljudmi zapusti sobo, v kateri mu dajo na voljo nov izdelek, na primer nov depilator, strokovnjaki lahko izvedo veliko novega.; exO drugih zdravilnih lastnosti te zabele je slovenska poznavalka Meta Krese napisala knjigo Oljka in njeno olje (MK), ki je te dni že na voljo na tržišču.; exNajprej, na voljo imamo delo Geralda in Valerie Mars o kulturni razvrstitvi londonskih gospodinjstev.; exProdajalci nafte iz drugih držav pa imajo na voljo mejne prehode Bosanska Gradiška in Orašje ob Savi, Izačić pri Bihaču in Crveni grm nad Pločami v Hercegovini.; exLeta 1991, v zadnjem letu, za katero so na voljo zanesljivi podatki, je bilo umorjenih 5.300 Rusinj.; exZa osebno higieno imajo na voljo 15 minut dnevno (brez tuširanja), za razgibavanje pa jim je odmerjenih dvakrat po 15 minut na teden.').
g(302457558,'exGozdarsko kmetijska zadruga Srednja vas je že dalj časa v težavah Večja sprememba v klavnici - Usmeritev na trajne izdelke').
g(400006105,'exSem pride malo turistov, pa še to so po večini bogati Francozi, ki se umaknejo iz mrzle domovine v rajske kraje in od tod vodijo posle doma.').
g(400031899,'exBudimpešta - Leto 2000, v katerem je Madžarska poleg drugega praznovala svojo tisočletnico, ocenjujejo državljani, politične stranke in mednarodne institucije na moč različno.').
g(400047903,'exNaprava BICOM je torej nekakšna zbirka impulzov, oblikovanih v zdravilne programe, ki pospešujejo zdravljenje in normalizacijo presnovnih procesov v telesu, toda na koncu je vseeno od človeka, ki upravlja z aparatom, in od njegovih izkušenj odvisno, ali bo pravilno postavil diagnozo in izbral pravi program za bolnika.; exOd glave na koncu ostanejo le lobanja in čeljustne kosti.; exOglaševalsko razsodišče Slovenske oglaševalske zbornice doslej ni prejelo nobene pritožbe zaradi oglasa za resna zdravila, obravnavalo pa je dve pritožbi (obe sta se na koncu izkazali za utemeljeni) zaradi oglaševanja čaja, ki naj bi bil primeren za diabetike, in tonika za lajšanje različnih zdravstvenih težav.; exV zadevo se je na koncu vpletel še predsednik Mednarodnega olimpijskega komiteja Jacques Rogge, ki je vlado v Rimu zaprosil za pomoč.; exDeklaracija iz Kanade ni po volji večine držav, toda ker so dogovor morali sprejeti s konsenzom, je na koncu zmagal Fujimori, čeprav ne manjka ocen, da to pomeni njegov poraz, ker bo moral sprejeti delegacijo, ki naj bi nato predlagala, kako naprej.; exToda na koncu bi lahko rekli, da so točko izgubili domači hokejisti.; exIn tudi, ko grem naprej v druge vrste ogrožanja nacionalne varnosti Republike Slovenije začne s stavkom, ki je že padel v oči predgovornikom, namreč je neposredni ali posredni nedemokratičen nazivni posegi za spremembo ustavne ureditve, ki se potem nadaljujejo s teoristično dejavnostjo, trgovanje z belim blagom in podobna grozodejstva, konča pa s stvarjo, ki me pravzaprav najbolj skrbi, namreč definicija na koncu obstajajo tudi možnosti nastajanja povsem novih oblik ogrožanja nacionalne varnosti.; exPri zabavi jih kljub žalovanju ni nihče motil, na koncu pa je natakar le prišepnil Majzlju: "Vam pa res ni lahko.').
g(400056916,'exNa vsak način sem hotel nanjo narediti vtis.; exNa vsak način sem hotel, da bi me deklica opazila, da bi vedela, da sem glavni, da sem bil najmanj tisočkrat v kinu in da bom nekoč delal filme…; exKer smo na vsak način hoteli Igrice krstiti, sem se sam lotil režije.; exNa vsak način se v Jeličićevi zgodbi ni moč izogniti naslednjemu dejstvu: da se je kot obetaven fant - tudi za jugoslovanske razmere - odločil za pot v Slovenijo, ki ne slovi kot država naklonjena mladim nogometašem, še zlasti tujim ne.').
g(400069771,'ex« Jan, ki je že nekaj časa razmišljal o tem, da bi bilo mogoče dobro skrajšati jadra, je sicer zasikal nekaj kot vse je pod kontrolo, vendar je že trenutek pozneje na glas oznanil: »Pripravite se za krajšavo genove!').
g(400069901,'ex»Spominjam se, da je Casanova po navadi na glas navijal rokenrol glasbo, kadar je bil v hiši.').
g(400073897,'exPotovalni stroški bodo majhni, je pa res, da smo v prvo vrsto takoj postavili organizacijo tekme, saj dobro vemo, kakšni so odnosi navijačev obeh klubov," je po žrebu, ki se ga je udeležil skupaj s članom sanacijske komisije Mitjo Hlastecem, dejal sekretar Maribora Pivovarne Laško Uroš Jurišič in nadaljeval: "Doma pričakujemo razprodan štadion.').
g(400081591,'exVsak teden kakšnih ducat.; exČe je jama globlja od petih metrov, narava, tudi če se jo zasuje, potrebuje kar pet do deset let, da ponovno vzpostavi naravno ravnovesje, pravi Notar in dodaja, da vsak teden dobijo nekaj prijav nedovoljenega izkopavanja gramoza.; exV Veliki Britaniji vsak teden zaradi zlorabe umreta dva otroka.').
g(400081737,'exTako je vsako leto nepogrešljiv labirint, pa nogomet, je za konec Mateja poskušala preglasiti glasno glasbo, na katero so čebelica in medvedki poplesavali.').
g(400103194,'exNamesto da bi država naročila vsaj predinvesticijsko študijo ali preučila možnosti, kako bi lahko pomagala podjetju in občini, je predloge že na začetku zatrla.; exV začetku bo morda hudo, ampak ne smeš popustiti.; exV začetku jim nisem posvečal posebne pozornosti, sčasoma pa sem uvidel, da imajo večji učinek kot pridige, za mnoge so celo bolj učinkovite kot duhovne vaje; zato se jih poslužujem" (MB XII 50).').
g(400103324,'exS tem pa še ni nič odločeno glede tehtnosti dolgoročnih pogojev, ki se ohranjajo iz preteklosti in ki so na prvi pogled padli v pozabo.').
g(400105775,'exReprezentantka doma iz okolice Reke se je hitro vključila v novo okolje, v naši vrsti so prijazno novinko lepo sprejeli, sama je čakala le še na višje dosežke od tistih, ki so ji v najboljšem primeru odpirali pota na zasledovalno tekmo, a nikdar med dobitnice točk.').
g(400119578,'exPO DRUGI STRANI NAJ BI NACIONALNI PARKI V ZDA PREDSTAVLJALI ZGODOVINSKO IN KULTURNO DIMENZIJO, KI NAJ BI BILA PRIMERLJIVA, ČE NE SUPERIORNEJŠA EVROPSKI KULTURNI DEDIŠČINI (NEUMANN 2002).; exOdkrili bi dokaj veliko in zanimivo ponudbo na eni ter nenavadno majhno število obiskovalcev na drugi strani, vendar nas je prehitel dan.; exPo drugi strani se podoživljanju teh dogodkov človek ne more izogniti, tudi če bi se preselil na drugi konec zemlje.; exSkratka, obstajali so in obstajajo po eni strani notranji razlogi, ki ovirajo boljše poznavanje dežele, po drugi strani pa zunanje metalne pregrade, ki jih je treba nenehno rušiti.; exLetošnje letno poročilo evropske komisije navaja velik napredek pri postopkih za ustanavljanje podjetij, boljši dostop podjetij do elektronskega poslovanja, uvajanje različnih oblik podjetniškega izobraževanja na visokih in srednjih šolah, na drugi strani pa tudi opozarja na zanemarjanje vprašanja učinkovitega zastopanja interesov malih podjetij na nacionalni in evropski ravni.; exTo se dogaja tudi zaradi trgovskih centrov na obrobju, po drugi strani pa je to le izgovor.; exIdeja o zaprtju mestnega središča za promet je že pred časom povzročila pravo razburjenje med lastniki trgovskih, gostinskih in drugih lokalov na eni ter stanovalci na drugi strani.; exNa drugi strani pa muslimanom protektorat nad najsvetejšim krajem, kamor Judje nimajo vstopa, daje precej samozavesti.; exMedtem ko je Jereb popoldne dvignil tempo, je bil na drugi strani Logar vse počasnejši, a je vseeno ostal na drugem mestu v skupni razvrstitvi.; exZame je tu cela vrsta vprašanj; jaz se sicer ne spoznam na stvari, ampak če postavi trditev, da na eni strani tega kadra manjka, na drugi strani pa je cela vrsta ljudi, ki so na zavodu za brezposelne, potem je zame pač zelo jasno vprašanje: tem je treba več plačati, drugače jih ne bomo dobili.; ex1Po drugi strani pa so se tudi kupci ozavestili in ne kupijo prav vsega, kar jim je ponujeno.; ex1"Srečna sem," je dejala, "ker toliko igram (kljub mladosti je posnela že 37 filmov), ker sem tu med vami, in nesrečna, ker bolj ko se dviga k vrhu moje profesionalno filmsko življenje, bolj se na drugi strani spušča kakovost mojega zasebnega življenja.; ex1Natakarji in barmani jo sovražijo, ker je prava mala nagnusna zver, po drugi strani pa se lahko vsaj dobro zabavajo na njen račun, ko Lindsay zapusti lokal, je pripovedoval eden od rednih gostov v tej restavraciji.; ex1Se pa zavedajte, da bo tako vaš sin prišel do e-pošte, ki vam jo piše žena - a po drugi strani boste tudi vi prišli do zapisov njegovih klepetalnih dogodivščin ...').
g(400119798,'exSkratka, obstajali so in obstajajo po eni strani notranji razlogi, ki ovirajo boljše poznavanje dežele, po drugi strani pa zunanje metalne pregrade, ki jih je treba nenehno rušiti.; exZelo nizka številka po eni strani, po drugi pa za podjetje ugodna.; exUdeleženci so ugotovili, da so tako na ravni bachelor kot na ravni master različne pobude in usmeritve, naravnane k definiranju učnih izidov in kompetenc, pa tudi, da bo ta različnost na eni strani omogočala kapitaliziranje bogastva evropskih visokošolskih tradicij, na drugi pa oblikovanje ''evropskih profilov'' v različnih disciplinah.; exZame je tu cela vrsta vprašanj; jaz se sicer ne spoznam na stvari, ampak če postavi trditev, da na eni strani tega kadra manjka, na drugi strani pa je cela vrsta ljudi, ki so na zavodu za brezposelne, potem je zame pač zelo jasno vprašanje: tem je treba več plačati, drugače jih ne bomo dobili.; exPo obliki je v zbirki na eni strani sedem moderniziranih sonetov, na drugi skoraj enako število pesmi v prostem verzu, ki pa spadajo med daljše v knjigi, kot tretja skupina nastopajo in daleč prevladujejo kitične pesmi.').
g(400138410,'ex"Tu mislim v prvi vrsti na Emmanuela Davisa.').
g(400147876,'exZa seboj ima odlično sezono, v kateri sicer ni igral veliko, a je lahko spoznal, kako se živi in igra zunaj Slovenije, ob tem pa je brez težav opravil tudi šolo.; exKo sta v strahu že najavili, da mora takoj priti veterinar, je bil v sekundi spet na nogah in je seveda dosegel, da je šel na sprehod v naravo, kjer je veselo izvedel vse figure in šel brez težave v vseh hodih.; exNa njuno veselje in zadovoljstvo se je konj navadil protokola, da je vsaj do izpusta odkorakal pridno in brez težav.').
g(400151149,'exKonec koncev je potovati prav tako zabavno, kot prispeti na cilj.; exMislim, da gospa Ravbarjeva podcenjuje parlament, konec koncev v našem parlamentu tudi nekaj vemo o gospodarstvu.').
g(400159040,'exV primeru Mercatorja in Emone Merkur so, na primer, vedeli, kdo je glavni, kdo je steber združitve, zato je bilo povezovanje uspešno,« pravi dr. Lahovnik.; exTorej bomo plavajočo kijasto vrvico št. 8, na primer, označili s kodo WF-8-F.; exNa začetku ima podatke o poziciji osebe (naslovna, glavna, stranska, pripovedovalec), nato o poklicu (nekateri med njimi imajo tudi svoje geslo, na primer učitelji, duhivniki...; exPonekod proizvodnja ostaja na lanski ravni kot na primer pri naši največji trgovinski partnerici Nemčiji.; exKo kateri od testnimi ljudmi zapusti sobo, v kateri mu dajo na voljo nov izdelek, na primer nov depilator, strokovnjaki lahko izvedo veliko novega.; exPRAV IDEALIZACIJA DOLOČENIH OBLIK LEPOTE JE NA PRIMER PRISPEVALA K OBLIKOVANJU IN USTANOVITVAM NACIONALNIH PARKOV (AITCHISON 2002).; exŽivimo v družbi, katere člani so zmožni samo še minimalnih dogovorov, na primer, po kateri strani ceste naj vozimo.; exČe vsebuje pivo sedimentirane kvasovke, nehamo nalivati, še preden pridejo kvasovke v kozarec (razen pri nekaterih vrstah piva, pri katerih je sediment zaželen - na primer pšenično pivo).; exTo počnem še danes, saj se mi vedno znova primeri, da me kdo iz časopisne redakcije povpraša na primer, kakšna je časovna razlika med Madridom in Ljubljano ali pa, kot me je nekdo z več kot srednješolsko izobrazbo pred leti vprašal, kakšen letni čas je tam v Sloveniji, prepričan, da sem na drugi polobli.; exSvojo hrano popestrite s pustim mesom, mastnimi modrimi ribami (na primer lososom), sadjem, temno zeleno listnato zelenjavo, pšeničnimi kalmi, orehi, sončničnimi semeni in lanenim semenom.; ex1Dokler vino pijemo v zmernih količinah, na primer kozarček na dan po obroku, nas vino res krepi, ko pa prestopimo mejo zmernega uživanja, ima vino ravno nasprotni učinek na naše zdravje.; ex1Tako lahko v nekem organizmu kombinirajo na primer ribje, mišje, človeške in žuželčje gene.; ex1Nueri se, na primer, spominjajo svojih prednikov nekaj generacij nazaj, ne da bi kadar koli spreminjali dolžino svojega spomina.; ex1Vsekakor je nekoliko resnejši s stališča izvirnosti kot v Latinski Ameriki in na Karibih, a so tudi tukaj pri preganjanju zlih duhov možnosti za transgresijo kot na primer v Benetkah: trangresije, ki seveda izpadejo naivne v primerjavi s tistimi iz eksotičnih dežel.; ex1Ne smemo pozabiti, da je na primer v italijanski resenansi postal "carneval" del urbane kulture tako rekoč v vseh mestih in pomembna sestavina ali satirični navdih v gledališki zvrsti "commedia dell'' arte".; ex1Po vsej Rusiji lahko vse pogosteje slišimo besedne zveze, ki na Zahodu že dolgo odzvanjajo, na primer »študije spolov« in »dviganje ozaveščenosti«.; ex1Enakega evropskega prvenstva v tenisu se je na primer na stroške državnega zbora udeležilo šest poslancev, večina seveda iz LDS.; ex1Baumgartner si bo zdaj vzel nekaj prostega časa za uživanje v najljubših športih, kot je na primer jadralno padalstvo.; ex1Če so v njihovem času obstajale na primer tri mesece, jih bodo astronomi mogli opazovati skoraj osem let!; ex1Tako obstaja na primer kriminalistično pravilo: Storilca zmeraj vleče nazaj na kraj zločina.; ex2Institucije civilne družbe (na primer Svetovni slovenski kongres) bi morale pozvati k bojkotu nasilnih trgovinskih središč, ki z zvenečimi avstrijskimi imeni ustvarjajo nelojalno konkurenco domačim podjetjem, denar pa prelivajo tja, od koder prihajajo najmočnejši sunki protislovenske politike, to je v Avstrijo.; ex2Nekaj danes že legendarnih vicev preberem naglas tudi P. Na primer tegale: Trgovec s konji svoji stranki priporoča jahalnega konja: »Če boste vzeli tega konja in ga boste zajahali ob štirih zjutraj, boste ob pol sedmih že v Bratislavi.; ex2Na primer narečja jugovzhodne Francije in italijanska narečja na drugi strani meje so si tako podobna, da bi lahko spadala v isti jezik.; ex2TAKO NA PRIMER DOGOVOR O POLITIKI PLAČ ZA OBDOBJE 19992001, URADNI LIST RS, ŠT. 22-1017/99, RS 39-1963/99 (V ČASU VELJAVNOSTI ZAKONA O MINIMALNI PLAČI, O NAČINU USKLAJEVANJA PLAČ IN O REGRESU ZA LETNI DOPUST V OBDOBJU 19992001 (ZMPUPR, URADNI LIST RS, ŠT. 39-1963/99) SE NE UPORABLJAJO DOLOČBE PREDPISA, KI SO V NASPROTJU S TEM ZAKONOM), 51-2422/00 (ANEKS).; ex2Na primer uspešne in že vsepovsod navzoče finske in v zadnjem obdobju - pred leti z Miko Kojonkoskim, zdaj pa s Hannujem Lepistöjem - z njo že oplemenitene avstrijske.; ex2V teh letih je tudi pravi čas, da uredite vsakršne hormonalne težave, ki lahko vplivajo na plodnost, na primer sindrom policističnih ovarijev.; ex2LJUBLJANA Ministrstvo za zdravje je s šestmesečno odločbo javnemu podjetju Vodovod- kanalizacija (VO-KA) dovolilo uporabo pitne vode, in sicer kljub prekoračeni vsebnosti nekaterih pesticidov, na primer atrazina, desetilatrazina in 2,6-diklorobenzamida.; ex2V policijski postaji številka 1 v Splitu na primer je samo 5 Srbov pobralo svojo kompletno oborožitev in pobegnilo v Knin, nekateri so se upokojili, drugi pa so ostali.; ex2Vendar pa je v pogovorih s člani ugotovil, da bi kazalo spremeniti zakonodajo tako, da bi določili cenzus, na primer 50-odstotno udeležbo, pri katerem bi referendum sploh veljal.; ex2Tako je na primer tudi dejala: »Kar pojdi in jim povej, kar moraš in kar hočejo vedeti.').
g(400164751,'exČeprav je zaostajanje za časom pogost problem naših podjetij, pa v primeru spanja na delovnih mestih temu ni tako.; exNo, zdaj je oboževana, lepih oblin in za vsak primer še dolgolasa.; exSlovensko plinovodno omrežje je v lasti Geoplina; kako pa boste kot javna gospodarska služba ravnali v primeru konkurence, ko se bodo porabniki plina denimo odločili za druge dobavitelje?; exSe je pa zato predvsem s to uvrstitvijo v ligo Goodyear dvignil Helios, ki pa tako kot na Hrvaškem Hermes Analitica ali pa Šibenka v primeru tekmovalnega uspeha še ne izpolnjuje pogojev, ki zadevajo dvorane in verjetno še marsikaj?; exTakšno razmerje sil, ki je posledica nasprotovanja Zahoda vstopu pravašev v vlado, onemogoča vodji HDZ Sanaderju, da bi Hrvaško kmečko stranko (HSS) izsiljeval z argumentom, da v primeru njihovih pretiranih zahtev lahko sestavi koalicijo s HSP.; exDOLOČA, DA MINISTRSTVO ZA OBRAMBO MO LAHKO PRIPADNIKU STALNE SESTAVE ENOSTRANSKO ODPOVE POGODBO O ZAPOSLITVI V PRIMERU:; exGlede tega je ustanovna listina jasna in bi bilo v primeru napada na Irak sklicevanje na samoobrambo zloraba te pravice.; exNapad na slovensko svobodo izbire pa je v primeru tokratnega štetja lahko tudi premalo premišljen.; exV primeru uspeha si lahko oddahneš, z neuspehom pogoriš.').
g(400167286,'exKot sem na začetku omenil, sem imel namen opisati svoje osebne spomine na mariborsko Narodno gledališče.').
g(400171322,'exJeseni bo v Berlinu naslednja postaja na poti bolonjskega procesa.; exTakrat je bil vitez žalostnega obraza prvič na poti, in kljub svojim skoraj petdesetim letom s seboj ni nosil rezervnih srajc in spodnjic.; ex»Avtomobil kot luksuz mi ne pomeni nič, pričakujem le udobno in gotovo vožnjo, ker sem ogromno na poti, saj to zahteva naš estradni poklic.').
g(400180420,'exPo vrsti so premagali vrstnike iz Francije, Hrvaške in Jugoslavije ter s tem bistveno prispevali k dvigu svoje samozavesti pred letošnjim evropskim prvenstvom.; exNajprej začne pripravljati sladice in speče kruh, zatem kuha juhe, ki se prav tako pripravijo vnaprej, potem pa gre vse po vrsti.').
g(400305283,'exVstopnino rade volje plačam, ker zato vsi dobimo zanimive izkušnje, malčki pa novo znanje o živalih.').
g(400305431,'ex38. člen zakona o vojaški dolžnosti omogoča tudi civilno služenje vojaškega roka, kar pa ni nič drugega, kot prisilno delo, saj mora delo posameznik opravljati proti svoji volji in brez ustreznega finančnega nadomestila.; exPo njegovem mnenju (pri pisanju pravne obtožbe naj bi zaprosil tudi za pravno pomoč) naj bi bile vsakemu človeku, ki proti svoji volji služi vojaški rok storjene krivice, kot so omejevanje svobode, vsiljevanje proti volji posameznika in izguba prihodka.; exNihče ni natanko vedel, kakšno naj bi to novo gledališče bilo, bili pa smo prepričani, da smo bili igralci in režiserji v teatrih zapostavljeni, bili smo proti svoji volji spremenjeni v jalove reproduktivce.').
g(400454210,'exPri pogledu od strani in od zadaj se nam na desni strani najprej prismehlja priročno nameščen vmesnik USB, nato pa še podpora za FireWire in reža za različne PC kartice tipa II, na desni strani pa je svoj prostor našel pogon DVD Super Multi Drive, ki v eni enoti zmore brati bolj ali manj vse, kar lahko svetlečega in okroglega dobite na trgu.').
g(400461834,'exMaturanti bežigrajske gimnazije pa so z olajšanjem po nastopu v en glas povedali: Občutki so bili božanski, videti pa je, da smo prišli do živega tudi bogovom, saj so jokali od sreče.').
